INSERT INTO `deals` (`id`, `source_id`, `title`, `description`, `image`, `link`, `ratings`, `reviews_count`, `base_price`, `sale_price`, `save_price`, `from_url`, `unique_md5`, `out_of_stock`, `ext_date`, `created_at`, `updated_at`) VALUES
(207, 1, 'RUGER LCP .380 ACP 6RD PISTOL- 3701', '<p>The Ruger LCP is<em> </em>a .380 Auto from the industry leader in rugged, reliable firearms. Designed with the shooter in mind, the ultralight LCP is as affordable as it is reliable. The compact design allows the Ruger LCP to fit a variety of holsters and provides concealed carry options. The rugged construction is achieved with a through-hardened alloy steel and a one piece, high performance, glass filled nylon grip frame. The checkered grip frame provides a comfortable and secure grip.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/1/2/1296.jpg', 'https://palmettostatearmory.com/ruger-lcp-380-acp-6rd-pistol-3701.html', '4.7', 101, 324.99, 169.99, 155.00, 'https://palmettostatearmory.com/ruger-lcp-380-acp-6rd-pistol-3701.html', '142c0020e3a4fb4ebc77e48fbf00ceac', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:00', '2018-08-06 06:45:49'),
(208, 1, 'D&H 5.56 30rd Aluminum Magazine', '<p>Brand new mil-spec M16/AR15 30rd aluminum mags with black teflon finish and foliage green Magpul followers. Made by D&amp;H (Company formerly named Labelle) for Palmetto State Armory. These are the best of the breed because they have a slick durable Teflon coat inside and out. Stamped with US military cage code Q4TQ4.</p>\n<div style=\"padding-bottom: 4px; padding-left: 0px; padding-right: 0px; padding-top: 4px;\"><p>Floorplates marked:<br>Palmetto State Armory, LLC<br>Columbia, SC</p></div>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/1/7/1767.jpg', 'https://palmettostatearmory.com/d-h-5-56-30rd-aluminum-magazine-8416.html', '4.9', 564, 12.99, 6.99, 6.00, 'https://palmettostatearmory.com/d-h-5-56-30rd-aluminum-magazine-8416.html', 'a73616873260489107b70177a5a29ac0', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:00', '2018-08-06 06:45:56'),
(209, 1, 'Federal 5.56mm 62gr FMJBT Steel Core Ammunition 420rds on Stripper Clips w/Ammo Can - XM855LC1 AC1', '<p>This Ammunition has been loaded and passed true NATO specifications. <b>This is first run ammo that met the US Military’s strict quality assurance standards and specifications.</b> It is packaged in a new Sealed Mil-Spec reusable ammo can with Lake City seal. Ammunition is loaded on 10-round stripper clips.  This ammunition is loaded with green painted penetrator tip, steel core bullets and is non-corrosive, boxer-primed with fully reloadable brass cases.  Can is sealed from the factory and does not come with a steel stripper clip guide.<br><br> This ammunition has passed Military Specification Testing and<b> </b>is <b>NOT</b> Quality Control Rejected Ammunition. This ammunition does not carry the label \"NOT FOR DUTY USE\".</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/2/2/2251.jpg', 'https://palmettostatearmory.com/lake-city-5-56-nato-62-grain-xm855-fmj-on-10-round-clips-in-ammo-can-of-420rds.html', '4.9', 214, 208.99, 139.99, 69.00, 'https://palmettostatearmory.com/lake-city-5-56-nato-62-grain-xm855-fmj-on-10-round-clips-in-ammo-can-of-420rds.html', '208e089a3dedcf879a107181ea8a390e', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:00', '2018-08-06 06:46:04'),
(210, 1, 'Palmetto State Armory Magpul MOE Lower Build Kit, Black - 598', '<p><span style=\"font-size: medium;\">Includes Mil-Spec MOE Stock, MOE grip, MOE Trigger Guard, Palmetto State Armory Classic Lower Parts Kit and Mil-Spec buffer tube assembly. Everything you need to finish your stripped lower!</span></p>\r\n<p> </p>\r\n<p><span style=\"font-size: medium; color: #ff0000;\"><strong>**Buffers may vary in finish, color, and may or may not have a PSA logo, depending on product availability.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/9/598_1.jpg', 'https://palmettostatearmory.com/moe-lower-build-kit-black.html', '4.7', 179, 179.99, 99.99, 80.00, 'https://palmettostatearmory.com/moe-lower-build-kit-black.html', 'f4545afce3d1424956f92401eb32e024', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:46:16'),
(211, 1, 'Kel-Tec KSG 12ga Shotgun (Black)', '<p><span style=\"font-size: medium;\">This simple and reliable pump action feeds from either the left or right tube. The feed side is manually selected by a lever located behind the trigger guard.</span></p>\r\n<p><span style=\"font-size: medium;\">The pump includes an under picatinny rail for the mounting of a forward grip, a light, or a laser. The included top picatinny sight rail will accept many types of optics or iron sights. Forward and rear sling loops are built in, and a basic sling is included. The soft rubber butt pad helps to tame recoil.</span></p>\r\n<p><span style=\"font-size: medium;\">The KSG receiver is made from hardened steel and includes the magazine tubes which have been welded in place. The grip and stock assembly is made of glass reinforced nylon (Zytel) and is easily disassembled by pushing out 2 pins, which store in 2 holes in the grip when removed. The barrel and pump assembly is removed by loosening the 2 front magazine tube nuts with a coin and sliding the assembly forward.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/k/e/kel_tec_ksg_sku_36568.jpg', 'https://palmettostatearmory.com/kel-tec-ksg-12ga-black.html', '0', 0, 990.00, 649.99, 340.01, 'https://palmettostatearmory.com/kel-tec-ksg-12ga-black.html', 'e54c74c366ed75b37a029686e566fa62', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:46:22'),
(212, 1, 'Winchester USA 9mm NATO 124gr FMJ Ammunition 50rds - Q4318', '<p>For plinking, target and range shooting, this ammunition offers a Full Metal Jacket bullet for sure functioning, no expansion, consistent accuracy, reduced barrel fouling, and controlled recoil.</p>\r\n<p>**<span>9mm NATO is loaded to pressures 10% to 15% higher than industry standard pressure for 9mm Luger. This places the ammunition in the “+P” category, which can cause increased wear on firearms. Though this ammunition is safe in most modern firearms, it is not intended for older firearms or ones not made by quality manufacturers. As with any ammunition please ensure proper inspection of your firearm before shooting to ensure the firearm is in good condition and is safe to shoot. <br></span></p>\r\n<p> </p>\r\n<p><strong>For the best selection of quality ammunition at the best prices, shop Palmetto State Armory!</strong></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/q/4/q4318_image.jpg', 'https://palmettostatearmory.com/winchester-usa-9mm-nato-124gr-fmj-ammunition-50rds-q4318.html', '4.7', 185, 12.99, 8.99, 4.00, 'https://palmettostatearmory.com/winchester-usa-9mm-nato-124gr-fmj-ammunition-50rds-q4318.html', '7d3fa56e2fb775ec5313007ed72542f5', 0, NULL, '2018-08-06 06:02:01', '2018-08-06 06:46:28'),
(213, 1, 'Kel-Tec Rifle CMR-30 .22wmr, Black ‒ CMR30', '<p><span style=\"font-size: medium;\">The CMR-30™ is a lightweight auto-loading firearm that accepts the 30 round magazines originally developed for the PMR-30™ pistol. The safety, magazine catch, stock latch, and non-reciprocating operating handles are accessible from both sides of the firearm. The collapsible stock pulls out and adjusts to 5 separate positions to accommodate a wide range of users. </span></p>\r\n<p><span style=\"font-size: medium;\">The CMR-30™ features a rigid aluminum upper assembly that houses the nitrided barrel and a long Picatinny rail for mounting of sights, optics, or other accessories. This rigid mounting, and a lock time better than most bolt action rifles, allows for excellent accuracy. The end of the barrel is threaded ½”-28 to accept a wide range of muzzle devices. The lower Picatinny rail allows for the mounting of forward grips or other accessories, but is also removable if preferred.</span></p>\r\n<p><span style=\"font-size: medium;\">The standard CMR-30™ is chambered for 22 Winchester Magnum Rimfire ammunition, also known as 22WMR or simply 22 Magnum. The caliber is marked on the firearm. Do not use any other caliber or designation of ammunition.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/c/m/cmr30-right.jpg', 'https://palmettostatearmory.com/kel-tec-rifle-cmr-30-22wmr-black.html', '0', 0, 630.00, 499.99, 130.01, 'https://palmettostatearmory.com/kel-tec-rifle-cmr-30-22wmr-black.html', '15eca540272a5b855067bef688d1a809', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:46:35'),
(214, 1, 'PSA GEN2 PA10 .308 Complete Classic Lower Receiver - 77932912', '<p>New and improved Palmetto State Armory PA10 Gen2 308 lower is fully assembled and ready for your complete PA10 Gen2 Upper!</p>\r\n<p>With streamlined styling and improved function, the new and improved PSA PA10 is here.  The Gen2 model offers enhanced chambers and extraction. with a more modern appearance.  </p>\r\n<p>Precision machined from forged 7075-T6 aluminum, these lowers are then Black anodize hardcoated to <span>MIL-8625 Type 3 class 2.  </span> With an AR-15 style fire control group, and stock and grip options, the PSA PA10 allows the same configuration flexibility as enjoyed by the AR15, and is an ideal platform for the 308 cartridge. </p>\r\n<p>Machined from Aluminum Forgings 7075-T6<br>Hardcoat Anodizing: MIL-A-8625F, Type III, Class 2<br>Milspec diameter PA10 6-position Receiver Extension<br>Standard AR15-style fire control group<br>A2-style grip<br>M4-style Stock<br>Staked M4 Lock Nut<br>Standard Heavy Carbine Buffer<br>Caliber: .308</p>\r\n<p><span><strong> The Gen2 PA10 receivers are functionally compatible with the Gen1 receivers, however we recommend matching Gen2 lowers to Gen2 uppers for best appearance.  There are external cosmetic differences when mixing gen1 and Gen2 upper and lower receivers that some may not find appealing. </strong></span> </p>\r\n<p><span style=\"color: #ff0000;\">The AR10 platform does not enjoy a common design between manufacturers, like the AR15.    As a result, there can and will be subtle differences in the parts kits of various manufacturers.  Some parts, like the fire control group, are shared with the AR15 platform to preserve the options for upgrading.  For best results, we recommend only using PSA PA10 parts with our uppers and lower receivers.  We do not recommend using other manufacturers parts in our products.</span></p>\r\n<p><b style=\"color: #ff0000; font-size: medium;\">PLEASE NOTE:  We are not accepting phone orders on this item. Lowers may take up to 10 BUSINESS DAYS to ship from receipt of FFL information. Please help us help you by ensuring your FFL is sent in as soon as possible.</b></p>\r\n<p><span style=\"color: #ff0000; font-size: medium;\"><b>Please make sure the business name of the FFL you will be using is on your order.</b></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/7/7/77932912_updated.jpg', 'https://palmettostatearmory.com/psa-gen2-pa10-308-complete-classic-lower-receiver-77932912.html', '4.7', 111, 399.99, 179.99, 220.00, 'https://palmettostatearmory.com/psa-gen2-pa10-308-complete-classic-lower-receiver-77932912.html', '61fbf550a17b13a1d1c23d9c414d0a02', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:46:41'),
(215, 1, 'Vortex Sparc Red Dot Scope & Ten Magpul PMAG 30rd Magazines', '<p><span style=\"text-decoration: underline; font-size: medium;\"><strong>Vortex SPARC AR 1x Red Dot Scope ‒ SPC-AR1</strong></span></p>\r\n<p> </p>\r\n<ul>\n<li><span style=\"font-size: medium;\"><b>• Magnification: </b>1 x</span></li>\r\n<li><span style=\"font-size: medium;\"><b><b>• </b>Length: </b>2.9”</span></li>\r\n<li><span style=\"font-size: medium;\"><b><b>• </b>Weight: </b>7.5 oz.</span></li>\r\n<li><span style=\"font-size: medium;\"><b><b>• </b>Objective Lens Diameter: </b>22 mm</span></li>\r\n<li><span style=\"font-size: medium;\"><b><b>• </b>Eye Relief: </b>Unlimited</span></li>\r\n<li><span style=\"font-size: medium;\"><b><b>• </b>Adjustment Graduation: </b>1 MOA</span></li>\r\n<li><span style=\"font-size: medium;\"><b><b>• </b>Max Elevation Adjustment: </b>90 MOA</span></li>\r\n<li><span style=\"font-size: medium;\"><b><b>• </b>Max Windage Adjustment: </b>90 MOA</span></li>\r\n<li><span style=\"font-size: medium;\"><b><b>• </b>Parallax Setting: </b>Parallax Free</span></li>\r\n</ul>\n<p> </p>\r\n<p><span style=\"font-size: medium;\">Simple—Fast—Effective—Point and Shoot. When you boil it down, those are the advantages of a red dot sight. And that’s what the SPARC AR delivers - all in a durable, lightweight, compact, and ultra-clean package. Digital rear-facing controls for power and dot brightness offer quick access and are viewable from the shooting position. 2 MOA dot diameter promotes </span>precise<span style=\"font-size: medium;\"> point of aim and automatically returns to last dot intensity used when powered up.</span></p>\r\n<p><span style=\"font-size: medium;\">Unlimited eye relief and parallax free, the SPARC AR gets shooters on target fast. The SPARC AR is waterproof, fog proof and shockproof for ultimate durability. Unit automatically shuts off after 12 hours to prevent accidental battery rundown and operates using a common AAA battery. Duty rifle, home defense, recreation, the SPARC AR is built to handle all your red dot needs.</span></p>\r\n<p> </p>\r\n<p><span style=\"text-decoration: underline;\"><strong><span style=\"font-size: medium;\">Magpul PMAG 30, 5.56x45 Magazine - MAG571-BLK</span></strong></span></p>\r\n<p> </p>\r\n<p><span style=\"font-size: medium;\">The PMAG 30 AR/M4 GEN M2 MOE is a 30-round 5.56x45 NATO (.223 Remington) AR15/M4 compatible magazine that offers a cost competitive upgrade from the aluminum USGI. It features an impact resistant polymer construction, easy to disassemble design with a flared floorplate for positive magazine extraction, resilient stainless steel spring for corrosion resistance, and an anti-tilt, self-lubricating follower for increased reliability.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/k/i/kit_sparc_and_pmags_2_.jpg', 'https://palmettostatearmory.com/vortex-sparc-red-dot-scope-ten-magpul-pmag-30-magazines.html', '4.9', 34, 0.00, 199.99, 0.00, 'https://palmettostatearmory.com/vortex-sparc-red-dot-scope-ten-magpul-pmag-30-magazines.html', 'd079ba5a396c7e7fbdc673da85aa7b25', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:46:47'),
(216, 1, 'PSA 16\" M4 Carbine 5.56 NATO 1:7 Nitride 13.5\" Lightweight M-Lok MOE Freedom Rifle Kit with MBUS Sight Set - 516446228', '<p><span><strong>Barrel</strong>: 16\" length, 4150V Chrome Moly Vanadium steel , chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a Carbine-length gas system. The barrel is finished with with a .750\" diameter low-profile gas block, PSA 13.5\" Lightweight M-lok Free Float Rail and an A2 flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized black for durability. Featuring M4 feedramp cuts, these upper upper receivers are made for us right here in the USA.</span></p>\r\n<p><span><strong>Bolt Carrier Group</strong>: For AR15 and M16 rifles and carbines. Bolt is made of shot-peened, Mil-spec Carpenter 158® steel. Gas key is secured with grade 8 fasteners and staked. Bolt carrier is parkerized outside and chrome lined inside. Includes Charging Handle.</span></p>\r\n<p><span><strong>Lower Build Kit:</strong>  PSA MOE Lower Build Kit</span></p>\r\n<p><span><span><strong>Includes: </strong>Magpul MBUS Sight Set, Black </span></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516446228.jpg', 'https://palmettostatearmory.com/psa-16-m4-carbine-5-56-nato-1-7-nitride-13-5-lightweight-m-lok-moe-freedom-rifle-kit-with-mbus-sight-set-516446228.html', '0', 0, 709.99, 419.99, 290.00, 'https://palmettostatearmory.com/psa-16-m4-carbine-5-56-nato-1-7-nitride-13-5-lightweight-m-lok-moe-freedom-rifle-kit-with-mbus-sight-set-516446228.html', 'f9d83b55b8550992f29dac24c4d17235', 0, ' Exp. 8/3, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:46:53'),
(217, 1, 'Kel-Tec Gen2 Sub2000 Glock 19 9mm Rifle, Black', '<p><span>The semi-automatic Gen2 Sub-2000™ is designed to be the most convenient 9mm available. It’s adjustable and foldable to 16.25 x 7 inches for easy storage and can accept most popular handgun magazines. Plus it can easily be disassembled for cleaning or inspection without tools. Ideal for backpacking trips and situations where space and convenience are paramount.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/k/e/kel-tec_g19_black.jpg', 'https://palmettostatearmory.com/kel-tec-gen2-sub2000-glock-19-9mm-rifle-black.html', '5.0', 2, 499.99, 399.99, 100.00, 'https://palmettostatearmory.com/kel-tec-gen2-sub2000-glock-19-9mm-rifle-black.html', '724d25de82885963a0d8f0a40541dd80', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:46:58'),
(218, 1, 'PSA 16\" 5.56 NATO M4 Carbine Classic Rifle Kit, Olive Drab Green - 516446411', '<p><span><strong>Barrel</strong>: 4150V Chrome Moly steel, nitride treated for durability. Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a carbine-length gas system. The barrel is finished off with a standard carbine olive drab green handguard, F-Marked gas sight base, and A2 flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized, features a forged upper receiver. These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span><strong>Bolt</strong>: Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt. Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec. 8620 steel M-16 profile carrier is chrome lined and phosphate coated.</span></p>\r\n<p><span><strong>Lower Build Kit</strong>: Includes Classic Olive Drab Green M4-Style Stock,  Olive Drab Green A2 Pistol grip, Classic Lower Parts Kit and Mil-Spec diameter 6-position buffer tube assembly. Everything you need to finish your stripped lower.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516446411_2.jpg', 'https://palmettostatearmory.com/psa-16-5-56-nato-m4-carbine-classic-rifle-kit-olive-drab-green-516446411.html', '4.9', 86, 559.99, 299.99, 260.00, 'https://palmettostatearmory.com/psa-16-5-56-nato-m4-carbine-classic-rifle-kit-olive-drab-green-516446411.html', 'a7f27c79fe59e522474d266944445a36', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:47:07'),
(219, 1, 'Vortex Strikefire II Red Dot Optic & Ten Magpul PMAG 5.56 30rd Magazines', '<p><span style=\"text-decoration: underline;\"><strong>Vortex Strikefire II Red Dot (4MOA Red/Green Dot) - SF-RG-501</strong></span></p>\r\n<ul>\n<li>\n<strong>Magnification: </strong>1x</li>\r\n<li>\n<strong>Objective Lens Diameter: </strong>30mm</li>\r\n<li>\n<strong>Eye Relief: </strong>Unlimited</li>\r\n<li>\n<strong>Adjustment Graduation: </strong>1/2 MOA</li>\r\n<li>\n<strong>Travel Per Rotation: </strong>25 MOA</li>\r\n<li>\n<strong>Max Elevation Adjustment: </strong>100 MOA</li>\r\n<li>\n<strong>Max Windage Adjustment: </strong>100 MOA</li>\r\n<li>\n<strong>Parallax Setting: </strong>Parallax Free</li>\r\n<li>\n<strong>Length: </strong>5.6 inches</li>\r\n<li>\n<strong>Weight: </strong>7.2 ounces</li>\r\n<li>\n<strong>Brightness Setting: </strong>10 Levels</li>\r\n<li>\n<strong>Dot Color: </strong>Red and Green</li>\r\n<li>\n<strong>Battery Life: </strong>300 hours on max</li>\r\n</ul>\n<p> </p>\r\n<p>When situations demand split-second target acquisition and maximum field of view, mount up the StrikeFire II and shoot both eyes open. Feature-rich, versatile and reliable, the StrikeFire II is a great choice for shooters who want a quality red dot sight, but don\'t want to break the bank. Features sleek rear-facing controls for power on/off and easy adjustment of ten dot intensity levels lowest two settings are night-vision compatible. Automatically returns to the last dot intensity used when powered up. The 30mm aluminum alloy chassis provides extra-high recoil rating and is waterproof and fog proof. Strike fast!</p>\r\n<p> </p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Magpul PMAG 30, 5.56x45 Magazine - MAG571-BLK</strong></span></p>\r\n<p> </p>\r\n<p>The PMAG 30 AR/M4 GEN M2 MOE is a 30-round 5.56x45 NATO (.223 Remington) AR15/M4 compatible magazine that offers a cost competitive upgrade from the aluminum USGI. It features an impact resistant polymer construction, easy to disassemble design with a flared floorplate for positive magazine extraction, resilient stainless steel spring for corrosion resistance, and an anti-tilt, self-lubricating follower for increased reliability.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/k/i/kit-0248.jpg', 'https://palmettostatearmory.com/vortex-strikefire-ii-red-dot-optic-ten-magpul-pmag-5-56-30rd-magazines.html', '4.9', 36, 0.00, 189.99, 0.00, 'https://palmettostatearmory.com/vortex-strikefire-ii-red-dot-optic-ten-magpul-pmag-5-56-30rd-magazines.html', '1a116769592c34e4578603650d74011a', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:47:17'),
(220, 1, 'PSA Gen2 PA10 18\" Midlength .308 WIN 1:10 Stainless Steel 15\" M-lok Upper - with BCG and CH -516446791', '<p><span>New and improved Palmetto State Armory PA10 Gen2 308 Upper is fully assembled and ready for your complete PA10 Gen2 Lower!</span></p>\r\n<p><span>With streamlined styling and improved function, the new and improved PSA PA10 is here.  The Gen2 model offers an enhanced chamber and extraction, with a more modern appearance.  </span></p>\r\n<p><span><strong>Barrel:</strong> 416R Stainless Steel, chambered in 308 WIN with a 1/10 twist, mid-length gas. Upper is paired with a Palmetto State Armory 15\" Lightweight M-Lok free-float rail, low profile gas block, and an A2-style muzzle device. </span></p>\r\n<p><span><strong>Upper:</strong>  Precision machined from forged 7075-T6 aluminum, then Black anodize hardcoated to MIL-8625 Type 3 class 2.   </span></p>\r\n<p><span><strong>Bolt Carrier Group:</strong> <span>9310 steel bolt assembly, nitride treated for durability.  8620 carrier, nitride treated, with a nitride treated gas key properly staked with grade 8 fasteners.  Charging handle is also included.</span></span></p>\r\n<ul>\n<li><span>7075-T6 Forged aluminum receiver</span></li>\r\n<li><span>18\" 416R Stainless Steel Barrel</span></li>\r\n<li><span>308 WIN Chamber</span></li>\r\n<li><span>1 in 10 twist rate</span></li>\r\n<li><span>Mid-length Gas system</span></li>\r\n<li><span>15\" free float lightweight m-lok rail</span></li>\r\n<li><span>low profile gas block</span></li>\r\n<li><span>A2-style muzzle device</span></li>\r\n<li><span>5/8-24 muzzle thread</span></li>\r\n<li><span>Nitride BCG &amp; Charging handle</span></li>\r\n</ul>\n<p><span><strong>The Gen2 PA10 receivers are functionally compatible with the Gen1 upper receivers, however we recommend matching Gen2 lowers to Gen2 uppers for best appearance.  There are external cosmetic differences when mixing Gen1 and Gen2 upper and lower receivers that some may not find appealing.  Gen1 lowers will be available in the future for those who want a cosmetic match.</strong> </span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>The AR10 platform does not enjoy a common design between manufacturers, like the AR15. As a result, there can and will be subtle differences in the parts kits of various manufacturers. Some parts, like the fire control group, are shared with the AR15 platform to preserve the options for upgrading. For best results, we recommend only using PSA PA10 parts with our uppers and lower receivers. We do not recommend using other manufacturers parts in our products.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516666791.jpg', 'https://palmettostatearmory.com/psa-gen2-pa10-18-midlength-308-win-1-10-stainless-steel-15-m-lok-upper-with-bcg-and-ch-516446791.html', '4.8', 61, 739.99, 449.99, 290.00, 'https://palmettostatearmory.com/psa-gen2-pa10-18-midlength-308-win-1-10-stainless-steel-15-m-lok-upper-with-bcg-and-ch-516446791.html', '5207a755c52dab3e22e118f3ebb19d2d', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:47:24'),
(221, 1, 'Premium 5.56 Nickel Boron BCG & PSA AR15/M16 Mil-Spec Charging Handle', '<p><span style=\"text-decoration: underline;\"><strong>Premium 5.56 Nickel Boron BCG with Carpenter 158 Bolt - No Logo</strong></span></p>\r\n<p> </p>\r\n<ul>\n<li>Caliber: 5.56/.223</li>\r\n<li>Finish: Nickel Boron Coating</li>\r\n<li>Bolt Steel: Milspec Carpenter No. 158</li>\r\n<li>Shot Peened Bolt</li>\r\n<li>High pressure tested</li>\r\n<li>Mag particle inspected</li>\r\n<li>Gas Key Hardened to USGI Specifications</li>\r\n<li>Gas Key Grade 8 Hardened Fasteners</li>\r\n<li>Gas Key Staked Per Mil-Spec</li>\r\n<li>Tool Steel Extractor</li>\r\n<li>Extractor Spring</li>\r\n<li>Extractor O-ring Insert</li>\r\n</ul>\n<p> </p>\r\n<p>For packaging considerations, BCG will be packed dry.   Nickel Boron\'s natural surface lubricity is not a substitute for normal rifle lubrication.   Please follow all manufacturers recommendations for lubrication.   It is possible to discolor the finish with dirty ammo or prolonged use without cleaning.</p>\r\n<p> </p>\r\n<p><span style=\"text-decoration: underline;\"><strong>PSA AR15/M16 7075 T6 Forged Mil-Spec Charging Handle - 24080</strong></span></p>\r\n<p> </p>\r\n<p>Forged T7075 charging handle. Manufactured to mil-specs. Fits AR15/M16 weapons.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/k/i/kit-0256.jpg', 'https://palmettostatearmory.com/premium-5-56-nickel-boron-bcg-psa-ar15-m16-mil-spec-charging-handle.html', '5.0', 17, 0.00, 99.99, 0.00, 'https://palmettostatearmory.com/premium-5-56-nickel-boron-bcg-psa-ar15-m16-mil-spec-charging-handle.html', '6ca7cb434c22366747a7a414a6ad122b', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:47:30'),
(222, 1, 'PSA 10.5\" Pistol-Length 300AAC 1/8 12\" M-lok Slant Upper - With BCG, CH, And MBUS Sight Set - 5165447571', '<p><strong>Barrel</strong>: 10.5\" 4150V Chrome Moly vanadium steel barrel phosphate coated and chambered in 300AAC Blackout with a 1 in 8\" twist. Pistol-length gas barrel is finished off with a PSA 12\" Slant End M-lok Rail, a low profile gas block and a Palmetto State State Armory Fluted Flash Can.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring a mil-spec finish, these uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Flash Can</strong>: Palmetto State Armory\'s new Fluted Flash Can! This is a solid 6061 aluminum device that is designed to direct muzzle gases and the muzzle flash forward. Threaded 5/8x24 for 300AAC Blackout. Black mil-spec hard anodizing. THIS DEVICE IS NOT DESIGNED TO REDUCE RECOIL, MUZZLE RISE, OR FLASH SIGNATURE. This device is designed to direct gasses and noise forward away from the shooter and enhance the weapon\'s appearance.</p>\r\n<p><strong><strong>Bolt Carrier Group</strong><span>: </span></strong>Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt, Shot Peened, High pressure tested, Mag particle inspected, Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec. 8620 steel M-16 profile carrier is chrome lined and phosphate coated.  </p>\r\n<p><strong>Includes: </strong>Magpul MBUS Sight Set, Black</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516447012_1_3.jpg', 'https://palmettostatearmory.com/psa-10-5-pistol-length-300aac-1-8-12-m-lok-slant-upper-with-bcg-ch-and-mbus-sight-set-5165447571.html', '4.7', 20, 519.99, 369.99, 150.00, 'https://palmettostatearmory.com/psa-10-5-pistol-length-300aac-1-8-12-m-lok-slant-upper-with-bcg-ch-and-mbus-sight-set-5165447571.html', '8533e137b6deaf1154777806f9d9c850', 0, ' Exp. 8/3, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:47:36'),
(223, 1, 'PSA 7\" Nitride 5.56 1/7 6\" Lightweight M-Lok Upper - With BCG & Charging Handle - 5165447572', '<p><span><strong>Barrel:  </strong>7\" 4150V Chrome Moly vanadium steel, nitride treated for accuracy and durability, and chambered in 5.56 NATO with a 1 in 7\" twist. Pistol-length gas barrel is finished off with an anodized PSA 6\" Lightweight  M-Lok Rail, a low profile gas block and an A2 Flash hider. </span></p>\r\n<p><span><strong>Upper:</strong> Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability.  These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span><strong>Bolt</strong>:<span> Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt, Shot Peened, High pressure tested, Mag particle inspected, Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec. 8620 steel M-16 profile carrier is chrome lined and phosphate coated.</span></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165447572.jpg', 'https://palmettostatearmory.com/psa-7-nitride-5-56-1-7-6-lightweight-m-lok-upper-with-bcg-charging-handle-5165447572.html', '4.8', 17, 399.99, 249.99, 150.00, 'https://palmettostatearmory.com/psa-7-nitride-5-56-1-7-6-lightweight-m-lok-upper-with-bcg-charging-handle-5165447572.html', 'a4992927b579fdd62462dccf28af6f02', 0, NULL, '2018-08-06 06:02:01', '2018-08-06 06:47:44'),
(224, 1, 'Taurus G2C 9mm Pistol, Black - 1-G2C931-12', '<p>Conceal Carry with more confidence with the Taurus G2C 9mm Pistol. The Taurus G2C is lightweight and has a polymer frame with a 3.2-inch barrel. The G2C features an accessory rail, Three Dot Adjustable Rear Sight, textured grip, and melted edges for comfort. If you need a gun you can depend on this is the perfect fit for your concealed carry needs.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/2/52549-g2c.jpg', 'https://palmettostatearmory.com/taurus-g2c-9mm-pistol-black-1-g2c931-12.html', '4.9', 11, 209.99, 199.99, 10.00, 'https://palmettostatearmory.com/taurus-g2c-9mm-pistol-black-1-g2c931-12.html', 'dfe8fa82d1eafd167ded62caee183e19', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:01', '2018-08-06 06:47:51'),
(225, 1, 'Sig Sauer Romeo5 1x20mm Red Dot Sight, Black - R52001', '<p>ROMEO5 compact red dot sights provide civilians and armed professionals a robust 1x aiming solution for any situation. Ultra-low parallax so point-of-aim is point-of-impact and the red dot remains parallel to the bore of your firearm, no matter what your viewing angle is relative to the optical axis of the sight. Unlimited eye-relief allows you to acquire the aiming point and the target regardless of the position of your eye behind the sight. The readily available CR2032 battery is side-loading, allowing for quick battery replacement (featuring 50,000+ hours or more of life). Dependable waterproof (IPX-7 rated for complete water immersion up to 1 atmosphere) and fog-proof performance.<br><br><strong>FEATURES:</strong></p>\r\n<ul>\n<li>-2 MOA Red-Dot provides 10 illumination settings (8 daylight plus 2 NV) for visibility in all light conditions</li>\r\n<li>-MOTAC™ (Motion Activated Illumination) powers up when it senses motion and powers down when it does not. Provides for optimum operational safety and enhanced 50,000+ hour battery life</li>\r\n<li>-Integrated M1913 Picatinny interface provides industry-standard mounting options for a wide range of applications</li>\r\n<li>-Dependable waterproof (IPX-7 rated for complete water immersion up to 1 meter) and fog-proof performance</li>\r\n<li>-Includes a M1913 Picatinny low mount riser and a co-witness 1.41” riser mount</li>\r\n</ul>\n<p> </p>\r\n<p><strong>For the best selection of optics to fit your mission, shop Palmetto State Armory!</strong></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/2/52574_1.jpg', 'https://palmettostatearmory.com/sig-sauer-romeo5-1x20mm-red-dot-sight-black-r52001.html', '4.7', 11, 219.99, 129.99, 90.00, 'https://palmettostatearmory.com/sig-sauer-romeo5-1x20mm-red-dot-sight-black-r52001.html', 'b2d97c0756a478c8011f9f0911ea0b0a', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:02', '2018-08-06 06:47:57'),
(226, 1, 'PSA 18\" Rifle Length 223 Wylde 1/7 Nitride  15\"  M-lok Upper with MBUS sight set, BCG, & CH - 5165447961', '<p><span><strong>Barrel</strong>: 4150V chrome moly steel.  Nitride treated for accuracy and durability.  Chambered in 223 Wylde, with a 1:7 twist rate, M4 barrel extension, and a rifle-length gas system. Barrel is finished off with a PSA 15\" M-Lok free float rail, .750\" low-profile gas block, and an A2-style flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 aluminum A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span><b>Bolt</b><span>: Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt, Shot Peened, High pressure tested, Mag particle inspected, Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked per Mil-Spec.  8620 steel M-16 profile carrier is chrome lined and phosphate coated.</span></span></p>\r\n<p><strong>Included:  </strong>Magpul MBUS Sight Set, Black</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165447961.jpg', 'https://palmettostatearmory.com/psa-18-rifle-length-223-wylde-1-7-nitride-15-m-lok-upper-with-mbus-sight-set-bcg-ch-5165447683.html', '4.9', 8, 525.99, 359.99, 166.00, 'https://palmettostatearmory.com/psa-18-rifle-length-223-wylde-1-7-nitride-15-m-lok-upper-with-mbus-sight-set-bcg-ch-5165447683.html', 'dbb0509f4ab88173b4f49f1716395421', 0, ' Exp. 8/3, 12pm EST', '2018-08-06 06:02:02', '2018-08-06 06:48:03'),
(227, 1, 'PSA Classic Blackhawk Lower Build Kit, Black - 5165447982', '<p><span>Includes Blackhawk! Stock, A2 Pistol grip, Palmetto State Armory Classic Lower Parts Kit and Mil-Spec diameter 6-position 7075 aluminum buffer tube assembly. Everything you need to finish your stripped lower.</span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>**Buffers may vary in finish, color, and may or may not have a PSA logo, depending on product availability.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/d/a/daily_deal_5165447982_2.jpg', 'https://palmettostatearmory.com/psa-classic-blackhawk-lower-build-kit-black-5165447982.html', '4.8', 183, 109.99, 69.99, 40.00, 'https://palmettostatearmory.com/psa-classic-blackhawk-lower-build-kit-black-5165447982.html', 'ea53085c590ecba51876c8cd8e53d33d', 0, NULL, '2018-08-06 06:02:02', '2018-08-06 06:48:10'),
(228, 1, 'PSA AR15 Complete BlackHawk Classic Lower - 5165448002', '<p>This Complete Palmetto State Armory lower is fully assembled and ready for your complete Upper!</p>\r\n<ul>\n<li>Machined from Aluminum Forgings 7075-T6</li>\r\n<li>Hardcoat Anodizing: MIL-A-8625F, Type III, Class 2</li>\r\n<li>Milspec diameter Receiver Extension</li>\r\n<li>Blackhawk! Stock</li>\r\n<li>Staked M4 Lock Nut</li>\r\n<li>Standard Carbine Buffer</li>\r\n<li>Un-notched Hammer compatible with 9mm use</li>\r\n<li>Caliber: Multi</li>\r\n</ul>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448002.jpg', 'https://palmettostatearmory.com/psa-ar15-complete-blackhawk-classic-lower-5165448002.html', '4.9', 103, 239.99, 129.99, 110.00, 'https://palmettostatearmory.com/psa-ar15-complete-blackhawk-classic-lower-5165448002.html', '859d37639bc341ac06ba8b497961efcf', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:02', '2018-08-06 06:48:18'),
(229, 1, 'BLEM PSA 16\" Mid-Length 5.56 NATO 1/7 Phosphate Classic Upper - With BCG & CH - 5165448386', '<p><strong>Barrel</strong>: 16\" barrel length Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a mid-length gas system. The A2-style profile barrel is phosphate coated and finished off with a .750\" diameter F-marked front sight base with sling swivel, classic mid-length handguards, and an A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized black for durability. Featuring M4 feedramp cuts, T-marks, these upper receivers are made for us right here in the USA.</p>\r\n<p><strong>Bolt Carrier Group</strong>: For AR15 and M16 rifles and carbines. Bolt is made of shot-peened, Mil-spec Carpenter 158® steel. Gas key is secured with grade 8 fasteners and staked. Bolt carrier is parkerized outside and chrome lined inside. Includes Charging Handle.</p>\r\n<p><strong>** These uppers will have cosmetic blemishes that do not affect function. This may include, but is not limited to, forging marks under the finish, scratches, slight variation in the finish color coat.</strong></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448386.jpg', 'https://palmettostatearmory.com/blem-psa-16-mid-length-5-56-nato-1-7-phosphate-classic-upper-with-bcg-ch-5165448396.html', '4.9', 68, 389.99, 199.99, 190.00, 'https://palmettostatearmory.com/blem-psa-16-mid-length-5-56-nato-1-7-phosphate-classic-upper-with-bcg-ch-5165448396.html', 'b1557ac584cf8f08e5ab1814c95d585c', 0, NULL, '2018-08-06 06:02:02', '2018-08-06 06:48:26'),
(230, 1, 'PSA 7.5\" 5.56 NATO 1/7 Phosphate 9\" M-Lok MOE SOB EPT Pistol Kit - 5165448478', '<p><span><strong>Barrel:  </strong>7.5\" phosphate coated chrome moly vanadium steel barrel chambered in 5.56 NATO with a 1 in 7\" twist rate.  Pistol-length gas system is finished off with an anodized PSA 9\" M-Lok Rail, a low profile gas block and a PSA Fluted Flash Can. </span></p>\r\n<p><span><strong>Upper:</strong> Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability.  These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span><strong>Flash Can</strong><span>: Palmetto State Armory\'s new Fluted Flash Can! This is a solid 6061 aluminum device that is designed to direct muzzle gases and the muzzle flash forward. Threaded 1/2-28 for 5.56 NATO. Black mil-spec hard anodizing. THIS DEVICE IS NOT DESIGNED TO REDUCE RECOIL, MUZZLE RISE, OR FLASH SIGNATURE. This device is designed to direct gasses and noise forward away from the shooter and enhance the weapon\'s appearance.</span></span></p>\r\n<p><span><strong>Bolt</strong>:<span> Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt, Shot Peened, High pressure tested, Mag particle inspected, Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec. 8620 steel M-16 profile carrier is chrome lined and phosphate coated.</span></span></p>\r\n<p><strong>Build Kit:</strong> <span>A high quality lower build kit with everything you need to assemble your AR-15 lower into a pistol. Features polished hammer and trigger contact points, and black oxide coated hammer and trigger springs. Also includes PSA\'s Enhanced Polished Trigger (EPT), an SB Tactical SOB Pistol Brace, double-looped pistol latch plate, carbine buffer spring, and standard carbine buffer.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/d/a/daily_deal_-_clearance_-_5165448478_fe.jpg', 'https://palmettostatearmory.com/psa-7-5-5-56-nato-1-7-phosphate-9-m-lok-moe-sob-ept-pistol-kit-5165448478.html', '5.0', 10, 679.99, 349.99, 330.00, 'https://palmettostatearmory.com/psa-7-5-5-56-nato-1-7-phosphate-9-m-lok-moe-sob-ept-pistol-kit-5165448478.html', '8eb43528d75db4f7b6a2839e1c092db5', 0, NULL, '2018-08-06 06:02:02', '2018-08-06 06:48:32'),
(231, 1, 'Blem PSAK-47 Liberty \"MOEkov\" Rifle, Black (No Cleaning Rod) - 5165448535B', '<p><strong>BLEM PSAK-47 GB2 Liberty \"MOEkov\" Rifle </strong></p>\r\n<div class=\"tab-content\">\r\n<div class=\"std\">\r\n<ul>\n<li>\n<strong>Caliber: </strong>7.62x39 NATO</li>\r\n<li>\n<strong>Barrel </strong><strong>Block: </strong>Billet Steel<strong> </strong>(front trunnion)</li>\r\n<li>\n<strong>Barrel Finish: </strong>Melonite 4150 steel treated barrel</li>\r\n<li>\n<strong>Receiver Type: </strong>Stamped</li>\r\n<li>\n<strong>Receiver Material: </strong>Hardened steel</li>\r\n<li>\n<strong>Bolt: </strong>Billet Steel</li>\r\n<li>\n<strong>Bolt </strong><strong>Carrier Group: </strong>Hammer Forged Steel Carrier </li>\r\n<li>\n<strong>Twist Rate: </strong>1 in 9.5\" Twist</li>\r\n<li>\n<strong>Rear Sight: </strong>Std. 800-yard rear sight leaf</li>\r\n<li>\n<strong>Stock: </strong>Magpul Zhukov Folding Stock, Black</li>\r\n<li>\n<b>Grip: </b>Magpul AK47 Grip, Black</li>\r\n<li>\n<strong>Handguard:  </strong>Magpul MOE AKM, Black</li>\r\n<li>\n<strong>Includes: </strong>Magpul 30 round magazine (1)</li>\r\n<li>This model does NOT include a cleaning rod</li>\r\n<li>Side Scope Mount</li>\r\n</ul>\n<p> </p>\r\n<p>The PSAK-47 was designed from the ground up to be a new standard in AK rifles, utilizing all new precision manufactured parts.  We took the best of all the different models to create an American AK.  Thoroughly tested in development, we tortured tested to 10,000 rounds to ensure a quality product.  Not to be satisfied with just a good AK, we kept improving and now are proud to announce our PSAK-47 GB2 Liberty rifle with a billet steel barrel block (front trunnion) and bolt, with a hammer forged carrier.</p>\r\n<p><span>The 4150 barrel is nitride treated for accuracy and durability and is pressed into a new Billet steel machined barrel block to ensure the longevity AKs are known for.  The hardened steel 1mm receiver features a mil-spec style single hook trigger, and side rail mount.  The front trunnion is engraved with a star to designate the GB2 (Billet Block) model. <span>The handguard is the MOE AKM, which complements the MOE Grip and Zhukov folding stock.  The rifle comes complete with a 30 round Magpul magazine (where allowed by law).</span></span></p>\r\n<p><span><span><strong>**These rifles will have cosmetic blemishes that do not affect function.  This may include, but is not limited to, machining marks under the finish, scratches, or variation in the finish color.</strong></span></span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Rifles must be shipped to a valid, current Federal Firearms Licensee (FFL).  Please have the shipping address of your preferred FFL before placing your order.  You will need the FFL information to complete the order.  It is the purchaser\'s responsibility to be aware of the laws in their state regarding high capacity sporting rifles.</strong></span></p>\r\n</div>\r\n</div>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448535b_1.jpg', 'https://palmettostatearmory.com/blemished-psa-ak47-liberty-moekov-rifle-black-5165448535b.html', '4.6', 8, 799.99, 599.99, 200.00, 'https://palmettostatearmory.com/blemished-psa-ak47-liberty-moekov-rifle-black-5165448535b.html', 'f6d35f98c2eb789fb1063a42a1be3474', 0, ' Exp. 8/3, 12pm EST', '2018-08-06 06:02:02', '2018-08-06 06:48:39'),
(232, 1, 'BLEM PSA Gen2 PA65 20\" 6.5 Creedmoor 1/8 Stainless Steel 15\" M-lok Upper - with Adjustable Gas Block, BCG, and CH -5165448667', '<p><span><strong>Barrel:</strong> 20\" Heavy 416R Stainless Steel barrel chambered in 6.5 Creedmoor with a 1:8 twist rate and rifle-length gas system.  Upper is paired with a Palmetto State Armory 15\" M-Lok free-float rail for enhanced accuracy, low profile adjustable gas block, and an A2-style muzzle device. </span></p>\r\n<p><span><strong>Upper:</strong>  Precision machined from forged 7075-T6 aluminum, then Black anodize hardcoated to MIL-8625 Type 3 class 2.   </span></p>\r\n<p><span><strong>Bolt Carrier Group:</strong> Gen2 6.5 Creedmoor BCG is designed with double ejectors in order to ensure flawless cycling.  <span>9310 steel bolt assembly, nitride treated for durability.  8620 carrier, with a nitride treated gas key properly staked with grade 8 fasteners.  Charging handle is also included.</span></span></p>\r\n<ul>\n<li><span>7075-T6 Forged Aluminum Receiver</span></li>\r\n<li><span>20\" 416R Stainless Steel Barrel</span></li>\r\n<li><span>6.5 Creedmoor Chamber</span></li>\r\n<li><span>1 in 8\" Twist Rate Rifling</span></li>\r\n<li><span>Rifle-length Gas System</span></li>\r\n<li><span>15\" Free Float M-Lok Rail</span></li>\r\n<li><span>Low Profile Adjustable Gas Block</span></li>\r\n<li><span>A2-Style Muzzle Device</span></li>\r\n<li><span>5/8-24 Muzzle Thread</span></li>\r\n<li><span>Nitride Gen2 BCG &amp; Charging handle</span></li>\r\n<li>Includes: High pressure/ small diameter firing pin bolt</li>\r\n</ul>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448667.jpg', 'https://palmettostatearmory.com/psa-gen2-pa65-20-6-5-creedmoor-1-8-stainless-steel-15-m-lok-upper-with-adjustable-gas-block-bcg-and-ch-5165448667.html', '5.0', 2, 749.99, 449.99, 300.00, 'https://palmettostatearmory.com/psa-gen2-pa65-20-6-5-creedmoor-1-8-stainless-steel-15-m-lok-upper-with-adjustable-gas-block-bcg-and-ch-5165448667.html', 'b4bf2f08ab61fce65039135ea6669f13', 0, NULL, '2018-08-06 06:02:02', '2018-08-06 06:48:45'),
(233, 1, 'BLEM PSA 20\" Rifle-Length .224 Valkyrie 1/7 Stainless Steel 15\" Lightweight M-Lok Upper with BCG & CH - 5165447815B', '<p>The ultimate long range AR-15 upper is finally here!</p>\r\n<p>The 224 Valkyrie round was developed to bring unheard of accuracy and long range ballistic performance to the AR-15 platform. </p>\r\n<p><strong>Barrel: </strong>The PSA 224 Valkyrie upper receiver was created with a 416R Stainless Steel barrel with a 1:7 twist rate for optimal accuracy over long distances.  Cycling reliability is achieved with a rifle length gas system, which is completed with a PSA Low-profile adjustable Gas Block.  The barrel is finished off with an A2 flash hider and a PSA 15\" Lightweight M-Lok Rail.  </p>\r\n<p><strong>Upper Receiver</strong><span>: The forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized. These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span><strong>**These uppers may have cosmetic blemishes that do not affect function. This may include, but is not limited to, forging marks under the finish, scratches, dings, slight variation in the finish color coat.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165447815.jpg', 'https://palmettostatearmory.com/blem-psa-20-rifle-length-224-valkyrie-1-7-stainless-steel-15-lightweight-m-lok-upper-with-bcg-ch-5165447815b.html', '4.7', 13, 589.99, 349.99, 240.00, 'https://palmettostatearmory.com/blem-psa-20-rifle-length-224-valkyrie-1-7-stainless-steel-15-lightweight-m-lok-upper-with-bcg-ch-5165447815b.html', '82750830a893cce0dd100f3634ed2b5d', 0, NULL, '2018-08-06 06:02:02', '2018-08-06 06:48:51');
INSERT INTO `deals` (`id`, `source_id`, `title`, `description`, `image`, `link`, `ratings`, `reviews_count`, `base_price`, `sale_price`, `save_price`, `from_url`, `unique_md5`, `out_of_stock`, `ext_date`, `created_at`, `updated_at`) VALUES
(234, 1, 'PSA 4\" 9mm 1/10 Lightweight M-Lok MOE EPT SBA3 Pistol - 5165448803', '<p><strong>Barrel</strong><span>: 4\" chrome moly steel barrel. Chambered in 9mm, (9x19), with a 1/10 twist. The barrel is nitride treated for durability and finished off with a Palmetto State Armory 6\" Lightweight M-Lok free-float rail and a Palmetto State Armory Fluted 9mm Flash Can.</span></p>\r\n<p><strong>Flash Can</strong><span>: Palmetto State Armory\'s Fluted \"FLASH CAN\". This is a solid 6061 aluminum device that is designed to direct muzzle gases and the muzzle flash forward. Threaded 1/2-36 for 9mm.  Black military-style hard anodizing.   THIS DEVICE IS NOT DESIGNED TO REDUCE RECOIL, MUZZLE RISE, OR FLASH SIGNATURE. This device is designed to direct gasses and noise forward away from the shooter and enhance the weapon\'s appearance.</span></p>\r\n<p><strong>Upper</strong><span>: Billet 6061-T6 Slick Side AR upper is hard coat anodized black for durability.  These upper receivers are made for us right here in the USA.</span></p>\r\n<p><strong>Bolt Carrier Group</strong><span>: G-9 Hybrid 9mm BCG. Phosphate coated, 8620 steel, G-9 Hybrid Bolt allows use with either Glock®-style, or Colt®-style magazine, Palmetto State Armory lowers. Includes charging handle.</span></p>\r\n<p><b>Lower:</b><span>. Forged 7075 T6 aluminum and then hard coat anodized, these lowers are purpose built to accept 9mm Glock®-style magazines.   Designed to work with PSA\'s new 9mm Hybrid uppers.  The lower is assembled with a Palmetto State Armory MOE EPT lower build kit with a Magpul Grip,  PSA 6 position buffer tube, and SBA3 adjustable brace. <strong> Does not include last round bolt hold open feature.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448803a.jpg', 'https://palmettostatearmory.com/psa-4-9mm-1-10-lightweight-m-lok-moe-ept-sba3-pistol-5165448803.html', '0', 0, 809.99, 599.99, 210.00, 'https://palmettostatearmory.com/psa-4-9mm-1-10-lightweight-m-lok-moe-ept-sba3-pistol-5165448803.html', '3d23c870467794c13057464b60fe5890', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:02', '2018-08-06 06:48:57'),
(235, 1, 'Blemished PSAK-47 GB2 Liberty MOE Rifle (No Cleaning Rod) - 5165448828B', '<p><span><strong>BLEM PSAK-47 Liberty MOE Rifle (No Cleaning Rod) - 5165448828B</strong></span></p>\r\n<p><span>The PSAK-47 was designed from the ground up to be a new standard in AK rifles, utilizing all new precision manufactured parts.  We took the best of all the different models to create an American AK.  Thoroughly tested in development, we tortured tested to 10,000 rounds to ensure a quality product.  Not to be satisfied with just a good AK, we kept improving and now are proud to announce our PSAK-47 GB2 rifle with a billet steel barrel block (front trunnion) and bolt.</span></p>\r\n<p><span>The 4150 barrel is nitride treated for accuracy and durability, and is pressed into a new Billet steel machined barrel block to ensure the longevity AKs are known for.  The hardened steel 1mm receiver features a mil-spec style single hook trigger, and side rail mount.  The front trunnion is engraved with a star to designate the GB2 (Billet Block) model.  The rifle comes complete with a 30 round Magpul magazine (where allowed by law).</span></p>\r\n<ul>\n<li><span>Melonite 4150 steel treated barrel</span></li>\r\n<li><span>Stamped steel receiver</span></li>\r\n<li><span>Billet Barrel Block (front trunnion)</span></li>\r\n<li><span>Forged Carrier</span></li>\r\n<li><span>Billet Bolt</span></li>\r\n<li><span>Side Scope Mount</span></li>\r\n<li><span>7.62x39 Caliber</span></li>\r\n<li><span>1 in 9.5\" Twist</span></li>\r\n<li><span>Std. 800-yard rear sight leaf</span></li>\r\n<li><span>Magpul Grip, Black</span></li>\r\n<li><span>Magpul AKM Handguard, Black</span></li>\r\n<li><span>Magpul AKM Stock, Black</span></li>\r\n<li><span>Magpul 30 round magazine (1)</span></li>\r\n</ul>\n<p> </p>\r\n<p><span>This item is available online only.</span></p>\r\n<p><span style=\"color: #ff0000;\">Rifles must be shipped to a valid, current Federal Firearms Licensee (FFL).  Please have the shipping address of your preferred FFL before placing your order.  You will need the FFL information to complete the order.  It is the purchaser\'s responsibility to be aware of the laws in their state regarding high capacity sporting rifles.</span></p>\r\n<p><span><strong>Signature required on delivery.</strong></span></p>\r\n<p><span><strong>**These rifles will have cosmetic blemishes that do not affect function. This may include, but is not limited to, machining marks under the finish, scratches, or variation in the finish color.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516447057_7.jpg', 'https://palmettostatearmory.com/blemished-psak-47-gb2-liberty-moe-rifle-no-cleaning-rod-5165448828b.html', '0', 0, 699.99, 499.99, 200.00, 'https://palmettostatearmory.com/blemished-psak-47-gb2-liberty-moe-rifle-no-cleaning-rod-5165448828b.html', '0396ea47069d238f598bae830fd3ebb9', 0, NULL, '2018-08-06 06:02:02', '2018-08-06 06:49:03'),
(236, 1, 'PSA 7\" Nitride 5.56 1/7 6\" Lightweight M-Lok Classic Shockwave Pistol Kit - 5165448870', '<p><strong>Barrel</strong>: 7\" 4150V Chrome Moly vanadium steel, nitride treated for durability and chambered in 5.56 NATO with a 1 in 7\" twist. Pistol-length gas barrel is finished off with a PSA 6\" Lightweight M-lok Rail, a low profile gas block and an A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring a mil-spec finish, these uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is nitride treated. </p>\r\n<p><strong>Build Kit:</strong> A high quality lower build kit with everything you need to assemble your AR-15 lower into a pistol. Pistol kit includes a Shockwave Blade pistol stabilizer, Shockwave tube, PSA classic A2 grip, USGI trigger guard, carbine buffer spring, and standard carbine buffer.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448870.jpg', 'https://palmettostatearmory.com/psa-7-nitride-5-56-1-7-6-lightweight-m-lok-classic-shockwave-pistol-kit-5165448870.html', '0', 0, 589.99, 299.99, 290.00, 'https://palmettostatearmory.com/psa-7-nitride-5-56-1-7-6-lightweight-m-lok-classic-shockwave-pistol-kit-5165448870.html', '99cf8edd0c9da2bd9a800c999cf889e9', 0, NULL, '2018-08-06 06:02:02', '2018-08-06 06:49:08'),
(237, 1, 'PSA 10.5\" Carbine-Length 5.56 NATO 1/7 Nitride 12\" Slant M-Lok MOE EPT SBA3 Pistol Kit - 5165448877', '<p><strong>Barrel</strong>: 10.5\" 4150V Chrome Moly vanadium steel, nitride treated for durability and chambered in 5.56 NATO with a 1 in 7\" twist. Carbine length gas barrel is finished off with a PSA 12\" Slant End M-lok Rail, a low profile gas block and a PSA Fluted Flash Can.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring a mil-spec finish, these uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Flash Can</strong>: Palmetto State Armory\'s Fluted \"FLASH CAN\". This is a solid 6061 aluminum device that is designed to direct muzzle gases and the muzzle flash forward. Threaded 1/2-28 for 5.56 NATO. Black military-style hard anodizing. THIS DEVICE IS NOT DESIGNED TO REDUCE RECOIL, MUZZLE RISE, OR FLASH SIGNATURE. This device is designed to direct gasses and noise forward away from the shooter and enhance the weapon\'s appearance.</p>\r\n<p><strong>Bolt</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is parkerized outside, and chrome lined inside.</p>\r\n<p><span><strong>Build Kit: </strong>A high quality lower build kit with everything you need to assemble your AR-15 lower into a pistol. Features Enhanced Polished Trigger (EPT), Magpul Grip, Magpul Trigger Guard, and black oxide coated hammer and trigger springs. Also includes SB Tactical SBA3 Adjustable Pistol Brace, castle nut, latch plate, carbine buffer spring, 5 positioning mil-spec buffer tube, and standard carbine buffer.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448877.png', 'https://palmettostatearmory.com/psa-10-5-carbine-length-5-56-nato-1-7-nitride-12-slant-m-lok-moe-ept-sba3-pistol-kit-5165448877.html', '5.0', 1, 709.99, 399.99, 310.00, 'https://palmettostatearmory.com/psa-10-5-carbine-length-5-56-nato-1-7-nitride-12-slant-m-lok-moe-ept-sba3-pistol-kit-5165448877.html', '22fe56dc5bb28ecdad151a6619c47792', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:08', '2018-08-06 06:49:13'),
(238, 1, 'PSA MOE SBA3 Lower Build Kit, Black - 5165448884', '<p><span>A high quality lower build kit with everything you need to assemble your AR-15 lower into a pistol. Features mil-spec single stage fire control group, Magpul Grip, Magpul Trigger Guard, and black oxide coated hammer and trigger springs. Also includes SB Tactical SBA3 Adjustable Pistol Brace, castle nut, latch plate, carbine buffer spring, 6 positioning mil-spec buffer tube, and standard carbine buffer.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448884.jpg', 'https://palmettostatearmory.com/psa-pistol-lower-build-kit-with-adjustable-sb-tactical-brace-black-5165448118.html', '5.0', 1, 199.99, 149.99, 50.00, 'https://palmettostatearmory.com/psa-pistol-lower-build-kit-with-adjustable-sb-tactical-brace-black-5165448118.html', '95f103af2b8891b64e8711e9c59ab3db', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:09', '2018-08-06 06:49:18'),
(239, 1, 'BLEM PSA 16\" Mid-Length 5.56 NATO 1:7 Phosphate 13.5\" Lightweight M-Lok Upper With BCG & CH - 5165448931', '<p><strong>Barrel</strong>: Chrome-moly vanadium steel, chambered in 5.56 NATO, with a 1:7 twist rate, M4 barrel extension, and a mid-length gas system. The A2-style profile barrel is phosphate coated and finished off with an .750 low-profile gas block, 13.5\" PSA Lightweight M-Lok Partial Picatinny Free Float Rail, and an A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized black for durability. Featuring M4 feedramp cuts, these upper upper receivers are made for us right here in the USA.</p>\r\n<p><strong>Bolt Carrier Group</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel, nitride treated.  Carrier is nitride treated 8620 steel.  Machined steel gas key is fastened with properly staked grade 8 bolts.  Charging handle included.</p>\r\n<p><strong>**These uppers may have cosmetic blemishes that do not affect function. This may include, but is not limited to, forging marks under the finish, scratches, dings, slight variation in the finish color coat.</strong></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448551_2.jpg', 'https://palmettostatearmory.com/blem-psa-16-mid-length-5-56-nato-1-7-phosphate-13-5-lightweight-m-lok-upper-with-bcg-ch-5165448931.html', '0', 0, 479.99, 259.99, 220.00, 'https://palmettostatearmory.com/blem-psa-16-mid-length-5-56-nato-1-7-phosphate-13-5-lightweight-m-lok-upper-with-bcg-ch-5165448931.html', '328fdf54dfa5f4e32507cb74d5ff2229', 0, NULL, '2018-08-06 06:02:10', '2018-08-06 06:49:23'),
(240, 1, 'Blem PSAK-47 GB2 Liberty \"MOEkov\" Rifle (No Cleaning Rod), FDE - 5165448850B', '<p><strong>Caliber: </strong>7.62x39 NATO<br><strong>Barrel </strong><strong>Block: </strong>Billet Steel<strong> </strong>(front trunnion)<br><strong>Barrel Finish: </strong>Melonite 4150 steel treated barrel<br><strong>Receiver Type: </strong>Stamped<br><strong>Receiver Material: </strong>Hardened steel<br><strong>Bolt: </strong>Billet Steel<br><strong>Bolt </strong><strong>Carrier Group: </strong>Hammer Forged Steel Carrier <br><strong>Twist Rate: </strong>1 in 9.5\" Twist<br><strong>Rear Sight: </strong>Std. 800-yard rear sight leaf<br><strong>Stock: </strong>Magpul Zhukov Folding Stock, Flat Dark Earth<br><b>Grip: </b>Magpul AK47 Grip, Flat Dark Earth<br><strong>Handguard:  </strong>Magpul MOE AKM, Flat Dark Earth<br><strong>Includes: </strong>Magpul 30 round magazine (1)<br>Side Scope Mount</p>\r\n<p><span>The PSAK-47 was designed from the ground up to be a new standard in AK rifles, utilizing all new precision manufactured parts.  We took the best of all the different models to create an American AK.  Thoroughly tested in development, we tortured tested to 10,000 rounds to ensure a quality product.  Not to be satisfied with just a good AK, we kept improving and now are proud to announce our PSAK-47 GB2 Liberty rifle with a billet steel barrel block (front trunnion) and bolt, with a hammer forged carrier.</span></p>\r\n<p><span>The 4150 barrel is nitride treated for accuracy and durability and is pressed into a new Billet steel machined barrel block to ensure the longevity AKs are known for.  The hardened steel 1mm receiver features a mil-spec style single hook trigger, and side rail mount.  The front trunnion is engraved with a star to designate the GB2 (Billet Block) model. The handguard is the MOE AKM, which complements the MOE Grip and Zhukov folding stock.  The rifle comes complete with a 30 round Magpul magazine (where allowed by law).</span></p>\r\n<p><span><strong>**These rifles will have cosmetic blemishes that do not affect function.  This may include, but is not limited to, machining marks under the finish, scratches, or variation in the finish color.</strong></span></p>\r\n<p><span><strong>Rifles must be shipped to a valid, current Federal Firearms Licensee (FFL).  Please have the shipping address of your preferred FFL before placing your order.  You will need the FFL information to complete the order.  It is the purchaser\'s responsibility to be aware of the laws in their state regarding high capacity sporting rifles.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448850b-no-cleaning-rod.jpg', 'https://palmettostatearmory.com/blem-psak-47-gb2-liberty-moekov-rifle-no-cleaning-rod-fde-5165448850b.html', '0', 0, 799.99, 599.99, 200.00, 'https://palmettostatearmory.com/blem-psak-47-gb2-liberty-moekov-rifle-no-cleaning-rod-fde-5165448850b.html', '7eb49e2ac6fd725b4f17813ea2c429d0', 0, ' Exp. 8/3, 12pm EST', '2018-08-06 06:02:10', '2018-08-06 06:49:27'),
(241, 1, 'PSA Shockwave 2.0 MOE EPT Lower Build Kit - Black - 5165448970', '<div class=\"std\">\r\n<p><span>A high quality lower build kit with everything you need to assemble your AR-15 lower into a pistol. Features our Enhanced Polished Trigger (EPT) fire control group which features finely polished contact surfaces and then finished off with a super slick nickel coating.  This results in a trigger which is significantly smoother than a standard Mil-Spec trigger assembly. Pistol kit also includes a Shockwave 2.0 Adjustable Blade, Shockwave 2.0 5 position buffer tube, Magpul MOE grip, MOE trigger guard, carbine buffer spring, and standard carbine buffer.</span></p>\r\n<p><span> </span></p>\r\n</div>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448970.jpg', 'https://palmettostatearmory.com/psa-shockwave-2-0-moe-ept-lower-build-kit-black-5165448970.html', '0', 0, 219.99, 139.99, 80.00, 'https://palmettostatearmory.com/psa-shockwave-2-0-moe-ept-lower-build-kit-black-5165448970.html', 'a11486b75ca14b16cd93f930fcc00511', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:10', '2018-08-06 06:49:33'),
(242, 1, 'PSA 16\" M4 Carbine 5.56 NATO 1/7 Nitride MOE EPT Rifle Kit with Rear MBUS - ODG - 5165448974', '<p><span><strong>Barrel</strong>: 4150V chrome moly vanadium 16\" barrel. Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a Mid-length gas system.  Nitride treated for accuracy and durability. Barrel is is finished off with Magpul MOE Carbine-length handguards in Olive Drab Green, F-Marked gas sight base, and A2 flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized for durability. These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span><strong>Bolt</strong><span>: Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt, Shot Peened, High pressure tested, Mag particle inspected,  Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec.  8620 steel M-16 profile carrier is chrome lined and phosphate coated.</span></span></p>\r\n<p><strong>Build Kit: </strong>PSA EPT MOE Lower Build Kit, Olive Drab Green</p>\r\n<p>Includes Magpul MOE Stock,  Pistol grip, and trigger guard, Palmetto State Armory EPT  Lower Parts Kit and Mil-Spec diameter 6-position buffer tube assembly.</p>\r\n<p>EPT Lower parts kit upgrades the standard combat-style fire control group with a single-stage, target-style,  fire control group with polished contact surfaces and an electroless nickel coating.</p>\r\n<p>Everything you need to finish your stripped lower!</p>\r\n<p><strong>Includes</strong>: Magpul® MBUS Rear Sight, Black</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448974.jpg', 'https://palmettostatearmory.com/psa-16-m4-carbine-5-56-nato-1-7-nitride-moe-ept-rifle-kit-with-rear-mbus-odg-5165448974.html', '0', 0, 579.99, 329.99, 250.00, 'https://palmettostatearmory.com/psa-16-m4-carbine-5-56-nato-1-7-nitride-moe-ept-rifle-kit-with-rear-mbus-odg-5165448974.html', '9f61f45dee0e2f396384487d04f88b1a', 0, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:10', '2018-08-06 06:49:38'),
(243, 1, 'PSA AR-15 Complete Classic Lower - No Magazine - 7244', '<p>This Complete Palmetto State Armory lower is fully assembled and ready for your complete Upper!</p>\n<ul>\n<li>Machined from Aluminum Forgings 7075-T6</li>\n<li>Hardcoat Anodizing: MIL-A-8625F, Type III, Class 2</li>\n<li>Milspec diameter Receiver Extension</li>\n<li>M4 Stock</li>\n<li>Staked M4 Lock Nut</li>\n<li>Standard Carbine Buffer</li>\n<li>Un-notched Hammer compatible with 9mm use</li>\n<li>Caliber: Multi</li>\n</ul>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/c/o/complete_lower.jpg', 'https://palmettostatearmory.com/complete-psa-ar-15-lower-classic-edition.html', '4.8', 79, 239.99, 129.99, 110.00, 'https://palmettostatearmory.com/complete-psa-ar-15-lower-classic-edition.html', '416e12d06815f777dd3d7bab1c1c66d9', 0, NULL, '2018-08-06 06:02:10', '2018-08-06 06:49:44'),
(244, 1, 'PSA 16\" 5.56 NATO M4 Carbine Classic Rifle Kit, Flat Dark Earth - 516446389', '<p><span><strong>Barrel</strong>: 4150V Chrome Moly steel barrel chambered in 5.56 NATO with a 1:7 twist rate, M4 barrel extension, and a carbine-length gas system. The barrel is finished off with a standard carbine flat dark earth handguard, F-Marked gas sight base, and A2 flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized, features a forged upper receiver. These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span><strong>Bolt</strong>: Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt. Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec. 8620 steel M-16 profile carrier is chrome lined and phosphate coated.</span></p>\r\n<p><span><strong>Lower Build Kit</strong>: Includes Classic Flat Dark Earth M4-Style Stock, Flat Dark Earth A2 Pistol grip, Classic Lower Parts Kit and Mil-Spec diameter 6-position buffer tube assembly. Everything you need to finish your stripped lower!</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/f/d/fde_rifle_kit.jpg', 'https://palmettostatearmory.com/psa-16-m4-carbine-classic-fde-rifle-kit-516446389.html', '4.9', 76, 499.99, 299.99, 200.00, 'https://palmettostatearmory.com/psa-16-m4-carbine-classic-fde-rifle-kit-516446389.html', '95b93b8e90eb70fe53206b6cd74958fe', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:49:52'),
(245, 1, 'Premium 5.56 Nickel Boron BCG with Carpenter 158 Bolt - No Logo', '<p><span>For packaging considerations, BCG will be packed dry.   Nickel Boron\'s natural surface lubricity is not a substitute for normal rifle lubrication.   Please follow all manufacturers recommendations for lubrication.   It is possible to discolor the finish with dirty ammo or prolonged use without cleaning.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/n/i/nib6.jpg', 'https://palmettostatearmory.com/psa-logoed-premium-5-56-nickel-boron-bcg-with-carpenter-158-bolt-516446450.html', '4.9', 242, 149.99, 89.99, 60.00, 'https://palmettostatearmory.com/psa-logoed-premium-5-56-nickel-boron-bcg-with-carpenter-158-bolt-516446450.html', '9a2fd54dfa13fc75bf52157d9146ca3b', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:00'),
(246, 1, 'BLEM PSA Gen2 PA10 18\" Midlength .308 WIN 1:10 Stainless Steel 15\" M-lok Upper - with BCG and CH -516447164B', '<p>New and improved Palmetto State Armory PA10 Gen2 .308 Upper is fully assembled and ready for your complete PA10 Gen2 Lower!</p>\r\n<p>With streamlined styling and improved function, the new and improved PSA PA10 is here.  The Gen2 model offers an enhanced chamber and extraction, with a more modern appearance.  </p>\r\n<p><b>Barrel:</b> 416R Stainless Steel, chambered in 308 WIN with a 1/10 twist, mid-length gas. Upper is paired with a Palmetto State Armory 15\" M-Lok free-float rail, low profile gas block, and an A2-style muzzle device. </p>\r\n<p><b>Upper:</b>  Precision machined from forged 7075-T6 aluminum, then Black anodize hardcoated to MIL-8625 Type 3 class 2.   </p>\r\n<p><b>Bolt Carrier Group:</b> 9310 steel bolt assembly, nitride treated for durability.  8620 carrier, nitride treated, with a nitride treated gas key properly staked with grade 8 fasteners.  Charging handle is also included.</p>\r\n<ul>\n<li>7075-T6 Forged aluminum receiver</li>\r\n<li>18\" 416R Stainless Steel Barrel</li>\r\n<li>308 WIN Chamber</li>\r\n<li>1 in 10 twist rate</li>\r\n<li>Mid-length Gas system</li>\r\n<li>15\" free float M-Lok rail</li>\r\n<li>low profile gas block</li>\r\n<li>A2-style muzzle device</li>\r\n<li>5/8-24 muzzle thread</li>\r\n<li>Nitride BCG &amp; Charging handle</li>\r\n</ul>\n<p><b>The Gen2 PA10 receivers are functionally compatible with the Gen1 upper receivers; however we recommend matching Gen2 lowers to Gen2 uppers for best appearance.  There are external cosmetic differences when mixing Gen1 and Gen2 upper and lower receivers that some may not find appealing.  Gen1 lowers will be available in the future for those who want a cosmetic match.</b> </p>\r\n<p><span style=\"color: #ff0000;\"><b>The AR10 platform does not enjoy a common design between manufacturers, like the AR15. As a result, there can and will be subtle differences in the parts kits of various manufacturers. Some parts, like the fire control group, are shared with the AR15 platform to preserve the options for upgrading. For best results, we recommend only using PSA PA10 parts with our uppers and lower receivers. We do not recommend using other manufacturer’s parts in our products.</b></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516447042_2.jpg', 'https://palmettostatearmory.com/blem-psa-gen2-pa10-18-midlength-308-win-1-10-stainless-steel-15-m-lok-upper-with-bcg-and-ch-516447164b.html', '4.7', 31, 689.99, 399.99, 290.00, 'https://palmettostatearmory.com/blem-psa-gen2-pa10-18-midlength-308-win-1-10-stainless-steel-15-m-lok-upper-with-bcg-and-ch-516447164b.html', '6044fe12a05a0c489787a9647e1ff2f0', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:06'),
(247, 1, 'Blem PSAK-47 GB2 Liberty Polymer Side Folding Rifle (No Cleaning Rod), Black - 5165448564B', '<p><span><strong>BLEM PSAK-47 GB2 Liberty Classic Polymer Side Folder Rifle (No Cleaning Rod) - 5165448564B</strong></span></p>\r\n<p><span>The PSAK-47 was designed from the ground up to be a new standard in AK rifles, utilizing all new precision manufactured parts.  We took the best of all the different models to create an American AK.  Thoroughly tested in development, we tortured tested to 10,000 rounds to ensure a quality product.  Not to be satisfied with just a good AK, we kept improving and now are proud to announce our PSAK-47 GB2 Liberty rifle with a billet steel barrel block (front trunnion) and bolt, with a hammer forged carrier.</span></p>\r\n<p><span>The 4150 barrel is nitride treated for accuracy and durability, and is pressed into a new Billet steel machined barrel block to ensure the longevity AKs are known for.  The hardened steel 1mm receiver features a mil-spec style single hook trigger, and side rail mount.  The front trunnion is engraved with a star to designate the GB2 (Billet Block) model.  The classic polymer furniture includes a compartment in the buttstock and sling loop, and the rifle comes complete with a 30 round Magpul magazine (where allowed by law).</span></p>\r\n<ul>\n<li>Melonite 4150 steel treated barrel</li>\r\n<li>Stamped steel receiver</li>\r\n<li>Billet Barrel Block (front trunnion)</li>\r\n<li>Billet Side Folding Rear Trunnion</li>\r\n<li>Billet Bolt</li>\r\n<li>Hammer Forged Steel Carrier </li>\r\n<li>Side Scope Mount</li>\r\n<li>7.62x39 Caliber</li>\r\n<li>1 in 9.5\" Twist</li>\r\n<li>Std. 800-yard rear sight leaf</li>\r\n<li>Standard Polymer Furniture with side folding stock</li>\r\n<li>Magpul 30 round magazine (1)</li>\r\n</ul>\n<p><span style=\"color: #ff0000;\"><strong>Rifles must be shipped to a valid, current Federal Firearms Licensee (FFL).  Please have the shipping address of your preferred FFL before placing your order.  You will need the FFL information to complete the order.  It is the purchaser\'s responsibility to be aware of the laws in their state regarding high capacity sporting rifles.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/s/i/sidefolding3_2.jpg', 'https://palmettostatearmory.com/blemished-psak-47-gb2-classic-forged-side-folder-polymer-rifle-no-cleaning-rod-black-5165448564b.html', '5.0', 4, 699.99, 599.99, 100.00, 'https://palmettostatearmory.com/blemished-psak-47-gb2-classic-forged-side-folder-polymer-rifle-no-cleaning-rod-black-5165448564b.html', '5fd745054e5d8509e1a58e72b7d3411c', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:12'),
(248, 1, 'PSA 16\" Carbine-Length 5.56 NATO 1/7 Phosphate 15\" lightweight M-lok Upper - With BCG & CH - 5165448948', '<p><strong>Barrel</strong>: Chrome-moly vanadium steel, chambered in 5.56 NATO, with a 1:7 twist rate, M4 barrel extension, and a carbine-length gas system. The heavy profile barrel is phosphate coated and finished off with an .750 low-profile gas block, 15\" PSA Lightweight M-Lok Partial Picatinny Free Float Rail, and an A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized black for durability. Featuring M4 feedramp cuts, these upper upper receivers are made for us right here in the USA.</p>\r\n<p><strong>Bolt Carrier Group</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel, phosphate coated.  Carrier is phosphate coated and chrome-lined 8620 steel.  Machined steel gas key is chrome lined and fastened with properly staked grade 8 bolts.  Charging handle included.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448948.jpg', 'https://palmettostatearmory.com/psa-16-carbine-length-5-56-nato-1-7-stainless-steel-15-lightweight-m-lok-upper-with-bcg-ch-5165448948.html', '0', 0, 469.99, 259.99, 210.00, 'https://palmettostatearmory.com/psa-16-carbine-length-5-56-nato-1-7-stainless-steel-15-lightweight-m-lok-upper-with-bcg-ch-5165448948.html', 'dc3d97d871fa04a64f1558643d8847ec', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:16'),
(249, 1, 'PSA 10.5\" Carbine-Length 5.56 NATO 1/7 Phosphate 12\" M-Lok MOE EPT SBA3 Pistol - 5165448952', '<p><strong>Barrel</strong>: 4150V chrome moly steel. Chambered in 5.56 NATO, with a 1:7 twist rate, M4 barrel extension, carbine-length gas system, and phosphate coated.  This A2 profile barrel is finished off with a PSA 12\" Lightweight Slant End M-Lok free-float rail, .750\" low-profile gas block, and PSA Fluted Flash Can.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized.  These uppers are made for us right here in the USA!</p>\r\n<p><strong>Bolt</strong>: Full-auto profile bolt carrier group. Shot-peened, mil-spec Carpenter No. 158® steel bolt. Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec. 8620 steel M-16 profile carrier is nitride treated.</p>\r\n<p><strong>Lower</strong>: These forged lowers are quality made using 7075-T6 aluminum and are marked \"MULTI\" for caliber. Finish is hardcoat anodized. Pistol 7075-T6 buffer tube is hardcoat anodized and is fitted with an SB Tactical SBA3 Adjustable Pistol Brace, Magpul Grip, and Enhanced Polished Trigger (EPT). </p>\r\n<p><span style=\"color: #ff0000;\"><strong>**FFL Required</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448952a.jpg', 'https://palmettostatearmory.com/psa-10-5-carbine-length-5-56-nato-1-7-phosphate-12-m-lok-moe-ept-sba3-pistol-5165448952.html', '0', 0, 769.99, 579.99, 190.00, 'https://palmettostatearmory.com/psa-10-5-carbine-length-5-56-nato-1-7-phosphate-12-m-lok-moe-ept-sba3-pistol-5165448952.html', '38d3809509e73dd2a5a0cf4b03ac7267', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:21'),
(250, 1, 'PSA 16\" 9mm Nitride 1/10 15\" Lightweight M-lok Railed Upper With Hybrid BCG & CH - 5165448961', '<p><strong>Palmetto State Armory is proud to announce the 9mm Hybrid Pistol upper. Designed to work with Palmetto State Armory 9mm lowers that use either Colt® or Glock®-style magazines.</strong></p>\r\n<p><strong>Barrel</strong>: 16\" chrome moly steel barrel, chambered in 9mm (9x19) with a 1/10 twist rate. The A2 profile barrel is nitride treated for durability and finished off with a Palmetto State Armory 15\" Lightweight M-Lok free-float rail and an A2 birdcage style flash hider.  The barrel is laser engraved with \"9MM 1:10 PSA PCC CHAMBER\" because it has been optimized for use in Pistol Caliber Carbine competitions.</p>\r\n<p><strong>Upper</strong>: Billet 6061-T6 A3 AR slick side upper is hard coat anodized black for durability.  These slick side upper receivers are made for us right here in the USA.</p>\r\n<p><strong>Bolt Carrier Group</strong>: G-9 Hybrid 9mm BCG. Nitride treated, 8620 steel, G-9 Hybrid Bolt allows use with either Glock®-style, or Colt®-style magazine, Palmetto State Armory lowers. Includes charging handle.<br><br><strong>To be used with Palmetto State Armory 9mm lowers that use either Colt® or Glock®-style magazines.</strong></p>\r\n<p>Each upper is assembled to order, and test fired to check function. </p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448961.jpg', 'https://palmettostatearmory.com/psa-16-9mm-nitride-1-10-15-lightweight-m-lok-railed-upper-with-hybrid-bcg-ch-5165448961.html', '0', 0, 529.99, 299.99, 230.00, 'https://palmettostatearmory.com/psa-16-9mm-nitride-1-10-15-lightweight-m-lok-railed-upper-with-hybrid-bcg-ch-5165448961.html', 'd2c3a0fc00f682f3b6fe6967ff3c663f', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:26'),
(251, 1, 'PSA AR15 Freedom Classic Lower, Flat Dark Earth - 7779346', '<p>This Complete Palmetto State Armory Flat Dark Earth lower is fully assembled and ready for your complete Upper!</p>\r\n<ul>\n<li>Machined from Aluminum Forgings 7075-T6</li>\r\n<li>Hardcoat Anodizing: MIL-A-8625F, Type III, Class 2</li>\r\n<li>Milspec diameter Receiver Extension</li>\r\n<li>M4 Stock, FDE</li>\r\n<li>Staked M4 Lock Nut</li>\r\n<li>Standard Carbine Buffer</li>\r\n<li>Un-notched Hammer compatible with 9mm use</li>\r\n<li>Caliber: Multi</li>\r\n</ul>\n<p><strong> </strong></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Due to state laws, this item cannot ship to California.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/7/7/7779346-fde-lower.jpg', 'https://palmettostatearmory.com/psa-ar15-freedom-classic-lower-flat-dark-earth-7779346.html', '4.8', 25, 239.95, 129.99, 109.96, 'https://palmettostatearmory.com/psa-ar15-freedom-classic-lower-flat-dark-earth-7779346.html', 'a1e37cfa32b9bf8a8e680025ca80b35c', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:33'),
(252, 1, 'PSA 10.5\" 5.56 Lightweight M-lok Slant 12\" Upper With MBUS Sight Set, BCG, CH, & Fluted Flash Can - 516447012', '<p><strong>Barrel</strong>: 10.5\" 4150V Chrome Moly vanadium steel, melonite treated for durability and chambered in 5.56 NATO with a 1 in 7\" twist. Carbine length gas barrel is finished off with a PSA 12\" Slant End M-lok Rail, a low profile gas block and a Palmetto State State Armory Fluted Flash Can.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring a mil-spec finish, these uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Flash Can</strong>: Palmetto State Armory\'s new Fluted Flash Can! This is a solid 6061 aluminum device that is designed to direct muzzle gases and the muzzle flash forward. Threaded 1/2-28 for 5.56 NATO. Black mil-spec hard anodizing. THIS DEVICE IS NOT DESIGNED TO REDUCE RECOIL, MUZZLE RISE, OR FLASH SIGNATURE. This device is designed to direct gasses and noise forward away from the shooter and enhance the weapon\'s appearance.</p>\r\n<p><strong>Bolt</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is parkerized outside, and chrome lined inside.</p>\r\n<p><strong>Includes: </strong>Magpul MBUS Sight Set, Black</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516447012_1.jpg', 'https://palmettostatearmory.com/psa-10-5-5-56-lightweight-m-lok-slant-12-upper-with-mbus-sight-set-bcg-ch-fluted-flash-can-516447012.html', '4.8', 27, 539.99, 369.99, 170.00, 'https://palmettostatearmory.com/psa-10-5-5-56-lightweight-m-lok-slant-12-upper-with-mbus-sight-set-bcg-ch-fluted-flash-can-516447012.html', '3ebd6fdc90919fab09469d5beaee0ba9', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:38'),
(253, 1, 'FN 509 Tactical 4.5\" 9mm 17/24 Round Pistol, Flat Dark Earth - 100373', '<p><strong>Get the all-new FN 509 Tactical Flat Dark Earth Optics and Suppressor ready 9mm Pistol with 17 round and 24 round magazines here at Palmetto State Armory!</strong></p>\r\n<p>The FN 509 Tactical is an extension of the FN 509 family. The pistol features the FN patent-pending Low-Profile Optics Mounting System that enables the platform to accept more than ten commercially-available miniature red dot (MRD) optics from Trijicon RMR, Vortex Razor, Vortex Viper, Vortex Venom, Burris FastFire, CMore STS II, and more that co-witness with the suppressor-height night sights and remain adaptable to future optics releases with no requirement of direct milling of the slide. The slide cap, for use when not shooting with an optic, has raised sight wings that protect iron sight alignment if the pistol is dropped or jostled, and provides a textured ramp for racking the slide against a belt loop, pant pocket or boot. An FN-signature 4.5-inch, cold hammer-forged, stainless-steel barrel with target crown, 1/2” x 28 threads that accept the bulk of 9mm suppressors available and thread cap with integrated O-ring to prevent loosening during use complete the top end. Lastly, this pistol comes with (1) 17 round magazine, (2) 24 round magazines (2) interchangeable backstraps, locking device, and an FN Logo soft pistol case.</p>\r\n<p><strong>Features:</strong></p>\r\n<ul>\n<li><span><b>• </b>FN Low Profile Optics Mounting System</span></li>\r\n<li><span><b>• </b>Sight Protecting Slide Cap</span></li>\r\n<li><span><b>• </b>External Extractor; Loaded Chamber Indicator</span></li>\r\n<li><span><b>• </b>Cold Hammer-Forged Stainless Steel Barrel</span></li>\r\n<li><span><b>• </b>Polished Chamber and Feed Ramp</span></li>\r\n<li><span><b>• </b>1/2\"x28 Threaded Barrel</span></li>\r\n<li><span><b>• </b>O-Ring Retention Thread Cap</span></li>\r\n<li><span><b>• </b>Enhanced Grip Texture</span></li>\r\n<li>\n<b>• I</b>nterchangeable Backstraps</li>\r\n<li>\n<b>• </b>MIL-STD-1913 Mounting Rail</li>\r\n<li>\n<b>• </b>Ambidextrous Slide Stop Lever and Magazine Release</li>\r\n</ul>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/f/n/fn_509_tactical_rotators_3-24_round.jpg', 'https://palmettostatearmory.com/fn-509-tactical-4-5-9mm-24-round-pistol-flat-dark-earth-100373.html', '0', 0, 1049.00, 899.00, 150.00, 'https://palmettostatearmory.com/fn-509-tactical-4-5-9mm-24-round-pistol-flat-dark-earth-100373.html', '144fa5dc4e527706d3a5ff009463538e', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:43'),
(254, 1, 'Federal 22 Long Rifle 40gr Solid Champion AutoMatch Ammunition 325rds - AM22', '<p>Federal Auto Match .22LR 40gr Lead Round Nose 325rd AM22 </p>\r\n<p>Find a nice range of capable target shooting options for your rimfire guns. If you\'re looking for the most performance for your dollar, look to the 40-grain solid AutoMatch 22LR—its sweet-spot velocity make it perfect for 10/22 actions and other autoloading firearms.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/a/m/am22.png', 'https://palmettostatearmory.com/federal-auto-match-22lr-40gr-lead-round-nose-325rd-am22.html', '4.7', 91, 29.99, 14.99, 15.00, 'https://palmettostatearmory.com/federal-auto-match-22lr-40gr-lead-round-nose-325rd-am22.html', 'baa6198c16b6fe5c8311769139ebffad', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:49'),
(255, 1, 'PSA AR-15/5.56 Nickel Boron Bolt Carrier Group - 7791928', '<p><span>This 5.56mm Bolt Carrier Group is Nickel Boron coated and features a 9310 shot peened bolt.  The bolt is magnetic partical inspected but is not marked.  The gas key is hardened and secured with Grade 8 fasteners, and is staked per Mil-Spec.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/7/7/7791928_2.jpg', 'https://palmettostatearmory.com/psa-ar15-bcg-5-56-nickel-boron.html', '4.9', 156, 199.99, 89.99, 110.00, 'https://palmettostatearmory.com/psa-ar15-bcg-5-56-nickel-boron.html', 'ed0081a0b9d60f46b88b2752eb1d61ec', 0, NULL, '2018-08-06 06:02:11', '2018-08-06 06:50:55'),
(256, 1, 'PSA AR15 Freedom Classic Lower, Olive Drab Green - 7779347', '<p><span style=\"font-size: medium;\">This Complete Palmetto State Armory lower in Olive Drab Green is fully assembled and ready for your complete Upper!</span></p>\r\n<ul>\n<li><span style=\"font-size: medium;\">Machined from Aluminum Forgings 7075-T6</span></li>\r\n<li><span style=\"font-size: medium;\">Hardcoat Anodizing: MIL-A-8625F, Type III, Class 2</span></li>\r\n<li><span style=\"font-size: medium;\">Milspec diameter Receiver Extension</span></li>\r\n<li><span style=\"font-size: medium;\">M4 Stock in Olive Drab</span></li>\r\n<li><span style=\"font-size: medium;\">Classic A2 Style Grip in Olive Drab</span></li>\r\n<li><span style=\"font-size: medium;\">Staked M4 Lock Nut</span></li>\r\n<li><span style=\"font-size: medium;\">Standard Carbine Buffer</span></li>\r\n<li><span style=\"font-size: medium;\">Un-notched Hammer compatible with 9mm use</span></li>\r\n<li><span style=\"font-size: medium;\">Caliber: Multi</span></li>\r\n</ul>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/7/7/7779347.jpg', 'https://palmettostatearmory.com/psa-ar15-freedom-classic-lower-odg-7779347.html', '4.6', 11, 239.95, 129.99, 109.96, 'https://palmettostatearmory.com/psa-ar15-freedom-classic-lower-odg-7779347.html', '7b4e63cdaf50e7ae9ff09b0135ae6810', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:51:01'),
(257, 1, 'PSA 16\" Classic M4 Freedom Upper with BCG & Charging Handle, OD Green - 7780181', '<p><strong>Barrel</strong>: 4150V Chrome Moly Vanadium steel. Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a carbine length gas system. This M4 profile barrel is finished off with a standard handguard in Olive Drab Green, F-Marked gas sight base, and an A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized. These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt</strong>: Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt, shot peened, high pressure tested, mag particle inspected, gas key hardened to USGI specifications, fastened with grade 8 screws, and staked per Mil-Spec. 8620 steel M-16 profile carrier is chrome lined and phosphate coated.  </p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/7/7/7780181.jpg', 'https://palmettostatearmory.com/psa-classic-freedom-m4-odg-upper-with-bcg-and-charing-handle-7780181.html', '4.6', 11, 399.99, 219.99, 180.00, 'https://palmettostatearmory.com/psa-classic-freedom-m4-odg-upper-with-bcg-and-charing-handle-7780181.html', 'e7734a3826ac1d34f5546010b913a0a3', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:51:06'),
(258, 1, 'PSA Gen2 PA65 20\" 6.5 Creedmoor 1:8 SS 15\" M-Lok Upper with Adjustable Gas Block, Gen2 BCG, and CH', '<p><span><strong>Barrel:</strong> 20\" Heavy 416R Stainless Steel barrel chambered in 6.5 Creedmoor with a 1:8 twist rate and rifle-length gas system.  Upper is paired with a Palmetto State Armory 15\" Lightweight M-Lok free-float rail for enhanced accuracy, low profile adjustable gas block, and an A2-style muzzle device. </span></p>\r\n<p><span><strong>Upper:</strong>  Precision machined from forged 7075-T6 aluminum, then Black anodize hardcoated to MIL-8625 Type 3 class 2.   </span></p>\r\n<p><span><strong>Bolt Carrier Group:</strong> Gen2 6.5 Creedmoor BCG is designed with double ejectors in order to ensure flawless cycling.  <span>9310 steel bolt assembly, nitride treated for durability.  8620 carrier, with a nitride treated gas key properly staked with grade 8 fasteners.  Charging handle is also included.</span></span></p>\r\n<ul>\n<li><span>7075-T6 Forged Aluminum Receiver</span></li>\r\n<li><span>20\" 416R Stainless Steel Barrel</span></li>\r\n<li><span>6.5 Creedmoor Chamber</span></li>\r\n<li><span>1 in 8\" Twist Rate Rifling</span></li>\r\n<li><span>Rifle-length Gas System</span></li>\r\n<li><span>15\" Free Float Lightweight M-Lok Rail</span></li>\r\n<li><span>Low Profile Adjustable Gas Block</span></li>\r\n<li><span>A2-Style Muzzle Device</span></li>\r\n<li><span>5/8-24 Muzzle Thread</span></li>\r\n<li><span>Nitride Gen2 BCG &amp; Charging handle</span></li>\r\n<li>Includes: High pressure/ small diameter firing pin bolt</li>\r\n</ul>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165447615.jpg', 'https://palmettostatearmory.com/psa-gen2-pa65-20-6-5-creedmoor-1-8-stainless-steel-15-m-lok-upper-with-adjustable-gas-block-bcg-and-ch-5165447615.html', '4.8', 18, 789.99, 549.99, 240.00, 'https://palmettostatearmory.com/psa-gen2-pa65-20-6-5-creedmoor-1-8-stainless-steel-15-m-lok-upper-with-adjustable-gas-block-bcg-and-ch-5165447615.html', '375c0a4351a58740a681509669bf01c6', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:51:12'),
(259, 1, 'PSA 18\" Rifle-Length .223 Wylde 1/7 Stainless Steel 15\" Lightweight M-lok Upper - With Nickel Boron BCG & CH - 5165448356', '<p><strong>Barrel</strong>: 416R Stainless steel.  Chambered in 223 Wylde, with a 1:7 twist rate, M4 barrel extension, and a rifle-length gas system.  Barrel is is finished off with a PSA 15\" Lightweight M-Lok free float rail, .750 gas block, and A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized.  These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt Carrier Group: </strong><span>5.56mm Bolt Carrier Group is Nickel Boron coated and features a 9310 bolt.  The gas key is hardened and secured with Grade 8 fasteners, and is staked per Mil-Spec.  </span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448356.jpg', 'https://palmettostatearmory.com/psa-18-rifle-length-223-wylde-1-7-stainless-steel-15-lightweight-m-lok-upper-with-nickel-boron-bcg-ch-5165448356.html', '0', 0, 559.99, 359.99, 200.00, 'https://palmettostatearmory.com/psa-18-rifle-length-223-wylde-1-7-stainless-steel-15-lightweight-m-lok-upper-with-nickel-boron-bcg-ch-5165448356.html', 'f091824ca965dbfa5c27768763a5ef93', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:51:18'),
(260, 1, 'PSA Gen2 PA10 18\" Mid-Length 7.62 NATO 1:12 CHF 15\" Lightweight M-lok Upper - with BCG and CH - 5165448933', '<p><span><strong>Barrel</strong>: A proprietary blend of Hammer forged chrome molly vanadium made by FN that is referred to as \"Machine Gun Steel\" by virtue of its required use in FN\'s M249 and M240 weapons. The hammer forging process work hardens the steel, making it more durable. In addition, the chrome process for the bore allows for a lining almost twice as thick as a standard M16 for enhanced durability. Chambered in 7.62 NATO, with a 1/12 twist, M4 barrel extension, and a Rifle-length gas system. This 18\" heavy profile barrel is Mil-spec phosphate coated, High Pressure tested and Magnetic Particle inspected. The barrel is finished off with a 15\" PSA Lightweight M-Lok free float rail and an A2 flash hider.</span></p>\r\n<p><span><strong>Upper:</strong> Precision machined from forged 7075-T6 aluminum, then Black anodize hardcoated to MIL-8625 Type 3 class 2.   </span></p>\r\n<p><span><strong>Bolt Carrier Group:</strong> <span>9310 steel bolt assembly, nitride treated for durability.  8620 carrier, nitride treated, with a nitride treated gas key properly staked with grade 8 fasteners.  Charging handle is also included.</span></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448933.jpg', 'https://palmettostatearmory.com/psa-gen2-pa10-18-mid-length-7-62-nato-1-12-chf-15-lightweight-m-lok-upper-with-bcg-and-ch-5165448933.html', '0', 0, 929.99, 599.99, 330.00, 'https://palmettostatearmory.com/psa-gen2-pa10-18-mid-length-7-62-nato-1-12-chf-15-lightweight-m-lok-upper-with-bcg-and-ch-5165448933.html', 'e0c101dfa37b46017f01c89710963264', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:51:22'),
(261, 1, 'PSA AR-15 Complete Lower Magpul MOE Edition - Black, No Magazine - 7065', 'PSA AR-15 Complete Lower Magpul MOE Edition - Black, No Magazine. Lowers may be Safe/Fire or Pictogram.', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/7/0/7065_1.jpg', 'https://palmettostatearmory.com/psa-ar-15-complete-lower-magpul-moe-edition-black-no-magazine-7065.html', '4.8', 103, 299.99, 159.99, 140.00, 'https://palmettostatearmory.com/psa-ar-15-complete-lower-magpul-moe-edition-black-no-magazine-7065.html', '1d7d9d5d2fd2f8696cb88c0bfed496d6', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:51:30');
INSERT INTO `deals` (`id`, `source_id`, `title`, `description`, `image`, `link`, `ratings`, `reviews_count`, `base_price`, `sale_price`, `save_price`, `from_url`, `unique_md5`, `out_of_stock`, `ext_date`, `created_at`, `updated_at`) VALUES
(262, 1, 'PSA 20\" Rifle Length 5.56 NATO 1/7 Nitride A2 Freedom Rifle Kit - 7788893', '<p><strong>Barrel</strong>: 20\" Chrome-moly vanadium steel, chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a rifle-length gas system. The A2-style profile barrel is nitride finished for accuracy and durability. Barrel is finished off with an .750\" diameter F-marked Front Sight Base, PSA Classic Handguards, and an A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability.  These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is parkerized outside, and chrome lined inside.</p>\r\n<p><strong>PSA A2 Freedom A2 Rifle Lower Build Kit</strong>: Everything you need to turn your stripped lower into an A2 fixed stock lower. Kit includes A2 stock, rifle length buffer tube, buffer and spring, and PSA Freedom Lower parts kit.</p>\r\n<p> </p>\r\n<p><span style=\"color: #ff0000;\"><strong> </strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/7/7/7788893.jpg', 'https://palmettostatearmory.com/psa-20-rifle-length-5-56-nato-1-7-melonite-a2-freedom-rifle-kit.html', '4.6', 80, 589.99, 379.99, 210.00, 'https://palmettostatearmory.com/psa-20-rifle-length-5-56-nato-1-7-melonite-a2-freedom-rifle-kit.html', '741c4c33f2397ba72cfe8ba1292690a0', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:51:37'),
(263, 1, 'PSA 20\" CHF SS Heavy Rifle-Length 15\" Lightweight M-Lok Upper - NO BCG or Charging Handle - 77932963', '<p><span style=\"font-size: medium;\"><strong>Barrel</strong>:  20\" cold hammer forged, matte finish, 410 stainless steel, 5.56 NATO chamber with a 1:7 twist, tapered bore, and a passivated exterior finish to reduce glare and increase corrosion resistance.  Features a Rifle-length gas system, standard  M4 feedramps, and is high pressure tested and mag particle inspected. The upper is finished off with a PSA 15\" lightweight M-Lok  free-float hand guard, .750\" diameter low profile gas block, and A2 flash hider. Barrel is made for us by FN Manufacturing here in Columbia SC.</span></p>\r\n<p><span style=\"font-size: medium;\"><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized. These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span style=\"color: #ff0000; font-size: medium;\"><strong>BCG and Charging Handle are NOT Included.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/7/7/77932963_1.jpg', 'https://palmettostatearmory.com/psa-20-chf-ss-a2-rifle-15-lightweight-mlok-freedom-upper-no-bcg-or-charging-handle-77932963.html', '4.7', 13, 629.99, 399.99, 230.00, 'https://palmettostatearmory.com/psa-20-chf-ss-a2-rifle-15-lightweight-mlok-freedom-upper-no-bcg-or-charging-handle-77932963.html', '401f09ae63bad438f19f98c42d668f08', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:51:43'),
(264, 1, 'PSA AR-15 Complete MOE+ EPT Pistol Lower With CQB PDW Brace - No Magazine, Flat Dark Earth - 516446769', '<ul>\n<li>\r\n<p><span style=\"font-size: medium;\">Machined from Aluminum Forgings 7075-T6</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Hardcoat Anodizing: MIL-A-8625F, Type III, Class 2</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">7075 Receiver Extension</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Magpul MOE+ Overmolded Grip in Flat Dark Earth</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Enhanced Polished Trigger &amp; Hammer</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Caliber: Multi</span></p>\r\n</li>\r\n</ul>\n<p><span style=\"font-size: medium;\"> </span></p>\r\n<p><strong style=\"font-size: medium;\">Maxim Defense CQB Pistol PDW Brace, Flat Dark Earth:</strong></p>\r\n<p><span style=\"font-size: medium;\">Perfect for PDW pistols the Maxim Defense Arm Brace gives you the adjustments needed to more comfortably shoot your AR pistol, and makes your pistol more compact for easier transport. Built on the same housing as Maxim Defense\'s PDW stocks, you get the same durability and features. </span></p>\r\n<p><span style=\"font-size: medium;\">Specs:</span></p>\r\n<p><span style=\"font-size: medium;\">Material-7075 Aluminum Alloy housing for optimal performance with QD mounts</span></p>\r\n<p><span style=\"font-size: medium;\">Length:</span></p>\r\n<ul>\n<li>\r\n<p><span style=\"font-size: medium;\">5.375” closed</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">6.875” 1st position</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">8.375” 2nd position</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">10” fully extended</span></p>\r\n</li>\r\n</ul>\n<p><span style=\"font-size: medium;\">Standard weight Buffer &amp; Spring.</span></p>\r\n<div class=\"std\">\r\n<p><span style=\"font-size: medium;\"><strong>This item contains parts that are not California compliant and as such may be illegal to import into the state of California.  We comply with all local, state, and federal laws.  Please be aware of your state and local laws before ordering. </strong></span></p>\r\n</div>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/f/d/fdepdw.jpg', 'https://palmettostatearmory.com/psa-ar-15-complete-moe-ept-pistol-lower-with-cqb-pdw-brace-flat-dark-earth-516446769.html', '0', 0, 679.99, 399.99, 280.00, 'https://palmettostatearmory.com/psa-ar-15-complete-moe-ept-pistol-lower-with-cqb-pdw-brace-flat-dark-earth-516446769.html', 'de93abdc48bf5e33271915b84356aab4', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:51:48'),
(265, 1, 'PSA Gen2 PA-65 20\" 6.5 Creedmoor 1:8 SS 15\" M-lok Upper with Adjustable Gas Block, Gen2 BCG, and CH', '<p><span><strong>Barrel:</strong> 20\" Heavy 416R Stainless Steel barrel chambered in 6.5 Creedmoor with a 1:8 twist rate and rifle-length gas system.  Upper is paired with a Palmetto State Armory 15\" Lightweight M-Lok free-float rail for enhanced accuracy, low profile adjustable gas block, and an A2-style muzzle device. </span></p>\r\n<p><span><strong>Upper:</strong>  Precision machined from forged 7075-T6 aluminum, then Black anodize hardcoated to MIL-8625 Type 3 class 2.   </span></p>\r\n<p><span><strong>Bolt Carrier Group:</strong> Gen2 6.5 Creedmoor BCG is designed with double ejectors in order to ensure flawless cycling.  <span>9310 steel bolt assembly, nitride treated for durability.  8620 carrier, with a nitride treated gas key properly staked with grade 8 fasteners.  Charging handle is also included.</span></span></p>\r\n<ul>\n<li><span>7075-T6 Forged Aluminum Receiver</span></li>\r\n<li><span>20\" 416R Stainless Steel Barrel</span></li>\r\n<li><span>6.5 Creedmoor Chamber</span></li>\r\n<li><span>1 in 8\" Twist Rate Rifling</span></li>\r\n<li><span>Rifle-length Gas System</span></li>\r\n<li><span>15\" Free Float Lightweight M-Lok Rail</span></li>\r\n<li><span>Low Profile Adjustable Gas Block</span></li>\r\n<li><span>A2-Style Muzzle Device</span></li>\r\n<li><span>5/8-24 Muzzle Thread</span></li>\r\n<li><span>Nitride Gen2 BCG &amp; Charging handle</span></li>\r\n<li>Includes: High pressure/ small diameter firing pin bolt</li>\r\n</ul>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516447017_4.jpg', 'https://palmettostatearmory.com/psa-gen2-pa65-20-6-5-creedmoor-1-8-stainless-steel-15-m-lok-upper-with-adjustable-gas-block-bcg-and-ch-516447593.html', '4.1', 15, 789.99, 549.99, 240.00, 'https://palmettostatearmory.com/psa-gen2-pa65-20-6-5-creedmoor-1-8-stainless-steel-15-m-lok-upper-with-adjustable-gas-block-bcg-and-ch-516447593.html', 'eafe6a0c09e3bee3ef28cf13b80d62ab', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:51:55'),
(266, 1, 'PSA Gen2 PA-10 20\" Rifle-Length .308 WIN 1:10 Stainless Steel 15\" M-lok Upper with BCG and CH - 5165447551', '<p><span>New and improved Palmetto State Armory PA10 Gen2 308 Upper is fully assembled and ready for your complete PA10 Gen2 Lower!</span></p>\r\n<p><span>With streamlined styling and improved function, the new and improved PSA PA10 is here.  The Gen2 model offers an enhanced chamber and extraction, with a more modern appearance.  </span></p>\r\n<p><span><strong>Barrel:</strong> 416R Stainless Steel, chambered in 308 WIN with a 1/10 twist, rifle-length gas. Upper is paired with a Palmetto State Armory 15\" Lightweight M-Lok free-float rail, low profile gas block, and an A2-style muzzle device. </span></p>\r\n<p><span><strong>Upper:</strong>  Precision machined from forged 7075-T6 aluminum, then Black anodize hardcoated to MIL-8625 Type 3 class 2.   </span></p>\r\n<p><span><strong>Bolt Carrier Group:</strong> <span>9310 steel bolt assembly, nitride treated for durability.  8620 carrier, nitride treated, with a nitride treated gas key properly staked with grade 8 fasteners.  Charging handle is also included.</span></span></p>\r\n<p><span><strong>The Gen2 PA10 receivers are functionally compatible with the Gen1 upper receivers, however we recommend matching Gen2 lowers to Gen2 uppers for best appearance.  There are external cosmetic differences when mixing Gen1 and Gen2 upper and lower receivers that some may not find appealing.  Gen1 lowers will be available in the future for those who want a cosmetic match.</strong> </span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>The AR10 platform does not enjoy a common design between manufacturers, like the AR15. As a result, there can and will be subtle differences in the parts kits of various manufacturers. Some parts, like the fire control group, are shared with the AR15 platform to preserve the options for upgrading. For best results, we recommend only using PSA PA10 parts with our uppers and lower receivers. We do not recommend using other manufacturers parts in our products.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165447551.jpg', 'https://palmettostatearmory.com/psa-gen2-pa10-20-rifle-length-308-win-1-10-stainless-steel-15-m-lok-upper-with-bcg-and-ch-5165447551.html', '4.5', 31, 719.99, 499.99, 220.00, 'https://palmettostatearmory.com/psa-gen2-pa10-20-rifle-length-308-win-1-10-stainless-steel-15-m-lok-upper-with-bcg-and-ch-5165447551.html', '0236301b2d23ee8ac3d5183a7eceeaeb', 0, NULL, '2018-08-06 06:02:12', '2018-08-06 06:52:02'),
(267, 1, 'BLEM PSA 16\" Mid-Length 5.56 NATO 1/7 Phosphate Classic Rifle Kit - 5165448139', '<p><strong>Barrel</strong>: Chrome Moly steel barrel chambered in 5.56 NATO with a 1:7 twist rate, M4 barrel extension, and a MId-Length gas system. The barrel is finished off with a standard handguard, F-Marked gas sight base, and A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized, features a forged upper receiver. These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt</strong>: Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt. Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec. 8620 steel M-16 profile carrier is chrome lined and phosphate coated.</p>\r\n<p><strong>Lower Build Kit</strong>: Includes Classic M4-Style Stock, A2 Pistol grip, Classic Lower Parts Kit and Mil-Spec diameter 6-position buffer tube assembly. Everything you need to finish your stripped lower.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448139.jpg', 'https://palmettostatearmory.com/blem-psa-16-mid-length-5-56-nato-1-7-phosphate-classic-rifle-kit-5165448139.html', '4.9', 11, 509.99, 299.99, 210.00, 'https://palmettostatearmory.com/blem-psa-16-mid-length-5-56-nato-1-7-phosphate-classic-rifle-kit-5165448139.html', 'a7e232a1580922799370ae1124210224', 0, NULL, '2018-08-06 06:02:18', '2018-08-06 06:52:07'),
(268, 1, 'PSA AR15 Complete MOE EPT SBA3 Lower - 5165448150', '<p><span>This complete Palmetto State Armory Pistol Lower with SB Tactical SBA3 Adjustable Brace is fully assembled and ready for your Pistol Upper!</span></p>\r\n<ul>\n<li>Receiver is Machined from 7075-T6 Aluminum Forgings</li>\r\n<li>Hardcoat Anodizing: MIL-A-8625F, Type III, Class 2</li>\r\n<li>7075 Receiver Extension</li>\r\n<li>Magpul Grip, Black</li>\r\n<li>SB Tactical SBA3 Adjustable Brace, Black</li>\r\n<li>Magpul Trigger Guard, Black</li>\r\n<li>Standard Carbine Buffer</li>\r\n<li>Enhanced Polished Trigger Group (EPT)</li>\r\n<li>Caliber: Multi</li>\r\n</ul>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448150.jpg', 'https://palmettostatearmory.com/psa-ar15-complete-moe-ept-sba3-lower-5165448150.html', '4.8', 51, 319.99, 219.99, 100.00, 'https://palmettostatearmory.com/psa-ar15-complete-moe-ept-sba3-lower-5165448150.html', '71ca227430670cb58d5f7d7d9b362895', 0, NULL, '2018-08-06 06:02:18', '2018-08-06 06:52:14'),
(269, 1, 'PSA Gen 1 PA10 Stripped Upper Receiver - 516444909', '<p>Made using the most advanced aerospace manufacturing technology to produce the industry\'s finest forged .308 uppers, our receivers are machined on an automated multi-million dollar manufacturing system which enables us to produce a product of unequaled quality and value.</p>\r\n<p>These forged uppers are quality made using 7075-T6 aluminum. The finish is black hardcoat anodize per MIL-8625 Type 3 Class 2.  These uppers take PA10 ejection port cover assemblies as well as PA10 forward assist assemblies.</p>\r\n<p> </p>\r\n<p><strong>**This is a Gen1 upper receiver.  It is functionally compatible with Gen2 lowers, but it has cosmetic style differences when mated to a Gen2 lower.</strong></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516444909.jpg', 'https://palmettostatearmory.com/psa-gen-1-pa10-stripped-upper-receiver-516444909.html', '3.5', 2, 109.99, 59.99, 50.00, 'https://palmettostatearmory.com/psa-gen-1-pa10-stripped-upper-receiver-516444909.html', 'a0ffe544a400b17fe4913cd560473c0c', 0, NULL, '2018-08-06 06:02:18', '2018-08-06 06:52:19'),
(270, 1, 'PSA 10.5\" CHF 5.56 NATO 1:7 A2 Profile - Without BCG or Charging Handle - 2012', '<p><strong>Barrel: </strong>Barrel is made for Palmetto State Armory by FN Manufacturing using their proprietary blend of hammer forged chrome molly vanadium that is referred to as \"Machine Gun Steel\" by virtue of its use in FN\'s M249 and M240 weapons.   The hammer forging process work hardens the steel, making it more durable.  In addition, the chrome process for the bore allows for a lining almost twice as thick as a standard M16 for enhanced durability.  Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension with extended feedramps, and a carbine gas system.   The barrel has an A2 style profile, is mil-spec phosphate coated, and MP/HP tested.  The upper is finished off with an F-marked front sight post with sling swivel, and an A2 flash hider.</p>\r\n<p><strong>Upper:</strong> Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring machined T marks, and a mil-spec finish. These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p>Each upper is assembled to order with care, and test fired.  <span style=\"color: #ff0000;\"><strong>Does not come with bolt carrier group or charging handle.</strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong> </strong></span></p>\r\n<p><span style=\"font-size: large;\"><strong><span style=\"color: #ff0000;\"> </span></strong></span></p>\r\n<p> </p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/1/0/10.5classic3_3.jpg', 'https://palmettostatearmory.com/psa-10-5-hammer-forged-ar15-upper.html', '4.9', 33, 399.99, 369.99, 30.00, 'https://palmettostatearmory.com/psa-10-5-hammer-forged-ar15-upper.html', '36a56ee1506aec7552d476659534c937', 0, NULL, '2018-08-06 06:02:18', '2018-08-06 06:52:26'),
(271, 1, 'Federal 5.56mm NATO 55gr FMJ-BT Ammunition, 20 Round Box - XM193', '<p>Federal 5.56x45mm NATO 55gr Full Metal Jacket Boat Tail 20rds XM193</p>\r\n<p>This round is made to military specifications. It is great for target practice and varmit hunting. Please note that this is a military round that runs at higher pressures than its .223 counter part and is not recommended to be fired in a .223 Remington chamber.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/9/0/9038_new_1.jpg', 'https://palmettostatearmory.com/federal-5-56x45mm-nato-55gr-full-metal-jacket-boat-tail-20rds-xm193.html', '4.8', 179, 8.99, 5.99, 3.00, 'https://palmettostatearmory.com/federal-5-56x45mm-nato-55gr-full-metal-jacket-boat-tail-20rds-xm193.html', '9a9c82c84f4e906a36b179314efd9de6', 0, NULL, '2018-08-06 06:02:18', '2018-08-06 06:52:32'),
(272, 1, 'Five Boxes Federal .308 175gr Sierra Gold Medal Ammo & Five Magpul PMAG 20 LR/SR Gen M3 7.62x51 Magazines', '<p><strong style=\"font-size: medium;\">Federal 308 175gr Sierra BTHP Gold Medal Ammunition 20rds - GM308M2</strong></p>\r\n<ul>\n<li>\n<strong style=\"font-size: small;\">Rounds Per Box: </strong>20</li>\r\n<li>\n<strong style=\"font-size: small;\">Muzzle Energy: </strong>2627 ft-lbs</li>\r\n<li>\n<strong style=\"font-size: small;\">Muzzle Velocity: </strong>2600 fps</li>\r\n</ul>\n<p><span style=\"font-size: small;\">These extraordinary loads combine the legendary Sierra MatchKing bullet with Federal\'s proven quality standards and stringent manufacturing controls to create a round that is as accurate as a match load, but available from the factory. </span></p>\r\n<p> </p>\r\n<p><strong style=\"font-size: medium;\">Magpul PMAG 20 LR/SR Gen M3, 7.62x51 Magazine Mag291-BLK</strong></p>\r\n<p><span>The PMAG 20 LR/SR GEN M3 brings the M3 improvements to the 20 round 7.62 NATO/.308 Winchester SR-25 magazine form factor. All of the GEN M3 improvements are here in the 20 round capacity form factor of our previous design. The PMAG 20 LR/SR GEN M3 will replace the MAG243 in our line.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/k/i/kit-0013_1.jpg', 'https://palmettostatearmory.com/federal-308-175gr-sierra-gold-medal-20rds-3-boxes-magpul-pmag-gen-m3-7-62x51-magazine-3-mags.html', '4.8', 30, 0.00, 159.99, 0.00, 'https://palmettostatearmory.com/federal-308-175gr-sierra-gold-medal-20rds-3-boxes-magpul-pmag-gen-m3-7-62x51-magazine-3-mags.html', '5ab017166775301c1ee628d828e2c688', 0, NULL, '2018-08-06 06:02:18', '2018-08-06 06:52:38'),
(273, 1, 'PSA AR-15 Complete MOE EPT Pistol Lower with SB Tactical PDW Pistol Brace, Black - 516446451', '<h3 class=\"icon-head head-products\" style=\"display: inline !important;\">PSA AR-15 Complete MOE EPT Pistol Lower with SBPDW Brace - No Magazine - Black - 516446451 </h3>\r\n<ul>\n<li>Machined from Aluminum Forgings 7075-T6</li>\r\n<li>Hardcoat Anodizing: MIL-A-8625F, Type III, Class 2</li>\r\n<li>7075 Receiver Extension</li>\r\n<li>Magpul Grip in Black</li>\r\n<li>Standard Carbine Buffer</li>\r\n<li>Enhanced Polished Trigger &amp; Hammer</li>\r\n<li>Caliber: Multi</li>\r\n<li>\r\n<div class=\"super-ratings\">SB Tactical SBPDW Adjustable AR Pistol Stabilizing Brace</div>\r\n</li>\r\n</ul>\n<p><strong>SB Tactical Personal Defense Weapon Pistol Brace: </strong></p>\r\n<p>Designed in conjunction with Maxim Defense, the SBPDW Pistol Stabilizing Brace® is 3-position adjustable and compatible with mil-spec bolt carrier groups and carbine buffers.</p>\r\n<p><b>Features:</b></p>\r\n<p>• 3-postion adjustable</p>\r\n<p>• Leverless extension, simply pull to release</p>\r\n<p>• Complete assembly ready to install including a proprietary buffer tube</p>\r\n<p>• Compatible with mil-spec bolt carrier groups and carbine buffers</p>\r\n<p>• QD attachment point at 6 o’clock position on housing</p>\r\n<p>• US veteran designed and proudly made in the USA</p>\r\n<p>• Fits Mil-spec AR-15 receivers</p>\r\n<p>• Includes adjustable nylon strap</p>\r\n<p><strong><span style=\"color: #ff0000;\">This item contains parts that are not California compliant and as such may be illegal to import into the state of California.     We comply with all local, state, and federal laws.  Please  be aware of your state and  local laws before ordering. </span></strong></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/p/d/pdwbrace1.jpg', 'https://palmettostatearmory.com/psa-ar-15-complete-moe-ept-pistol-lower-with-sbpdw-brace-no-magazine-black-516446451.html', '4.8', 14, 549.99, 349.99, 200.00, 'https://palmettostatearmory.com/psa-ar-15-complete-moe-ept-pistol-lower-with-sbpdw-brace-no-magazine-black-516446451.html', 'a89fc1ee42a7e1aed8d3797042f4ec09', 0, NULL, '2018-08-06 06:02:18', '2018-08-06 06:52:44'),
(274, 1, 'PSA 16\" .22 LR 1:16 Nitride 13.5\" Lightweight M-Lok Upper with BCG & CH - 516446934', '<p><strong>Palmetto State Armory is proud to announce the Dedicated .22 LR Upper! </strong></p>\r\n<p><span><strong>Barrel</strong>:  4150V Chrome moly vanadium steel 16\" barrel length chambered in .22 LR, with a 1:16 twist. The M4 profile barrel has a gas nitride finish for accuracy and durabiltly, and is finished off with a PSA 13.5\" M-Lok Lightweight Free Float Rail, and an A2 flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized black for durability. Featuring M4 feedramp cuts, these upper upper receivers are made for us right here in the USA</span></p>\r\n<p><strong>BCG:</strong> Dedicated Stainless Steel .22 LR Bolt Group</p>\r\n<p><strong>Magazine: </strong>Uses standard Black Dog Machine AR15 - .22LR Magazines.  Magazine NOT Included</p>\r\n<p><strong> </strong></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516446934_1.jpg', 'https://palmettostatearmory.com/psa-16-22-lr-1-16-nitride-13-5-lightweight-m-lok-upper-with-bcg-ch-516446934.html', '4.8', 20, 539.99, 349.99, 190.00, 'https://palmettostatearmory.com/psa-16-22-lr-1-16-nitride-13-5-lightweight-m-lok-upper-with-bcg-ch-516446934.html', '207715538069b1adb852f2b748d982b8', 0, NULL, '2018-08-06 06:02:18', '2018-08-06 06:52:50'),
(275, 1, 'PSA Complete MOE EPT SOB pistol lower receiver, Black - 516447200', '<p><span>This complete Palmetto State Armory MOE EPT Pistol Lower with SB Tactical SOB Brace is fully assembled and ready for your Pistol Upper!</span><br><span>Receiver is Machined from 7075-T6 Aluminum Forgings</span><br><span>Hardcoat Anodizing: MIL-A-8625F, Type III, Class 2</span><br><span>7075 Receiver Extension</span><br><span>Magpul grip, Black</span><br><span>Magpul polymer trigger guard, Black</span><br><span>Standard Carbine Buffer</span><br>Enhanced Polished Trigger (EPT)<br><span>Caliber: Multi</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516447200.jpg', 'https://palmettostatearmory.com/psa-complete-moe-ept-sob-pistol-lower-receiver-black-516447200.html', '4.9', 7, 299.99, 199.99, 100.00, 'https://palmettostatearmory.com/psa-complete-moe-ept-sob-pistol-lower-receiver-black-516447200.html', '7d9677dc71873e2b1ea6effddc075a72', 0, NULL, '2018-08-06 06:02:18', '2018-08-06 06:52:55'),
(276, 1, 'PSA 18\" Rifle Length .223 Wylde 1/7 Stainless Steel 15\" M-lok Upper With BCG, CH, & MBUS Sight Set - 5165448754', '<p><span><strong>Barrel</strong>: 416R stainless steel barrel.  Chambered in 223 Wylde, with a 1:7 twist rate, M4 barrel extension, and a rifle-length gas system. Barrel is finished off with a PSA 15\" Lightweight M-Lok free float rail, .750\" low-profile gas block, and an A2-style flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 aluminum A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span><b>Bolt</b><span>: Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt, Shot Peened, High pressure tested, Mag particle inspected, Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked per Mil-Spec.  8620 steel M-16 profile carrier is chrome lined and phosphate coated.</span></span></p>\r\n<p><strong>Included:  </strong>Magpul MBUS Sight Set, Black</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448754.jpg', 'https://palmettostatearmory.com/psa-18-rifle-length-223-wylde-1-7-stainless-steel-15-m-lok-upper-with-bcg-ch-mbus-sight-set-5165448754.html', '5.0', 1, 599.99, 369.99, 230.00, 'https://palmettostatearmory.com/psa-18-rifle-length-223-wylde-1-7-stainless-steel-15-m-lok-upper-with-bcg-ch-mbus-sight-set-5165448754.html', '912be16e808f45b56d9a949d390c8271', 0, NULL, '2018-08-06 06:02:18', '2018-08-06 06:53:00'),
(277, 1, 'PSA 10.5\" 5.56 NATO 1/7 Nitride 9\" M-Lok MOE EPT SBA3 Pistol Kit', '<p><strong>Barrel</strong>: 10.5\" 4150V Chrome Moly vanadium steel, nitride treated for durability and chambered in 5.56 NATO with a 1 in 7\" twist. Carbine length gas barrel is finished off with a PSA Lightweight 9\" M-lok Rail, a low profile gas block, and a PSA A2 Flash Hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring a mil-spec finish, these uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is parkerized outside, and chrome lined inside.</p>\r\n<p><span><strong>Build Kit: </strong>A high quality lower build kit with everything you need to assemble your AR-15 lower into a pistol. Features Enhanced Polished Trigger (EPT), Magpul Grip, Magpul Trigger Guard, and black oxide coated hammer and trigger springs. Also includes SB Tactical SBA3 Adjustable Pistol Brace, castle nut, latch plate, carbine buffer spring, 5 positioning mil-spec buffer tube, and standard carbine buffer.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448840.jpg', 'https://palmettostatearmory.com/psa-10-5-5-56-nato-1-7-nitride-9-m-lok-moe-ept-sba3-pistol-kit.html', '0', 0, 689.99, 399.99, 290.00, 'https://palmettostatearmory.com/psa-10-5-5-56-nato-1-7-nitride-9-m-lok-moe-ept-sba3-pistol-kit.html', '0caf17221f339bdac76fb2f16e72d5c0', 0, NULL, '2018-08-06 06:02:19', '2018-08-06 06:53:05'),
(278, 1, 'PSA 7\" 5.56 NATO 1/7 Nitride 9\" M-Lok Upper With Fluted Flash Can, BCG, & CH - 5165448120', '<p><strong>Barrel</strong>: 7\" 4150V Chrome Moly vanadium steel, melonite treated for durability and chambered in 5.56 NATO with a 1 in 7\" twist. The pistol-length gas barrel is finished off with a PSA 9\" M-Lok Rail, a low profile gas block and a PSA Fluted Flash Can.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring a mil-spec finish, these uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Flash Can</strong>: Palmetto State Armory Fluted \"FLASH CAN\". This is a solid 6061 aluminum device that is designed to direct muzzle gases and the muzzle flash forward. Threaded 1/2-28 for 5.56 NATO. Black military-style hard anodizing. THIS DEVICE IS NOT DESIGNED TO REDUCE RECOIL, MUZZLE RISE, OR FLASH SIGNATURE. This device is designed to direct gasses and noise forward away from the shooter and enhance the weapon\'s appearance.</p>\r\n<p><strong>Bolt</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is parkerized outside, and chrome lined inside.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448120.jpg', 'https://palmettostatearmory.com/psa-7-5-56-nato-1-7-nitride-9-m-lok-upper-with-fluted-flash-can-bcg-ch-5165448120.html', '0', 0, 349.99, 279.99, 70.00, 'https://palmettostatearmory.com/psa-7-5-56-nato-1-7-nitride-9-m-lok-upper-with-fluted-flash-can-bcg-ch-5165448120.html', '8e658a568d421aa54e6be2f2c1ab7071', 0, NULL, '2018-08-06 06:02:19', '2018-08-06 06:53:10'),
(279, 1, 'Kel-Tec PMR30 .22 wmr Pistol - Black', '<p>The PMR-30 is a light weight, full size pistol chambered for the flat-shooting .22Magnum cartridge (.22WMR). The PMR-30 operates on a unique hybrid blowback/locked-breech system. This operation system allows for the use of a wide variety of ammunition as it seamlessly adjusts between locked breech and blowback operation, depending on the pressure of the cartridge. It uses a double stack magazine of a new design that holds 30 rounds and fits completely in the grip of the pistol. The trigger is a crisp single action with an over-travel stop. The manual safety is a thumb activated ambidextrous safety lever (up for SAFE, down for FIRE). The slide locks back after the last shot and a manual slide lock lever is also provided. The light, crisp trigger pull and fiber optic sights make the PMR-30 ideal for target shooting and hunting small game.</p>\n<p><span> </span></p>\n<p><span>Slide and barrel are 4140 steel, frame is 7075 aluminum. Grip, slide cover, trigger, mag release, and safety levers are glass reinforced Nylon (Zytel), much like other Kel-Tec Pistols. Magazine is Also Zytel and holds 30 rounds, with round count ports. Other features include: dual opposing extractors for reliability, heel magazine release to aid in magazine retention, dovetailed steel front sight, picatinny accessory rail under the barrel, Urethane recoil buffer, captive coaxial recoil springs. PMR30 disassembles for cleaning by removal of a single pin.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/0/9/092620167669fsview1.jpg', 'https://palmettostatearmory.com/kel-tec-pistol-pmr30-22-wm-black.html', '4.6', 5, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/kel-tec-pistol-pmr30-22-wm-black.html', 'c9142322c8471febd608e0ec235460ee', 1, ' Exp. 8/6, 12pm EST', '2018-08-06 06:02:19', '2018-08-06 06:53:15'),
(280, 1, 'PSA 7\" 5.56 NATO 1/7 Nitride 9\" Lightweight M-Lok Freedom Upper w/ Fluted Flash Can, BCG, & CH', '<p><span style=\"font-size: medium;\">This upper features a 9” M-LOK rail that can be used to attach M-LOK rail accessories giving you the ability to customize your build to suit your needs. Includes bolt carrier group and charging handle. Comes installed with the PSA Fluted Flash Can that is designed to direct the muzzle gases and muzzle flash forward and away from the shooter. <b>This device is not designed to reduce recoil, muzzle rise, or flash.</b></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/m/f/mfg-516447043.jpg', 'https://palmettostatearmory.com/psa-7-5-56-nato-1-7-nitride-9-lightweight-m-lok-freedom-upper-w-fluted-flash-can-bcg-ch.html', '4.9', 14, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-7-5-56-nato-1-7-nitride-9-lightweight-m-lok-freedom-upper-w-fluted-flash-can-bcg-ch.html', 'cf03c25aa844edb25cd3c1d9b76e84f5', 1, ' Exp. 8/3, 12pm EST', '2018-08-06 06:02:19', '2018-08-06 06:53:20'),
(281, 1, 'PSA Gen3 PA-9 4\" 9mm 6\" Lightweight M-Lok Railed Upper With BCG & CH', '<p><strong>Palmetto State Armory is proud to announce the Gen 3 9mm Pistol upper.  Designed to work with Palmetto State Armory 9mm lowers that use Glock®-style magazines.</strong></p>\r\n<p><strong>Barrel</strong><span>: 4\" chrome moly steel barrel chambered in 9mm (9x19) with a 1:10 twist rate.  The heavy profile Barrel is melonite treated for durability and finished off with a Palmetto State Armory 6\" M-lok free-float rail and a PSA Fluted Flash Can.</span></p>\r\n<p><strong>Flash Can</strong><span>: Palmetto State Armory Fluted \"FLASH CAN\".  This is a solid 6061 aluminum device that is designed to direct muzzle gases and the muzzle flash forward.  Threaded 1/2-36 for 9mm.  Black military-style hard anodizing.  <em><span>THIS DEVICE IS NOT DESIGNED TO REDUCE RECOIL, MUZZLE RISE, OR FLASH SIGNATURE</span></em>. This device is designed to direct gasses and noise forward away from the shooter and enhance the weapon\'s appearance.</span></p>\r\n<p><strong>Upper</strong><span>: Newly designed billet 7075-T6 slick side upper is hard coat anodized black for durability.  Featuring T-marks, these upper upper receivers are made for us right here in the USA.</span></p>\r\n<p><strong>Bolt Carrier Group</strong><span>: G3-9mm BCG was developed with a removable center weight to optimize use with captured recoil buffer systems (not included).  An Integrated gas key was incorporated in to the design to produce a solid &amp; reliable carrier round after round.  BCG is nitride treated with an 8620 steel bolt.<br><br>To be used with Palmetto State Armory 9mm lowers that use Glock®-style magazines.</span></p>\r\n<p><span>Each upper is assembled to order, and test fired to check function. </span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516447524_1.jpg', 'https://palmettostatearmory.com/psa-gen3-pa-9-4-9mm-6-lightweight-m-lok-railed-upper-with-bcg-ch.html', '4.6', 11, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-gen3-pa-9-4-9mm-6-lightweight-m-lok-railed-upper-with-bcg-ch.html', '70ffbb559971ed795cd6d54a1ca6b3c1', 1, ' Exp. 8/3, 12pm EST', '2018-08-06 06:02:19', '2018-08-06 06:53:26'),
(282, 1, 'PSA 16\" Mid-Length 5.56 NATO 1/7 Phosphate MOE+ CTR Rifle Kit, Flat Dark Earth - 5165448268', '<p><span><strong>Barrel</strong>: Phosphate coated 4150V chrome moly vanadium 16\" barrel. Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a Mid-length gas system. Barrel is is finished off with Magpul MOE Mid-length handguards in Flat Dark Earth, F-Marked gas sight base, and A2 flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized for durability. These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span><strong>Bolt</strong><span>: Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt, Shot Peened, High pressure tested, Mag particle inspected,  Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec.  8620 steel M-16 profile carrier is chrome lined and phosphate coated.</span></span></p>\r\n<p><strong>Build Kit: </strong>PSA MOE+ CTR Lower Build Kit, Flat Dark Earth</p>\r\n<p>Includes Magpul MOE CTR Stock,  MOE+ Overmolded Pistol grip, and trigger guard, Palmetto State Armory Lower Parts Kit and Mil-Spec diameter 6-position buffer tube assembly.</p>\r\n<p>Everything you need to finish your stripped lower!</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/c/l/clearance_fe_-_5165448268.jpg', 'https://palmettostatearmory.com/psa-16-mid-length-5-56-nato-1-7-phosphate-moe-ctr-rifle-kit-flat-dark-earth-5165448268.html', '4.9', 22, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-16-mid-length-5-56-nato-1-7-phosphate-moe-ctr-rifle-kit-flat-dark-earth-5165448268.html', 'd05c1d7e76b89b88efe81f4df44e9c28', 1, NULL, '2018-08-06 06:02:19', '2018-08-06 06:53:31'),
(283, 1, 'Kel-Tec P-3AT .380 ACP 6 Round Pistol with Crimson Trace Laser, Black - P3ATLASER', '<p>The Kel-Tec P-3AT is the lightest .380 ACP pistol ever made. This semi-automatic, locked breech pistol features a double action only firing mechanism. <span>The slide stop has been eliminated and the magazine capacity reduced to 6 rounds due to the larger cartridge. T<span>hanks to its locking dynamics and superior ergonometry, perceived recoil and practical accuracy are comparable to much larger guns. The P-3AT is mainly intended for plainclothes police officers as a secondary weapon, or for concealed carry by licensed citizens.</span></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/d/a/daily_deal_-_clearance_-_5165448890_fe.jpg', 'https://palmettostatearmory.com/kel-tec-p-3at-380-acp-6-round-pistol-with-laser-p3atlaser.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/kel-tec-p-3at-380-acp-6-round-pistol-with-laser-p3atlaser.html', 'dcc33027a20163b2dd33df8dfeaf7989', 1, NULL, '2018-08-06 06:02:19', '2018-08-06 06:53:36'),
(284, 1, 'PSA 10.5\" 5.56 NATO 1/7\" Phosphate Classic Shockwave Pistol Kit, Flat Dark Earth - 5165448969', '<p><strong>Barrel</strong>: Phosphate finished chrome-moly barrel. Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a carbine-length gas system. Barrel is is finished off with a classic FDE carbine-length handguard, F-Marked gas sight base, and A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Lower Build Kit:  </strong>PSA Flat Dark Earth Classic Shockwave<strong> </strong>Pistol lower build kit with KAK Industries Shockwave Blade, KAK industries Shockwave Buffer Tube, double loop latch plate, and classic fire control group.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/c/l/clearance_fe5165448969.jpg', 'https://palmettostatearmory.com/psa-10-5-5-56-nato-1-7-phosphate-classic-shockwave-pistol-kit-flat-dark-earth-5165448969.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-10-5-5-56-nato-1-7-phosphate-classic-shockwave-pistol-kit-flat-dark-earth-5165448969.html', '5360509bc613eac280385902a89d9c82', 1, NULL, '2018-08-06 06:02:19', '2018-08-06 06:53:40'),
(285, 1, 'PSA 10.5\" 5.56 NATO 1/7\" Phosphate Classic Shockwave Pistol Kit, Black - 5165448973', '<p><strong>Barrel</strong>: Phosphate finished chrome-moly barrel. Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a carbine-length gas system. Barrel is is finished off with a classic black carbine-length handguard, F-Marked gas sight base, and A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Lower Build Kit:  </strong>PSA Classic Shockwave<strong> </strong>Pistol lower build kit with KAK Industries Shockwave Blade, KAK industries Shockwave Buffer Tube, double loop latch plate, and classic fire control group.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448973.jpg', 'https://palmettostatearmory.com/psa-10-5-5-56-nato-1-7-phosphate-classic-shockwave-pistol-kit-black-5165448973.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-10-5-5-56-nato-1-7-phosphate-classic-shockwave-pistol-kit-black-5165448973.html', 'd770363c0d3fa967d41ae12dd91a9367', 1, NULL, '2018-08-06 06:02:19', '2018-08-06 06:53:46'),
(286, 1, 'PSA PX-9 Classic Billet Glock®-Style 9mm Lower Receiver, Black', '<p>PSA 9mm Billet Complete Classic Lower designed to use Glock<span>®</span>-style magazines - <b>Non Last Round Bolt Hold Open  </b></p>\r\n<p>Machined from Billet 7075 T6 forgings and then hard coat anodized, these lowers are purpose built to accept 9mm Glock<span>®</span>-style magazines.  Designed to work with the Palmetto State Armory PA-9 9mm upper.  The lower is assembled with a Palmetto State Armory lower build kit with a classic A2 Grip, 6 position Buffer tube and PSA M4-style stock.</p>\r\n<p><strong>Must be used with a Palmetto State Armory 9mm Upper.  <strong> <a href=\"http://palmettostatearmory.com/ks-47-ar-47-ar-9/ar-9/ar9-uppers.html\" target=\"_blank\">Compatible uppers can be found here.</a></strong></strong></p>\r\n<p><span style=\"color: #ff0000;\">Please check your local laws before ordering.  Not available for shipping to all areas.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516447190.jpg', 'https://palmettostatearmory.com/psa-px9mm-billet-complete-classic-lower-uses-glockr-style-516447190.html', '3.8', 4, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-px9mm-billet-complete-classic-lower-uses-glockr-style-516447190.html', 'e3a05181586c7dd77f34ee1aeeea62d1', 1, NULL, '2018-08-06 06:02:19', '2018-08-06 06:53:51'),
(287, 1, 'BLEM PSA 10.5\" Carbine-Length 5.56 NATO 1/7 Phosphate Lightweight M-lok Slant 12\" Upper - With BCG & CH - 5165448228', '<p><strong>Barrel</strong>: 10.5\" 4150V Chrome Moly vanadium steel, phosphate coated and chambered in 5.56 NATO with a 1 in 7\" twist. Carbine length gas barrel is finished off with a PSA 12\" Slant End M-lok Rail, a low profile gas block and a Palmetto State State Armory Fluted Flash Can.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring a mil-spec finish, these uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Flash Can</strong>: Palmetto State Armory\'s new Fluted Flash Can! This is a solid 6061 aluminum device that is designed to direct muzzle gases and the muzzle flash forward. Threaded 1/2-28 for 5.56 NATO. Black mil-spec hard anodizing. THIS DEVICE IS NOT DESIGNED TO REDUCE RECOIL, MUZZLE RISE, OR FLASH SIGNATURE. This device is designed to direct gasses and noise forward away from the shooter and enhance the weapon\'s appearance.</p>\r\n<p><strong>Bolt</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is parkerized outside, and chrome lined inside.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448228.jpg', 'https://palmettostatearmory.com/blem-psa-10-5-carbine-length-5-56-nato-1-7-phosphate-lightweight-m-lok-slant-12-upper-with-bcg-ch-5165448228.html', '4.8', 64, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/blem-psa-10-5-carbine-length-5-56-nato-1-7-phosphate-lightweight-m-lok-slant-12-upper-with-bcg-ch-5165448228.html', '4be8851015ff91c639944b46b18e7e57', 1, NULL, '2018-08-06 06:02:19', '2018-08-06 06:53:57'),
(288, 1, 'Blemished PSAK-47 GB2 Liberty Classic Polymer Rifle (No Cleaning Rod), ODG - 5165448562B', '<p><span><strong>BLEM PSAK-47 GB2 Liberty Classic Polymer Rifle (No Cleaning Rod), Olive Drab Green</strong></span></p>\r\n<p><span>The PSAK-47 was designed from the ground up to be a new standard in AK rifles, utilizing all new precision manufactured parts.  We took the best of all the different models to create an American AK.  Thoroughly tested in development, we tortured tested to 10,000 rounds to ensure a quality product.  Not to be satisfied with just a good AK, we kept improving and now are proud to announce our PSAK-47 GB2 Liberty rifle with a billet steel barrel block (front trunnion) and bolt, with a hammer forged carrier.</span></p>\r\n<p><span>The 4150 barrel is nitride treated for accuracy and durability, and is pressed into a new Billet steel machined barrel block to ensure the longevity AKs are known for.  The hardened steel 1mm receiver features a mil-spec style single hook trigger, and side rail mount.  The front trunnion is engraved with a star to designate the GB2 (Billet Block) model.  The classic polymer furniture includes a compartment in the buttstock and sling loop, and the rifle comes complete with a 30 round Magpul magazine (where allowed by law).</span></p>\r\n<ul>\n<li>Melonite 4150 steel treated barrel</li>\r\n<li>Stamped steel receiver</li>\r\n<li>Billet Barrel Block (front trunnion)</li>\r\n<li>Billet Bolt</li>\r\n<li>Hammer Forged Steel Carrier </li>\r\n<li>Side Scope Mount</li>\r\n<li>7.62x39 Caliber</li>\r\n<li>1 in 9.5\" Twist</li>\r\n<li>Std. 800-yard rear sight leaf</li>\r\n<li>Standard Polymer Furniture, ODG</li>\r\n<li>Magpul 30 round magazine (1)</li>\r\n</ul>\n<p><span style=\"color: #ff0000;\"><strong>Rifles must be shipped to a valid, current Federal Firearms Licensee (FFL).  Please have the shipping address of your preferred FFL before placing your order.  You will need the FFL information to complete the order.  It is the purchaser\'s responsibility to be aware of the laws in their state regarding high capacity sporting rifles.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/p/o/poly_odg_2.jpg', 'https://palmettostatearmory.com/blemished-psak-47-gb2-liberty-classic-polymer-rifle-no-cleaning-rod-odg-5165448562b.html', '4.5', 4, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/blemished-psak-47-gb2-liberty-classic-polymer-rifle-no-cleaning-rod-odg-5165448562b.html', '24c2b2766275e3f9b4722d192f6779a3', 1, NULL, '2018-08-06 06:02:19', '2018-08-06 06:54:03'),
(289, 1, 'PSA 16\" 5.56 NATO 1/7 Mid-Length Phosphate 13.5\" Lightweight M-Lok MOE EPT STR Rifle Kit, ODG - 5165448814', '<p><span><strong>Barrel</strong>: 16\" 4150V Chrome Moly Vanadium steel phosphate barrel, chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a Mid-length gas system. The barrel is finished with with a .750\" diameter low-profile gas block, PSA 13.5\" Lightweight M-Lok Free Float Rail and an A2 flash hider. <br></span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized black for durability. Featuring M4 feedramp cuts, these upper upper receivers are made for us right here in the USA.</span></p>\r\n<p><span><strong>Bolt Carrier Group</strong>: For AR15 and M16 rifles and carbines. Bolt is made of shot-peened, Mil-spec Carpenter 158® steel. Gas key is secured with grade 8 fasteners and staked. Bolt carrier is nitride treated. Includes Charging Handle.</span></p>\r\n<p><span><strong>Lower Build Kit:</strong>  PSA MOE STR EPT Lower Build Kit, Olive Drab Green</span></p>\r\n<p><span><strong>Includes: </strong>Magpul MBUS Sight Set, Black </span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448814.jpg', 'https://palmettostatearmory.com/psa-16-5-56-nato-1-7-mid-length-phosphate-13-5-lightweight-m-lok-moe-str-rifle-kit-odg-5165448814.html', '4.8', 4, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-16-5-56-nato-1-7-mid-length-phosphate-13-5-lightweight-m-lok-moe-str-rifle-kit-odg-5165448814.html', '68a5d7bdde2f7de82daa8917ed5c3cab', 1, NULL, '2018-08-06 06:02:19', '2018-08-06 06:54:10'),
(290, 1, 'PSA 16\" Pistol-Length 300AAC Blackout 1/8 Nitride 15\" Lightweight M-Lok Upper - With BCG & CH - 5165448932', '<p><span><strong>Barrel</strong>: This Chrome Moly vanadium 4150V barrel is chambered in .300 AAC Blackout with a 1:8\" twist, M4 barrel extension, and a pistol-length gas system. It is finished off with a .750\" diameter gas block, PSA 15\" Lightweight M-Lok Partial Picatinny free float rail, and an A2 Flash Hider.</span></p>\r\n<p><span><strong>Upper</strong>: The forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized. These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><strong><strong>Bolt</strong><span>:</span></strong> Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is nitride treated.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448932.jpg', 'https://palmettostatearmory.com/psa-16-pistol-length-300aac-blackout-1-8-nitride-15-lightweight-m-lok-upper-with-bcg-ch-5165448932.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-16-pistol-length-300aac-blackout-1-8-nitride-15-lightweight-m-lok-upper-with-bcg-ch-5165448932.html', '4d96825494d02fa311020bdc341911b2', 1, NULL, '2018-08-06 06:02:20', '2018-08-06 06:54:15');
