(291, 1, 'PSA 10.5\" 5.56 NATO 1/8 Stainless Steel 9\" M-Lok Upper - With BCG & CH - 5165448947', '<p><span><strong>Barrel:  </strong>10.5\" 416R stainless steel A2 barrel chambered in 5.56 NATO with a 1 in 8\" twist rate. Carbine length gas barrel is finished off with a PSA 9\" M-Lok Rail, a low profile gas block and an A2 Flash hider. </span></p>\r\n<p><span><strong>Upper:</strong> Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. These uppers are made for us right here in the USA by a mil-spec manufacturer. </span></p>\r\n<p><span><strong>Bolt</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is parkerized outside, and chrome lined inside.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165447823_2.jpg', 'https://palmettostatearmory.com/psa-10-5-5-56-nato-1-8-stainless-steel-9-m-lok-upper-with-bcg-ch-5165448947.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-10-5-5-56-nato-1-8-stainless-steel-9-m-lok-upper-with-bcg-ch-5165448947.html', 'e58813b05a276196962b95dbdbbd957b', 1, NULL, '2018-08-06 06:02:20', '2018-08-06 06:54:20'),
(292, 1, 'BLEM PSAK-47 GB2 Liberty Classic Polymer Rifle, FDE (No Cleaning Rod) - 5165448946B', '<p><span><strong>BLEM PSAK-47 GB2 Liberty Classic Polymer Rifle (No Cleaning Rod), Flat Dark Earth</strong></span></p>\r\n<p><span>The PSAK-47 was designed from the ground up to be a new standard in AK rifles, utilizing all new precision manufactured parts.  We took the best of all the different models to create an American AK.  Thoroughly tested in development, we tortured tested to 10,000 rounds to ensure a quality product.  Not to be satisfied with just a good AK, we kept improving and now are proud to announce our PSAK-47 GB2 Liberty rifle with a billet steel barrel block (front trunnion) and bolt, with a hammer forged carrier.</span></p>\r\n<p><span>The 4150 barrel is nitride treated for accuracy and durability, and is pressed into a new Billet steel machined barrel block to ensure the longevity AKs are known for.  The hardened steel 1mm receiver features a mil-spec style single hook trigger, and side rail mount.  The front trunnion is engraved with a star to designate the GB2 (Billet Block) model.  The classic polymer furniture includes a compartment in the buttstock and sling loop, and the rifle comes complete with a 30 round Magpul magazine (where allowed by law).</span></p>\r\n<ul>\n<li>Melonite 4150 steel treated barrel</li>\r\n<li>Stamped steel receiver</li>\r\n<li>Billet Barrel Block (front trunnion)</li>\r\n<li>Billet Bolt</li>\r\n<li>Hammer Forged Steel Carrier </li>\r\n<li>Side Scope Mount</li>\r\n<li>7.62x39 Caliber</li>\r\n<li>1 in 9.5\" Twist</li>\r\n<li>Std. 800-yard rear sight leaf</li>\r\n<li>Standard Polymer Furniture, Flat Dark Earth</li>\r\n<li>Magpul 30 round magazine (1)</li>\r\n</ul>\n<p><span><strong>Rifles must be shipped to a valid, current Federal Firearms Licensee (FFL).  Please have the shipping address of your preferred FFL before placing your order.  You will need the FFL information to complete the order.  It is the purchaser\'s responsibility to be aware of the laws in their state regarding high capacity sporting rifles.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448946b_.jpg', 'https://palmettostatearmory.com/blem-psak-47-gb2-liberty-classic-polymer-rifle-fde-no-cleaning-rod-5165448946b.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/blem-psak-47-gb2-liberty-classic-polymer-rifle-fde-no-cleaning-rod-5165448946b.html', '25f111f628df3d2fef591e4bb2bc5501', 1, NULL, '2018-08-06 06:02:20', '2018-08-06 06:54:25'),
(293, 1, 'PSA 16\" Classic Freedom M4 FDE Upper - with BCG and Charging Handle - 7779344', '<p><strong>Barrel</strong>: 4150V Chrom Moly steel. Chambered in 5.56 NATO, with a 1/7 twist, M4 barrel extension, and a carbine-length gas system. This M4 profile barrel is finished off with a standard handguard in Flat Dark Earth, F-Marked gas sight base, and A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized. These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt</strong>: Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt, Shot Peened, High pressure tested, Mag particle inspected, Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec. 8620 steel M-16 profile carrier is chrome lined and phosphate coated.  </p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/7/7/7779344-fde-upper.jpg', 'https://palmettostatearmory.com/psa-16-classic-freedom-m4-fde-upper-with-bcg-and-charing-handle-7779344.html', '4.9', 30, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-16-classic-freedom-m4-fde-upper-with-bcg-and-charing-handle-7779344.html', '424e1afdd6de98ff695ae95b9b0cf12c', 1, NULL, '2018-08-06 06:02:20', '2018-08-06 06:54:30'),
(294, 1, 'PSA Gen2 PA10 18\" Mid-Length .308 WIN Stainless Steel Lightweight M-Lok Rifle - 516447138', '<p><strong>PSA Gen2 PA10 18\" Mid-Length .308 WIN Nitride Lightweight M-Lok Rifle - 516447138</strong></p>\r\n<p><strong>Barrel:</strong> Machined from 416R stainless steel, chambered in .308 WIN with a 1:10 twist rate and a midlength gas system.  Upper is paired with a PSA 15\" Lightweight M-Lok free float rail, .750 gas block, and an A2-style muzzle device.</p>\r\n<p><span><strong>Upper:</strong>  Precision machined from forged 7075-T6 aluminum, then black anodize hardcoated to MIL-8625 Type 3 class 2.   </span></p>\r\n<p><span><strong>Bolt Carrier Group:</strong>  9310 steel bolt assembly, nitride treated for durability.  8620 carrier, nitride treated, with a nitride treated gas key properly staked with grade 8 fasteners.  Charging handle is also included.</span></p>\r\n<p><span><strong>Lower: </strong>Precision machined from forged 7075-T6 aluminum, these lowers are then Black anodize hardcoated to MIL-8625 Type 3 class 2.   With an AR-15 style fire control group, a PSA M4 Classic Stock, and a PSA Classic A2 Grip. This is an ideal platform for the 308 cartridge.<strong> </strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516447138_1.jpg', 'https://palmettostatearmory.com/psa-gen2-pa10-18-mid-length-308-win-stainless-steel-lightweight-m-lok-rifle-516447138.html', '5.0', 3, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-gen2-pa10-18-mid-length-308-win-stainless-steel-lightweight-m-lok-rifle-516447138.html', '2b3f5aa3c168bbac7f25eec9336a5ab2', 1, NULL, '2018-08-06 06:02:20', '2018-08-06 06:54:35'),
(295, 1, 'PSA 8.5\" Pistol-length 300AAC 1/8 Phosphate Barrel and 7\" 2A Armament M-Lok Rail With BCG & CH', '<p><strong>Barrel</strong>: Chambered in 300AAC Blackout with a 1:8 twist rate, M4 barrel extension, and a pistol gas system this barrel features a phosphate finish for accuracy and durability. It is finished off with a 7\" 2A Armament M-Lok rail, .750\" diameter low profile gas block, and an A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring machined T marks, and a mil-spec finish. These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt</strong><span>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is parkerized outside, and chrome lined inside.</span></p>\r\n<p><span>Each upper is assembled to order with care, and test fired.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516446369_1.jpg', 'https://palmettostatearmory.com/psa-8-5-pistol-length-300aac-1-7-nitride-barrel-and-7-2a-armament-m-lok-rail-with-bcg-ch.html', '4.8', 54, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-8-5-pistol-length-300aac-1-7-nitride-barrel-and-7-2a-armament-m-lok-rail-with-bcg-ch.html', '6537e36688aafcd9f068dfe170318ffa', 1, NULL, '2018-08-06 06:02:20', '2018-08-06 06:54:41'),
(296, 1, 'Blemished PSAK-47 Liberty GB2 Classic Red Rifle (No Cleaning Rod) - 5165448552B', '<p>BLEM PSAK-47 Liberty GB2 Classic Red Wood Rifle!</p>\r\n<p>A quality American standard AK built in America, with all new manufactured parts and a premium standard of fit, finish and workmanship.   From the nitride finished, 4150 steel, barrel precision mated to a Billet barrel block, to the 1mm stamped steel receiver, the PSAK-47 was designed from the ground up to be a new standard in AK rifles.  <br>Thoroughly tested in development, we tortured tested to 10,000 rounds to ensure a quality product.  Not to be satisfied with just a good AK, we kept improving and now are proud to announce our PSAK47 GB2 rifle with a billet steel barrel block (front trunnion) and bolt.</p>\r\n<p>The 4150 barrel is nitride treated for accuracy and durability, is matched to a billet bolt, and is pressed into a new Billet steel machined barrel block to ensure the longevity AKs are known for.  The hardened steel 1mm receiver features a mil-spec style single hook trigger, and side rail mount.  The front trunnion is engraved with a star to designate the GB2 (Billet Block) model.  The classic polished American hardwood furniture includes a  sling loop, and the rifle comes complete with a 30 round Magpul magazine (where allowed by law).</p>\r\n<p><strong> </strong><strong>**These rifles will have cosmetic blemishes that do not affect function. This may include, but is not limited to, machining marks under the finish, scratches, or variation in the finish color.</strong></p>\r\n<p><strong>This item is available online only.</strong></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Rifles must be shipped to a valid, current Federal Firearms Licensee (FFL).  Please have the shipping address of your preferred FFL before placing your order.  You will need the FFL information to complete the order.  It is the purchaser\'s responsibility to be aware of the laws in their state regarding high capacity sporting rifles.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/a/k/akred2_2.jpg', 'https://palmettostatearmory.com/blemished-psak-47-liberty-gb2-classic-red-rifle-no-cleaning-rod-5165448552b.html', '4.6', 8, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/blemished-psak-47-liberty-gb2-classic-red-rifle-no-cleaning-rod-5165448552b.html', 'a20a663fe48a15c26c13fdbdb2383fe2', 1, NULL, '2018-08-06 06:02:20', '2018-08-06 06:54:46'),
(297, 1, 'PSA Gen2 PA65 20\" Rifle-Length 6.5 Creedmoor 1/8 Stainless Steel Lightweight M-Lok MOE 2-Stage Rifle - 5165448588', '<p><strong>PSA PA-65 20\" Rifle Length 6.5 Creedmoor 1:8 Stainless Steel Lightweight M-Lok MOE 2-Stage  Rifle - 5165448588</strong></p>\r\n<p><strong>Barrel:</strong> Machined from 416R stainless steel, chambered in 6.5 Creedmoor with a 1:8 twist rate and a rifle-length gas system.  Upper is paired with a PSA 15\" Lightweight M-Lok free float rail, .750 gas block, and an A2-style muzzle device.</p>\r\n<p><span><strong>Upper:</strong>  Precision machined from forged 7075-T6 aluminum, then black anodize hardcoated to MIL-8625 Type 3 class 2.   </span></p>\r\n<p><span><strong>Bolt Carrier Group:</strong>  <span>Gen2 6.5 Creedmoor BCG is designed with double ejectors in order to ensure flawless cycling.  </span><span>9310 steel bolt assembly, nitride treated for durability.  8620 carrier, with a nitride treated gas key properly staked with grade 8 fasteners.  Charging handle is also included.</span></span></p>\r\n<p><span><strong>Lower: </strong>Precision machined from forged 7075-T6 aluminum, these lowers are then Black anodize hardcoated to MIL-8625 Type 3 class 2.   With a Nickel Boron 2-Stage Trigger Assambly, a Magpul MOE Stock, and a Magpul Miad Grip. This is an ideal platform for the 6.5 Creedmoor.<strong> </strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448588a.jpg', 'https://palmettostatearmory.com/psa-gen2-pa65-20-rifle-length-6-5-creedmoor-1-8-stainless-steel-lightweight-m-lok-str-2-stage-rifle-5165448588.html', '4.3', 9, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-gen2-pa65-20-rifle-length-6-5-creedmoor-1-8-stainless-steel-lightweight-m-lok-str-2-stage-rifle-5165448588.html', '69c916ab3d4786d3920b3c10a0d48b10', 1, NULL, '2018-08-06 06:02:25', '2018-08-06 06:54:52'),
(298, 1, 'PSA 16\" Mid-length Phosphate 5.56 NATO 1/7 MOE EPT Rifle Kit with Rear MBUS - ODG - 5165448871', '<p><span><strong>Barrel</strong>: Phosphate finished 4150V chrome moly vanadium 16\" barrel. Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a Mid-length gas system. Barrel is is finished off with Magpul MOE Mid-length handguards in Olive Drab Green, F-Marked gas sight base, and A2 flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized for durability. These uppers are made for us right here in the USA by a mil-spec manufacturer.</span></p>\r\n<p><span><strong>Bolt</strong><span>: Full-auto profile bolt carrier group. Milspec Carpenter No. 158® steel bolt, Shot Peened, High pressure tested, Mag particle inspected,  Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec.  8620 steel M-16 profile carrier is chrome lined and phosphate coated.</span></span></p>\r\n<p><strong>Build Kit: </strong>PSA EPT MOE Lower Build Kit, Olive Drab Green</p>\r\n<p>Includes Magpul MOE Stock,  Pistol grip, and trigger guard, Palmetto State Armory EPT  Lower Parts Kit and Mil-Spec diameter 6-position buffer tube assembly.</p>\r\n<p>EPT Lower parts kit upgrades the standard combat-style fire control group with a single-stage, target-style,  fire control group with polished contact surfaces and an electroless nickel coating.</p>\r\n<p>Everything you need to finish your stripped lower!</p>\r\n<p><strong>Includes</strong>: Magpul® MBUS Rear Sight, Black</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448871.jpg', 'https://palmettostatearmory.com/psa-16-mid-length-phosphate-5-56-nato-1-7-moe-ept-rifle-kit-with-rear-mbus-odg-5165448871.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-16-mid-length-phosphate-5-56-nato-1-7-moe-ept-rifle-kit-with-rear-mbus-odg-5165448871.html', '26a51205d42740fb2f6ffd37f0a882ad', 1, NULL, '2018-08-06 06:02:25', '2018-08-06 06:54:57'),
(299, 1, 'PSA 10.5\" 5.56 NATO 1/7\" Phosphate Classic Shockwave Pistol Kit, Gray - 5165448935', '<p><strong>Barrel</strong>: Phosphate finished chrome-moly barrel. Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a carbine-length gas system. Barrel is is finished off with a classic gray carbine-length handguard, F-Marked gas sight base, and A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Lower Build Kit:  </strong>PSA Gray Classic Shockwave<strong> </strong>Pistol lower build kit with KAK Industries Shockwave Blade, KAK industries Shockwave Buffer Tube, double loop latch plate, and classic fire control group.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448935.jpg', 'https://palmettostatearmory.com/psa-10-5-5-56-nato-1-7-phosphate-classic-shockwave-pistol-kit-gray-5165448935.html', '4.5', 2, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-10-5-5-56-nato-1-7-phosphate-classic-shockwave-pistol-kit-gray-5165448935.html', '2ab8ad0fd1b34b93fa3e08958fbef6e6', 1, NULL, '2018-08-06 06:02:25', '2018-08-06 06:55:02'),
(300, 1, 'PSA AR-15 \"Stealth\" Stripped Lower Receiver', '<p>Palmetto State Armory is proud to provide the AR-15 Stealth Lower Receiver.  Just the thing for that special build, this lower features no rollmark on the left hand side, just the caliber, model and serial.  Leave the area blank or engrave your own logo for the ultimate custom rifle.</p>\r\n<p>These forged lowers are quality made by a mil-spec contractor using 7075-T6 aluminum and are marked \"MULTI\" to accommodate most builds.  Finish is Black Hardcoat Anodize per MIL-8625 Type 3 class 2.</p>\r\n<p>Serial Number prefix is \"PA\".  Fire selector is marked \"Safe\" and \"Fire\".</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/s/t/stealth1.jpg', 'https://palmettostatearmory.com/psa-stealth-lower.html', '4.9', 185, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-stealth-lower.html', '0591e642494c743f7ef6b2cef37b7d29', 1, NULL, '2018-08-06 06:02:25', '2018-08-06 06:55:09'),
(301, 1, 'PSA 18\" Rifle-Length 6.5 Grendel 1/8 Stainless Steel 15\" Lightweight M-Lok Upper - With BCG & CH - 5165448774', '<p><strong>Barrel</strong>: 416R Stainless steel. Chambered in 6.5 Grendel, with a 1:8 twist, M4 barrel extension, and a rifle-length gas system. The barrel is finished off with a PSA 15\" Lightweight M-Lok free float rail, .750 adjustable gas block, and A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized. These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt</strong>: Full-auto profile bolt carrier group. 9310 steel bolt, Shot Peened, Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec. 8620 steel M-16 profile carrier is nitride treated.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/516446372_1_1_1.jpg', 'https://palmettostatearmory.com/psa-18-rifle-length-6-5-grendel-1-8-stainless-steel-15-lightweight-m-lok-upper-with-bcg-ch-5165448709.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-18-rifle-length-6-5-grendel-1-8-stainless-steel-15-lightweight-m-lok-upper-with-bcg-ch-5165448709.html', '5d378db4099ee1d13568559651fe3cb4', 1, NULL, '2018-08-06 06:02:25', '2018-08-06 06:55:14'),
(302, 1, 'Blem PSAK-47 Liberty GB2 MOE Rifle, Flat Dark Earth (No Cleaning Rod) - 5165448942', '<p><span><strong>BLEM PSAK-47 Liberty MOE Rifle, Flat Dark Earth (No Cleaning Rod) - 5165448942</strong></span></p>\r\n<p><span>The PSAK-47 was designed from the ground up to be a new standard in AK rifles, utilizing all new precision manufactured parts.  We took the best of all the different models to create an American AK.  Thoroughly tested in development, we tortured tested to 10,000 rounds to ensure a quality product.  Not to be satisfied with just a good AK, we kept improving and now are proud to announce our PSAK-47 GB2 rifle with a billet steel barrel block (front trunnion) and bolt.</span></p>\r\n<p><span>The 4150 barrel is nitride treated for accuracy and durability and is pressed into a new Billet steel machined barrel block to ensure the longevity AKs are known for.  The hardened steel 1mm receiver features a single hook trigger, and side rail mount.  The front trunnion is engraved with a star to designate the GB2 (Billet Block) model.  The rifle comes complete with a 30 round Magpul magazine (where allowed by law).</span></p>\r\n<p><span style=\"color: #ff0000;\">This item is available online only.</span></p>\r\n<p><span>Rifles must be shipped to a valid, current Federal Firearms Licensee (FFL).  Please have the shipping address of your preferred FFL before placing your order.  You will need the FFL information to complete the order.  It is the purchaser\'s responsibility to be aware of the laws in their state regarding high capacity sporting rifles.</span></p>\r\n<p><span><span><strong>**These rifles will have cosmetic blemishes that do not affect function. This may include, but is not limited to, machining marks under the finish, scratches, or variation in the finish color.</strong></span></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448942_2.jpg', 'https://palmettostatearmory.com/blem-psa-ak47-liberty-gb2-moe-rifle-flat-dark-earth-5165448942.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/blem-psa-ak47-liberty-gb2-moe-rifle-flat-dark-earth-5165448942.html', '667e53b3bee4d1e11044aeaf35486186', 1, NULL, '2018-08-06 06:02:26', '2018-08-06 06:55:20'),
(303, 1, 'Ruger SR9c Compact 9mm 17 Round Pistol with Stainless Steel Slide - 3313', '<p class=\"overview\">The SR9c compact 9mm pistol weighs in at 23.40 oz. and features an overall length of 6.85\", a height of 4.61\", and the same slim 1.27\" grip width (across safety levers) as the full-sized SR9. It comes with two magazines that provide options in both capacity and grip size. The standard magazine holds 10 rounds and features a flat bottom butt plate; a finger grip extension floor plate is also included. The second magazine features a grip adapter and holds 17 rounds, instantly transforming the smaller, compact grip into a full-sized 9mm grip. The 3.50\" barreled pistol features an integral accessory rail that accommodates most lights and lasers.</p>\r\n<p class=\"overview\">The SR9c compact pistol utilizes the same adjustable, high-visibility 3-Dot sight system as its full-sized predecessor, setting it apart from many compact pistols that rely on fixed sights. New serrations are located on the front portion of the slide, making it easier to both manipulate the slide and to press check the chamber. Just like the original, full-sized SR9, the SR9c is loaded with modern safety features like a 1911-style ambidextrous manual safety, internal trigger bar interlock and striker blocker, trigger safety, magazine disconnect, plus a visual and tactile loaded chamber indicator.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/r/u/ruger_7774.jpg', 'https://palmettostatearmory.com/ruger-sr9c-9mm-compact.html', '4.0', 1, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/ruger-sr9c-9mm-compact.html', '71c5f194152479fbe9d3a23cf70929ea', 1, NULL, '2018-08-06 06:02:27', '2018-08-06 06:55:25'),
(304, 1, 'PSA Freedom 5.56 Nickel Boron BCG - 516445123', '<p><span>This 5.56mm Bolt Carrier Group is Nickel Boron coated and features a 9310 bolt.  The gas key is hardened and secured with Grade 8 fasteners, and is staked per Mil-Spec.  </span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/7/7/7791928_2_1.jpg', 'https://palmettostatearmory.com/psa-freedom-5-56-nickel-boron-bcg-516445123.html', '4.6', 32, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-freedom-5-56-nickel-boron-bcg-516445123.html', '8518b58b915721a73b5b5bfe5a1f71e3', 1, NULL, '2018-08-06 06:02:27', '2018-08-06 06:55:32'),
(305, 1, 'PSA 10.5\" 9mm 1/10 GX M-Lok MOE Shockwave Pistol, Olive Drab Green  - 5165448146', '<p><strong>Barrel</strong>: 10.5\" chrome moly steel barrel. Chambered in 9mm, (9x19), with a 1/10 twist. The barrel is nitride treated for durability and finished off with a Palmetto State Armory 9\" M-Lok free-float rail and a bird cage style A2 flash hider. </p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized black for durability.  These upper receivers are made for us right here in the USA.</p>\r\n<p><strong>Bolt Carrier Group</strong>: G-9 Hybrid 9mm BCG. Phosphate coated, 8620 steel, G-9 Hybrid Bolt allows use with either Glock®-style, or Colt®-style magazine, Palmetto State Armory lowers. Includes charging handle.</p>\r\n<p><b>Lower:</b>. Forged 7075 T6 aluminum and then hard coat anodized, these lowers are purpose built to accept 9mm Glock®-style magazines.   Designed to work with PSA\'s new 9mm Hybrid uppers.  The lower is assembled with a Palmetto State Armory MOE lower build kit with a PSA Classic A2 ODG Grip,  KAK industries pistol buffer tube, and KAK Industries Pistol Stabilizing Blade in Olive Drab Green. <strong> Does not include last round bolt hold open feature. </strong></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448146.jpg', 'https://palmettostatearmory.com/psa-10-5-9mm-1-10-gx-m-lok-moe-shockwave-pistol-olive-drab-green-5165448146.html', '5.0', 1, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-10-5-9mm-1-10-gx-m-lok-moe-shockwave-pistol-olive-drab-green-5165448146.html', '41c541954456b6dd89bd60f21dea6eac', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:55:38'),
(306, 1, 'PSA 10.5\" Carbine-Length .223 Wylde 1/8 Phosphate M-lok Slant 12\" MOE EPT SBA3 Pistol Kit - 5165448876', '<p><strong>Barrel</strong>: 10.5\" 4150V Chrome Moly vanadium steel, phosphate coated and chambered in Wylde with a 1 in 8\" twist. Carbine length gas barrel is finished off with a PSA 12\" Slant End M-lok Rail, a low profile gas block and a PSA Fluted Flash Can.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring a mil-spec finish, these uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Flash Can</strong>: Palmetto State Armory\'s Fluted \"FLASH CAN\". This is a solid 6061 aluminum device that is designed to direct muzzle gases and the muzzle flash forward. Threaded 1/2-28 for 5.56 NATO. Black military-style hard anodizing. THIS DEVICE IS NOT DESIGNED TO REDUCE RECOIL, MUZZLE RISE, OR FLASH SIGNATURE. This device is designed to direct gasses and noise forward away from the shooter and enhance the weapon\'s appearance.</p>\r\n<p><strong>Bolt</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is parkerized outside, and chrome lined inside.</p>\r\n<p><span><strong>Build Kit: </strong>A high quality lower build kit with everything you need to assemble your AR-15 lower into a pistol. Features Enhanced Polished Trigger (EPT), Magpul Grip, Magpul Trigger Guard, and black oxide coated hammer and trigger springs. Also includes SB Tactical SBA3 Adjustable Pistol Brace, castle nut, latch plate, carbine buffer spring, 5 positioning mil-spec buffer tube, and standard carbine buffer.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448877_1.png', 'https://palmettostatearmory.com/psa-10-5-carbine-length-223-wylde-1-8-phosphate-m-lok-slant-12-moe-ept-sba3-pistol-kit-5165448876.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-10-5-carbine-length-223-wylde-1-8-phosphate-m-lok-slant-12-moe-ept-sba3-pistol-kit-5165448876.html', '0a606e64fce190fc864230686db8f47e', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:55:43'),
(307, 1, 'Remington 700 ADL .308 WIN 26\" Rifle w/ Scope, Camo - RL85435', '<p>When you’re out on the hunt, you need a rifle you can depend on. The Remington 700 ADL Camo bolt-action rifle delivers accuracy and reliability when you need it most. It comes equipped with a bore sighted scope with adjustable objective lens and an X-Mark Pro trigger. Finished in a Mossy Oak Brush Country Camo coating for use in various environments. </p>\r\n<p><b>Shop Palmetto State Armory for the best selection of Remington hunting rifles.</b></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/r/l/rl85435.jpg', 'https://palmettostatearmory.com/remington-700-adl-308-win-26-rifle-w-scope-camo-rl85435.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/remington-700-adl-308-win-26-rifle-w-scope-camo-rl85435.html', '7b84afa5b6878f111e24cebe62c81676', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:55:48'),
(308, 1, 'Remington 700 ADL .223 Rem 26” Rifle w/ Scope, Camo - RL85433', '<p>Experience the accuracy and reliability of the Remington 700 ADL Camo bolt-action rifle. It comes equipped with a bore sighted scope with adjustable objective lens and an X-Mark Pro trigger. The Mossy Oak Brush Country Camo coating makes this rifle the perfect companion on any hunt. </p>\r\n<p><b>Shop Palmetto State Armory for the best selection of Remington hunting rifles.</b></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448878-camo.jpg', 'https://palmettostatearmory.com/remington-700-adl-223-rem-26-rifle-w-scope-camo-rl85433.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/remington-700-adl-223-rem-26-rifle-w-scope-camo-rl85433.html', '6cde4a1c1e7273abcea2981afd4b3f60', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:55:53'),
(309, 1, 'PSA 7\" Nitride 5.56 1/7 6\" Lightweight M-Lok Classic Shockwave Pistol Kit, Gray - 5165448891', '<p><strong>Barrel</strong>: 7\" 4150V Chrome Moly vanadium steel, nitride treated for durability and chambered in 5.56 NATO with a 1 in 7\" twist. Pistol-length gas barrel is finished off with a PSA 6\" Lightweight M-lok Rail, a low profile gas block and an A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is made to MIL-SPECS and hard coat anodized black for durability. Featuring a mil-spec finish, these uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt</strong>: Bolt is made of Mil-spec shot-peened Carpenter 158 steel. Gas key is secured with grade 8 fasteners and staked per mil-spec. Bolt carrier is nitride treated. </p>\r\n<p><strong>Build Kit:</strong> A high quality lower build kit with everything you need to assemble your AR-15 lower into a pistol. Pistol kit includes a Gray Shockwave Blade pistol stabilizer, Shockwave tube, PSA classic gray A2 grip, USGI trigger guard, carbine buffer spring, and standard carbine buffer.</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448891.jpg', 'https://palmettostatearmory.com/psa-7-nitride-5-56-1-7-6-lightweight-m-lok-classic-shockwave-pistol-kit-gray-5165448891.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-7-nitride-5-56-1-7-6-lightweight-m-lok-classic-shockwave-pistol-kit-gray-5165448891.html', '59debcf42defdd2c4c1e6233cf5568ba', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:55:58'),
(310, 1, 'PSA 16\" .22 LR 1:16 Nitride 13.5\" M-Lok Upper - With Phosphate BCG & CH - 5165448928', '<p><strong>Palmetto State Armory is proud to announce the Dedicated .22 LR Upper! </strong></p>\r\n<p><span><strong>Barrel</strong>:  4150V Chrome moly vanadium steel 16\" barrel length chambered in .22 LR, with a 1:16 twist. The M4 profile barrel has a gas nitride finish for accuracy and durabiltly, and is finished off with a PSA 13.5\" M-Lok Free Float Rail, and an A2 flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized black for durability. Featuring M4 feedramp cuts, these upper upper receivers are made for us right here in the USA</span></p>\r\n<p><strong>BCG:</strong> Dedicated Phosphate .22 LR Bolt Group</p>\r\n<p><strong>Magazine: </strong>Uses standard Black Dog Machine AR15 - .22LR Magazines.  Magazine NOT Included</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448928.jpg', 'https://palmettostatearmory.com/psa-16-22-lr-1-16-nitride-13-5-m-lok-upper-with-bcg-ch-5165448928.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-16-22-lr-1-16-nitride-13-5-m-lok-upper-with-bcg-ch-5165448928.html', 'd05ba2d3a2e4fc53e383d8d022b92316', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:56:03'),
(311, 1, 'Ruger SR9c 9mm Compact Pistol, Brushed Stainless (10rd Mag Model w/ Two 17rd Mags) - 3316', '<p>This is the 10 Round Magazine model that ships with two 17 Round Magazines instead.</p>\r\n<p>Unique reversible backstrap (flat or arched) that allows shooters to quickly customize the size and feel of the grip, without the use of separate inserts or special tools.  Integral accessory mounting rail provides space for mounting lights, lasers, and other tactical accessories.  Dovetailed, high-visibility 3-dot sight system features a raked-forward front sight for easy removal from the holster and an adjustable rear sight.  High-performance, glass-filled nylon grip frame.  Manual safety and D-shaped magazine release are easy to reach and actuate and appeal to both left- and right-handed shooters.  Patented loaded chamber indicator provides confirmation of a loaded or empty chamber.  Ships with a Finger Grip Extension Floorplate and two 17-Round Magazines.  Additional front slide serrations provide a sure grip.  Accepts most full-sized SR9® accessories and all full-sized SR9® magazines</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/3/3/3316.jpg', 'https://palmettostatearmory.com/ruger-sr9c-9mm-compact-10rd-pistol-brushed-stainless-3316.html', '4.5', 2, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/ruger-sr9c-9mm-compact-10rd-pistol-brushed-stainless-3316.html', '923f18a206e47ffd0e6951d62fbd1251', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:56:08'),
(312, 1, 'PSA 16\" Midlength 5.56 NATO 1:7 A2 Nitride Freedom Rifle Kit - 507279', '<p><strong>Barrel</strong>: 16\" barrel length Chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, and a mid-length gas system. The A2-style profile barrel is melonite finished for accuracy and durability. Barrel is finished off with an .750\" diameter F-marked front sight base with sling swivel, standard handguards and an A2 flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized black for durability. Featuring M4 feedramp cuts, T-marks, these upper upper receivers are made for us right here in the USA.</p>\r\n<p><strong>Bolt Carrier Group</strong>: For AR15 and M16 rifles and carbines. Bolt is made of shot-peened, Mil-spec Carpenter 158® steel. Gas key is secured with grade 8 fasteners and staked. Bolt carrier is parkerized outside and chrome lined inside. Includes Charging Handle.</p>\r\n<p><strong>Lower Build Kit</strong>: Includes the PSA Freedom Lower Build Kit</p>\r\n<p> </p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/0/507279.jpg', 'https://palmettostatearmory.com/psa-16-midlength-5-56-nato-1-7-socom-melonite-freedom-rifle-kit.html', '4.8', 139, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-16-midlength-5-56-nato-1-7-socom-melonite-freedom-rifle-kit.html', 'a839e74576396799922cf3e35abdcffb', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:56:15'),
(313, 1, 'Magpul PMAG D-60 AR/M4, 5.56x45 Magazine, Black - MAG576-BLK', '<p><span style=\"font-size: medium;\">The PMAG D-60 is a durable, lightweight, highly reliable 60-round 5.56x45 NATO/.223 Remington* polymer drum magazine for AR15/M4 compatible weapons.</span></p>\r\n<p><span style=\"font-size: medium;\">With a larger capacity than previous PMAGs, the PMAG D-60 gives the shooter 60 rounds of ammunition, effectively allowing the same round count as two standard capacity 30-round magazines without requiring a critical reload.</span></p>\r\n<p><span style=\"font-size: medium;\">The unique drum configuration keeps the height of the magazine manageable as well as allowing for prone firing and easier storage. Features an easy-to-use loading lever, paint pen dot matrix for easy marking, and a rear window for instant capacity indication. Compatible with a wide range of NATO firearms such as the M4, M16, SCAR™ MK16/16S, HK®416, MR556, M27 IAR, IWI Tavor, and others.</span><span style=\"font-size: medium;\"> </span></p>\r\n<p><em><span style=\"font-size: medium;\">Made in U.S.A.</span></em></p>\r\n<p><strong><span style=\"font-size: medium;\">FEATURES</span></strong></p>\r\n<p><span style=\"font-size: medium;\">Next-generation impact and crush resistant polymer construction</span></p>\r\n<p><span style=\"font-size: medium;\">Wide compatibility with most \'STANAG 4179\' platforms such as the AR15, M4, M16, SCAR MK16/16S, HK416, MR556, M27 IAR, IWI Tavor, and others</span></p>\r\n<p><span style=\"font-size: medium;\">Will seat fully loaded on a closed bolt</span></p>\r\n<p><span style=\"font-size: medium;\">Bolt hold open feature to lock the bolt back on the last round**</span></p>\r\n<p><span style=\"font-size: medium;\">Ratcheting Loading Lever to take tension off the spring for easy loading by hand</span></p>\r\n<p><span style=\"font-size: medium;\">Feed Tower compatible with most loading devices, including USGI stripper clips and guides, the StripLULA™, and others</span></p>\r\n<p><span style=\"font-size: medium;\">Designed to be left loaded for long term storage without any loss of function or degradation</span></p>\r\n<p><span style=\"font-size: medium;\">All components used are corrosion resistant</span></p>\r\n<p><span style=\"font-size: medium;\">Easy to disassemble for cleaning with only a flat-bladed screwdriver or similar</span></p>\r\n<p><span style=\"font-size: medium;\">Anti-glare translucent window on rear of drum allows for easy determination of rounds remaining</span></p>\r\n<p><span style=\"font-size: medium;\">Paint pen dot matrix panel on back of body to allow for identification marking</span></p>\r\n<p><span style=\"font-size: medium;\">Slip-on, semi-rigid Dust Cover prevents grit and debris intrusion during storage and transport</span></p>\r\n<p><span style=\"font-size: medium;\"> </span><span style=\"font-size: medium;\"> </span></p>\r\n<p><strong><span style=\"font-size: medium;\">ITAR</span></strong></p>\r\n<p><span style=\"font-size: medium;\">International Traffic in Arms Regulations Controlled Product</span></p>\r\n<p> </p>\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 30px; height: 0; overflow: hidden;\"><iframe style=\"position: absolute; top: 0; left: 0;\" src=\"https://www.youtube-nocookie.com/embed/i8bt6Mb0rUc?rel=0\" frameborder=\"0\" width=\"100%\" height=\"100%\"></iframe></div>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/6/0/60401_up.jpg', 'https://palmettostatearmory.com/magpul-magazine-pmag-d-60-ar-m4-5-56x45-blk-mag576-blk.html', '4.8', 30, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/magpul-magazine-pmag-d-60-ar-m4-5-56x45-blk-mag576-blk.html', 'c48ff9b936ef6a26ba428e9e42df0614', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:56:21'),
(314, 1, 'CMC Single Stage AR-15/AR-10 Tactical Flat Bow Drop-in Trigger, (3.5lbs) - 91503', '<p>CMC\'s innovative, self-contained and easy-to-install AR-15 trigger groups have been completely re-tooled to maximize production capacities, incorporate new design enhancements and reduce cost. CMC\'s AR-15 trigger groups have always yielded exceptional trigger pull dynamics for tens of thousands of satisfied customers.</p>\r\n<p><span>Standard Trigger Pull - Flat CMC’s AR-15/10 Patented “Signature Flat” Trigger is the ultimate for feel and break. With the Shooters finger coming to rest naturally on the shoe, every pull is the same as the one before it. The Flat Trigger Bow renders a linear feel unsurpassed by any other Trigger Bow shape!</span><br><span>With exceptional Lock Time and lighting fast reset, the Flat Trigger is unsurpassed by any other fire control group.</span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/6/0/60699_1.jpg', 'https://palmettostatearmory.com/cmc-trigger-single-stage-tactical-flat-bow-3-5lbs-91503.html', '4.9', 94, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/cmc-trigger-single-stage-tactical-flat-bow-3-5lbs-91503.html', 'b2f6e54f40d56a1b712d6dee657b2f40', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:56:27'),
(315, 1, 'PSA 16\" Mid-Length 5.56 NATO 1:7 Nitride 13.5\" Lightweight M-Lok Classic Rifle Kit With MBUS Sight Set - 5165448515', '<p><span><strong>Barrel</strong>: 4150V Chrome moly steel, chambered in 5.56 NATO, with a 1:7 twist, M4 barrel extension, nitride treated, and a midlength gas system. Barrel is finished off with a .750\" diameter low-profile gas block, PSA 13.5\" Lightweight M-Lok Partial Picatinny free float rail, and A2 flash hider.</span></p>\r\n<p><span><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is hard coat anodized black for durability. Featuring M4 feedramp cuts, these upper receivers are made for us right here in the USA.</span></p>\r\n<p><span><strong>Bolt Carrier Group</strong>: For AR15 and M16 rifles and carbines. Bolt is made of shot-peened, Mil-spec Carpenter 158® steel. Gas key is secured with grade 8 fasteners and staked. Bolt carrier is parkerized outside and chrome lined inside. Includes Charging Handle.</span></p>\r\n<p><span><strong>Lower Build Kit</strong>: Includes the PSA Classic Freedom Lower Build Kit</span></p>\r\n<p><strong>Sight Set:</strong> Magpul MBUS Backup Sight Set, Black</p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448515.jpg', 'https://palmettostatearmory.com/psa-16-mid-length-5-56-nato-1-7-nitride-13-5-lightweight-m-lok-classic-rifle-kit-with-mbus-sight-set-5165448515.html', '5.0', 3, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-16-mid-length-5-56-nato-1-7-nitride-13-5-lightweight-m-lok-classic-rifle-kit-with-mbus-sight-set-5165448515.html', 'c2794778a7b5d1c54972ab28d156f550', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:56:32'),
(316, 1, 'PSA 10.5\" Carbine-Length 5.56 NATO 1/7 Nitride Lightweight M-Lok MOE EPT Shockwave Pistol - 5165448764', '<p><strong>Barrel</strong>: 4150V chrome moly steel. Chambered in 5.56 NATO, with a 1:7 twist rate and a Carbine Length gas system. Barrel is Nitride treated for accuracy and durability.  A2 profile barrel is finished off with a PSA Lightweight 9\" M-Lok free-float rail, .750\" low-profile gas block, and A2 style flash hider.</p>\r\n<p><strong>Upper</strong>: Forged 7075-T6 A3 AR upper is machined to MIL-SPECS and hard coat anodized. Uppers include forward assist and dust cover. These uppers are made for us right here in the USA by a mil-spec manufacturer.</p>\r\n<p><strong>Bolt</strong>: Full-auto profile bolt carrier group. Shot-peened, mil-spec Carpenter No. 158® steel bolt. Gas Key Hardened to USGI Specifications, Fastened with Grade 8 screws, and Staked Per Mil-Spec. 8620 steel M-16 profile carrier is chrome lined and phosphate coated.</p>\r\n<p><strong>Lower</strong>: <span>These forged lowers are quality made using 7075-T6 aluminum and are marked \"MULTI\" for caliber.  Built with an Enhanced Polished Trigger (EPT) and fitted with a KAK Industries Shockwave Blade and Magpul Grip in Black. </span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448764_1.jpg', 'https://palmettostatearmory.com/psa-10-5-carbine-length-5-56-nato-1-7-nitride-lightweight-m-lok-moe-ept-shockwave-pistol-5165448764.html', '5.0', 1, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-10-5-carbine-length-5-56-nato-1-7-nitride-lightweight-m-lok-moe-ept-shockwave-pistol-5165448764.html', '1df94d8825eb00e4844547669b8edd3e', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:56:37'),
(317, 1, 'PSA 10.5\" 9mm 1:10 Lightweight M-Lok MOE EPT SBA3 Pistol, Black', '<p><strong>Barrel</strong><span>: 10.5\" chrome moly steel barrel. Chambered in 9mm, (9x19), with a 1/10 twist. The barrel is nitride treated for durability and finished off with a Palmetto State Armory 9\" Lightweight M-Lok free-float rail and a bird cage style A2 flash hider. </span></p>\r\n<p><strong>Upper</strong>: Billet 6061-T6 Slick side AR upper is hard coat anodized black for durability.  These upper receivers are made for us right here in the USA.</p>\r\n<p><strong>Bolt Carrier Group</strong><span>: G-9 Hybrid 9mm BCG. Phosphate coated, 8620 steel, G-9 Hybrid Bolt allows use with either Glock®-style, or Colt®-style magazine, Palmetto State Armory lowers. Includes charging handle.</span></p>\r\n<p><b>Lower:</b><span>. Forged 7075 T6 aluminum and then hard coat anodized, these lowers are purpose built to accept 9mm Glock®-style magazines.   Designed to work with PSA\'s new 9mm Hybrid uppers.  The lower is assembled with a Palmetto State Armory MOE EPT lower build kit with a Magpul Grip,  PSA 6 position buffer tube, and SBA3 Adjustable Brace. <strong> Does not include last round bolt hold open feature.</strong></span></p>', 'https://palmettostatearmory.com/media/catalog/product/cache/1/thumbnail/95x/9df78eab33525d08d6e5fb8d27136e95/5/1/5165448852.jpg', 'https://palmettostatearmory.com/psa-10-5-9mm-1-10-lightweight-m-lok-moe-shockwave-pistol-black1.html', '0', 0, 0.00, 0.00, 0.00, 'https://palmettostatearmory.com/psa-10-5-9mm-1-10-lightweight-m-lok-moe-shockwave-pistol-black1.html', '4f6f7639454f20b8846cde947abbd714', 1, NULL, '2018-08-06 06:02:28', '2018-08-06 06:56:42'),
(376, 2, 'Aero Precision AR15 Lower Parts Kit, Minus FCG/Trigger Guard/Pistol Grip', '<p>Our lower parts kit helps you to build a custom AR15 from the ground up. Mil-spec dimensions and coating ensure the highest quality and correct component interface.</p>\r\n<p>This lower parts kit <span>does not include</span> the fire control group, pistol grip or trigger guard.</p>\r\n<h3><strong>Includes:</strong></h3>\r\n<ul>\n<li>Takedown/pivot Spring</li>\r\n<li>Takedown/pivot detent</li>\r\n<li>Takedown pin</li>\r\n<li>Pivot pin</li>\r\n<li>Bolt Catch</li>\r\n<li>Bolt Catch Spring</li>\r\n<li>Bolt Catch buffer</li>\r\n<li>Bolt catch roll pin</li>\r\n<li>Safety Selector</li>\r\n<li>Safety Selector spring</li>\r\n<li>Safety Selector detent</li>\r\n<li>Buffer retainer</li>\r\n<li>Buffer retainer spring</li>\r\n<li>Magazine catch body</li>\r\n<li>Magazine catch spring</li>\r\n<li>Magazine catch button</li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-ar15-lower-parts-kit-minus-fcg-trigger-guard-pistol-grip/', NULL, NULL, 30.00, 28.99, 1.01, 'https://e-arms.com/aero-precision-ar15-lower-parts-kit-minus-fcg-trigger-guard-pistol-grip/', '0e10440f4a1ee9113de801b38427bb39', 1, NULL, '2018-08-06 09:59:32', '2018-08-06 10:06:39'),
(377, 2, 'Aero Precision AR15 Standard Lower Parts Kit', '<p>The Aero lower parts kit helps you to build a custom AR15 from the ground up. Mil-spec dimensions and coating ensure the highest quality and correct component interface.</p>\r\n<h3><strong>Includes:</strong></h3>\r\n<ul>\n<li>Takedown/pivot Spring</li>\r\n<li>Takedown/pivot detent</li>\r\n<li>Trigger/hammer pin</li>\r\n<li>Takedown pin</li>\r\n<li>Pivot pin</li>\r\n<li>Bolt Catch</li>\r\n<li>Bolt Catch Spring</li>\r\n<li>Bolt Catch buffer</li>\r\n<li>Bolt catch roll pin</li>\r\n<li>Safety Selector</li>\r\n<li>Safety Selector spring</li>\r\n<li>Safety Selector detent</li>\r\n<li>Buffer retainer</li>\r\n<li>Buffer retainer spring</li>\r\n<li>Trigger guard</li>\r\n<li>Trigger guard roll pin</li>\r\n<li>A2 pistol grip</li>\r\n<li>Pistol grip screw</li>\r\n<li>Pistol grip lock washer</li>\r\n<li>Trigger spring</li>\r\n<li>Hammer spring</li>\r\n<li>Disconnector spring</li>\r\n<li>Magazine catch body</li>\r\n<li>Magazine catch spring</li>\r\n<li>Magazine catch button</li>\r\n<li>Hammer</li>\r\n<li>Trigger</li>\r\n<li>Disconnector</li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-ar15-standard-lower-parts-kit/', NULL, NULL, 59.99, 48.99, 11.00, 'https://e-arms.com/aero-precision-ar15-standard-lower-parts-kit/', 'a1cb58f11fe93fd229477b267bc31230', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:06:44'),
(378, 2, 'Aero Precision .750 Low Profile Gas Block - Phosphate', '<h3><strong>Features:</strong></h3>\r\n<ul>\n<li>Fits barrels with .750 OD</li>\r\n<li>Constructed from 4150 hardened steel</li>\r\n<li>Phosphate coating</li>\r\n<li>Low profile for easy fitment</li>\r\n<li>Set Screws are Steel 10-32 x 3/16 Knurled Cup Point</li>\r\n<li>Made in the USA</li>\r\n<li>*Roll pin not included*</li>\r\n</ul>\n<p><em>Please note: We do not recommend the use of red thread locker on the threads of the set screws. If you decide to use thread locker we recommend using the non permanent variety.</em></p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-750-low-profile-gas-block-phosphate/', NULL, NULL, 29.99, 19.99, 10.00, 'https://e-arms.com/aero-precision-750-low-profile-gas-block-phosphate/', 'a0de1b4f874b565d4df277e75b206c5a', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:06:50');
INSERT INTO `deals` (`id`, `source_id`, `title`, `description`, `image`, `link`, `ratings`, `reviews_count`, `base_price`, `sale_price`, `save_price`, `from_url`, `unique_md5`, `out_of_stock`, `ext_date`, `created_at`, `updated_at`) VALUES
(379, 2, 'Aero Precision AR15 Stripped Upper Receiver - Anodized Black', '<p><strong>For a limited time, this Stripped Upper comes with a FREE Upper Parts Kit. Just add the upper to your cart and the parts kit will add automatically. Add an <a href=\"https://e-arms.com/aero-precision-ar15-m4-5-56-charging-handle/\">Aero Charging Handle</a> for just 9.99 with purchase.</strong></p>\r\n<p><strong>Aero Precision AR15 Stripped Upper Receiver - Anodized Black</strong></p>\r\n<p>The Aero Precision AR15 Stripped Upper Receiver is one of our most popular products. Forged from 7075-T6 aluminum, this stripped upper is precision machined to mil-spec M16/M4 specifications and features M4 feedramps. Match this upper with your AR15 lower receiver for a solid and dependable fit.</p>\r\n<h3>Features:</h3>\r\n<ul>\n<li>.250 takedown pin holes</li>\r\n<li>Laser engraved T-marks</li>\r\n<li>Made of 7075 T6 Aluminum Forging.</li>\r\n<li>Features M4 Feed Ramps</li>\r\n<li>Hard Anodized Black</li>\r\n<li>Can be used for all Calibers on the AR15 Platform.</li>\r\n<li>.223/5.56, 6.5 Grendel, 300 Blackout, 25-45 Sharps Ect</li>\r\n<li>This upper is machined to the Mil Spec.</li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-ar15-stripped-upper-receiver-anodized-black/', NULL, NULL, 79.99, 63.99, 16.00, 'https://e-arms.com/aero-precision-ar15-stripped-upper-receiver-anodized-black/', '64fa7ff0f58e92dd3c099007198e595f', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:06:56'),
(380, 2, 'Aero Precision M4E1 Stripped Lower Receiver - Anodized Black', '<p><strong>Get $10 off with code 10OFFM4E1</strong></p>\r\n<p>The M4E1 Lower Receiver delivers billet aesthetics in a forged package. This custom designed enhanced forging is machined from 7075-T6 Aluminum and compatible with all mil-spec AR15 parts. Aside from the visual upgrades this custom engineered design provides that challenge much more expensive billet options, we have added several functional features to the lower receiver to simplify the assembly process for the at home builder.</p>\r\n<h3>M4E1 Lower Receiver Improvements:</h3>\r\n<ul>\n<li>Threaded Bolt Catch Roll Pin - Allows for simple installation of the bolt catch and virtually eliminates the chance to damage the finish during installation (pin included). 1/16\" Hex Key required for assembly.</li>\r\n<li>Integrated Trigger Guard - Eliminates the possibility of breaking the trigger guard tabs by integrating the trigger guard into the lower, creating a stronger more rigid platform to build upon.</li>\r\n<li>Upper Tension Screw - Allows users to fine tune the fit of the upper and lower receiver using a nylon tipped tensioning set screw inserted in the grip tang of the lower receiver. This provides a tight fit with any standard AR15 upper receiver.</li>\r\n<li>Threaded Takedown Pin Detent Recess - Allows user to easily install the Takedown Pin detent and spring with the use of a 4-40 set screw (no more launching detents across the room).</li>\r\n<li>Increased Magwell Flare - Increased the flare of the magwell to aid in quick and efficient magazine changes.</li>\r\n<li>Marked and milled to accept short-throw safety selectors, but will work with standard selectors as well.</li>\r\n</ul>\n<h3>Includes:</h3>\r\n<ul>\n<li>Stripped M4E1 Lower Receiver</li>\r\n<li>Nylon tipped tensioning set screw</li>\r\n<li>Threaded Bolt Catch Pin</li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-m4e1-stripped-lower-receiver-anodized-black/', NULL, NULL, 99.99, 79.99, 20.00, 'https://e-arms.com/aero-precision-m4e1-stripped-lower-receiver-anodized-black/', '5a25588ac886c3dc1493c1dd79d64b46', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:07:04'),
(381, 2, 'Aero Precision AR15 Upper Parts Kit', '<p><span class=\"s1\">The Aero Precision upper parts kit includes all of the parts you need to assemble your AR15 Upper Receiver. Whether you’re building your gun from the ground up or just need some extra parts, The Aero Precision upper parts kit has what you need.</span></p>\r\n<p class=\"p2\"><span class=\"s1\">Includes:</span></p>\r\n<ul class=\"ul1\">\n<li class=\"li3\"><span class=\"s2\">Forward Assist Assembly</span></li>\r\n<li class=\"li3\"><span class=\"s2\">Forward Assist Spring</span></li>\r\n<li class=\"li3\"><span class=\"s2\">Forward Assist Roll Pin</span></li>\r\n<li class=\"li3\"><span class=\"s2\">Ejection Port Cover Door</span></li>\r\n<li class=\"li3\"><span class=\"s2\">Ejection Port Cover Rod with c-clip</span></li>\r\n<li class=\"li3\"><span class=\"s2\">Ejection Port Cover Spring</span></li>\r\n<li class=\"li3\"><span class=\"s2\">Weighs 1.5oz</span></li>\r\n<li class=\"li3\"><span class=\"s2\">Made in the USA</span></li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-ar15-upper-parts-kit/', NULL, NULL, 17.99, 14.99, 3.00, 'https://e-arms.com/aero-precision-ar15-upper-parts-kit/', '481fbce8211c03f72cbe9a082865b0b4', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:07:09'),
(382, 2, 'Aero Precision AR15/M4 5.56 Charging Handle', '<h3><strong>Features:</strong></h3>\r\n<ul>\n<li>Tried and True Standard Charging Handle</li>\r\n<li>Black Anodize</li>\r\n<li>Caliber - 5.56</li>\r\n<li>Made in the USA</li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-ar15-m4-5-56-charging-handle/', NULL, NULL, 19.99, 13.99, 6.00, 'https://e-arms.com/aero-precision-ar15-m4-5-56-charging-handle/', '27af5c0aca4aa50aafad1a68dfa0db08', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:07:14'),
(383, 2, 'Aero Precision AR-15 Stripped Lower Receiver, Gen 2 - Anodized Black (HOT SALE)', '<p class=\"p1\">The Aero Precision AR15 Gen 2 Stripped Lower Receiver is the ideal base for any custom AR15 build. Machined to mil-spec dimensions, the Aero Precision AR15 Gen 2 lower ensures the highest quality with the correct interface for all standard components.</p>\r\n<p class=\"p2\"><span class=\"s1\">The Aero Precision Gen 2 AR15 lower has been improved with new features. The Increased Magwell Flare provides a sleeker look while allowing for easier insertion of magazines, and the new nylon tipped Upper Tension Screw allows you to fine tune the fit of your upper and lower receiver. This feature provides you with a tight fit in any standard AR15 upper receiver.</span></p>\r\n<p class=\"p3\"> </p>\r\n<ul class=\"ul1\">\n<li class=\"li5\"><span class=\"s3\">Stripped AR15 Lower Receiver, Gen 2</span></li>\r\n<li class=\"li5\"><span class=\"s3\">Nylon tipped tensioning set screw</span></li>\r\n<li class=\"li5\"><span class=\"s3\">Weighs 8.35oz</span></li>\r\n<li class=\"li5\"><span class=\"s3\">Made in the USA</span></li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-ar-15-stripped-lower-receiver-gen-2-anodized-black/', NULL, NULL, 89.99, 72.00, 17.99, 'https://e-arms.com/aero-precision-ar-15-stripped-lower-receiver-gen-2-anodized-black/', 'bd7c125a4d51e38ca3051fca87e33205', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:07:20'),
(384, 2, 'Aero Precision AR15 Stripped Receiver Set - Anodized Black - HOT SALE', '<p><strong>For a limited time, this set comes with a free charging handle and upper parts kit.</strong></p>\r\n<p>Don\'t forget your <a href=\"https://e-arms.com/aero-precision-ar15-standard-lower-parts-kit/\">lower parts kit</a> and <a href=\"https://e-arms.com/aero-precision-ar15-upper-parts-kit/\">upper parts kit</a>!</p>\r\n<h3>Includes:</h3>\r\n<ul>\n<li>AR15 Stripped Upper Receiver in Anodized Black</li>\r\n<li>AR15 Gen 2 Stripped Lower Receiver in Anodized Black</li>\r\n</ul>\n<h3>Upper Receiver Features:</h3>\r\n<ul>\n<li>\n<strong>Platform: </strong>AR15</li>\r\n<li>\n<strong>Material: </strong>Machined from 7075-T6 forged aluminum</li>\r\n<li>M4 Feedramps</li>\r\n<li>.250” takedown pin holes</li>\r\n<li>Works with standard AR15 components</li>\r\n</ul>\n<h3>Lower Receiver Features:</h3>\r\n<ul>\n<li>\n<strong>Platform: </strong>AR15</li>\r\n<li>\n<strong>Material: </strong>Machined from 7075-T6 forged aluminum</li>\r\n<li>\n<strong>Markings: </strong>\"Cal Multi\"</li>\r\n<li>Upper Tension Screw</li>\r\n<li>Flared Magwell</li>\r\n<li>Rear takedown pin detent hole is threaded for a 4-40 set screw</li>\r\n<li>Works with standard AR15 components and magazines</li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-ar15-stripped-receiver-set-anodized-black/', NULL, NULL, 152.99, 124.99, 28.00, 'https://e-arms.com/aero-precision-ar15-stripped-receiver-set-anodized-black/', '0c0a1cdcc5bdf8e50c2664d55ad068ea', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:07:25'),
(385, 2, 'Aero Precision AR-15 Carbine Lower Build Kit', '<p>This kit contains everything you need to build a complete Aero Precision Lower.  The kit includes:</p>\r\n<ul>\n<li>Stock</li>\r\n<li>Buffer Tube Assembly</li>\r\n<li>Lower Parts Kit</li>\r\n</ul>\n<p>All parts are brand new, straight from Aero Precision.</p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-ar-15-carbine-lower-build-kit/', NULL, NULL, 111.99, 104.99, 7.00, 'https://e-arms.com/aero-precision-ar-15-carbine-lower-build-kit/', 'c0864479c596ee2be6db1d22451f41c5', 1, NULL, '2018-08-06 09:59:32', '2018-08-06 10:07:30'),
(386, 2, 'Aero Precision AR15/M4 Carbine Buffer Kit, No Stock', '<p><span style=\"font-size: small;\"><strong>Aero Precision AR15/M4 Carbine Buffer Kit, No Stock</strong></span></p>\r\n<p>The finest quality AR Carbine buffer.  Excellent machining and fit. The Treads are rolled cleanly, the finish is excellent and its made out of 7075 T6 and is mil-spec.  </p>\r\n<h3><strong>Includes:</strong></h3>\r\n<ul>\n<li>Mil-Spec 7075-T6 Aluminum Buffer Tube, 6-position</li>\r\n<li>Carbine buffer</li>\r\n<li>Buffer spring</li>\r\n<li>End plate and lock nut</li>\r\n<li>Made in the USA</li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-ar15-m4-carbine-buffer-kit-no-stock/', NULL, NULL, 39.99, 28.99, 11.00, 'https://e-arms.com/aero-precision-ar15-m4-carbine-buffer-kit-no-stock/', '22f597c93adadb923372e3ca77ed763b', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:07:36'),
(387, 2, 'Toolcraft AR15 Nickel Boron Bolt Carrier Group 5.56/.223', '<p class=\"p1\"><span class=\"s1\">The ToolCraft Bolt Carrier Group is the “Heart of an AR-15.” The bolt carrier houses the bolt and resets the hammer as it moves within the upper receiver. The carrier also bears the brunt of the gas pressure during operation. This pressure moves it back to cycle the firing mechanism, and its performance is crucial to the proper function of your firearm.</span></p>\r\n<p class=\"p2\"> <span class=\"s1\">In addition to having an attractive chrome colored finish, the Nickel/Boron finished BCG has a low co-efficient of friction and is wear resistant. Due to the columnar structure of the Nickel/Boron, the ToolCraft NiBor BCG is naturally lubricious and hard (70C+, on Rockwell scale).</span></p>\r\n<p class=\"p3\">The ToolCraft Nickel Boron BCG is an M16 Full Auto (Preferred for most AR-15 builds)</p>\r\n<ul class=\"ul1\">\n<li class=\"li4\"><span class=\"s2\">5.56 / .223 caliber</span></li>\r\n<li class=\"li4\"><span class=\"s2\">Bolt Carrier constructed from 8620 steel</span></li>\r\n<li class=\"li4\"><span class=\"s2\">Bolt constructed from 9310 steel</span></li>\r\n<li class=\"li4\"><span class=\"s2\">Gas Key constructed from 4130 Steel; Grade 8 Gas Key Screws</span></li>\r\n<li class=\"li4\"><span class=\"s2\">Mil-Spec O-Ring</span></li>\r\n<li class=\"li4\"><span class=\"s2\">Mil-Spec gas rings (3)</span></li>\r\n<li class=\"li4\"><span class=\"s2\">MPI inspected</span></li>\r\n<li class=\"li4\"><span class=\"s2\">Weighs 11.7oz</span></li>\r\n<li class=\"li4\"><span class=\"s2\">Made in the USA</span></li>\r\n<li class=\"li4\"><span class=\"s2\">Includes Lifetime Warranty from ToolCraft</span></li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/toolcraft-ar15-nickel-boron-bolt-carrier-group-5-56-223/', NULL, NULL, 149.99, 94.99, 55.00, 'https://e-arms.com/toolcraft-ar15-nickel-boron-bolt-carrier-group-5-56-223/', 'c8175d751cc5ef1efa584da1c90a70d7', 1, NULL, '2018-08-06 09:59:32', '2018-08-06 10:07:42'),
(388, 2, 'Aero Precision M4 Sliding Stock', '<p class=\"p1\"><span class=\"s1\">The Aero Precision M4 Sliding Stock is a collapsible, AR/M4 style stock constructed of weather proof and rugged high impact polymer. </span></p>\r\n<p class=\"p2\"> </p>\r\n<p class=\"p1\"><span class=\"s1\">Features:</span></p>\r\n<ul class=\"ul1\">\n<li class=\"li3\"><span class=\"s3\">Gen 2 collapsible stock</span></li>\r\n<li class=\"li3\"><span class=\"s3\">Polymer construction</span></li>\r\n<li class=\"li3\"><span class=\"s3\">Fits mil-spec dimensioned carbine receiver extensions/buffer tubes</span></li>\r\n<li class=\"li3\"><span class=\"s3\">Weighs 7.2 oz</span></li>\r\n<li class=\"li3\"><span class=\"s3\">Made in the USA</span></li>\r\n</ul>\n<p class=\"p4\"> </p>\r\n<p class=\"p5\"><span class=\"s1\"><strong>Note</strong> : Buffer tube extension and stock assembly components are sold separately. </span></p>\r\n<h3> </h3>\r\n<h3> </h3>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-m4-sliding-stock/', NULL, NULL, 24.95, 19.99, 4.96, 'https://e-arms.com/aero-precision-m4-sliding-stock/', '99535a797c453e8ce1653f6cafedcf88', 1, NULL, '2018-08-06 09:59:32', '2018-08-06 10:07:47'),
(389, 2, 'Ruger Ar-556 556nato 16.1\" Black 30rd', '<p>Ruger Ar-556, Semi-automatic Rifle, 5.56nato/223rem, 16.1\" Barrel, 1/2\" X 28 Thread Pitch, Anodized Finish, Black Collapsible Stock, Adjustable Flip-up Rear &amp; Adjustable Post Front Sight, 30rd, 1 Magazine 08500<br><br>Model: AR-556<br>Product Type: AR<br>Finish/Color: Anodized<br>Caliber: 223 Rem</p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/ruger-ar-556-556nato-16-1-black-30rd/', NULL, NULL, 648.99, 599.99, 49.00, 'https://e-arms.com/ruger-ar-556-556nato-16-1-black-30rd/', '5abcf7fde1f9671cf145fb6156285515', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:07:53'),
(390, 2, 'Toolcraft AR15 Nitride Bolt Carrier Group 5.56/.223', '<p><strong>These are in stock and shipping free! They are coated by and purchased directly from Toolcraft.</strong></p>\r\n<p>Toolcraft Black Nitride <strong>AR15 Bolt Carrier Group</strong> is a M16 Full Auto BCG, manufactured using a 9310 steel bolt, and a 8620 steel carrier.</p>\r\n<p><span><strong>Carrier Specifications</strong></span></p>\r\n<p>Material: 8620 Steel<br>Type:  M16 Full Auto (Preferred for most AR-15 builds)<br>Gas Key Material:  4130 Steel; Grade 8 Gas Key Screws<br>Coating:  Black Nitride</p>\r\n<p><span><strong>Bolt Specifications</strong></span></p>\r\n<p>Bolt Material:  9310 Steel<br>Extractor Material: 4140 Steel<br>Mil-Spec O-Ring<br>Mil-Spec Gas Rings (3)<br>Cam Pin Material: 8620 Steel<br>Firing Pin Material: 416 Stainless Steel<br>Other: MPI Inspected</p>\r\n<p><strong>Lifetime Warranty </strong></p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/toolcraft-ar15-nitride-bolt-carrier-group-5-56-223/', NULL, NULL, 119.99, 73.99, 46.00, 'https://e-arms.com/toolcraft-ar15-nitride-bolt-carrier-group-5-56-223/', '1b458d1b0a6d44f4ddc0481d8b77f739', 0, NULL, '2018-08-06 09:59:32', '2018-08-06 10:08:00'),
(391, 2, 'Toolcraft AR15 Nitride Bolt Carrier Group 6.5 Grendel', '<p><strong>These are in stock and shipping free! They are coated by and purchased directly from Toolcraft.</strong></p>\r\n<p>Toolcraft Black Nitride <strong>AR15 Bolt Carrier Group</strong> is a M16 Full Auto BCG, manufactured using a 9310 steel bolt, and a 8620 steel carrier.</p>\r\n<p><span><strong>Carrier Specifications</strong></span></p>\r\n<p>Material: 8620 Steel<br>Type:  M16 Full Auto (Preferred for most AR-15 builds)<br>Gas Key Material:  4130 Steel; Grade 8 Gas Key Screws<br>Coating:  Black Nitride</p>\r\n<p><span><strong>Bolt Specifications</strong></span></p>\r\n<p>Bolt Material:  9310 Steel<br>Extractor Material: 4140 Steel<br>Mil-Spec O-Ring<br>Mil-Spec Gas Rings (3)<br>Cam Pin Material: 8620 Steel<br>Firing Pin Material: 416 Stainless Steel<br>Other: MPI Inspected</p>\r\n<p><strong>Lifetime Warranty </strong></p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/toolcraft-ar15-nitride-bolt-carrier-group-6-5-grendel/', NULL, NULL, 139.99, 85.99, 54.00, 'https://e-arms.com/toolcraft-ar15-nitride-bolt-carrier-group-6-5-grendel/', '73ea0295072016dacd0087391e354afb', 0, NULL, '2018-08-06 09:59:37', '2018-08-06 10:08:06'),
(392, 2, 'Aero Precision AR 308 Ejection Port Cover Kit', '<p>Ejection port cover kit for M5 (.308) Upper Receivers.</p>\r\n<h3>Includes:</h3>\r\n<ul>\n<li>Ejection Port Cover Door (DPMS 308 style)</li>\r\n<li>Ejection Port Cover Rod (DPMS 308 style)</li>\r\n<li>Ejection Port Cover Spring</li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-ar-308-ejection-port-cover-kit/', NULL, NULL, 13.00, 11.99, 1.01, 'https://e-arms.com/aero-precision-ar-308-ejection-port-cover-kit/', '2d17e07be176082d78fb0bf39fe6e984', 0, NULL, '2018-08-06 09:59:37', '2018-08-06 10:08:10'),
(393, 2, 'Aero Precision Forward Assist Assembly Kit', '<p>This Forward Assist Assembly Kit fits both AR15 and M5 .308 Upper Receivers</p>\r\n<h3>Includes:</h3>\r\n<ul>\n<li>Forward Assist Assembly</li>\r\n<li>Forward Assist Spring</li>\r\n<li>Forward Assist Roll Pin</li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-forward-assist-assembly-kit/', NULL, NULL, 11.00, 9.99, 1.01, 'https://e-arms.com/aero-precision-forward-assist-assembly-kit/', '64986f01d90b90a18e1b14ac4da1c7ca', 0, NULL, '2018-08-06 09:59:37', '2018-08-06 10:08:17'),
(394, 2, 'Aero Precision M5 .308 Enhanced Pistol Buffer Kit, No Stock', '<h3><strong>Includes:</strong></h3>\r\n<ul>\n<li>Enhanced 7075-T6 Aluminum Pistol Buffer Tube</li>\r\n<li>.308 Carbine Buffer</li>\r\n<li>.308 Carbine Buffer Spring</li>\r\n<li>End plate and lock nut</li>\r\n<li>Made in the USA</li>\r\n</ul>\n<!-- snippet location product_description -->', NULL, 'https://e-arms.com/aero-precision-m5-308-enhanced-pistol-buffer-kit-no-stock/', NULL, NULL, 69.99, 59.99, 10.00, 'https://e-arms.com/aero-precision-m5-308-enhanced-pistol-buffer-kit-no-stock/', '9222319a0ed563f53603dbd9bb37ff18', 0, NULL, '2018-08-06 09:59:37', '2018-08-06 10:08:26'),
