(398, 2, 'Armalite M15 Light Tactical Carbine 556NATO 16\" 30rd Black', '<p>Armalite M-15 Light Tactical Carbine, Semi-automatic Rifle, 223 Rem/556nato, 16\" Chrome Lined Barrel, 1:7 Twist, Black Finish, 6 Position Collapsible Stock, 30rd, 10\" Aluminum Keymod Handguard, 1-30rd Magazine M15ltc16<br><br>Model: M-15 Light Tactical Carbine<br>Product Type: AR<br>Finish/Color: Black<br>Accessories: 1-30 round Magazine<br>Description: 10 Aluminum KeyMod Handguard<br>Caliber: 223 Rem</p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/armalite-m15-light-tactical-carbine-556nato-16-30rd-black/', NULL, NULL, 931.99, 849.99, 82.00, 'https://e-arms.com/armalite-m15-light-tactical-carbine-556nato-16-30rd-black/', '87e4ec191c56b4de7421d1504ccd6cd4', 0, NULL, '2018-08-06 09:59:37', '2018-08-06 10:08:48'),
(399, 2, 'E-ARMS.COM Authentic Logo Hat', '<p>This sweet E-ARMS.COM Logo Hat is just what you need for your next trip to the range. These are Yupoong Classinc Trucker hats so they tend to run a bit large. One size fits MOST.</p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/e-arms-com-authentic-logo-hat/', NULL, NULL, 15.99, 15.99, 0.00, 'https://e-arms.com/e-arms-com-authentic-logo-hat/', '82432d6134a8f6bf8581725c923fcf06', 0, NULL, '2018-08-06 09:59:37', '2018-08-06 10:08:53'),
(400, 2, 'S&W Bodyguard 380acp 6 Round, W/Laser, No Thumb Safety', '<p>Smith &amp; Wesson M&amp;P Bodyguard, Semi-automatic, Compact, 380acp, 2.75\" Barrel, Polymer Frame, Black, Finish, Adjustable Sights, Crimson Trace Laser, 6 Rounds, 2 Magazines 10265<br><br>Model: Bodyguard<br>Product Type: Double Action Only<br>Finish/Color: Black<br>Accessories: Crimson Trace Laser<br>Description: No Manual Safety<br>Frame/Material: Polymer<br>Size: Compact<br>Caliber: 380ACP</p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/s-w-bodyguard-380acp-6-round-w-laser-no-thumb-safety/', NULL, NULL, 428.99, 274.99, 154.00, 'https://e-arms.com/s-w-bodyguard-380acp-6-round-w-laser-no-thumb-safety/', '3b84b23e4538d847fd1a52cf53a0c3a8', 1, NULL, '2018-08-06 09:59:37', '2018-08-06 10:08:57'),
(401, 2, 'S&W M&P15-22 22LR 16\" 25rd Black MOE-SL', '<p>Smith &amp; Wesson M&amp;P15-22, Semi-automatic, Ar, 22lr, 16.5\" Threaded Barrel, Black Moe-sl Grip &amp; Stock, 25rd, 10\" M&amp;P Slim Handguard With Magpul M-lok, Magpul Flip Up Front And Rear Sights 10213<br><br>Model: M&amp;P15-22<br>Product Type: AR<br>Finish/Color: Black<br>Caliber: 22LR</p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/s-w-m-p15-22-22lr-16-25rd-black-moe-sl/', NULL, NULL, 460.99, 469.99, -9.00, 'https://e-arms.com/s-w-m-p15-22-22lr-16-25rd-black-moe-sl/', 'ca997a49a351c5dafd9833c1c5d13f08', 0, NULL, '2018-08-06 09:59:37', '2018-08-06 10:09:04'),
(402, 2, 'S&W M&P15-22 22LR 16\" 25rd FDE Threaded', '<p>Smith &amp; Wesson M&amp;P15-22, Semi-automatic, Ar, 22lr, 16.5\" Threaded Barrel, Flat Dark Earth Moe-sl Grip, Stock And Rail Panels, 25rd, Flip Up Front And Rear Sights 10210<br><br>Model: M&amp;P15-22<br>Product Type: AR<br>Finish/Color: Flat Dark Earth<br>Caliber: 22LR</p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/s-w-m-p15-22-22lr-16-25rd-fde-threaded/', NULL, NULL, 460.99, 469.99, -9.00, 'https://e-arms.com/s-w-m-p15-22-22lr-16-25rd-fde-threaded/', 'c19b0b457fcbe17354e8df4cfcd0da00', 0, NULL, '2018-08-06 09:59:37', '2018-08-06 10:09:10'),
(403, 2, 'S&W M&P15t 556nato 16\" 30rd Black', '<p>Smith &amp; Wesson L, Black Finish, Black Collapsible Stock, Flattoprail, Flash Suppersor, Mid Length Gas System, Free Float M-lock Handguard, Flip Up Rear Sight, 30 Rounds 11600<br><br>Model: M&amp;P 15T<br>Product Type: AR<br>Finish/Color: Black<br>Description: Flattop Rail<br>Caliber: 556NATO</p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/s-w-m-p15t-556nato-16-30rd-black/', NULL, NULL, 1005.99, 999.99, 6.00, 'https://e-arms.com/s-w-m-p15t-556nato-16-30rd-black/', 'e85d67d2103cdb4ef3d0a2d3ceb81ea8', 1, NULL, '2018-08-06 09:59:37', '2018-08-06 10:09:15'),
(404, 2, 'Spike\'s PHU Skull 556NATO 16\" M-lok Black', '<p>Spike\'s Tactical Pipe Hitters Union, Skull Lower Receiver, Semi-automatic Rifle, 556nato, 16\" Cold Hammer Forged Barrel, Black Finish, Minimalist Stock, CMC Trigger, 13.2\" Mlok Rail, R2 Muzzle Brake, No Mag Phur5435-m3r<br><br>Model: Pipe Hitters Union<br>Product Type: AR<br>Finish/Color: Black<br>Accessories: CMC Trigger, 13.2 MLOK Rail, R2 Muzzle Brake<br>Caliber: 556NATO</p>\r\n        <!-- snippet location product_description -->', NULL, 'https://e-arms.com/spikes-phu-skull-556nato-16-m-lok-black/', NULL, NULL, 1912.50, 1765.99, 146.51, 'https://e-arms.com/spikes-phu-skull-556nato-16-m-lok-black/', '3033feb8a7ea33c55756d50e93b91b1c', 0, NULL, '2018-08-06 09:59:37', '2018-08-06 10:09:22'),
(405, 3, 'Guntec USA AR-15 Steel Low Profile Gas Block - Carbine Length Gas Tube', 'Guntec USA has been designing, manufacturing, and distributing tactical weapon accessories since 1989. Their goal is to supply excellent quality, at an economical value to professionals and enthusiasts alike.<br><br>This Low Profile Gas Block secures to any 0.750” gas seat diameter AR-15 barrel using a three set screw design. It includes a carbine length gas tube and roll pin.<br><br><b>Features:</b><br><ul>\n<li>Steel gas block</li>\n<li>.750” gas seat diameter </li>\n<li>Three set screw design</li>\n<li>Carbine length gas tube and roll pin included</li>\n<li>Made in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/guntec-usa-gas-block-with-carbine-gas-tube-gt750ss-ctube', NULL, NULL, 49.95, 17.99, 31.96, 'https://www.primaryarms.com/guntec-usa-gas-block-with-carbine-gas-tube-gt750ss-ctube', 'ff0666decd3cb9008edfefee98978c98', 0, NULL, '2018-08-06 10:28:14', '2018-08-06 11:07:21'),
(406, 3, 'Diamondhead USA 15\" VRS T-556 KeyMod Handguard', 'Diamondhead USA is a leading design innovator, manufacturer, and distributor of top quality accessories for the tactical weapons industry.<br><br>The VRS T-556 KeyMod Freefloat Handguard offers an uninterrupted Picatinny top rail for optics or other accessories. KeyMod slots available at the 3, 6, and 9-o’clock along the rail, provide many more locations for your favorite gear.<br><br>With tough 6061 aluminum construction protected by an anodized finish, this rail installs easily with the included hardware. Sturdy and lightweight, the rounded edges of this triangular shaped rail rest comfortably in hand. Designed to improve accuracy and provide exceptional airflow for a cooler barrel.<br><br><b>NOTE: Some heavy barrels may have compatibility issues with the proprietary Diamondhead VRS barrel nut.</b><br><br><b>Features:</b><br><ul>\n<li>Proprietary barrel nut included</li>\n<li>Freefloat design</li>\n<li>Comfortable triangular shape<br>\n</li>\n<li>KeyMod compatible</li>\n<li>Uninterrupted Picatinny rail</li>\n<li>Proprietary clamping system for rigid, secure attachment</li>\n<li>MIL-SPEC Type III hardcoat anodized</li>\n<li>6061 aluminum construction</li>\n</ul>', NULL, 'https://www.primaryarms.com/Diamondhead-USA-15-VRS-T-KeyMod-Rail-2245', NULL, NULL, 197.77, 69.99, 127.78, 'https://www.primaryarms.com/Diamondhead-USA-15-VRS-T-KeyMod-Rail-2245', '189e832114115671f593231de670444e', 1, NULL, '2018-08-06 10:28:14', '2018-08-06 11:07:26'),
(407, 3, '', '', NULL, 'https://www.primaryarms.com/bear-creek-arsenal-stripped-upper-receiver-baupperrcvr', NULL, NULL, 13.99, 10.99, 3.00, 'https://www.primaryarms.com/bear-creek-arsenal-stripped-upper-receiver-baupperrcvr', 'b4dcceb4530456a075af2330a8142b3e', 0, NULL, '2018-08-06 10:28:14', '2018-08-06 11:07:28'),
(408, 3, 'Mission First Tactical 3 Prong Ported Muzzle Brake - 1/2x28', 'Mission First Tactical develops select rife/carbine accessories specifically for military and law enforcement markets and civilian shooters also benefit from these leading edge, affordable products. Design of these accessories is based on the need for enhanced accuracy and functionality, improving the effectiveness of weapon systems.<br><br>The Mission First Tactical 3-Prong Ported Muzzle Brake is engineered to direct combustion gases first through four top and two side ports for reduced recoil. In addition to the recoil mitigation performed by the ports, the MFT brake takes things a step further by redirecting gas using the front three prongs sending the remaining gas and concussion forward, away from the shooter.<br><br><b>Features:</b><br><ul>\n<li>For .223/5.56 NATO</li>\n<li>416R stainless steel construction</li>\n<li>Black nitride finish</li>\n<li>Three prong design</li>\n<li>Reduced muzzle climb</li>\n<li>Reduced felt recoil</li>\n<li>Directs concussion forward of the shooter</li>\n<li>17PH4 steel crush washer included</li>\n<li>1/2x28 thread pitch</li>\n<li>Outside diameter: 0.750”</li>\n<li>Length: 2”</li>\n<li>Weight: 1.568</li>\n</ul>', NULL, 'https://www.primaryarms.com/mission-first-tactical-3-prong-ported-ar-15-muzzle-brake-1-2x28', NULL, NULL, 34.99, 15.99, 19.00, 'https://www.primaryarms.com/mission-first-tactical-3-prong-ported-ar-15-muzzle-brake-1-2x28', '1d9c810fb6a61d8b264db08f2664c105', 0, NULL, '2018-08-06 10:28:14', '2018-08-06 11:07:31'),
(409, 3, 'Magpul PMAG 30 AR-15/M4 GEN M2 MOE Window 5.56 NATO Magazine - Black', 'The PMAG 30 Gen M2 MOE Window is a 30-round 5.56 NATO AR-15 and M4 compatible magazine that offers a competitive upgrade from the aluminum USGI. It features an impact resistant polymer construction, easy to disassemble design with a flared floorplate for positive magazine extraction, resilient stainless steel spring for corrosion resistance, and an anti-tilt, self-lubricating follower for increased reliability. Durable dual-side transparent windows allow for quick determination of approximate number of rounds remaining in the magazine. The MagLevel system utilizes a high visibility indicator coil on the spring and numerical markers on the magazine body. This lightweight and durable AR mag is a great option to run in your rifle or carbine.<br><b><br>Features:</b><br><ul>\n<li>Optimized for use with Colt-SPEC AR-15/M4 firearms</li>\n<li>Impact and crush resistant polymer construction</li>\n<li>Constant-curve internal geometry</li>\n<li>Anti-tilt, self-lubricating follower</li>\n<li>Long life USGI-SPEC stainless steel spring</li>\n<li>Transparent MagLevel windows</li>\n<li>Textured gripping surface</li>\n<li>Flared floorplate</li>\n</ul>\n<br>Magpul continues to grow and develop based on innovation, simplicity, and efficiency. At Magpul, mission driven requirements inform their product design, materials, and manufacturing, focusing on efficiency without sacrificing quality or performance.', NULL, 'https://www.primaryarms.com/magpul-pmag-30-ar15-m4-gen-m2-moe-window-5.56-nato-magazine-black-polymer', NULL, NULL, 15.95, 0.00, 0.00, 'https://www.primaryarms.com/magpul-pmag-30-ar15-m4-gen-m2-moe-window-5.56-nato-magazine-black-polymer', 'd07ba0ad07b8156a28e255922d11632c', 0, NULL, '2018-08-06 10:28:14', '2018-08-06 11:07:35'),
(410, 3, 'LANTAC Ultra Low Profile Gas Block - .750” - Set Screw', 'LANTAC USA manufactures the highest quality accessories for AR-15/M16 pattern rifles. Precision made in the U.S.A., rifles, muzzle brakes and more.<br><br>The GB750-S is designed to fit .750” gas seat diameter barrels and utilizes two set screws to secure the block in place. Gas port hole placed correctly at .295” from the shoulder. Includes (2) #10-32 X .125\'\' set screws and gas tube roll pin.<br><br><b>Features:</b><br><ul>\n<li>4140 gun barrel steel</li>\n<li>Black phosphate finish</li>\n<li>Laser engraved</li>\n<li>Ultra-low profile</li>\n<li>Gas seat diameter: .750\'\'</li>\n<li>Length: 0.875\'\'</li>\n<li>Weight: 1.2 oz</li>\n<li>Made in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/lantac-750-set-screw-lowpro-gas-block-la00243', NULL, NULL, 60.30, 0.00, 0.00, 'https://www.primaryarms.com/lantac-750-set-screw-lowpro-gas-block-la00243', '4e861c72940d49e4c34a5f20623f87d8', 0, NULL, '2018-08-06 10:28:14', '2018-08-06 11:07:39'),
(411, 3, 'Holosun 2 MOA Red Dot Sight - 65 MOA Circle', 'Holosun Technologies is committed to creating innovative optic, laser/IR technologies for a broad range of shooting, hunting, law enforcement, and military needs. Using quality manufacturing standards, they provide military grade optics without the military grade price.<br><br>The HS503GU-FDE is a compact red dot optic. The housing is designed to shroud the windage and elevation turrets on two sides and the battery compartment can be found on the side of the optic. Features a 2 MOA red dot surrounded by a 65 MOA circle, a 50,000 hour battery life on a single CR2032 coin battery, and Shake Awake technology, powering the optic on with slight movement.<br><br><b>Features:</b><br><ul>\n<li>2 MOA dot with 65 MOA circle</li>\n<li>1x magnification</li>\n<li>Unlimited field of view</li>\n<li>Parallax-free with unlimited eye relief</li>\n<li>Unaffected by extreme weather conditions</li>\n<li>Durable and reliable construction</li>\n<li>Low mount and 1/3 co-witness mount included</li>\n<li>Multi-coated lens</li>\n<li>Powered by (1) CR2032 battery</li>\n<li>50,000 hour runtime</li>\n<li>10 daylight and 2 NV compatible brightness settings</li>\n<li>6061 aluminum construction</li>\n<li>Click value: 0.5 MOA</li>\n<li>Windage and elevation travel range: ±50 MOA</li>\n<li>IP67 rated</li>\n<li>Shockproof up to 1000G</li>\n<li>Dimensions: 2.44\" x 1.18\" x 1.45\"</li>\n<li>Central height: 1.63\"</li>\n<li>Weight: 6.3 oz</li>\n</ul>', NULL, 'https://www.primaryarms.com/holosun-2-moa-red-dot-20-000-hr-battery-hs503gu', NULL, NULL, 241.49, 0.00, 0.00, 'https://www.primaryarms.com/holosun-2-moa-red-dot-20-000-hr-battery-hs503gu', '0d2c34ee94783d300019aee05cc1f0a8', 0, NULL, '2018-08-06 10:28:14', '2018-08-06 11:07:40'),
(412, 3, 'Holosun HS503GU-FDE 2 MOA Red Dot Sight - 65 MOA Circle - FDE', 'Holosun Technologies is committed to creating innovative optic, laser/IR technologies for a broad range of shooting, hunting, law enforcement, and military needs. Using quality manufacturing standards, they provide military grade optics without the military grade price.<br><br>The HS503GU-FDE is a compact red dot optic. The housing is designed to shroud the windage and elevation turrets on two sides and the battery compartment can be found on the side of the optic. Features a 2 MOA red dot surrounded by a 65 MOA circle, a 50,000 hour battery life on a single CR2032 coin battery, and Shake Awake technology, powering the optic on with slight movement.<br><br><b>Features:</b><br><ul>\n<li>2 MOA dot with 65 MOA circle</li>\n<li>1x magnification</li>\n<li>Unlimited field of view</li>\n<li>Parallax-free with unlimited eye relief</li>\n<li>Unaffected by extreme weather conditions</li>\n<li>Durable and reliable construction</li>\n<li>Low mount and 1/3 co-witness mount included</li>\n<li>Multi-coated lens</li>\n<li>Powered by (1) CR2032 battery</li>\n<li>50,000 hour runtime</li>\n<li>10 daylight and 2 NV compatible brightness settings</li>\n<li>6061 aluminum construction</li>\n<li>Click value: 0.5 MOA</li>\n<li>Windage and elevation travel range: ±50 MOA</li>\n<li>IP67 rated</li>\n<li>Shockproof up to 1000G</li>\n<li>Dimensions: 2.44\" x 1.18\" x 1.45\"</li>\n<li>Central height: 1.63\"</li>\n<li>Weight: 6.3 oz</li>\n</ul>\n<br><br>', NULL, 'https://www.primaryarms.com/holosun-503-elite-red-circle-dot-hs503gu-fde', NULL, NULL, 241.49, 0.00, 0.00, 'https://www.primaryarms.com/holosun-503-elite-red-circle-dot-hs503gu-fde', '6437130fbc399d6f4544b705a283fc8f', 0, NULL, '2018-08-06 10:28:14', '2018-08-06 11:07:43'),
(413, 3, 'Diamondhead USA 10.25\" VRS T-556 KeyMod Handguard', 'Diamondhead USA is a leading design innovator, manufacturer, and distributor of top quality accessories for the tactical weapons industry.<br><br>The VRS T-556 KeyMod Freefloat Handguard offers an uninterrupted Picatinny top rail for optics or other accessories. KeyMod slots available at the 3, 6, and 9-o’clock along the rail, provide many more locations for your favorite gear.<br><br>With tough 6061 aluminum construction protected by an anodized finish, this rail installs easily with the included hardware. Sturdy and lightweight, the rounded edges of this triangular shaped rail rest comfortably in hand. Designed to improve accuracy and provide exceptional airflow for a cooler barrel.<br><br><b>NOTE: Some heavy barrels may have compatibility issues with the proprietary Diamondhead VRS barrel nut.</b><br><br><b>Features:</b><br><ul>\n<li>Proprietary barrel nut included</li>\n<li>Freefloat design</li>\n<li>Comfortable triangular shape<br>\n</li>\n<li>KeyMod compatible</li>\n<li>Uninterrupted Picatinny rail</li>\n<li>Proprietary clamping system for rigid, secure attachment</li>\n<li>MIL-SPEC Type III hardcoat anodized</li>\n<li>6061 aluminum construction</li>\n</ul>', NULL, 'https://www.primaryarms.com/Diamondhead-USA-10.25-VRS-T-KeyMod-Rail-2215', NULL, NULL, 159.77, 69.99, 89.78, 'https://www.primaryarms.com/Diamondhead-USA-10.25-VRS-T-KeyMod-Rail-2215', 'a354095636281dd893d8e7005b38e1f2', 0, NULL, '2018-08-06 10:28:14', '2018-08-06 11:07:47'),
(414, 3, 'Magpul PMAG 10 GL9 Magazine - Glock 19', 'Magpul continues to grow and develop based on innovation, simplicity, and efficiency. At Magpul, mission driven requirements inform their product design, materials, and manufacturing, focusing on efficiency without sacrificing quality or performance.<br><br>The PMAG 10 GL9 Magazine is the highest performing and most reliable restricted capacity magazine on the market. They are designed to provide quality and performance while satisfying requirements where a 10-round capacity restriction is imposed. This mag utilizes the same double stack feed geometry as the standard capacity PMAG GL9 to ensure proper feeding. Whether for competitive use or otherwise, the PMAG 10 GL9 is the highest quality restricted capacity magazine option available.<br><br><b>NOTE: May not be compatible with other platforms designed for use with Glock magazines due to a wide range of magwell designs and tolerances.</b><br><b><br></b><br><b>Features:</b><br><ul>\n<li>Compatible with all compact and sub-compact 9mm Glock handguns</li>\n<li>Compatible with Magpul GL-L Plates for competition use</li>\n<li>Meets regulatory requirements in capacity restricted locations</li>\n<li>Easy disassembly and reassembly for routine maintenance</li>\n<li>Durable, lightweight and extremely stiff polymer construction</li>\n<li>High visibility controlled-tilt follower</li>\n<li>Long life stainless steel spring for corrosion resistance</li>\n<li>Dot matrix panel for magazine marking and identification</li>\n<li>Drops free when loaded or empty</li>\n</ul>', NULL, 'https://www.primaryarms.com/magpul-10-round-gl9-pmag-for-glock-19-mag907-blk', NULL, NULL, 15.95, 0.00, 0.00, 'https://www.primaryarms.com/magpul-10-round-gl9-pmag-for-glock-19-mag907-blk', 'c646e27e688dd8e11eebb9e63fcdc5e3', 0, NULL, '2018-08-06 10:28:14', '2018-08-06 11:07:50'),
(415, 3, 'LANTAC Enhanced .308 Bolt Carrier Group', 'LANTAC USA manufactures the highest quality accessories for AR-15/M16 pattern rifles. Precision made in the U.S.A., rifles, muzzle brakes and more.<br><br>The Enhanced .308 Bolt Carrier Group is precision machined from 8620 Steel with a 9310 precision hard ground bolt. The entire carrier assembly is electroless nickel boron coated for lubricity and corrosion resistance.<br><br>The carrier design features forward facing gas ports which offers a smoother energy pulse and a system that runs cooler and cleaner with less pressurization of the upper receiver when running a suppressed barrel. The flared boss at the tail of the carrier provides a more consistent lock position within the upper receiver while its 1 lb 2.1 oz weight helps to increase lock time.<br><br>The included Domed Cam Pin is machined from 17-4 PH stainless steel, hardened to H900, polished, and finished in its natural hardened coppery state. The circular head has a flat face machined so that it may be inserted into any bolt carrier without removing the gas key. Two further flats are machined at 90 degrees to the front face, minimizing internal wear to the cam channel.<br><br><b>Features:</b><br><ul>\n<li>DPMS pattern</li>\n<li>NiB UCT EXO coating</li>\n<li>Heat treated 8620 steel carrier</li>\n<li>Hard turned 9310 steel bolt</li>\n<li>Bolt magnetic particle inspected</li>\n<li>CP-R360 domed cam pin</li>\n<li>Forward porting with enlarged vents</li>\n<li>Balanced flared boss</li>\n<li>MIL-SPEC gas rings</li>\n<li>MIL-SPEC staked gas key</li>\n<li>Grade 8 hardened fasteners</li>\n<li>MIL-SPEC chrome lined carrier bore and gas key</li>\n<li>Lifetime warranty</li>\n<li>Weight: 1 lb 2.1 oz</li>\n<li>Made in the U.S.A. </li>\n</ul>', NULL, 'https://www.primaryarms.com/lantac-enhanced-308-bolt-carrier-group-la00300', NULL, NULL, 327.75, 0.00, 0.00, 'https://www.primaryarms.com/lantac-enhanced-308-bolt-carrier-group-la00300', '006c7c8889ae82b517119959c47cf2db', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:07:51'),
(416, 3, 'Holosun Paralow Compact Solar Power 2 MOA Circle Dot Sight with Flip Cap', 'Extremely compact, solar powered, and factory outfitted with flip caps, the Paralow 515C is one of the most exciting new optics from Holosun! The low profile design has moved the controls to the right side of the optic allowing the installation of a top-mounted solar panel that helps extend the estimated battery life to an unprecedented 50,000 hours. The circle dot reticle allows for precise fire as well as wicked fast target acquisition with the 65 MOA circle! Perfectly suited for shotguns, handguns, and rifles, the Paralow HS515C includes two QD risers, the low base for AKs and other low applications and an AR-height base ready to be matched up with a magnifier!<br><br><p style=\"margin-top: 0px; margin-bottom: 20px; background-color: rgb(255, 255, 255);\"><b><font face=\"times new roman\">Features</font></b></p>\n<ul style=\"background-color: rgb(255, 255, 255);\">\n<li><font face=\"times new roman\">Parallax free with unlimited eye relief.</font></li>\n<li><font face=\"times new roman\">Minimize vision obstruction with push button controls and streamlined housing design.</font></li>\n<li><font face=\"times new roman\">Solar and battery power supplies.</font></li>\n<li><font face=\"times new roman\">Switch between circle dot and red dot reticles.</font></li>\n<li><font face=\"times new roman\">Kill flash included.</font></li>\n<li><font face=\"times new roman\">Battery tray.</font></li>\n<li><font face=\"times new roman\">Flip-up lens covers won\'t obstruct your vision.</font></li>\n<li><font face=\"times new roman\">1/3 Co-witness QR mount included</font></li>\n<li><font face=\"times new roman\">Quick release mount.  Adaptable to Picatinny.</font></li>\n<li><font face=\"times new roman\">CNC machining with T6061-T6 aluminum housing.</font></li>\n</ul>', NULL, 'https://www.primaryarms.com/holosun-paralow-compact-solar-power-circle-dot-sight-with-flip-cap-hs515c-hs515c', NULL, NULL, 259.77, 207.82, 51.95, 'https://www.primaryarms.com/holosun-paralow-compact-solar-power-circle-dot-sight-with-flip-cap-hs515c-hs515c', '4447ace14d46c61551ccac83af9a5e24', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:07:54'),
(417, 3, 'Magpul PMAG 10 GL9 Magazine - Glock 17', 'Magpul continues to grow and develop based on innovation, simplicity, and efficiency. At Magpul, mission driven requirements inform their product design, materials, and manufacturing, focusing on efficiency without sacrificing quality or performance.<br><br>The PMAG 10 GL9 Magazine is the highest performing and most reliable restricted capacity magazine on the market. They are designed to provide quality and performance while satisfying requirements where a 10-round capacity restriction is imposed. This mag utilizes the same double stack feed geometry as the standard capacity PMAG GL9 to ensure proper feeding. Whether for competitive use or otherwise, the PMAG 10 GL9 is the highest quality restricted capacity magazine option available.<br><br><b>NOTE: May not be compatible with other platforms designed for use with Glock magazines due to a wide range of magwell designs and tolerances.</b><br><b><br></b><br><b>Features:</b><br><ul>\n<li>Compatible with all standard, compact and sub-compact 9mm Glock handguns</li>\n<li>Compatible with Magpul GL-L Plates for competition use</li>\n<li>Meets regulatory requirements in capacity restricted locations</li>\n<li>Easy disassembly and reassembly for routine maintenance</li>\n<li>Durable, lightweight and extremely stiff polymer construction</li>\n<li>High visibility controlled-tilt follower</li>\n<li>Long life stainless steel spring for corrosion resistance</li>\n<li>Dot matrix panel for magazine marking and identification</li>\n<li>Drops free when loaded or empty</li>\n</ul>', NULL, 'https://www.primaryarms.com/magpul-10-round-gl9-pmag-for-glock-17-mag801-blk', NULL, NULL, 15.95, 0.00, 0.00, 'https://www.primaryarms.com/magpul-10-round-gl9-pmag-for-glock-17-mag801-blk', '7a54f9298188ac0739e875521ee98694', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:07:56'),
(418, 3, 'FailZero EXO Coated M16 Bolt Carrier Group', 'Not all Nickel Boron is created equal and FailZero is the undisputed pioneer of Nickel Boron technology. When failure is not an option, you can depend on FailZero.<br><br>The M16 Bolt Carrier Group is fully assembled and drop-in ready for most MIL-SPEC upper receivers. All critical parts are coated with EXO Nickel Boron technology providing permanent dry lubricity, extreme durability and increased wear and corrosion resistance. This patented Nickel Boron coating will reduce friction and improve the overall performance of your rifle.<br><br><b>NOTE: BCG may ship with either a dark FailZero logo or a subdued lasered FailZero logo.</b><br><b><br></b><br><b>Features:</b><br><ul>\n<li>M16 cut carrier</li>\n<li>Magnetic particle inspected</li>\n<li>Live fire tested</li>\n<li><b>EXO Nickel Boron treated parts include:</b></li>\n<li>Bolt, extractor, bolt carrier, cam pin, carrier key, and firing pin</li>\n</ul>', NULL, 'https://www.primaryarms.com/failzero-exo-coated-m16-cut-complete-bolt-carrier-group-009-fzm16-4-01-nh', NULL, NULL, 159.99, 0.00, 0.00, 'https://www.primaryarms.com/failzero-exo-coated-m16-cut-complete-bolt-carrier-group-009-fzm16-4-01-nh', 'cbea452d16adf541c305294fa827d10b', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:07:57'),
(419, 3, 'Bear Creek Arsenal 6.5 Grendel Type II Bolt Carrier Group', 'Bear Creek Arsenal products complete their entire production cycle at their Sanford, North Carolina facilities. Drilling, reaming, rifling, and turning are all performed on CNC machines under ISO-9002 Quality Systems, allowing Bear Creek to precisely control each step of manufacturing. Careful inspection ensures each component meets their stringent standards before shipping.<br><br>The Bear Creek Arsenal 6.5 Grendel Type II Bolt Carrier Group has been magnetic particle inspected for quality assurance against defects. Perfect for your next 6.5 Grendel build.<br><br><b>Safety Note: Choosing 6.5 Grendel comes with an added complication. There are “Type I” and “Type II” bolt/barrel specifications out there, and you CAN NOT mix and match parts for each of them without risk of damage and/or injury. Type II is by far the most popular configuration, but pay attention to what you are buying! A Type I bolt won’t chamber rounds in a Type II barrel at all. Even worse, a Type II bolt mated to a Type I barrel will create excessive headspace and result in a rifle that is dangerous to fire.</b><br><br><b>Features:</b><br><ul>\n<li>Caliber: 6.5 Grendel Type II<br>\n</li>\n<li>Carrier style: M16 / Full Auto<br>\n</li>\n<li>Platform: AR-15 </li>\n<li>Parkerized bolt finish</li>\n<li>Bolt material: 9310 steel </li>\n<li>Black nitride carrier finish </li>\n<li>Staked gas key</li>\n</ul>', NULL, 'https://www.primaryarms.com/bear-creek-arsenal-6.5-grendel-bolt-carrier-group-bcg65-15', NULL, NULL, 77.99, 69.99, 8.00, 'https://www.primaryarms.com/bear-creek-arsenal-6.5-grendel-bolt-carrier-group-bcg65-15', '60898eb7704f3de978ad366a5adc8f56', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:07:58');
