(420, 3, 'Diamondhead USA 8.75\" VRS T-556 KeyMod Handguard', 'Diamondhead USA is a leading design innovator, manufacturer, and distributor of top quality accessories for the tactical weapons industry.<br><br>The VRS T-556 KeyMod Freefloat Handguard offers an uninterrupted Picatinny top rail for optics or other accessories. KeyMod slots available at the 3, 6, and 9-o’clock along the rail, provide many more locations for your favorite gear.<br><br>With tough 6061 aluminum construction protected by an anodized finish, this rail installs easily with the included hardware. Sturdy and lightweight, the rounded edges of this triangular shaped rail rest comfortably in hand. Designed to improve accuracy and provide exceptional airflow for a cooler barrel.<br><br><b>NOTE: Some heavy barrels may have compatibility issues with the proprietary Diamondhead VRS barrel nut.</b><br><br><b>Features:</b><br><ul>\n<li>Proprietary barrel nut included</li>\n<li>Freefloat design</li>\n<li>Comfortable triangular shape<br>\n</li>\n<li>KeyMod compatible</li>\n<li>Uninterrupted Picatinny rail</li>\n<li>Proprietary clamping system for rigid, secure attachment</li>\n<li>MIL-SPEC Type III hardcoat anodized</li>\n<li>6061 aluminum construction</li>\n</ul>', NULL, 'https://www.primaryarms.com/diamondhead-usa-8-75in-vrs-t-keymod-free-float-ar-15-handguard', NULL, NULL, 150.77, 69.99, 80.78, 'https://www.primaryarms.com/diamondhead-usa-8-75in-vrs-t-keymod-free-float-ar-15-handguard', 'ac431b38895424c76fbfab70910e4113', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:07:59'),
(421, 3, 'Diamondhead USA 13.5\" VRS T-556 KeyMod Handguard', 'Diamondhead USA is a leading design innovator, manufacturer, and distributor of top quality accessories for the tactical weapons industry.<br><br>The VRS T-556 KeyMod Freefloat Handguard offers an uninterrupted Picatinny top rail for optics or other accessories. KeyMod slots available at the 3, 6, and 9-o’clock along the rail, provide many more locations for your favorite gear.<br><br>With tough 6061 aluminum construction protected by an anodized finish, this rail installs easily with the included hardware. Sturdy and lightweight, the rounded edges of this triangular shaped rail rest comfortably in hand. Designed to improve accuracy and provide exceptional airflow for a cooler barrel.<br><br><b>NOTE: Some heavy barrels may have compatibility issues with the proprietary Diamondhead VRS barrel nut.</b><br><br><b>Features:</b><br><ul>\n<li>Proprietary barrel nut included</li>\n<li>Freefloat design</li>\n<li>Comfortable triangular shape<br>\n</li>\n<li>KeyMod compatible</li>\n<li>Uninterrupted Picatinny rail</li>\n<li>Proprietary clamping system for rigid, secure attachment</li>\n<li>MIL-SPEC Type III hardcoat anodized</li>\n<li>6061 aluminum construction</li>\n</ul>', NULL, 'https://www.primaryarms.com/Diamondhead-USA-13.5-VRS-T-KeyMod-Rail-2235', NULL, NULL, 178.77, 69.99, 108.78, 'https://www.primaryarms.com/Diamondhead-USA-13.5-VRS-T-KeyMod-Rail-2235', '5b5f1b8740c0944bdef5abdabcf13aa5', 1, NULL, '2018-08-06 10:28:15', '2018-08-06 11:08:01'),
(422, 3, 'Bear Creek Arsenal 16\", 1:8, 300BLK Heavy Barrel with Pistol gas system, Nitride finish', 'This high quality Bear Creek Arsenal barrel goes through its entire production life in Sanford, North Carolina at Bear Creek\'s facilities. Drilling, reaming, rifling, and turning are all accomplished on their CNC machines under ISO-9002 Quality Systems, allowing Bear Creek to put every barrel through a 100% inspection and air gauging process, ensuring every individual barrel is flawless before it leaves their facilities.<br><br>This 16\", 1:8 twist, heavy contour barrel is machined from 41V50 chromoly vanadium steel, heat treated to RC 28-32 hardness, properly stress relieve, and treated with a highly corrosion resistant Salt Bath Nitride finish inside and out. Chambered for .300 BLK, BCA expects that it, along with any of their barrels 16\" or longer, will hold a 1.000 MOA group at 100 yards when used with appropriate ammo and shooting techniques.<br><br>Gas Port: Pistol, 0.076\"<br>', NULL, 'https://www.primaryarms.com/B300PHB1618M', NULL, NULL, 89.99, 64.99, 25.00, 'https://www.primaryarms.com/B300PHB1618M', 'fe45d7ae185a47507b9bcb09790d56aa', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:08:02'),
(423, 3, 'Troy Medieval AR-15 Flash Suppressor 5.56 NATO / .223', 'The Troy Medieval Flash Suppressor effectively mitigates muzzle flash, allowing the shooter to better maintain focus on the target. The aggressive diamond-shaped teeth can serve as an improvised breaching device or for close quarter battle. Not only is it effective as a flash hider, but it also works as a muzzle brake by redirecting excess gas to keep the muzzle of your AR-15 rifle from rising after every shot. It is made from durable, heat treated steel so that it won\'t bend or break when used as a breaching device. This muzzle device is a great addition to your 5.56 AR carbine that won\'t fail you under any circumstance.<br><br><b>Features:</b><br><ul>\n<li>Thread pattern: 1/2x28</li>\n<li>Overall length: 2.25\"</li>\n<li>Heat-treated ordinance steel construction</li>\n<li>Effective as a flash hider and muzzle brake</li>\n<li>Post ban compliant when permanently attached</li>\n</ul>\n<br>Troy Industries is the choice of professionals the world over. Made in the U.S.A., Troy products are reliable, innovative, and made from the finest quality materials. When lives are on the line, you can count on Troy Industries.', NULL, 'https://www.primaryarms.com/troy-medieval-ar15-flash-suppressor-5-56-nato-223', NULL, NULL, 44.99, 19.99, 25.00, 'https://www.primaryarms.com/troy-medieval-ar15-flash-suppressor-5-56-nato-223', '7374c64887ca37a364e3ae855525dee5', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:08:03'),
(424, 3, 'CMC AR-15/AR-10 Drop-In Single Stage 3.5lb Flat Trigger Mil-Spec .154\"', 'Assembling an AR-15 for the most part is pretty simple; however, some aspects of the process can be frustrating such as installing the takedown detent and spring or trying to put the trigger together. CMC Triggers saw a need to improve on the AR15 trigger installation process and introduced their line of completely self-contained trigger groups. Each trigger is encased in 8620 alloy steel to protect the internal components from dirt and debris, carbon buildup, or anything else that might get into the lower receiver and can be installed in seconds. Just drop it in, install the Mil-Spec trigger pins and you are ready to go. They have a huge selection of triggers that are built for specific applications and preferences. This model is designed for target shooting, home defense, and hunting as it has a light trigger pull to improve accuracy without sacrificing reliability or safety. Install this fire control group today and experience a smooth trigger pull like never before.<br><br><b>Features:</b><br><ul>\n<li>Compatible with AR-15 and AR-10 rifles</li>\n<li>Installs with Mil-Spec .154” trigger pins</li>\n<li>Single stage 3.5lb trigger pull</li>\n<li>Non-adjustable flat trigger bow for improved trigger control</li>\n<li>Tactile and short reset</li>\n<li>Minimal lock time with lightened hammer and full power Rocket Wire spring</li>\n<li>Drop-in, one-piece design made from 8620 alloy steel</li>\n<li>100% Manufacturers Lifetime Warranty!</li>\n</ul>\n<br><b>Note: Trigger pull weights are approximate and may vary between rifles</b><br><br>The CMC Single Stage trigger features a non-adjustable flat trigger bow with a 3.5lb pull that breaks like glass. It has almost no take-up and extremely short reset to make follow up shots fast and easy. The flat trigger increases the surface area that your finger rests on giving you increased control and leverage when pulling the trigger. The hammer is lightened and uses a high-power Rocket Wire spring that ensures reliability with commercial and surplus ammunition. The high-power spring also results in minimal lock time, which is the time it takes for the hammer to fall and strike the primer, resulting in much more accurate shots. CMC Triggers have invested in a new production and tooling setup that incorporates advanced techniques that help to reduce manufacture time and cost while still providing you with a high quality, reliable trigger that is affordable.<br><br>With roots in aerospace manufacturing, CMC is perhaps best known as the producer of the original drop-in precision trigger for the AR-15/10 platform. CMC Triggers are dedicated to crafting the finest parts and accessories for law enforcement, military, and civilian use.', NULL, 'https://www.primaryarms.com/cmc-ar-15-ar10-drop-in-single-stage-3.5lb-flat-trigger-mil-spec-.145in', NULL, NULL, 167.99, 125.99, 42.00, 'https://www.primaryarms.com/cmc-ar-15-ar10-drop-in-single-stage-3.5lb-flat-trigger-mil-spec-.145in', '0775493c743ef1b6fc0ec8e152cb7736', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:08:04'),
(425, 3, 'Streamlight ProTac 1L-1AA 350 Lumen Dual Fuel Tactical Flashlight', 'The Streamlight ProTac 1L-1AA brings 350 lumens of bright light in a compact size perfect for every day carry. Add TEN-TAP programming, dual-fuel capability, and a handy multi-purpose clip, along with the reliability and durability you expect of the ProTac line and it\'s easy to see it becoming your new favorite EDC light. <br><br><b>Features:</b><br><ul>\n<li>Bright 6,400 candela beam reaches out to almost 175 yards</li>\n<li>Multi-function tail cap</li>\n<li>TEN-TAP programming</li>\n<li>Strobe feature (that can be disabled)</li>\n<li>Powered by your choice of a CR123A lithium battery or a AA lithium or alkaline battery.</li>\n<li>IPX7 water proof to 1 meter for thirty minutes and impact tested to 2 meters</li>\n<li>Durable aluminum body with anodized finish</li>\n<li>Compact size at just 4.25\" and 2.5 oz (2.8 oz with AA)</li>\n<li>Limited lifetime warranty through Streamlight</li>\n<li>RoHS compliant</li>\n</ul>\n<br><b>Modes: (CR123A Lithium)</b><br><ul>\n<li><b>White LED</b></li>\n<li>\n<i>High</i> - 6,400 candela - 350 lumens - 1.5 hours runtime</li>\n<li>\n<i>Low</i> - 720 candela - 40 lumens - 14 hours runtime</li>\n<li>\n<i>Strobe</i> - 6,400 candela - 350 lumens - 3 hours runtime</li>\n</ul>\n<br><b>Modes: (AA Alkaline/Lithium)</b><br><ul>\n<li><b>White LED</b></li>\n<li>\n<i>High</i> - 2,750 candela - 150 lumens - 4.25 hours runtime (lithium) or 1.33 hours (alkaline)</li>\n<li>\n<i>Low</i> - 720 candela - 40 lumens - 14 hours runtime (lithium) or 7.5 hours (alkaline)</li>\n<li>\n<i>Strobe</i> - 2,750 candela - 150 lumens - 8 hours runtime (lithium) or 3.5 hours (alkaline)</li>\n</ul>\n<br><b>Programs:</b><br><ul>\n<li>High / Strobe / Low (Factory Default)</li>\n<li>High only</li>\n<li>Low / High  (Strobe disabled)</li>\n</ul>', NULL, 'https://www.primaryarms.com/streamlight-protac-1l-1aa-tactical-light-350-lumens-dual-fuel-flashlight', NULL, NULL, 67.99, 29.99, 38.00, 'https://www.primaryarms.com/streamlight-protac-1l-1aa-tactical-light-350-lumens-dual-fuel-flashlight', 'b6b0cadb75f19527ea99eb8049d72001', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:08:06'),
(426, 3, 'Bravo Company Manufacturing 5.5\" M-LOK Rail Panel Kit - 5 Pack - Black', 'Bravo Company Manufacturing M-LOK Rail Panels offer an aggressive, non-slip, anti-reflective surface, ventilated for cooling. Ultra-slim rounded surface allows a ‘round’ handguard feeling from an octagonal profile. Each strip is designed to fit all M-LOK mounting surfaces with 4 consecutive M-LOK slots, though each may be cut to any length.<br><br><b>Features:</b><br><ul>\n<li>Contains 5 matching color M-LOK panel strips</li>\n<li>High-strength polymer material</li>\n<li>Install in either direction</li>\n<li>Length: 5.550”</li>\n<li>Width: 0.625”</li>\n<li>Thickness: 0.100”</li>\n<li>Made in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/bcm-gunfighter-5-5-mlok-panel-kit-5-pack-bcm-mmr-rp-blk-5', NULL, NULL, 9.95, 0.00, 0.00, 'https://www.primaryarms.com/bcm-gunfighter-5-5-mlok-panel-kit-5-pack-bcm-mmr-rp-blk-5', '8cf338c3d8010dbc8ea058b4693de08e', 1, NULL, '2018-08-06 10:28:15', '2018-08-06 11:08:07'),
(427, 3, 'Bear Creek Arsenal 16\" 6.5 Grendel Type II M4 Contour 1:8 Carbine 416R Barrel - Stainless', 'This high quality Bear Creek Arsenal barrel goes through its entire production life in Sanford, North Carolina at Bear Creek\'s facilities. Drilling, reaming, rifling, and turning are all accomplished on their CNC machines under ISO-9002 Quality Systems, allowing Bear Creek to put every barrel through a 100% inspection and air gauging process, ensuring every individual barrel is flawless before it leaves their facilities.<br><br>This 16\", 1:8 twist, M4 contour barrel is machined from 416R stainless steel, heat treated to RC 28-32 hardness, and properly stress relieved. Chambered for 6.5 Grendel Type II, BCA expects that it, along with any of their barrels 16\" or longer, will hold a 1.000 MOA group at 100 yards when used with appropriate ammo and shooting techniques.<br><br>Gas Port: Carbine, 0.072\"<br><br><b>Safety Note: Choosing 6.5 Grendel comes with an added complication. There are “Type I” and “Type II” bolt/barrel specifications out there, and you CAN NOT mix and match parts for each of them without risk of damage and/or injury. Type II is by far the most popular configuration, but pay attention to what you are buying! A Type I bolt won’t chamber rounds in a Type II barrel at all. Even worse, a Type II bolt mated to a Type I barrel will create excessive headspace and result in a rifle that is dangerous to fire.</b>', NULL, 'https://www.primaryarms.com/B6-5CM41618-SS', NULL, NULL, 96.99, 54.99, 42.00, 'https://www.primaryarms.com/B6-5CM41618-SS', '07cffd96ffa6f37509bbc60bc48d9fae', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:08:08'),
(428, 3, 'Bear Creek Arsenal 16\" .223 Wylde 1:9 Carbine Length Government Contour AR-15 Barrel - Parkerized', 'Bear Creek Arsenal products complete their entire production cycle at their Sanford, North Carolina facilities. Drilling, reaming, rifling, and turning are all performed on CNC machines under ISO-9002 Quality Systems, allowing Bear Creek to precisely control each step of manufacturing. Careful inspection ensures each barrel meets their stringent standards before shipping.<br><br>This barrel is machined from 4150 chrome moly vanadium steel, heat treated to RC 28-32 hardness, properly stress relieved, and Parkerized for a corrosion resistant finish. BCA guarantees 1 MOA groups at 100 yards when observing proper shooting techniques and using high quality ammunition.<br><br><b>NOTE: Bear Creek Arsenal does <u>not</u> recommend using steel cased ammo in their assemblies or rifles.</b><br><b><br></b><br><b>Features:</b><br><ul>\n<li>Chambered in .223 Wylde with a 1:9 twist rate</li>\n<li>4150 chrome moly vanadium steel barrel with a Parkerized finish</li>\n<li>Govt. contour</li>\n<li>Carbine length gas system</li>\n<li>1/2x28 thread pitch</li>\n<li>0.750” gas seat diameter</li>\n<li>M4 feed ramps</li>\n<li>Weight: 2.5 lbs</li>\n</ul>', NULL, 'https://www.primaryarms.com/bear-creek-arsenal-16in-223-wylde-mid-length-government-ar-15-barrel-b223wcgvnt1619-p', NULL, NULL, 90.77, 53.99, 36.78, 'https://www.primaryarms.com/bear-creek-arsenal-16in-223-wylde-mid-length-government-ar-15-barrel-b223wcgvnt1619-p', 'c03a612bb15e7427d2cf1b647140d0a3', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:08:09'),
(429, 3, 'Spike\'s Tactical AR-15 Standard Lower Parts Kit with Single Stage Trigger', 'Spike\'s Tactical set out to offer the best factory lower parts kit on the market! The lower parts kit they came up with exceeds military specifications by a long shot, they also have a much better fit, and finish! 100% made in the U.S.A. with a lifetime warranty.<br><br><b>Kit includes:</b><br><ul>\n<li>Rounded hammer and hammer spring (works with all calibers).</li>\n<li>Trigger and trigger spring.</li>\n<li>Disconnector and disconnector spring.</li>\n<li>Stainless steel hammer and trigger pins with black oxide finish. </li>\n<li>Safety selector.</li>\n<li>Safety selector detent.</li>\n<li>Safety selector spring.</li>\n<li>Bolt catch.</li>\n<li>Bolt catch plunger.</li>\n<li>Bolt catch roll pin.</li>\n<li>Bolt catch spring.</li>\n<li>Magazine catch.</li>\n<li>Billet magazine catch button.</li>\n<li>Magazine catch spring.</li>\n<li>Pivot pin.</li>\n<li>Takedown pin.</li>\n<li>Takedown/pivot pin springs and detents.</li>\n<li>Aluminum trigger guard w/spring loaded detent.</li>\n<li>Trigger guard roll pin.</li>\n<li>Buffer retainer spring.</li>\n<li>Buffer retaining pin.</li>\n<li>Spike\'s Pro Grip.</li>\n<li>1/4x28 Allen grip screw.</li>\n<li>Star lock washer for grip screw.</li>\n</ul>', NULL, 'https://www.primaryarms.com/spikes-tactical-ar-15-lower-receiver-parts-kit-single-stage-trigger-slpk101', NULL, NULL, 71.96, 0.00, 0.00, 'https://www.primaryarms.com/spikes-tactical-ar-15-lower-receiver-parts-kit-single-stage-trigger-slpk101', 'dc43c37a23d2dda7c21b83e741f40784', 0, NULL, '2018-08-06 10:28:15', '2018-08-06 11:08:11'),
(430, 3, 'Bravo Company Manufacturing 5.5\" KeyMod Rail Panel Kit - 5 Pack - Black', 'Bravo Company Manufacturing KeyMod Rail Panels offer an aggressive, non-slip, anti-reflective surface, ventilated for cooling. Ultra-slim rounded surface allows a ‘round’ handguard feeling from an octagonal profile. Each strip is designed to fit all KeyMod mounting surfaces with 7 consecutive KeyMod slots, though each may be cut to any length.<br><br><b>Features:</b><br><ul>\n<li>Contains 5 matching color KeyMod panel strips</li>\n<li>High-strength polymer material</li>\n<li>Bi-directional locking tabs</li>\n<li>Length: 5.550”</li>\n<li>Width: 0.625”</li>\n<li>Thickness: 0.100”</li>\n<li>Made in the U.S.A.</li>\n</ul>\n<br>Expect nothing less than professional grade weaponry from Bravo Company USA, one of the nation’s largest stocking inventories of AR-15, M4, and M16 parts and accessories. Their products have been used by many United States law enforcement agencies, US Border Patrol, HQ SOCOM, US Army, US Navy, US Airforce, US Marines, US Coast Guard, and more. They believe in providing responsible citizens with the means to defend themselves and will continue to do so for many years to come.', NULL, 'https://www.primaryarms.com/bravo-company-5-5-keymod-rail-panel-kit-5-pack-black', NULL, NULL, 9.95, 0.00, 0.00, 'https://www.primaryarms.com/bravo-company-5-5-keymod-rail-panel-kit-5-pack-black', 'ebc2b4434cad92404feecb99b3ccfa0c', 1, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:12'),
(431, 3, 'Phase 5 Tactical Ambi-Battle Latch - Charging Handle - Red', 'Phase 5 builds the best equipment possible for dedicated professionals. Their components are designed to solve problems and help those who protect and defend us, using the best equipment possible. Every part and weapon they build is made in the U.S.A.<br><br>The Ambi Battle Latch/Charging Handle is structurally and functionally improvement over standard charging handles. This ambidextrous handle features tough 7075 aluminum construction, increased sidewall thickness, and an upgraded stainless coiled spring pin.<br><br><b>Features:<br></b><ul>\n<li>AR-15 compatible</li>\n<li>Ambidextrous design</li>\n<li>Broad contact points</li>\n<li>0.1874” diameter stainless steel coiled spring</li>\n<li>Increased sidewall thickness</li>\n<li>7075 aluminum construction</li>\n<li>Made in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/phase-5-tactical-ambilatch-ar15-charging-handle-abl-cha-red', NULL, NULL, 80.77, 29.99, 50.78, 'https://www.primaryarms.com/phase-5-tactical-ambilatch-ar15-charging-handle-abl-cha-red', 'e8ffa93ab4b1d886b27372392e9e6432', 1, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:13'),
(432, 3, 'Phase 5 Tactical Ambi-Battle Latch - Charging Handle - Black', 'Phase 5 builds the best equipment possible for dedicated professionals. Their components are designed to solve problems and help those who protect and defend us, using the best equipment possible. Every part and weapon they build is made in the U.S.A.<br><br>The Ambi Battle Latch/Charging Handle is structurally and functionally improvement over standard charging handles. This ambidextrous handle features tough 7075 aluminum construction, increased sidewall thickness, and an upgraded stainless coiled spring pin.<br><br><b>Features:<br></b><ul>\n<li>AR-15 compatible</li>\n<li>Ambidextrous design</li>\n<li>Broad contact points</li>\n<li>0.1874” diameter stainless steel coiled spring</li>\n<li>Increased sidewall thickness</li>\n<li>7075 aluminum construction</li>\n<li>Made in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/phase-5-tactical-ambi-battle-latch-charging-handle-black-abl-cha', NULL, NULL, 80.77, 29.99, 50.78, 'https://www.primaryarms.com/phase-5-tactical-ambi-battle-latch-charging-handle-black-abl-cha', '4887b90a38b28d45eecd6e3e24f014be', 1, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:14'),
(433, 3, 'CMC AR-15/AR-10 Drop-In Single Stage 3.5lb Curved Trigger Mil-Spec .154\"', 'Assembling an AR-15 for the most part is pretty simple; however, some aspects of the process can be frustrating such as installing the takedown detent and spring or trying to put the trigger together. CMC Triggers saw a need to improve on the AR15 trigger installation process and introduced their line of completely self-contained trigger groups. Each trigger is encased in 8620 alloy steel to protect the internal components from dirt and debris, carbon buildup, or anything else that might get into the lower receiver and can be installed in seconds. Just drop it in, install the Mil-Spec trigger pins and you are ready to go. They have a huge selection of triggers that are built for specific applications and preferences. This model is designed for target shooting, home defense, and hunting as it has a light trigger pull to improve accuracy without sacrificing reliability or safety. Install this fire control group today and experience a smooth trigger pull like never before.<br><br><b>Features:</b><br><ul>\n<li>Compatible with AR-15 and AR-10 rifles</li>\n<li>Installs with Mil-Spec .154” trigger pins</li>\n<li>Single stage 3.5lb trigger pull</li>\n<li>Non-adjustable curved trigger bow for improved trigger control</li>\n<li>Tactile and short reset</li>\n<li>Minimal lock time with lightened hammer and full power Rocket Wire spring</li>\n<li>Drop-in, one-piece design made from 8620 alloy steel</li>\n<li>100% Manufacturers Lifetime Warranty!</li>\n</ul>\n<b><b><br></b><br>Note: Trigger pull weights are approximate and may vary between rifles</b><br><br>The CMC Single Stage trigger features a non-adjustable curved trigger bow with a 3.5lb pull that breaks like glass. It has almost no take-up and extremely short reset to make follow up shots fast and easy. The curved trigger gives you improved trigger control and keeps your finger placement consistent. The hammer is lightened and uses a high-power Rocket Wire spring that ensures reliability with commercial and surplus ammunition. The high-power spring also results in minimal lock time, which is the time it takes for the hammer to fall and strike the primer, resulting in much more accurate shots. CMC Triggers have invested in a new production and tooling setup that incorporates advanced techniques that help to reduce manufacture time and cost while still providing you with a high quality, reliable trigger that is affordable.<br><br>With roots in aerospace manufacturing, CMC is perhaps best known as the producer of the original drop-in precision trigger for the AR-15/10 platform. CMC Triggers are dedicated to crafting the finest parts and accessories for law enforcement, military, and civilian use.', NULL, 'https://www.primaryarms.com/cmc-ar-15-ar-10-drop-in-single-stage-3.5lb-curved-trigger-mil-spec-.154in', NULL, NULL, 167.99, 125.99, 42.00, 'https://www.primaryarms.com/cmc-ar-15-ar-10-drop-in-single-stage-3.5lb-curved-trigger-mil-spec-.154in', 'a1249535aac49fee80b47a8fdb2ac0ad', 0, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:15'),
(434, 3, 'SIG Sauer SigTac SBX15 Pistol Stabilizing Brace Gen2 - Black', 'The SIG Sauer SBX Pistol Stabilizing Brace is an aid designed to improve the single-handed shooting performance of buffer tube equipped AR pistols. The SBX features a slim design with a thick strap for extra stability. This veteran designed and U.S. manufactured accessory enhances accuracy and reduces felt recoil when using an AR style pistol. Made from high quality elasto-polymer, the SBX is manufactured to close tolerances. It fits all pistols equipped with 1” - 1.2” diameter AR style buffer tubes. The brace uses your forearm to provide stable support, minimizing accuracy robbing spin and shift. A flexible cuff with two adjustable nylon straps provides a custom fit for the SBX.', NULL, 'https://www.primaryarms.com/sig-sauer-sigtac-sbx15-pistol-stabilizing-brace-gen2-balck-sbx-ar-blk', NULL, NULL, 139.00, 0.00, 0.00, 'https://www.primaryarms.com/sig-sauer-sigtac-sbx15-pistol-stabilizing-brace-gen2-balck-sbx-ar-blk', '469c1fafdf20b7893f01ef1d3cb0b3f2', 0, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:17'),
(435, 3, 'Bravo Company Manufacturing PNT Trigger Assembly', 'The Bravo Company Manufacturing PNT Trigger Assembly is precision machined from MIL-SPEC AISI8620 investment castings. The PNT then undergoes a 3-step heat treat and case hardening process for optimal grain structure alignment, yielding a stronger and more wear resistance product.<br><br>In another 3-step process, the hammer and trigger are finished. In the first step, polishing, the sear engagement surfaces are ground, then hand polished for increased smoothness and reduction in friction up to 300% beyond MIL-SPEC.<br><br>Next, an electroless nickel finish is applied for a smoother trigger pull with a crisp break. Nickel also provides a long-lasting finish that will not corrode, rust, or discolor due to oxidation.<br><br>Finally, Teflon particles are embedded in the nickel, further reducing the friction of the interface and ensuring a long-life for the coating.<br><br>This assembly includes BCM’s impact resistant trigger and hammer pins. They are centerless ground to a fine finish and superior tolerances to ensure compatibility with all MIL SPEC lower receivers.<br>The disconnector is stamped from 1070 steel, fine blanked for cleaner edges, and double disc ground to precise size. All hammer engagement surfaces are also ground for a super clean reset.', NULL, 'https://www.primaryarms.com/bravo-company-pnt-trigger-assembly-ar-15-bcm-pnt-ta1', NULL, NULL, 65.95, 0.00, 0.00, 'https://www.primaryarms.com/bravo-company-pnt-trigger-assembly-ar-15-bcm-pnt-ta1', 'a782f898bf2db546266753d764a6ca70', 0, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:18'),
(436, 3, 'Streamlight TLR-1 HL 800 Lumen Weapon Light', 'The Streamlight TLR-1 HL Rail Mounted Tactical Light is a virtually indestructible and intensely bright tactical light that attaches to nearly any weapon system in seconds. Perfectly sized for handguns or long guns, the TLR-1 HL is powered by two  CR123 batteries to provide a bright 800 lumens of light. Whether in the line of duty or simply protecting the homestead, you can trust the TLR-1 HL.<br><br><b>Features:</b><br><ul>\n<li>Bright 15000 candela peak beam intensity provides almost 270 yards of throw</li>\n<li>Deep dish parabolic reflector produces a concentrated long reaching beam with excellent peripheral light</li>\n<li>Strobe function can be enabled or disabled</li>\n<li>Powered by (2) CR123A batteries</li>\n<li>Ambidextrous toggle switch allows for momentary, constant, or strobe functions</li>\n<li>Durable aluminum body with MIL-SPEC anodized finish</li>\n<li>Mounting keys for Glocks, Picatinny, Beretta 90two, S&amp;W 99, and S&amp;W TSW rails</li>\n<li>Mounting system attaches and detaches quickly without placing hands before the muzzle</li>\n<li>IPX7 rated water proof to 1 meter for half an hour</li>\n<li>Weighs just 4.18 ounces</li>\n<li>Limited lifetime warranty</li>\n</ul>\n<br><br><b>Modes:</b><br><ul>\n<li><b>White LED</b></li>\n<li>\n<i>High</i> - 15000 candela - 800 lumens - 1.75 hours runtime</li>\n</ul>', NULL, 'https://www.primaryarms.com/streamlight-tlr-1-hl-tactical-light-black-stl69260', NULL, NULL, 119.99, 114.99, 5.00, 'https://www.primaryarms.com/streamlight-tlr-1-hl-tactical-light-black-stl69260', '10e0dc3c44f190005e60505d04f9e83b', 0, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:19'),
(437, 3, 'Strike Industries Sidewinder 45 Degree Offset BUIS', 'The SI Sidewinder is a backup iron sight that offers remarkable flexibility. This ambidextrous set may be configured for 45-degree offset or more conventional in-line use. Perfect as a short range offset backup sight for magnified optics or co-witnessing a red dot.<br><br>The SI-Ambush mounting system features a unique locking bar design that allows it to be lightweight and durable, while fitting neatly under optics and accessories.<br><br><b>Features:</b><br><ul>\n<li>SI-Ambush low profile mounting system</li>\n<li>Left or right 45-degree offset and conventional inline capabilities</li>\n<li>Tool-less dial adjustments for windage and elevation</li>\n<li>Steel and aircraft aluminum construction</li>\n<li>Weight: 3.4 oz</li>\n</ul>\n<br>Strike Industries products are designed by shooting experts for the shooting sportsman. They have anything from AR-15 parts and accessories to Glock components so you can completely customize your set up no matter what you run. Their complete line of innovative products come in a huge variety of colors and finishes so you can not only customize function, but personalize your look. You can’t go wrong with Strike Industries.', NULL, 'https://www.primaryarms.com/strike-industries-sidewinder-45-degree-offset-buis', NULL, NULL, 159.95, 0.00, 0.00, 'https://www.primaryarms.com/strike-industries-sidewinder-45-degree-offset-buis', '667ccf17648b5ec6e569834baf9bef7c', 0, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:20'),
(438, 3, 'Bravo Company Manufacturing 5.5\" M-LOK Rail Panel Kit - 5 Pack - Flat Dark Earth', 'Bravo Company Manufacturing M-LOK Rail Panels offer an aggressive, non-slip, anti-reflective surface, ventilated for cooling. Ultra-slim rounded surface allows a ‘round’ handguard feeling from an octagonal profile. Each strip is designed to fit all M-LOK mounting surfaces with 4 consecutive M-LOK slots, though each may be cut to any length.<br><br><b>Features:</b><br><ul>\n<li>Contains 5 matching color M-LOK panel strips</li>\n<li>High-strength polymer material</li>\n<li>Install in either direction</li>\n<li>Length: 5.550”</li>\n<li>Width: 0.625”</li>\n<li>Thickness: 0.100”</li>\n<li>Made in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/bcm-gunfighter-5-5-mlok-panel-kit-5-pack-bcm-mmr-rp-fde-5', NULL, NULL, 9.95, 0.00, 0.00, 'https://www.primaryarms.com/bcm-gunfighter-5-5-mlok-panel-kit-5-pack-bcm-mmr-rp-fde-5', '639621905c32b1a63672fd3eb1e9099f', 1, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:22'),
(439, 3, 'Magpul PMAG 30 AK74 MOE 5.45x39mm Magazine - Black', 'Magpul continues to grow and develop based on innovation, simplicity, and efficiency. At Magpul, mission driven requirements inform their product design, materials, and manufacturing, focusing on efficiency without sacrificing quality or performance.<br><br>The PMAG 30 AK74 MOE is an inexpensive, lightweight, dependable 30-round polymer magazine designed for Kalashnikov pattern rifles in 5.45x39mm (AK74, MPi-AK-74N, PA md. 86, and others).<br><br>It features a removable floorplate, constant curve geometry, and a high-reliability/low-friction follower for the affordable performance you expect from a MOE PMAG.<br><br><b>NOTE: Magazine counts as three US compliance parts for 922r.</b><br><br><b>Features:</b><br><ul>\n<li>Impact and crush resistant polymer body</li>\n<li>Constant-curve internal geometry</li>\n<li>Anti-tilt, self-lubricating follower</li>\n<li>Long life stainless steel spring</li>\n<li>Ribbed gripping surface and aggressive front and rear texture</li>\n<li>Paint pen dot matrix panels</li>\n<li>Flared floorplate</li>\n</ul>', NULL, 'https://www.primaryarms.com/magpul-ak74-moe-5-45x39-30rd-black-mag673-blk', NULL, NULL, 13.25, 0.00, 0.00, 'https://www.primaryarms.com/magpul-ak74-moe-5-45x39-30rd-black-mag673-blk', '921acb4576d76ea1fef91fdc90f04016', 0, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:23'),
(440, 3, 'Inforce APL Gen3 400 Lumen Pistol Light', 'The Inforce APL Gen3, now with 400 lumens of vibrant white light, the Gen3 APL provides a high-intensity tight beam to fill your field of view for close to mid-range target identification for up to 1.5 hours. At less than 3 ounces, the water-resistant, glass reinforced polymer body is incredibly powerful yet compact in size. Extensively tested, the APL integrates seamlessly with MIL-STD 1913 and Universal rails and offers constant and momentary operating modes, textured paddles for a non-slip grip, and an ambidextrous on/off switch to enable left or right-hand activation and natural movement from the weapon to the switch. In addition, the easy-to-operate lockout system ensures the light isn’t activated until you’re ready.<br><br><b>Features:</b><br><ul>\n<li>400 lumen output</li>\n<li>1.5 hour runtime</li>\n<li>Integrated MIL-STD-1913 and Universal Rails.</li>\n<li>Powered by (1) CR 123A battery</li>\n<li>Ambidextrous on/off switch</li>\n<li>Water resistant</li>\n<li>Length: 3.01”</li>\n<li>Width: 1.16”</li>\n<li>Bezel Diameter: 1.05”</li>\n<li>Weight: 2.95 oz</li>\n</ul>', NULL, 'https://www.primaryarms.com/inforce-apl-200-lumens-pistol-light-inf-apl-b-w_2', NULL, NULL, 140.00, 0.00, 0.00, 'https://www.primaryarms.com/inforce-apl-200-lumens-pistol-light-inf-apl-b-w_2', 'e03c1789dd61d550152ca54efbf608a8', 0, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:24'),
(441, 3, 'Strike Industries Venom Flash Hider - .308/7.62', 'Strike Industries products are designed by shooting experts for the shooting sportsman.<br><br>The Strike Industries Venom Flash Hider combines an aggressive and eye catching four-prong design with top-level flash suppressing performance to create one of the best flash hiders on the market. Capable of reducing muzzle flash by nearly 100%, the unique design quickly and efficiently disperses the burning gasses exploding from the barrel. Each of the four prongs ends with teeth that help to bring the over-all length of a 14.5\" barrel to the minimum 16\" requirements.<br><br><b>Features:</b><br><ul>\n<li>Effective four prong design almost entirely negates muzzle flash</li>\n<li>Aggressive, eye catching design</li>\n<li>Pre-drilled for permanent attachment to 14.5\" barrels to meet 16\" minimum</li>\n<li>Includes crush washer</li>\n<li>Weight: 3 oz</li>\n</ul>', NULL, 'https://www.primaryarms.com/strike-industries-venom-flash-hider-308-7-62-SI-VENOM-FH-308-7-62', NULL, NULL, 49.95, 0.00, 0.00, 'https://www.primaryarms.com/strike-industries-venom-flash-hider-308-7-62-SI-VENOM-FH-308-7-62', 'be663469716da51893976b195cf5ab8b', 0, NULL, '2018-08-06 10:28:16', '2018-08-06 11:08:25'),
(442, 3, 'Leapers UTG PRO Ops Ready S3 MIL-SPEC Stock - Black', 'The Leapers UTG PRO Ops Ready S3 MIL-SPEC stock is a heavy duty carbine stock for the AR platform. A lightweight, compact, and ergonomic design allows for improved weapon control and comfortable cheekweld. With multiple sling attachment points,  fully dehorned corners, and slightly increased length of pull make this an ideal stock for your next build.<br><br><b>Features:</b><br><ul>\n<li>Durable impact resistant polymer</li>\n<li>Multiple sling attachment points</li>\n<li>Lightweight, compact, and ergonomic design</li>\n<li>Fully dehorned and melted corners and edges</li>\n<li>Proudly designed and manufactured in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/utg-pro-model-4-ops-ready-s3-mil-spec-stock-black-rbus3bms', NULL, NULL, 32.97, 19.99, 12.98, 'https://www.primaryarms.com/utg-pro-model-4-ops-ready-s3-mil-spec-stock-black-rbus3bms', '2f0627a98135629f410eb90f3721b8bc', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:27'),
(443, 3, 'Bravo Company Manufacturing 5.5\" KeyMod Rail Panel Kit - 5 Pack - Flat Dark Earth', 'Bravo Company Manufacturing KeyMod Rail Panels offer an aggressive, non-slip, anti-reflective surface, ventilated for cooling. Ultra-slim rounded surface allows a ‘round’ handguard feeling from an octagonal profile. Each strip is designed to fit all KeyMod mounting surfaces with 7 consecutive KeyMod slots, though each may be cut to any length.<br><br><b>Features:</b><br><ul>\n<li>Contains 5 matching color KeyMod panel strips</li>\n<li>High-strength polymer material</li>\n<li>Bi-directional locking tabs<br>\n</li>\n<li>Length: 5.550”</li>\n<li>Width: 0.625”</li>\n<li>Thickness: 0.100”</li>\n<li>Made in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/bravo-company-5-5-keymod-rail-panel-kit-5-pack-flat-dark-earth-bcm-kmr-rp-fde-5', NULL, NULL, 9.95, 0.00, 0.00, 'https://www.primaryarms.com/bravo-company-5-5-keymod-rail-panel-kit-5-pack-flat-dark-earth-bcm-kmr-rp-fde-5', '7db98e76873e039f50b3454e06e42f36', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:28'),
(444, 3, 'Sightmark .223 Rem / 5.56 NATO Laser Boresight', 'The Chamber Laser Boresight gets you on target quickly without wasting a single round. Simply drop the boresight into your chamber like a standard cartridge, and the bright 632-650nm red laser will show you exactly where your rifle is aiming. When done, it ejects just like an empty casing, clearing your chamber allowing you to go straight to live fire, without the risks of forgetting a bore-mounted sight.<br><br>This compact laser boresight is designed for .223 Rem, .223 Wylde, and 5.56 NATO chambers, and includes carrying case, batteries, and instructions.<br><br><b>Features:</b><br><ul>\n<li>Compact and lightweight design fits in any range bag</li>\n<li>Powered by (3) AG3 batteries</li>\n<li>Designed to fit .223 and 5.56 chambers</li>\n<li>Tested and recommended by the National Tactical Officers Association</li>\n</ul>', NULL, 'https://www.primaryarms.com/sightmark-223-rem-5-56-nato-laser-boresight-sm39001', NULL, NULL, 29.97, 23.98, 5.99, 'https://www.primaryarms.com/sightmark-223-rem-5-56-nato-laser-boresight-sm39001', 'df14ca5518b1bd5f9915002adaf070df', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:29'),
(445, 3, 'Guntec USA AR-308 MIL-SPEC Buffer Tube Set', 'This Guntec USA Deluxe AR-15 Buffer Kit features a high strength T6 aluminum receiver extension with laser engraved position markings. A smooth chrome silicone carbine spring and shorty .308 carbine buffer work together to provide a soft and smooth shooting experience. As an added bonus, a dual-loop ambidextrous end plate compatible with popular sling attachments such as MASH Hooks, HK-style Snap hooks, and Magpul Paraclips.<br><br><br>MIL-SPEC diameter buffer tube for use with MIL-SPEC carbine stocks.', NULL, 'https://www.primaryarms.com/guntec-usa-ar10-milspec-buffer-tube-kit-miltubeset-308', NULL, NULL, 52.95, 39.99, 12.96, 'https://www.primaryarms.com/guntec-usa-ar10-milspec-buffer-tube-kit-miltubeset-308', 'f17d7c2071f2d4b7eb4961b348ad31cd', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:30'),
(446, 3, 'Vickers Tactical Glock Slide Stop', 'Get the optimal slide stop for your Glock handgun with the Vickers Tactical Slide Stop! Extensive testing and prototyping has resulted in the perfectly shaped and angled slide stop, ensuring positive lock back and release even with gloves. The angled design helps to reduce the risk of riding the slide release that can result in the slide not locking back on an empty magazine.<br><br> Fits Glock models 17, 17L, 18, 19, 21, 22, 23, 24, 25, 26, 27, 28, 31, 32, 33, 34, 45, and 41!', NULL, 'https://www.primaryarms.com/vickers-tactical-glock-slide-stop-vtss-001', NULL, NULL, 19.95, 15.99, 3.96, 'https://www.primaryarms.com/vickers-tactical-glock-slide-stop-vtss-001', 'f0137aa4788cf8d51932809f72214664', 1, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:31'),
(447, 3, 'WeaponTech AK47 Enhanced Bolt Hold Open Follower - 10 Pack', '<b>Ten pack!</b><br><br>The WeaponTech AK-47 Enhanced BHO Follower keeps the bolt open when the last round is fired, allowing for faster reloads without the guess work! Improve reliability and increase safety with this gunsmith-free upgrade for your AK magazines! Simply replace your factory followers for the WeaponTech Enhanced BHO Follower. It fits as a drop-in replacement for standard AK-47 metal and polymer magazines designed for 7.62x39. Not compatible with AK-74 magazines. <b>Note: Not compatible with Magpul AK Pmags.</b>', NULL, 'https://www.primaryarms.com/weapontech-ak47-enhanced-bolt-hold-open-follower-3-pack-afwtakf10', NULL, NULL, 39.99, 29.99, 10.00, 'https://www.primaryarms.com/weapontech-ak47-enhanced-bolt-hold-open-follower-3-pack-afwtakf10', 'f3f4db50fc198af35c04c6333c572a09', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:32'),
(448, 3, 'EDC Tactical AR-15 Billet Lower Receiver - S&W Red', 'EDC Tactical specializes in the custom design and manufacture of safe, high quality firearms and parts. They aim to be your first and last stop for firearms, parts, and accessories!<br><br>This AR-15 Billet Lower Receiver is machined to MIL-SPEC dimensions ensuring compatibility with the widest range of components on the market. Crafted from billet 6061-T6 aluminum, this receiver features a flared magwell, integrated trigger guard, and Cerakote finish.<br><br><b>Features:<br></b><ul>\n<li>Billet 6061-T6 aluminum</li>\n<li>Integrated trigger guard</li>\n<li>Flared magwell</li>\n<li>MIL-SPEC dimensions</li>\n<li>Cerakote finish</li>\n<li>Engraving on both sides for ambidextrous fire controls</li>\n<li>Machined and engraved in Richmond, Virginia U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/edc-tactical-ar15-billet-lower-edc-15-std-swr', NULL, NULL, 74.99, 59.99, 15.00, 'https://www.primaryarms.com/edc-tactical-ar15-billet-lower-edc-15-std-swr', '1e4ba9e3396fc1f4b4d4cbae4d2e7036', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:33'),
(449, 3, 'Streamlight TLR-1 HL 800 Lumen Tactical Weapon Light - Flat Dark Earth', 'The Streamlight TLR-1 HL Rail Mounted Tactical Light is a virtually indestructible and intensely bright tactical light that attaches to nearly any weapon system in seconds. Perfectly sized for handguns or long guns, the TLR-1 HL is powered by two  CR123 batteries to provide a bright 800 lumens of light. Whether in the line of duty or simply protecting the homestead, you can trust the TLR-1 HL.<br><br><b>Features:</b><br><ul>\n<li>Bright 15,000 candela peak beam intensity provides almost 270 yards of throw</li>\n<li>Deep dish parabolic reflector produces a concentrated long reaching beam with excellent peripheral light</li>\n<li>Strobe function can be enabled or disabled</li>\n<li>Powered by (2) CR123A batteries</li>\n<li>Ambidextrous toggle switch allows for momentary, constant, or strobe functions</li>\n<li>Durable aluminum body with MIL-SPEC anodized finish</li>\n<li>Mounting keys for Glocks, Picatinny, Beretta 90two, S&amp;W 99, and S&amp;W TSW rails</li>\n<li>Mounting system attaches and detaches quickly without placing hands before the muzzle</li>\n<li>IPX7 rated water proof to 1 meter for half an hour</li>\n<li>Weighs just 4.18 ounces</li>\n<li>Limited lifetime warranty</li>\n</ul>\n<br><br><b>Modes:</b><br><ul>\n<li><b>White LED</b></li>\n<li>\n<i>High</i> - 15,000 candela - 800 lumens - 1.75 hours runtime</li>\n<li>\n<i>Strobe - </i>15,000 candela - 800 lumens - 1.75 hours runtime</li>\n</ul>', NULL, 'https://www.primaryarms.com/streamlight-tlr-1-hl-weapon-light-flat-dark-earth-69266', NULL, NULL, 132.99, 114.99, 18.00, 'https://www.primaryarms.com/streamlight-tlr-1-hl-weapon-light-flat-dark-earth-69266', '532d47b9281356b2b19fc3101bb3f4b0', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:34'),
(450, 3, 'Anderson Manufacturing Low Profile Adjustable Gas Block - .750\" - Set Screw Style', 'Anderson Manufacturing builds rifles, pistols, and parts utilizing the latest in computerized manufacturing. By keeping manufacturing in house, Anderson can offer quality, American-made products at an affordable price, backed by a limited lifetime warranty.<br><br>The Anderson Manufacturing Low Profile Adjustable Gas Block is CNC machined from solid cold rolled steel. A slick salt bath nitride finish is applied for superior corrosion resistance.<br><br>Featuring twenty points of adjustment, the Anderson Manufacturing Adjustable Gas Block is the perfect way to fine-tune your rifles gas system!<br><br><b>Features:</b><br><ul>\n<li>Set screw style</li>\n<li>.750” gas seat diameter</li>\n<li>20-point adjustment</li>\n<li>Nitride finish</li>\n<li>Gas tube roll pin and hex key included<br>\n</li>\n</ul>', NULL, 'https://www.primaryarms.com/anderson-manufacturing-low-profile-adjustable-gas-block-750-set-screw-style-b2-l056-a00', NULL, NULL, 58.00, 39.99, 18.01, 'https://www.primaryarms.com/anderson-manufacturing-low-profile-adjustable-gas-block-750-set-screw-style-b2-l056-a00', '0492c7a132cd2f4317b8039cc3b4ea4e', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:36'),
(451, 3, 'Phase 5 Tactical Ambi-Battle Latch - Charging Handle - Gray', 'Phase 5 builds the best equipment possible for dedicated professionals. Their components are designed to solve problems and help those who protect and defend us, using the best equipment possible. Every part and weapon they build is made in the U.S.A.<br><br>The Ambi Battle Latch/Charging Handle is structurally and functionally improvement over standard charging handles. This ambidextrous handle features tough 7075 aluminum construction, increased sidewall thickness, and an upgraded stainless coiled spring pin.<br><br><b>Features:<br></b><ul>\n<li>AR-15 compatible</li>\n<li>Ambidextrous design</li>\n<li>Broad contact points</li>\n<li>0.1874” diameter stainless steel coiled spring</li>\n<li>Increased sidewall thickness</li>\n<li>7075 aluminum construction</li>\n<li>Made in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/phase-5-tactical-ambilatch-ar15-charging-handle-abl-cha-grey', NULL, NULL, 80.77, 29.99, 50.78, 'https://www.primaryarms.com/phase-5-tactical-ambilatch-ar15-charging-handle-abl-cha-grey', 'edd599c7eed2b950c8722c2dbf01f97b', 1, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:37'),
(452, 3, '2A Armament T3 Compensator - 1/2x28', 'The development of the T3 compensator started with the need for a muzzle device that not only maintains a small size, but also performs well within its intended use. The T3 is a dual baffle compensator that directs expelled gasses to control muzzle direction. The initial baffle directs gas in a geometrical pattern that stabilizes the rifle system. The second baffle system channels gasses upward to compensate for muzzle rise. This gives the shooter the ability to decrease time between follow up shots and maintain control of muzzle direction. The T3 also mitigates some of the flash that is commonly associated with compensators.', NULL, 'https://www.primaryarms.com/2a-armament-t3-compensator-1-2x28-2a-t3-comp', NULL, NULL, 75.00, 0.00, 0.00, 'https://www.primaryarms.com/2a-armament-t3-compensator-1-2x28-2a-t3-comp', 'fddc112f1d9e78f112dbe91ad223579d', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:38'),
(453, 3, 'Leapers UTG PRO Ops Ready S3 MIL-SPEC Stock Kit - Black', 'The Leapers UTG PRO Ops Ready S3 MIL-SPEC stock is a heavy duty carbine stock for the AR platform. A lightweight, compact, and ergonomic design allows for improved weapon control and comfortable cheekweld. With multiple sling attachment points,  fully dehorned corners, and slightly increased length of pull make this an ideal stock for your next build.<br><br>This kit includes a MIL-SPEC receiver extension, standard carbine spring, 3.0 ounce carbine buffer, receiver end plate, and standard castle nut.<br><br><b>Features:</b><br><ul>\n<li>Durable impact resistant polymer</li>\n<li>Multiple sling attachment points</li>\n<li>Lightweight, compact, and ergonomic design</li>\n<li>Fully dehorned and melted corners and edges</li>\n<li>Proudly designed and manufactured in the U.S.A.</li>\n<li>Includes stock and full MIL-SPEC stock kit</li>\n</ul>', NULL, 'https://www.primaryarms.com/utg-pro-model-4-6-position-mil-spec-s3-stock-assembly-black-rbus3bm', NULL, NULL, 57.97, 39.99, 17.98, 'https://www.primaryarms.com/utg-pro-model-4-6-position-mil-spec-s3-stock-assembly-black-rbus3bm', '44b4d330abef1b0446b4b79d121f0b07', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:41');
