(454, 3, 'Inforce Gen3 APL 400 Lumen Pistol Light - Flat Dark Earth', 'The INFORCE Gen3 APL Now with 400 lumens of vibrant white light, the Gen3 APL provides a high-intensity tight beam to fill your field of view for close to mid-range target identification for up to 1.5 hours. At less than 3 ounces, the water-resistant, glass reinforced polymer body is incredibly powerful yet compact in size. Extensively tested, the APL integrates seamlessly with MIL-STD 1913 and Universal rails and offers constant and momentary operating modes, textured paddles for a non-slip grip, and an ambidextrous on/off switch to enable left or right hand activation and natural movement from the weapon to the switch. In addition, the easy-to-operate lockout system ensures the light isn’t activated until you’re ready.', NULL, 'https://www.primaryarms.com/inforce-apl-pistol-mounted-weapon-light-200-lumens-led-fde-inf-apl-f-w_2', NULL, NULL, 140.00, 0.00, 0.00, 'https://www.primaryarms.com/inforce-apl-pistol-mounted-weapon-light-200-lumens-led-fde-inf-apl-f-w_2', '922e7c819bb4a083729344a38d1c1365', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:42'),
(455, 3, 'High Standard AR-15 Front Sight Detent Spring', 'The High Standard AR-15 Front Sight Detent Spring is a high-quality spare or replacement for a worn out, damaged, or lost spring.', NULL, 'https://www.primaryarms.com/high-standard-front-sight-detent-spring-ar-b80-61709', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.primaryarms.com/high-standard-front-sight-detent-spring-ar-b80-61709', '1ac984777721190e2f02a69ba536e686', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:44'),
(456, 3, 'Bear Creek Arsenal 16\" .308 Win 1:10 Mid-Length Heavy Contour AR-10 Barrel - Parkerized', 'Bear Creek Arsenal products complete their entire production cycle at their Sanford, North Carolina facilities. Drilling, reaming, rifling, and turning are all performed on CNC machines under ISO-9002 Quality Systems, allowing Bear Creek to precisely control each step of manufacturing. Careful inspection ensures each barrel meets their stringent standards before shipping.<br><br>This AR-10 barrel is machined from 4150 chrome moly vanadium steel, heat treated to RC 28-32 hardness, properly stress relieved, and Parkerized for a corrosion resistant finish. BCA guarantees 1 MOA groups at 100 yards when observing proper shooting techniques and using high quality ammunition.<br><br><b>NOTE: Bear Creek Arsenal does <u>not</u> recommend using steel cased ammo in their assemblies or rifles.</b><br><b><br></b><br><b>Features:</b><br><ul>\n<li>Chambered in .308 Winchester with a 1:10 twist rate</li>\n<li>4150 chrome moly vanadium steel barrel with a Parkerized finish</li>\n<li>HBAR</li>\n<li>Mid-length gas system</li>\n<li>5/8x24 thread pitch</li>\n<li>0.750” gas seat diameter</li>\n<li>AR-10 feed ramps</li>\n<li>Weight: 1.5 lbs</li>\n</ul>', NULL, 'https://www.primaryarms.com/bear-creek-arsenal-16in-308-win-mid-length-heavy-ar10-barrel-b308mhb1610-p', NULL, NULL, 89.99, 64.99, 25.00, 'https://www.primaryarms.com/bear-creek-arsenal-16in-308-win-mid-length-heavy-ar10-barrel-b308mhb1610-p', '6a5c653c3167bfa31abeb34ae54801d2', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:45'),
(457, 3, 'Leapers UTG PRO Ops Ready S2 MIL-SPEC Stock Kit - Black', 'The Leapers UTG PRO Ops Ready S2 MIL-SPEC stock is a heavy duty carbine stock for the AR platform. A lightweight and ergonomic design allows for improved weapon control and comfortable cheekweld. With multiple sling attachment points,  fully dehorned corners, and slightly increased length of pull make this an ideal stock for your next build.<br><br>This kit includes a MIL-SPEC receiver extension, standard carbine spring, 3.0 ounce carbine buffer, receiver end plate, and standard castle nut.<br><br><b>Features:</b><br><ul>\n<li>Durable impact resistant polymer</li>\n<li>Multiple sling attachment points</li>\n<li>Lightweight and ergonomic design</li>\n<li>Fully dehorned and melted corners and edges</li>\n<li>Proudly designed and manufactured in the U.S.A.</li>\n<li>Includes stock and full MIL-SPEC stock kit</li>\n</ul>', NULL, 'https://www.primaryarms.com/utg-pro-model-4-ops-ready-s2-mil-spec-stock-kit-black-rbus2bm', NULL, NULL, 64.97, 43.99, 20.98, 'https://www.primaryarms.com/utg-pro-model-4-ops-ready-s2-mil-spec-stock-kit-black-rbus2bm', '77674b71953ae8f7d1b13a274ce52975', 0, NULL, '2018-08-06 10:28:17', '2018-08-06 11:08:47'),
(458, 3, 'Vickers Tactical Glock Gen 4 Extended Magazine Release', 'Using the Vickers Tactical Glock Extended Magazine Release, anyone with average to small hands may now easily perform magazine changes without shifting their firing grip on the weapon. The VT GMR-003 is easy to install, and made of the same tough polymer as the Glock factory part. The magazine will not accidentally release if pistol is laid on a hard surface. Perfect for use with back strap mounted lasers.<br><br><b>Compatible with:</b><br>Gen 4 G17, 19, 22, 23, 26, 27, 31, 32, 34, 35, 37<br>Gen 5 G17, 19<br><br><b>Features:</b><br><ul>\n<li>Ambidextrous</li>\n<li>Extended and rounded button</li>\n<li>Injection molded</li>\n<li>Same polymer as OEM factory part</li>\n<li>Fits most of Gen 4 Glock pistols</li>\n<li>Overall length: 1.31”</li>\n<li>Weight: 0.2 oz</li>\n<li>Made in U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/vickers-tactical-glock-gen-4-extended-magazine-release-gmr-003', NULL, NULL, 16.99, 14.99, 2.00, 'https://www.primaryarms.com/vickers-tactical-glock-gen-4-extended-magazine-release-gmr-003', '5e7100425f5bde757eac88da1ca8ee15', 0, NULL, '2018-08-06 10:28:18', '2018-08-06 11:08:49'),
(459, 3, 'Leapers UTG PRO Ops Ready S2 MIL-SPEC Stock - Black', 'The Leapers UTG PRO Ops Ready S2 MIL-SPEC stock is a heavy duty carbine stock for the AR platform. A lightweight and ergonomic design allows for improved weapon control and comfortable cheekweld. With multiple sling attachment points,  fully dehorned corners, and slightly increased length of pull make this an ideal stock for your next build.<br><br><b>Features:</b><br><ul>\n<li>Durable impact resistant polymer</li>\n<li>Multiple sling attachment points</li>\n<li>Lightweight and ergonomic design</li>\n<li>Fully dehorned and melted corners and edges</li>\n<li>Proudly designed and manufactured in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/utg-pro-model-4-ops-ready-s2-mil-spec-stock-black-rbus2bms', NULL, NULL, 32.97, 23.99, 8.98, 'https://www.primaryarms.com/utg-pro-model-4-ops-ready-s2-mil-spec-stock-black-rbus2bms', 'e2a12c38d951affb2269529e07b6b139', 0, NULL, '2018-08-06 10:28:18', '2018-08-06 11:08:52'),
(460, 3, 'Remington 870 TAC-14 Pump Action 12 Gauge Firearm 14\" Barrel with 4 Shot Tube - Black', '<p class=\"MsoNormal\"><b>The Bureau of Alcohol, Tobacco, Firearms &amp; Explosives has classified this as a “firearm” per the gun control act, but not a Class 3/NFA firearm. However, there could be local, state laws that prohibit the sale of this firearm in your state. Consult your state police for clarification.</b></p>\n<p class=\"MsoNormal\">Remington has taken the venerable 870 pump action and made it even better. The 870 TAC-14 features 4 round tube magazine and a shortened barrel and Raptor pistol grip, making this a compact 12-gauge powerhouse. This compact model features the same reliable, smooth pump action that the full size 870 series have been known for. The fore-end is Magpul furniture with the versatile M-LOK attachment points for attaching your favorite lights, lasers, and other tactical accessories. Adding a light is fast and easy, especially if using a quick detach M-LOK rail segment, and will instantly make this firearm more usable in home defense situations. Not only is it good for personal defense and concealability, but it is fun at the range too. Load it up with some light, birdshot loads and shoot all day. Or as much as your wrist can handle.</p>\n<p class=\"MsoNormal\"><b>Features:</b></p>\n<p class=\"MsoNormal\"></p>\n<ul>\n<li>4 Round tube magazine</li>\n<li>Bead front sight for fast target acquisition</li>\n<li>Cross bolt safety</li>\n<li>Ambidextrous pump action release</li>\n<li>Black synthetic Raptor pistol grip and Magpul fore-end</li>\n<li>M-LOK attachment on fore-end for lights, lasers, and tactical accessories</li>\n<li>Matte blue finish on receiver and barrel</li>\n<li>14-inch barrel</li>\n</ul>\n<p></p>\n<p class=\"MsoNormal\">Because this has no stock, the barrel can be shortened to a compact 14 inches, making this an excellent choice for personal defense and home protection. It can easily be stored out of sight and ready to grab at a moment’s notice with 4 rounds of 12-gauge shot ready to go. The Raptor pistol grip is designed to help you maintain the recoil but it is recommended that you aim from the hip in order to fully absorb the power of a 12-gauge defensive load. The bead front sight can help you aim, but this setup is designed for ranges within a few yards. Even though it may be difficult to aim, the small size and concealability may be worth the tradeoff to you.</p>\n<p class=\"MsoNormal\">For more than 200 years, Remington innovation has always been ahead of its time. Remington engineers are extremely passionate about what they do and are always looking for new ideas on and off the clock. Because of this enthusiasm, Remington is constantly bringing new products to the market like the Versaport Gas operated system and the Core-Lokt projectile.  At their state-of-the-art research and development facility, The Rock, they continue shattering convention, revolutionizing an industry, and setting the performance standard all others must follow.</p>', NULL, 'https://www.primaryarms.com/remington-14-in-870-tac-14-pump-action-12-gauge-firearm-3-in-chamber-4-shot-tube-black-REM81230', NULL, NULL, 443.05, 289.99, 153.06, 'https://www.primaryarms.com/remington-14-in-870-tac-14-pump-action-12-gauge-firearm-3-in-chamber-4-shot-tube-black-REM81230', '307ff9fd6ac2a08e6878e79cf87d84b6', 0, NULL, '2018-08-06 10:28:18', '2018-08-06 11:08:53'),
(461, 3, 'Bravo Company Manufacturing 5.5\" KeyMod Rail Panel Kit - 5 Pack - Wolf Gray', 'Bravo Company Manufacturing KeyMod Rail Panels offer an aggressive, non-slip, anti-reflective surface, ventilated for cooling. Ultra-slim rounded surface allows a ‘round’ handguard feeling from an octagonal profile. Each strip is designed to fit all KeyMod mounting surfaces with 7 consecutive KeyMod slots, though each may be cut to any length.<br><br><b>Features:</b><br><ul>\n<li>Contains 5 matching color KeyMod panel strips</li>\n<li>High-strength polymer material</li>\n<li>Bi-directional locking tabs<br>\n</li>\n<li>Length: 5.550”</li>\n<li>Width: 0.625”</li>\n<li>Thickness: 0.100”</li>\n<li>Made in the U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/bravo-company-5-5-keymod-rail-panel-kit-5-pack-wolf-gray-bcm-kmr-rp-wg-5', NULL, NULL, 9.95, 0.00, 0.00, 'https://www.primaryarms.com/bravo-company-5-5-keymod-rail-panel-kit-5-pack-wolf-gray-bcm-kmr-rp-wg-5', '8a0cc4d3a9e1ea104f7da6f5029addff', 1, NULL, '2018-08-06 10:28:18', '2018-08-06 11:08:55'),
(462, 3, 'EDC Tactical AR-15 Billet Lower Receiver - Flat Dark Earth', 'EDC Tactical specializes in the custom design and manufacture of safe, high quality firearms and parts. They aim to be your first and last stop for firearms, parts, and accessories!<br><br>This AR-15 Billet Lower Receiver is machined to MIL-SPEC dimensions ensuring compatibility with the widest range of components on the market. Crafted from billet 6061-T6 aluminum, this receiver features a flared magwell, integrated trigger guard, and Cerakote finish.<br><br><b>Features:<br></b><ul>\n<li>Billet 6061-T6 aluminum</li>\n<li>Integrated trigger guard</li>\n<li>Flared magwell</li>\n<li>MIL-SPEC dimensions</li>\n<li>Cerakote finish</li>\n<li>Engraving on both sides for ambidextrous fire controls</li>\n<li>Machined and engraved in Richmond, Virginia U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/edc-tactical-billet-ar-15-lower-receiver-with-fde-cerakote', NULL, NULL, 74.99, 59.99, 15.00, 'https://www.primaryarms.com/edc-tactical-billet-ar-15-lower-receiver-with-fde-cerakote', '190bba770442be0f7b5d2b34f7ab4949', 0, NULL, '2018-08-06 10:28:18', '2018-08-06 11:08:57'),
(463, 3, 'Spike\'s Tactical AK-47 Dynacomp Muzzle Brake - 14x1 LH', 'The Spike\'s Tactical Dynacomp is a muzzle device designed to reduce recoil impulse and muzzle climb. The ports on the Dynacomp are ball dimpled for smooth expansion of gases and rapid heat dissipation. The entire device is protected with a slick black Melonite finish. Compatible with calibers up to 7.62x39 or .308 Winchester.<br><br><b>Features:</b><br><ul>\n<li>416 heat treated stainless steel.</li>\n<li>M14 X 1 LH.</li>\n<li>Black nitride finish.</li>\n<li>Brake ports covering 360 degrees.</li>\n<li>Index notch for proper timing.</li>\n<li>Weight: 2.7 oz.</li>\n</ul>', NULL, 'https://www.primaryarms.com/spikes-tactical-ak-47-dynacomp-muzzle-brake-14-x-1-lh', NULL, NULL, 89.10, 0.00, 0.00, 'https://www.primaryarms.com/spikes-tactical-ak-47-dynacomp-muzzle-brake-14-x-1-lh', '9c71d6a26cea71bbc95c58aa25cd40cb', 0, NULL, '2018-08-06 10:28:18', '2018-08-06 11:08:58'),
(464, 3, 'Caldwell Mag Charger AR-15 Magazine Loader', 'Simply put, the Caldwell AR Mag Charger revolutionizes the way ammo is handled and loaded into AR-15 magazines. It is designed to accept 50 loaded rounds directly from any common 50 round ammo manufacturer box or from aftermarket 50 round plastic storage boxes. Simply align bullet tips and dump a box of ammo into the Mag Charger. The ammo is automatically aligned without touching a single round. Once filled with ammo, insert any AR magazine into the Mag Charger just as you would into a rifle. Then actuate the plunger back and forth loading 5 rounds per stroke as the spring loaded ammo carrier automatically advances aligning the next five rounds until magazine is fully loaded.', NULL, 'https://www.primaryarms.com/caldwell-mag-charger-ar-15-magazine-loader-397488', NULL, NULL, 59.99, 39.99, 20.00, 'https://www.primaryarms.com/caldwell-mag-charger-ar-15-magazine-loader-397488', 'eedc3ddc6c426bb02b5f2694956dfb6e', 0, NULL, '2018-08-06 10:28:18', '2018-08-06 11:08:59'),
(465, 3, 'Radical Firearms 7.5\" 5.56 NATO 1:7 Pistol Length M4 Complete Upper - 7\" M-LOK FCR Gen3 Rail', 'The Radical Firearms 7.5\" 5.56 NATO M4 Complete Upper is a law enforcement grade, drop-in solution for your next AR build. Crafted with quality materials and covered by Radical’s lifetime warranty, this MIL-SPEC upper receiver provides an outstanding solution for any budget. Arrives at your door with the hard work done. Finish the build with your favorite lower receiver and sights, then head for the range!<br><br>The Radical Firearms FCR system is a slim handguard that provides the weight savings you want without sacrificing any of the mounting possibilities you require. This freefloat design offers a monolithic Picatinny rail and plenty of M-LOK attachment points for all your gear.<br><br><b>NOTE: This upper receiver has a barrel that is less than 16” in length and is intended for use in AR pistol or legal short-barreled rifle builds. Other configurations may violate Federal law.</b><br><br><b>Features:</b><br><ul>\n<li>7.5\" 41V50 chrome moly vanadium steel M4 contour barrel</li>\n<li>Chambered in 5.56 NATO with a 1:7 twist rate</li>\n<li>M16 cut bolt carrier group with Melonite finish</li>\n<li>BCG high pressure tested and magnetic particle inspected</li>\n<li>Standard charging handle</li>\n<li>1/2x28 A2 flash hider</li>\n<li>7\" Radical Firearms M-LOK FCR rail</li>\n<li>Gen 3 rail mounting system</li>\n<li>Made in the U.S.A. in Stafford, Texas!</li>\n</ul>', NULL, 'https://www.primaryarms.com/radical-firearms-7.5in-5.56-nato-complete-ar-15-pistol-upper-w-7in-m-lok-rail', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.primaryarms.com/radical-firearms-7.5in-5.56-nato-complete-ar-15-pistol-upper-w-7in-m-lok-rail', '10ef1a5f2c85606936f0ab243a631b66', 0, NULL, '2018-08-06 10:28:18', '2018-08-06 11:09:00'),
(466, 3, 'Sightmark .243 Win / .308 Win / 7.62x54r Laser Boresight', 'The Chamber Laser Boresight gets you on target quickly without wasting a single round. Simply drop the boresight into your chamber like a standard cartridge, and the bright 632-650nm red laser will show you exactly where your rifle is aiming. When done, it ejects just like an empty casing, clearing your chamber allowing you to go straight to live fire, without the risks of forgetting a bore-mounted sight.<br><br>This compact laser boresight is designed to fit .243 Win, .308 Win, and 7.62x54r chambers, and includes carrying case, batteries, and instructions.<br><br><b>Note:</b> Rim will not engage with 7.62x54r extractors and may require manual extraction.<br><b><br>Features:</b><br><ul>\n<li>Compact and lightweight design fits in any range bag</li>\n<li>Powered by (3) AG3 batteries</li>\n<li>Designed to fit .243 Win, .308 Win, and 7.62x54r chambers</li>\n<li>Tested and recommended by the National Tactical Officers Association</li>\n</ul>', NULL, 'https://www.primaryarms.com/sightmark-243-win-308-win-7-62x54r-laser-boresight-sm39005', NULL, NULL, 29.97, 23.98, 5.99, 'https://www.primaryarms.com/sightmark-243-win-308-win-7-62x54r-laser-boresight-sm39005', '0abbb8770972460bd42be78adbae3fe7', 1, NULL, '2018-08-06 10:28:18', '2018-08-06 11:09:01'),
