(468, 3, 'Radical Firearms 16\" 300 BLK 1:8 Pistol Length HBAR Complete Upper - 15\" M-LOK FCR Rail', 'The Radical Firearms 16\" 300 BLK HBAR Complete Upper is a law enforcement grade, drop-in solution for your next AR build. Crafted with quality materials and covered by Radical’s lifetime warranty, this MIL-SPEC upper receiver provides an outstanding solution for any budget. Arrives at your door with the hard work done. Finish the build with your favorite lower receiver and sights, then head for the range!<br><br>The Radical Firearms FCR system is a slim handguard that provides the weight savings you want without sacrificing any of the mounting possibilities you require. This freefloat design offers a monolithic Picatinny rail and plenty of M-LOK attachment points for all your gear.<br><b><br></b><br><b>Features:</b><br><ul>\n<li>16\" 41V50 chrome moly vanadium steel HBAR barrel with Melonite finish</li>\n<li>Chambered in 300 BLK with a 1:8 twist rate</li>\n<li>M16 cut bolt carrier group with Melonite finish</li>\n<li>BCG high pressure tested and magnetic particle inspected</li>\n<li>Standard charging handle</li>\n<li>5/8x24 A2 flash hider</li>\n<li>15\" Radical Firearms M-LOK FCR rail</li>\n<li>Made in the U.S.A. in Stafford, Texas!</li>\n</ul>', NULL, 'https://www.primaryarms.com/CFU16-5-56M4-12FCR_6', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.primaryarms.com/CFU16-5-56M4-12FCR_6', '237a849444afada89b7e6845af3b09b5', 0, NULL, '2018-08-06 10:28:18', '2018-08-06 11:09:04'),
