(473, 3, 'Sightmark 7.62x39mm Russian Laser Boresight', 'The Chamber Laser Boresight gets you on target quickly without wasting a single round. Simply drop the boresight into your chamber like a standard cartridge, and the bright 632-650nm red laser will show you exactly where your rifle is aiming. When done, it ejects just like an empty casing, clearing your chamber allowing you to go straight to live fire, without the risks of forgetting a bore-mounted sight.<br><br>This compact laser boresight is designed for 7.62x39mm chambers, and includes carrying case, batteries, and instructions.<br><br><b>Features:</b><br><ul>\n<li>Compact and lightweight design fits in any range bag</li>\n<li>Powered by (3) AG3 batteries</li>\n<li>Designed to fit 7.62x39mm chambers</li>\n<li>Tested and recommended by the National Tactical Officers Association</li>\n</ul>', NULL, 'https://www.primaryarms.com/sightmark-7-62x39mm-russian-laser-boresight-sm39002', NULL, NULL, 29.97, 23.98, 5.99, 'https://www.primaryarms.com/sightmark-7-62x39mm-russian-laser-boresight-sm39002', 'f57765ebe7ccca473f9b9b8f78162e70', 0, NULL, '2018-08-06 10:28:18', '2018-08-06 11:09:09'),
