(475, 3, 'Streamlight TLR-1 HL 800 Lumen Tactical Weapon Light - Flat Dark Earth Brown', 'The Streamlight TLR-1 HL Rail Mounted Tactical Light is a virtually indestructible and intensely bright tactical light that attaches to nearly any weapon system in seconds. Perfectly sized for handguns or long guns, the TLR-1 HL is powered by two  CR123 batteries to provide a bright 800 lumens of light. Whether in the line of duty or simply protecting the homestead, you can trust the TLR-1 HL.<br><br><b>Features:</b><br><ul>\n<li>Bright 15000 candela peak beam intensity provides almost 270 yards of throw</li>\n<li>Deep dish parabolic reflector produces a concentrated long reaching beam with excellent peripheral light</li>\n<li>Strobe function can be enabled or disabled</li>\n<li>Powered by (2) CR123A batteries</li>\n<li>Ambidextrous toggle switch allows for momentary, constant, or strobe functions</li>\n<li>Durable aluminum body with MIL-SPEC anodized finish</li>\n<li>Mounting keys for Glocks, Picatinny, Beretta 90two, S&amp;W 99, and S&amp;W TSW rails</li>\n<li>Mounting system attaches and detaches quickly without placing hands before the muzzle</li>\n<li>IPX7 rated water proof to 1 meter for half an hour</li>\n<li>Weighs just 4.18 ounces</li>\n<li>Limited lifetime warranty</li>\n</ul>\n<br><br><b>Modes:</b><br><ul>\n<li><b>White LED</b></li>\n<li>\n<i>High</i> - 15000 candela - 800 lumens - 1.75 hours runtime</li>\n</ul>', NULL, 'https://www.primaryarms.com/streamlight-tlr-1-hl-tactical-light-flat-dark-earth-brown-stl69267', NULL, NULL, 129.99, 114.99, 15.00, 'https://www.primaryarms.com/streamlight-tlr-1-hl-tactical-light-flat-dark-earth-brown-stl69267', '14312d38d9869c5610444c4ec7d38228', 0, NULL, '2018-08-06 10:28:18', '2018-08-06 11:09:11'),
