(477, 3, 'Leapers UTG PRO Ops Ready S2 MIL-SPEC Stock Kit - Flat Dark Earth', 'The Leapers UTG PRO Ops Ready S2 MIL-SPEC stock is a heavy duty carbine stock for the AR platform. A lightweight and ergonomic design allows for improved weapon control and comfortable cheekweld. With multiple sling attachment points,  fully dehorned corners, and slightly increased length of pull make this an ideal stock for your next build.<br><br>This kit includes a MIL-SPEC receiver extension, standard carbine spring, 3.0 ounce carbine buffer, receiver end plate, and standard castle nut.<br><br><b>Features:</b><br><ul>\n<li>Durable impact resistant polymer</li>\n<li>Multiple sling attachment points</li>\n<li>Lightweight and ergonomic design</li>\n<li>Fully dehorned and melted corners and edges</li>\n<li>Proudly designed and manufactured in the U.S.A.</li>\n<li>Includes stock and full MIL-SPEC stock kit</li>\n</ul>', NULL, 'https://www.primaryarms.com/utg-pro-model-4-ops-ready-s2-mil-spec-stock-kit-fde-rbus2dm', NULL, NULL, 72.97, 49.99, 22.98, 'https://www.primaryarms.com/utg-pro-model-4-ops-ready-s2-mil-spec-stock-kit-fde-rbus2dm', '2830c91c1a936eab3744138183eb9fed', 0, NULL, '2018-08-06 10:28:19', '2018-08-06 11:09:14'),
