(488, 3, 'Springfield Armory XD9 9mm Full Size 16-Round Handgun - 4\" Barrel - Black', 'Springfield Armory is one of the largest firearms manufacturers in the world. After resurrecting some of America’s most treasured, historically significant firearm designs, the M14 and M1911, Springfield Armory, Inc. has expanded its line of firearms to include modern sporting rifles and polymer pistols.<br><br>The Springfield XD is a premier example of polymer framed striker fired semi-automatic pistols. With excellent ergonomics, a cold hammer forged barrel, user friendly controls, and more, the XD brings together an impressive set of features that will keep you shooting reliably.<br><br><b>Features:</b><br><ul>\n<li>Chambered in 9mm Luger with a 1:10 twist rate</li>\n<li>Includes (2) 16-round magazines</li>\n<li>Striker fired</li>\n<li>Forged steel slide with Melonite finish</li>\n<li>Black polymer frame</li>\n<li>Dovetail front and rear sights</li>\n<li>Cold hammer forged steel barrel with Melonite finish</li>\n<li>Length: 7.3”</li>\n<li>Height: 5.5”</li>\n<li>Width: 1.20”</li>\n<li>Weight: 28 oz</li>\n</ul>', NULL, 'https://www.primaryarms.com/springfield-armory-xd9-4in-sub-compact-9mm-carry-pistol-with-16-round-magazine-black', NULL, NULL, 439.99, 384.99, 55.00, 'https://www.primaryarms.com/springfield-armory-xd9-4in-sub-compact-9mm-carry-pistol-with-16-round-magazine-black', 'f7f4ffb8646b0b6b9200c2d4e4446fe9', 0, NULL, '2018-08-06 10:28:19', '2018-08-06 11:09:35'),
(489, 3, 'Ruger American 9mm Full Size 10-Round Handgun - 4.5\" Barrel - Black', 'Sturm, Ruger &amp; Co., Inc. has been one of the nation\'s leading manufacturers of dependable rifles, shotguns, and pistols since 1949.<br><br>The Ruger American Pistol Model 8607 is a striker fired full frame handgun chambered in 9mm Luger. The American includes two 10-round nickel Teflon plated steel magazines and features a Picatinny accessory rail and Novak LoMount Carry Sights.<br><br><b>Features:</b><br><ul>\n<li>Chambered in 9mm Luger with a 1:10 twist rate</li>\n<li>Includes (2) 10-round magazine</li>\n<li>Striker fired</li>\n<li>Semi-automatic</li>\n<li>Stainless steel slide with black nitride finish</li>\n<li>Polymer frame</li>\n<li>Picatinny accessory rail</li>\n<li>Novak LoMount carry 3-dot sights</li>\n<li>4.2” barrel</li>\n<li>Width: 1.05”</li>\n<li>Overall length: 7.5”</li>\n<li>Height: 5.60”</li>\n<li>Weight: 30 oz</li>\n</ul>', NULL, 'https://www.primaryarms.com/ruger-american-full-size-9mm-pistol-with-10-round-magazines-black', NULL, NULL, 459.99, 359.99, 100.00, 'https://www.primaryarms.com/ruger-american-full-size-9mm-pistol-with-10-round-magazines-black', 'e9beee354aca022edcb8dee2f3c0b1fe', 0, NULL, '2018-08-06 10:28:19', '2018-08-06 11:09:38'),
(490, 3, 'Sightmark 20 Gauge Laser Boresight', 'The Chamber Laser Boresight gets you on target quickly without wasting a single round. Simply drop the boresight into your chamber like a standard cartridge, and the bright 632-650nm red laser will show you exactly where your rifle is aiming. When done, it ejects just like an empty casing, clearing your chamber allowing you to go straight to live fire, without the risks of forgetting a bore-mounted sight.<br><br>This compact laser boresight is designed to fit 20 gauge chambers, and includes carrying case, batteries, and instructions.<br><br><b>Features:</b><br><ul>\n<li>Compact and lightweight design fits in any range bag</li>\n<li>Powered by (3) AG3 batteries</li>\n<li>Designed to fit 20 gauge chambers</li>\n<li>Tested and recommended by the National Tactical Officers Association</li>\n</ul>', NULL, 'https://www.primaryarms.com/sightmark-20-gauge-laser-boresight-sm39008', NULL, NULL, 29.97, 23.98, 5.99, 'https://www.primaryarms.com/sightmark-20-gauge-laser-boresight-sm39008', '7bdafcc2dfd2a5785c637f5bb1ec4604', 0, NULL, '2018-08-06 10:28:19', '2018-08-06 11:09:41'),
(491, 3, 'Troy Industries 16\" 5.56 Complete Upper with 13\" Alpha Rail and Flip Up BattleSights - Flat Dark Earth', 'The Troy Industries 16\" 5.56 NATO Complete Upper is a high quality, MIL-SPEC assembly. Complete with bolt carrier group, charging handle, and BattleSights, this upper has everything you need. Just add your favorite complete lower receiver, and hit the range.<br><br><b>Features:</b><br><ul>\n<li>16\" 41V50 chrome moly vanadium steel, mid-length gas barrel with Melonite finish</li>\n<li>5.56 NATO with a 1:7 twist rate</li>\n<li>AR-15 cut bolt carrier group with Melonite finish. Not HPT or MPI</li>\n<li>Troy Medieval Flash Suppressor, 1/2x28 thread pitch</li>\n<li>Includes Troy\'s Rear BattleSight in flat dark earth</li>\n<li>13\" free float Troy Industries Alpha Rail with integrated front sight, in flat dark earth</li>\n<li>Made in the U.S.A. in West Springfield, Massachusetts!</li>\n</ul>', NULL, 'https://www.primaryarms.com/troy-industries-upper-5-56-16-w-13-alpha-rail-and-rear-flip-up-sight-fde-supr-bf1-16ft-00', NULL, NULL, 475.00, 409.99, 65.01, 'https://www.primaryarms.com/troy-industries-upper-5-56-16-w-13-alpha-rail-and-rear-flip-up-sight-fde-supr-bf1-16ft-00', '58f15b90c8b8835ff542b5b8a6911d64', 0, NULL, '2018-08-06 10:28:19', '2018-08-06 11:09:42'),
(492, 3, 'Troy Industries 16\" 5.56 Complete Upper with 13\" Alpha Rail and Flip Up BattleSights - Black', 'The Troy Industries 16\" 5.56 NATO Complete Upper is a high quality, MIL-SPEC assembly. Complete with bolt carrier group, charging handle, and BattleSights, this upper has everything you need. Just add your favorite complete lower receiver, and hit the range.<br><br><b>Features:</b><br><ul>\n<li>16\" 41V50 chrome moly vanadium steel Melonited barrel, with mid-length gas system</li>\n<li>5.56 NATO with a 1:7 twist rate</li>\n<li>AR-15 cut bolt carrier group with Melonite finish. Not HPT or MPI</li>\n<li>Troy Medieval Flash Suppressor, 1/2x28 thread pitch</li>\n<li>Includes Troy\'s Rear BattleSight in black</li>\n<li>13\" free float Troy Industries Alpha Rail with integrated front sight</li>\n<li>Made in the U.S.A. in West Springfield, Massachusetts!</li>\n</ul>', NULL, 'https://www.primaryarms.com/troy-industries-upper-5-56-16-w-13-alpha-rail-and-rear-flip-up-sight-supr-bf1-16bt-00', NULL, NULL, 475.00, 409.99, 65.01, 'https://www.primaryarms.com/troy-industries-upper-5-56-16-w-13-alpha-rail-and-rear-flip-up-sight-supr-bf1-16bt-00', 'a3e52ce5ac584eb7000bab6fd94578b6', 0, NULL, '2018-08-06 10:28:19', '2018-08-06 11:09:46');
INSERT INTO `deals` (`id`, `source_id`, `title`, `description`, `image`, `link`, `ratings`, `reviews_count`, `base_price`, `sale_price`, `save_price`, `from_url`, `unique_md5`, `out_of_stock`, `ext_date`, `created_at`, `updated_at`) VALUES
(493, 3, 'Springfield Armory XD9 9mm Full Size 10-Round Handgun - 4\" Barrel - Black', 'Springfield Armory is one of the largest firearms manufacturers in the world. After resurrecting some of America’s most treasured, historically significant firearm designs, the M14 and M1911, Springfield Armory, Inc. has expanded its line of firearms to include modern sporting rifles and polymer pistols.<br><br>The Springfield XD is a premier example of polymer framed striker fired semi-automatic pistols. With excellent ergonomics, a cold hammer forged barrel, user friendly controls, and more, the XD brings together an impressive set of features that will keep you shooting reliably.<br><br><b>Features:</b><br><ul>\n<li>Chambered in 9mm Luger with a 1:10 twist rate</li>\n<li>Includes (2) 10-round magazines</li>\n<li>Striker fired</li>\n<li>Forged steel slide with Melonite finish</li>\n<li>Black polymer frame</li>\n<li>Dovetail front and rear sights</li>\n<li>Cold hammer forged steel barrel with Melonite finish</li>\n<li>Length: 7.3”</li>\n<li>Height: 5.5”</li>\n<li>Width: 1.20”</li>\n<li>Weight: 28 oz</li>\n</ul>', NULL, 'https://www.primaryarms.com/springfield-armory-xd9-sub-compact-9mm-carry-pistol-with-10-round-magazine-black', NULL, NULL, 439.99, 384.99, 55.00, 'https://www.primaryarms.com/springfield-armory-xd9-sub-compact-9mm-carry-pistol-with-10-round-magazine-black', 'e0fcbc213b856c1fb7a290d2d7a989da', 0, NULL, '2018-08-06 10:28:19', '2018-08-06 11:09:49'),
(494, 3, 'Ruger American 9mm Full Size 17-Round Handgun - 4.5\" Barrel - Black', 'Sturm, Ruger &amp; Co., Inc. has been one of the nation\'s leading manufacturers of dependable rifles, shotguns, and pistols since 1949.<br><br>The Ruger American Pistol Model 8605 is a striker fired full frame handgun chambered in 9mm Luger. The American includes two 17-round nickel Teflon plated steel magazines and features a Picatinny accessory rail and Novak LoMount Carry Sights.<br><br><b>Features:</b><br><ul>\n<li>Chambered in 9mm Luger with a 1:10 twist rate</li>\n<li>Includes (2) 17-round magazine</li>\n<li>Striker fired</li>\n<li>Semi-automatic</li>\n<li>Stainless steel slide with black nitride finish</li>\n<li>Polymer frame</li>\n<li>Picatinny accessory rail</li>\n<li>Novak LoMount carry 3-dot sights</li>\n<li>4.2” barrel</li>\n<li>Width: 1.05”</li>\n<li>Overall length: 7.5”</li>\n<li>Height: 5.60”</li>\n<li>Weight: 30 oz</li>\n</ul>', NULL, 'https://www.primaryarms.com/ruger-american-full-size-9mm-pistol-with-17-round-magazines-black', NULL, NULL, 434.99, 359.99, 75.00, 'https://www.primaryarms.com/ruger-american-full-size-9mm-pistol-with-17-round-magazines-black', '52e7f88a058211d669743caf50ad564d', 0, NULL, '2018-08-06 10:28:19', '2018-08-06 11:09:52'),
(495, 3, 'EDC Tactical AR-15 Billet Lower Receiver - The Cutter', 'EDC Tactical specializes in the custom design and manufacture of safe, high quality firearms and parts. They aim to be your first and last stop for firearms, parts, and accessories!<br><br>This AR-15 Billet Lower Receiver is machined to MIL-SPEC dimensions ensuring compatibility with the widest range of components on the market. Crafted from billet 6061-T6 aluminum, this receiver features a flared magwell, integrated trigger guard, and Cerakote finish.<br><br><b>Features:<br></b><ul>\n<li>Unique engraving</li>\n<li>Billet 6061-T6 aluminum</li>\n<li>Integrated trigger guard</li>\n<li>Flared magwell</li>\n<li>MIL-SPEC dimensions</li>\n<li>Cerakote finish</li>\n<li>Engraving on both sides for ambidextrous fire controls</li>\n<li>Machined and engraved in Richmond, Virginia U.S.A.</li>\n</ul>', NULL, 'https://www.primaryarms.com/edc-tactical-billet-ar-15-lower-receiver-coast-guard-cutter-edition', NULL, NULL, 74.99, 59.99, 15.00, 'https://www.primaryarms.com/edc-tactical-billet-ar-15-lower-receiver-coast-guard-cutter-edition', '0dc1397df36f5827837f6ddb0795dc98', 0, NULL, '2018-08-06 10:28:19', '2018-08-06 11:09:56'),
(496, 3, 'Sightmark .30-30 Winchester Laser Boresight', 'The Chamber Laser Boresight gets you on target quickly without wasting a single round. Simply drop the boresight into your chamber like a standard cartridge, and the bright 632-650nm red laser will show you exactly where your rifle is aiming. When done, it ejects just like an empty casing, clearing your chamber allowing you to go straight to live fire, without the risks of forgetting a bore-mounted sight.<br><br>This compact laser boresight is designed to fit .30-30 Win chambers, and includes carrying case, batteries, and instructions.<br><br><b>Features:</b><br><ul>\n<li>Compact and lightweight design fits in any range bag</li>\n<li>Powered by (3) AG3 batteries</li>\n<li>Designed to fit .30-30 Win chambers</li>\n<li>Tested and recommended by the National Tactical Officers Association</li>\n</ul>', NULL, 'https://www.primaryarms.com/sightmark-30-30-winchester-laser-boresight-sm39009', NULL, NULL, 29.97, 23.98, 5.99, 'https://www.primaryarms.com/sightmark-30-30-winchester-laser-boresight-sm39009', '74d06f28aec1a34ce50291cbe910f7ca', 0, NULL, '2018-08-06 10:28:20', '2018-08-06 11:09:59'),
(497, 3, 'Millett DMS 1-6X24 BCR-1 .233 MBLK', 'Illuminated donut-dot reticle with 11 brightness settings allows you to see your target clearly in low-light conditions. True 1x scope allows target acquisition with both eyes open at low power. Fully coated optics.', NULL, 'https://www.primaryarms.com/millett-dms-1-6x24-bcr-1-233-mblk-bk81624', NULL, NULL, 299.77, 249.77, 50.00, 'https://www.primaryarms.com/millett-dms-1-6x24-bcr-1-233-mblk-bk81624', '191b693c0bc2ae293a8fa8c0ed7ea3e6', 0, NULL, '2018-08-06 10:28:20', '2018-08-06 11:10:02'),
(498, 3, 'JP Enterprises Large Frame MKIII Rapid Config Tube Handguard - 12.5\" - Armalite Pattern', 'The JP Enterprise MKIII modular handguard system has been in development for over twenty years and combines all of the important features such as durability, modularity, and utility. It\'s stylish aesthetic is more than just looks and is rock-blasted for texture and improved grip. It has many attachment points for rails and accessories that are quick and easy to use.<br><br>Machined from 6061-T6 aluminum with a 4140 steel barrel nut, this hand guard includes two JPHGS quick-detach sling studs. Designed for the Armalite AR-10, Pre-2010 Bushmaster, Rock River Arms LAR-8, and similar. <br><br>Features:<br><ul>\n<li>Machined from 6061-T6 Aluminum</li>\n<li>Includes steel barrel nut</li>\n<li>Includes two quick-detach sling studs</li>\n<li>Barrel nut redesign allows for easier and faster barrel installation or replacement</li>\n<li>Ergonomically optimal 2\" tube diameter easily clears minimized gas block and is available for both small and large frame models</li>\n</ul>', NULL, 'https://www.primaryarms.com/jp-enterprises-large-frame-mkiii-rapid-configuration-tube-handguard-12-5-jphg3-1a-rc', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.primaryarms.com/jp-enterprises-large-frame-mkiii-rapid-configuration-tube-handguard-12-5-jphg3-1a-rc', '2b9dc876e92e573174e15fde0c974bd2', 0, NULL, '2018-08-06 10:28:20', '2018-08-06 11:10:05'),
(499, 3, 'Vortex Optics Crossfire II 6-24x50 AO Riflescope with Dead-Hold BDC Reticle (MOA) with Vortex Optics Cantilever Ring Mount for 30mm Tube, 2in Offset', '<span style=\'color: rgb(38, 38, 38); font-family: \"Open Sans\", Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\'>Clearer. Tougher. Brighter. Our popular Crossfire riflescopes are completely redesigned and built to exceed the performance standards of similarly-priced riflescopes. Longer eye relief, a fast-focus eyepiece, fully multi-coated lenses and improved, resettable MOA turrets ensure optimal performance in the field. The hard anodized one-piece aircraft-grade aluminum tube is nitrogen purged and o-ring sealed for a lifetime of waterproof/fogproof performance. The Crossfires deliver — and then some.</span><br><span style=\'color: rgb(38, 38, 38); font-family: \"Open Sans\", Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\'>Use this cantilever mount for mounting 30 mm telescopic sights onto flattop style AR-15 rifles. The 2-inch offset of this cantilever mount positions the scope in a forward location, allowing the correct eye relief and head placement on an AR-15. Aluminum construction.</span>', NULL, 'https://www.primaryarms.com/Kit-CF2-31045CANTILEVER', NULL, NULL, 389.98, 299.99, 89.99, 'https://www.primaryarms.com/Kit-CF2-31045CANTILEVER', '5720952b67c0f1b960b070ea20fbf599', 0, NULL, '2018-08-06 10:28:20', '2018-08-06 11:10:09'),
(500, 3, 'Vortex Optics Crossfire II 6-24x50 AO Riflescope with Dead-Hold BDC Reticle (MOA) with Burris AR P.E.P.R. Mount - 30mm', '<span style=\'color: rgb(38, 38, 38); font-family: \"Open Sans\", Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\'>Clearer. Tougher. Brighter. Our popular Crossfire riflescopes are completely redesigned and built to exceed the performance standards of similarly-priced riflescopes. Longer eye relief, a fast-focus eyepiece, fully multi-coated lenses and improved, resettable MOA turrets ensure optimal performance in the field. The hard anodized one-piece aircraft-grade aluminum tube is nitrogen purged and o-ring sealed for a lifetime of waterproof/fogproof performance. The Crossfires deliver — and then some.</span><br><span style=\'color: rgb(38, 38, 38); font-family: \"Open Sans\", Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\'>Proper Eye Position Ready for combat rifle scopes, this mount provides 2 inches of forward scope positioning on the M-4 and AR-15 platform. Ring bases are milled as a single, tough unit, and ring tops feature Picatinny tops for mounting additional accessories.</span>', NULL, 'https://www.primaryarms.com/Kit-CF2-31045PEPR', NULL, NULL, 384.98, 299.99, 84.99, 'https://www.primaryarms.com/Kit-CF2-31045PEPR', 'a05aefc9cc59d2040ce0be43747645a6', 0, NULL, '2018-08-06 10:28:20', '2018-08-06 11:10:12'),
(2475, 4, 'HOWA - \r\n                1500 BARRELED ACTION MINI ACTION LW BLUE 7.62X39', '<p></p>\n<p> Howa 1500 Barreled Actions are the perfect platform for a quality precision rifle build, at an affordable cost.  Every Howa Barreled Action features a hammer forged barrel, bottom metal and precise HACT two stage trigger.  The receiver and bolt are forged steel, with the bolt featuring an integral bolt handle.  Bolt faces are square to the barrel chamber and bolt faces have excellent contact with the receiver recesses.  M16 style extractor ensure positive extraction and function.  Factory barrels are hammer forged with headspace set to exacting standards.  The HACT two stage trigger has a crisp, light and consistent pull.  The included 3 position safety allows for the bolt to be locked, as well as put on safe when unloaded.  Scope bases are available from a variety of quality manufacturers.</p>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-barreled-action-mini-action-lw-blue-7-62x39-prod94643.aspx', NULL, NULL, 418.00, 239.99, 178.01, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-barreled-action-mini-action-lw-blue-7-62x39-prod94643.aspx', 'e6b9ec49f1337818e5ccd4fad484b281', 0, NULL, '2018-08-06 12:12:18', '2018-08-06 13:43:36'),
(2476, 4, 'CCI - \r\n                BLAZER BRASS AMMO 9MM LUGER 115GR FMJ-RN', '<h3 class=\"mbm\">Highly Accurate Full Metal Jacket Round</h3>\n<p></p>\n<p>Over the last 25 years, CCI Blazer has developed a reputation around the world as a reliable training and practice ammunition. For the shooter who wants to combine the economical pricing with the freedom to reload his spent cases, these Blazer loads are made with conventional, Boxer-primed brass cases ideal for reloading. These cases combined with high-quality Speer bullets deliver economy, accuracy, and performance. Available many common centerfire handgun calibers.</p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:64, Page:505</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/handgun-ammo/blazer-brass-ammo-9mm-luger-115gr-fmj-rn-prod43036.aspx', NULL, NULL, 209.99, 10.99, 199.00, 'https://www.brownells.com/ammunition/handgun-ammo/blazer-brass-ammo-9mm-luger-115gr-fmj-rn-prod43036.aspx', 'b5445822b1aa8bced4a2aef09bfec7e3', 0, NULL, '2018-08-06 12:12:18', '2018-08-06 13:43:43'),
(2477, 4, 'TAURUS - \r\n                SPECTRUM TORCH .380 2.8\" 6+1', '<h3 class=\"mbm\">An Exceptional Blend of Comfort and Functionality</h3>\n<p></p>\n<p> The Taurus SPECTRUM bridges aesthetics with ergonomics resulting in a truly exceptional blend of comfort and functionality. Its breakthrough design completely reimagines the concealed carry experience delivering better comfort, better responsiveness and better control. Its soft edges allow the gun to be quickly drawn with no snag points and a reversible magazine release adds greater versatility for right-or-left-handed shooters.<br><br> The SPECTRUM features enhanced grip design enabling the hand to naturally conform to the firearm—providing a more secure grip. Soft-touch polymers have been implemented to improve grip retention in wet or dry conditions.<br><br> Unique to Taurus, the SPECTRUM’s true double-action only trigger system features a non-energized striker with no pre-cock or pre-load applied—ensuring no contact between the sear and striker.</p>\n<ul>\n<li>  Caliber: .380 Auto</li> <li>  Capacity: 6RDS / 7RDS</li> <li>  Trigger Pull: 7-9 lbs</li> <li>  Slide Material: Stainless Steel</li> <li>  Length: 5.40”</li> <li>  Height: 3.82”</li>\n</ul>\n<p> The all-new Taurus SPECTRUM has been engineered to deliver a natural point of aim and a confident user experience.</p>', NULL, 'https://www.brownells.com/firearms/handguns/semi-auto/spectrum-torch-380-2-8-6-1-prod104997.aspx', NULL, NULL, 269.99, 199.99, 70.00, 'https://www.brownells.com/firearms/handguns/semi-auto/spectrum-torch-380-2-8-6-1-prod104997.aspx', 'e2b79284196009e1da2323736ac3a9aa', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:43:48'),
(2478, 4, 'DANIEL DEFENSE - MK18 STRIPPED SOCOM UPPER RECEIVER W/ HANDGUARD ONLY', '<p></p>\n<p> Daniel Defense manufactures the highest quality complete AR-15 upper receivers on the market today! Every Daniel Defense upper is painstakingly hand assembled, quality assurance tested, and test fired to ensure that the highest quality product makes it to the hands of customers.<br><br> The upper receiver is mil-spec with indexing marks and M4 feed ramps. CNC Machined of 7075-T6 aluminum, type III hard coat anodized, color is black. The barrel is chrome-moly vanadium steel, cold hammer forged in a 1:7 twist, 10.3\" government profile, chrome lined. The handguard is the Daniel Defense RIS II MK18 model. It is CNC machined of 6061-T6 aluminum, and type III hard coat anodized, Flat Dark Earth. The gas system is made up of the pinned, low-profile gas block CNC machined from 4140 hardened steel with mil-spec heavy phosphate coating. It also features a carbine length direct impingement gas system.</p>\n<p> <strong>These Upper Receiver Assemblies have been installed on a lower receiver &amp; test fired.  Please expect some signs of use from this testing conducted by Daniel Defense.</strong></p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:003 <br> Big Book Catalog, Issue:71, Page:004</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/upper-receivers/mk18-stripped-socom-upper-receiver-w-handguard-only-prod81194.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/upper-receivers/mk18-stripped-socom-upper-receiver-w-handguard-only-prod81194.aspx', '3137db3ec90febb37a7c005d4dba393a', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:43:51'),
(2479, 4, 'TULAMMO USA - \r\n                STEEL CASE AMMO 223 REMINGTON 62GR FMJ', '<p></p>\n<p> In the fields, at the range or on the hunt, you can trust TulaAmmo to deliver a superior level of internal, external, and terminal ballistics, more consistent velocities and impressive retained energies downrange from your favorite rifle, with an unmatched value-to-performance ratio. All TulaAmmo rifle cartridges are steel cased, zinc jacketed, non-corrosive Berdan primed, with a phosphate polymer coating and a lead core.</p>\n<ul>\n<li>  Shooting Accuracy- more uniform and consistent jacket delivers up to 15% better shooting accuracy than standard bimetal bullets.</li> <li>  Corrosion Resistance- Zinc jacket doesn\'t change in appearance over time and is proven to inhibit electrochemical corrosion of the steel case.</li> <li>  Environmental Impact- Zinc jacket is more ecologically sound.</li>\n</ul>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>', NULL, 'https://www.brownells.com/ammunition/rifle-ammo/steel-case-ammo-223-remington-62gr-fmj-prod88365.aspx', NULL, NULL, 256.99, 5.49, 251.50, 'https://www.brownells.com/ammunition/rifle-ammo/steel-case-ammo-223-remington-62gr-fmj-prod88365.aspx', '1ef09a37de65b7c54c7aebdf7d004419', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:43:56'),
(2480, 4, 'ED BROWN - 1911 45 ACP SUPPRESSOR READY THREADED BARRELS', '<p></p>\n<p> Identical to the standard drop-in Ed Brown barrel, but longer length and threaded for use with suppressors. Thread size is 0.578 x 28 tpi RH. Includes link, link pin, bushing and thread protector.<br><br> Barrel accuracy comes from using the highest quality materials and manufacturing methods. Ed Brown Products is committed to both.  The barrels are made from T-416 modified, gun barrel quality stainless steel bar stock, just like a benchrest rifle barrel.  T-416 is certified pure, there are no foreign materials, and no hard or soft spots to worry about. It is stress-relieved and heat-treated prior to final rifling and refinishing. Ed Brown barrels are precision machine cut from a 3 pound chunk bar of this top quality steel.<br><br> Ed Brown barrels are rifled by precision broach in the original six lands and grooves, one turn in sixteen, left hand twist as originally designed by John Browning. This deep cut, broached rifling gives superior accuracy with all types of bullets, including lead.  Ed Brown barrels are heat-treated by an aerospace certified heat treat facility, and sub-zero frozen for maximum strength and stress relief. This means more accuracy and longer barrel life to the shooter. Ed Brown has also cut the dimensions to max tolerance on the outside of the barrel. This means less fitting work for you, and more accuracy.<br><br><em>A suppressor equipped with a Nielsen device (such as <a href=\"/handgun-parts/barrel-parts/muzzle-devices/suppressors/ti-rant-45-auto-pistol-silencer-578-28-sku276000055-72561-140101.aspx?sku=276-000-055\" target=\"_blank\"><strong><u>276-000-055</u></strong></a>) is REQUIRED for reliability in a 1911. This is also referred to as a booster, kicker, or Linear Inertial Decoupler.</em></p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:100</em></strong></div>', NULL, 'https://www.brownells.com/handgun-parts/barrel-parts/barrels/1911-45-acp-suppressor-ready-threaded-barrels-prod77975.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/barrel-parts/barrels/1911-45-acp-suppressor-ready-threaded-barrels-prod77975.aspx', '5f6725620a9a0dca9d1e8712c6ff4e64', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:00'),
(2481, 4, 'GLOCK - MODEL 19 9MM MAGAZINE 10 PACK', '<p></p>\n<p> Be confident your Glock<em>®</em> pistol will perform to factory standards each and every time with genuine Glock<em>®</em> factory magazines. Manufactured to Glock<em>®</em> specifications in Austria by Glock<em>®</em>. All models include round count indicator on rear face of magazine body and standard factory baseplate.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	<em>“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H. Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H. The use of Glock on this page is merely to advertise the sale of Glock parts or components. As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</em></p>\r\n</div>', NULL, 'https://www.brownells.com/magazines/handgun-magazines/magazines/model-19-9mm-magazine-10-pack-prod80254.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/handgun-magazines/magazines/model-19-9mm-magazine-10-pack-prod80254.aspx', 'aeeadb10a69bb6dbaee5f6c43cd73d2e', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:04'),
(2482, 4, 'LYMAN - BORECAM DIGITAL BORESCOPE', '<p></p>\n<p> Lyman\'s new Borescope provides active shooters with the means to carefully inspect the bores of their firearms for wear, throat erosion, tool marks, and other rifling or chamber damage, as well as for checking for fouling. The scope will fit 20 caliber and larger barrels and works with miniature camera technology. The display will show a clear image of the inside of the barrel and also allows you to take a photo of the bore. The image will be stored on a standard SD card and can later be viewed on a computer or laptop.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:442</em></strong></div>', NULL, 'https://www.brownells.com/gunsmith-tools-supplies/general-gunsmith-tools/borescopes/borecam-digital-borescope-prod81507.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/gunsmith-tools-supplies/general-gunsmith-tools/borescopes/borecam-digital-borescope-prod81507.aspx', '38c1709005ffabc4d5854c3787ec5cb2', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:07'),
(2483, 4, 'AGUILA - \r\n                12 GAUGE MINISHELL 1-3/4\" 7/8OZ SLUG', '<p></p>\n<p> A full 1\" shorter than traditional shotgun shells, the Aguila Minishell 12 Ga. Slug lets you nearly double the capacity of your pump-action or semi-auto shotgun. Great for recoil sensitive shooters, the Minishell Slug produces a diminished recoil and quieter report than full-sized 12 ga. shells. Loaded to SAAMI specs, the Minishell Slug is effective for home defense, target shooting or taking small game.</p>\n<ul>\n<li>  7/8 oz. slug</li> <li>  1¾\" OAL</li> <li>  1,250 ft/sec velocity</li> <li>  Safe to fire in smooth OR rifled barrels</li>\n</ul>\n<p> Due to their unique size, Aguila 12 Ga. Minishell Slugs may not feed properly in semi-automatic shotguns and some pump-action shotguns without gunsmith modification to the gun. Also excellent low-recoil ammo for use in single- or double-barreled guns (just make sure the barrel can handle slugs).</p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>', NULL, 'https://www.brownells.com/ammunition/shotgun-ammo/12-gauge-minishell-1-3-4-7-8oz-slug-prod106086.aspx', NULL, NULL, 524.99, 16.99, 508.00, 'https://www.brownells.com/ammunition/shotgun-ammo/12-gauge-minishell-1-3-4-7-8oz-slug-prod106086.aspx', '4fd846da73aa584ddc96f0940d02a523', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:11'),
(2484, 4, 'FEDERAL - \r\n                LAKE CITY AMMO 5.56X45MM NATO 62GR XM855', '<p></p>\n<p> Bulk-packed, new-manufactured 5.56 x 45mm NATO ammo has a 62-grain bullet with a green-painted steel \"penetrator\" tip over a lead core with a partial jacket. The 90-Round box and 420-Round ammo can offerings come in 10-round stripper clips. The 420-Round ammo can also comes with a stripper guide. All others are bulk packed. Manufactured at the Lake City Army Ammunition Plant to Federal Cartridge Company specifications for commercial ammunition. The boxer-primed, reloadable brass case is headstamped with the Federal symbol and date of manufacture. Water-resistant lacquer-sealed primer. Every cartridge is visually inspected before packing. For use only in rifles with chambers designed for 5.56mm x 45 ammunition. Some ranges prohibit steel core ammunition; check range rules before shooting this ammo.</p>\n<p> <strong>Ammo can only included with stock# 105-000-002</strong></p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:104 <br> Big Book Catalog, Issue:68, Page:546</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/rifle-ammo/lake-city-ammo-5-56x45mm-nato-62gr-xm855-prod44665.aspx', NULL, NULL, 184.99, 159.99, 25.00, 'https://www.brownells.com/ammunition/rifle-ammo/lake-city-ammo-5-56x45mm-nato-62gr-xm855-prod44665.aspx', '31db500698f8979f819c28cf0974072e', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:16'),
(2485, 4, 'BROWNELLS - \r\n                P80 G17 FRAME W/ G17 GEN 3 RMR SLIDE+ WINDOW BLACK', '<h3 class=\"mbm\">Build Your Own Full-Size G17</h3>\n<p></p>\n<p> The DIY market of firearm enthusiasts got a boost with the launch of the Polymer80 Glock G17 pistol frame, enabling handgun aficionados to apply their skills to the construction and finishing of a Glock-style pistol. Now, Brownells makes the process even easier by adding one of the company\'s exclusive Front Cut RMR Slides for Gloc®k pistols to the kit.<br><br> Each Polymer80 G17 frame is also enhanced with Brownells-exclusive elements, incorporating a specially developed Aggressive Texture finish that can only be had from Brownells. The Front Cut RMR Slides included with the kit are machined with wraparound serrations and feature a specially milled slot designed for Trijicon RMR sights.</p>\n<ul>\n<li>  Includes finishing jig</li> <li>  Frame molded from high-strength polymer</li> <li>  Includes Picatinny accessory-attachment rail</li> <li>  Strengthened by stainless-steel locking block and rear module</li>\n</ul>\n<p> The Brownells RMR Glock® Slide is made from durable 17-4 stainless steel and accepts all standard G17 Gen 3 slide components. The slide is also cut for Glock-style iron sights, though suppressor-height sights are required to co-witness with a mounted optic.</p>\n<p> <strong>Returns will not be accepted once the receiver is modified in any way. All warranty issues will be directed to the manufacturer.</strong><br>  </p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H. Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H. The use of Glock on this page is merely to advertise the sale of Glock parts or components. As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</p>\r\n</div>', NULL, 'https://www.brownells.com/handgun-parts/frame-parts/frames/p80-g17-frame-w-g17-gen-3-rmr-slide-window-black-prod120323.aspx', NULL, NULL, 369.99, 299.99, 70.00, 'https://www.brownells.com/handgun-parts/frame-parts/frames/p80-g17-frame-w-g17-gen-3-rmr-slide-window-black-prod120323.aspx', '13296c0409faab8d97d68ea4585295aa', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:19'),
(2486, 4, 'DPMS - \r\n                AR-15 LOWER RECEIVER COMPLETE WITH M4 STOCK ASSEMBLY', '<p></p>\n<p> Forged, fully assembled lower is ready for your choice of upper. Precision machined from 7075-T6 aircraft-grade aluminum alloy, mil-spec hardcoat anodized, then Teflon-coated black for superior wear and scratch resistance.  Includes mil-spec trigger group. The M4 lower is equipped with a 6-position, collapsible carbine stock made of impact-resistant polymer.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:008</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/lower-receivers/ar-15-lower-receiver-complete-with-m4-stock-assembly-prod85259.aspx', NULL, NULL, 208.99, 159.99, 49.00, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/lower-receivers/ar-15-lower-receiver-complete-with-m4-stock-assembly-prod85259.aspx', '952fc38e9a5be604dac306276d1838e0', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:25'),
(2487, 4, 'VORTEX OPTICS - STRIKE EAGLE SCOPE 1-6X24MM AR-BDC RETICLE', '<p></p>\n<p> Speed and versatility—that’s what 1x variable optics offer AR shooters who need to engage targets from point-blank out to extended ranges. And that’s exactly what you’re going to get with Vortex’s new Strike Eagle 1-6 x 24. Take into consideration what it costs to get into this optic, and you may find you can’t afford not to buy it.<br><br> Whether you’re burning through a 3-Gun Stage, logging some range time, or holding for hair on a coyote you’ve duped into thinking you’re lunch, the Strike Eagle is up to the task. High-quality, fully multi-coated lenses deliver a clear, crisp sight picture and optimal low-light performance. A true one-power on the low end of its 6x zoom range provides quick target acquisition in close quarters scenarios. Need to engage targets at distance? Crank it up to 6x and let it rip.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:101 <br> Big Book Catalog, Issue:69, Page:278 <br> Sinclair, Issue:5B, Page:193</em></strong></div>', NULL, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/strike-eagle-scope-1-6x24mm-ar-bdc-reticle-prod75096.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/strike-eagle-scope-1-6x24mm-ar-bdc-reticle-prod75096.aspx', '7071df4820813e4c4adcde4dd56206e0', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:29'),
(2488, 4, 'WHEELER ENGINEERING - FAT WRENCH', '<p></p>\n<p> FAT Wrench w/10 Bit Set:  Wheeler\'s FAT Wrench brings perfect consistency to every screw on your rifle!</p>\n<p>  This amazing handheld torque wrench lets you apply repeatable, accurate torque settings to scope rings, guard screws and other screws, which aids in accuracy and decreases the opportunity for problems in the field.</p>\n<p>  The FATWrench is a perfect compliment to the Deluxe Gunsmithing Screwdriver Sets. Together, they can ensure accurate tightening of most every screw on any gun in your collection.</p>\n<ul>\n<li>   Torque adjustments range from 10 inch pounds to 65 inch pounds</li> <li>   Accuracy plus/minus 2 inch pounds</li> <li>   1/4\" drive</li>\n</ul>\n<p>  Plastic Case Included</p>\n<div> Included bits:<br><ul>\n<li>   Leupold/Buehler windage bit</li>  <li>   #10 flat blade bit</li>  <li>   #11 flat blade bit</li>  <li>   #32 flat blade bit</li>  <li>   3/32\" Allen bit</li>  <li>   7/64\" Allen bit</li>  <li>   5/32\" Allen bit</li>  <li>   T15 Torx bit</li>  <li>   T20 Torx bit</li>  <li>   Square drive adapter bit</li> </ul>\n</div>\n<p>  </p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:437</em></strong></div>', NULL, 'https://www.brownells.com/gunsmith-tools-supplies/general-gunsmith-tools/wrenches/general-wrenches/fat-wrench-prod56976.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/gunsmith-tools-supplies/general-gunsmith-tools/wrenches/general-wrenches/fat-wrench-prod56976.aspx', '7555ff67db949a7493a5a62eafda0828', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:32'),
(2489, 4, 'BROWNELLS - M16 6.5 GRENDEL BOLT CARRIER GROUP NITRIDE MP', '<h3 class=\"mbm\">The Perfect Piece for Your 6.5 Grendel Build</h3>\n<p></p>\n<p> The Brownells 6.5 Grendel Bolt Carrier Group provides users with a caliber-specific bolt carrier assembly that ensures reliable, premium performance at an affordable price.<br><br> The Brownells 6.5 Grendel Bolt Carrier Group is constructed with two separate kinds of steel. The bolt itself is fabricated from 9310, while the carrier is built using 8620 hardened steel. After machining, the bolt is completed with shot peening and heat treatment.</p>\n<ul>\n<li>  Each bolt undergoes magnetic-particle inspection</li> <li>  Extractor installation includes rubber insert and spring</li> <li>  Features correct gas-key torqueing and staking</li> <li>  Bolt finished with black-nitride coating</li> <li>  Type 2 Bolt</li> <li>  Bolt face depth is .136\"</li>\n</ul>\n<p> The Brownells 6.5 Grendel Bolt Carrier Group, in addition to the bolt, bolt carrier and gas key, also features a firing pin, cam pin and a firing pin retaining pin.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:009</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-6-5-grendel-bolt-carrier-group-nitride-mp-prod105382.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-6-5-grendel-bolt-carrier-group-nitride-mp-prod105382.aspx', 'ae9f5e839f2167f89073cbb0e27e5415', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:35'),
(2490, 4, 'AERO PRECISION - \r\n                OEM MID-LENGTH 16\" RIFLE', '<h3 class=\"mbm\">High-End, Nearly Complete AR Includes Everything You Need - Nothing You Don\'t</h3>\n<p></p>\n<p> This fully-assembled, nearly-complete, Brownells-exclusive rifle from Aero Precision is constructed using second-to-none components to ensure the highest level of accuracy and reliability, while leaving off the handguard and buttstock – <em>saving you money to buy the accessories you want!</em></p>\n<p> Build your Dream AR-15 from this high quality custom rifle platform without wasting money on components you don\'t want. Simply choose the free-float handguard that fits your needs, sights, and a mil-spec buttstock, snap them on and head to the range.</p>\n<p> <span style=\"font-size: 16px\"><a href=\"/search/index.htm?avs%7CNewsletter_1=OEM+Handguards\"><strong>Shop mil-spec barrel nut compatible free-float handguards </strong></a></span></p>\n<p> <strong>M4 Aero Precision Upper Receiver</strong></p>\n<ul>\n<li>  Mid-Length Gas &amp; Barrel System Ideal for free-float handguards </li> <li>  16” 5.56 NATO, 1:7 Twist Barrel with M4 feed ramps </li> <li>  Barrel is machined from 4150 Chrome Moly Vanadium steel to a Government, mid-length profile, then treated with a QPQ corrosion-resistant finish </li> <li>  ½-28 barrel thread pitch includes an installed A2 flash hider </li> <li>  M16 Bolt/Carrier Group features 8620 steel carrier with phosphate finish &amp; chrome lining, and has a properly-staked Gas Key </li> <li>  Bolt machined from Carpenter 158 – High Pressure Tested &amp; Magnetic Particle Inspected</li>\n</ul>\n<p> <strong>Aero Precision Gen 2 Lower Receiver </strong></p>\n<ul>\n<li>  Flared mag well &amp; upper tension screw</li> <li>  Standard AR-15 Lower Parts Kit </li> <li>  Mil-spec AR-15/M14 Buffer Kit </li> <li>  Forged from 7075 T6 Aluminum</li> <li>  Matte black hard anodized finish</li> <li>  <a href=\"/search/index.htm?avs%7cNewsletter_1=AERO+PRECISION+AC-15+Popular+Accessories&amp;s_o=MostPopular%20(Descending)\" target=\"_blank\"><strong><u>Accessorize this rifle now! Shop these popular accessories. </u></strong></a>\n</li>\n</ul>\n<p> <em><em>* While supplies last. Prices and availability subject to change without notice. FFL transfer fees may apply. All federal, state, and local laws and ordinances apply. Not available for sale online to CA, CT, DC, MA, NY &amp; NJ. If you live in a restricted area but have proper authorization to purchase please call us at 800-741-0015 and ask for customer service. <em>Rifle comes fully assembled (without handguard and buttstock). </em></em></em></p>', NULL, 'https://www.brownells.com/firearms/rifles/semi-auto/oem-mid-length-16-rifle-prod81838.aspx', NULL, NULL, 520.99, 499.99, 21.00, 'https://www.brownells.com/firearms/rifles/semi-auto/oem-mid-length-16-rifle-prod81838.aspx', '47b29d6b84033c2951d4e57ab06cda20', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:40'),
(2491, 4, 'GLOCK - MODEL 19 9MM MAGAZINE 3 PACK', '<p></p>\n<p> Be confident your Glock® pistol will perform to factory standards each and every time with genuine Glock® factory magazines. Manufactured to Glock® specifications in Austria by Glock®. All models include round count indicator on rear face of magazine body and standard factory baseplate.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	<em>“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H. Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H. The use of Glock on this page is merely to advertise the sale of Glock parts or components. As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</em></p>\r\n</div>', NULL, 'https://www.brownells.com/magazines/handgun-magazines/magazines/model-19-9mm-magazine-3-pack-prod80253.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/handgun-magazines/magazines/model-19-9mm-magazine-3-pack-prod80253.aspx', '18c9636ec563e771a7475fd41d03c87a', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:44'),
(2492, 4, 'HOWA - \r\n                1500 7.62X39 20\" HEAVY BARRELED MINI ACTION', '<p></p>\n<p> Howa 1500 Barreled Actions are the perfect platform for a quality precision rifle build, at an affordable cost.  Every Howa Barreled Action features a hammer forged barrel, bottom metal and precise HACT two stage trigger.  The receiver and bolt are forged steel, with the bolt featuring an integral bolt handle.  Bolt faces are square to the barrel chamber and bolt faces have excellent contact with the receiver recesses.  M16 style extractor ensure positive extraction and function.  Factory barrels are hammer forged with headspace set to exacting standards.  The HACT two stage trigger has a crisp, light and consistent pull.  The included 3 position safety allows for the bolt to be locked, as well as put on safe when unloaded.  Scope bases are available from a variety of quality manufacturers.</p>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-7-62x39-20-heavy-barreled-mini-action-prod94579.aspx', NULL, NULL, 449.00, 249.99, 199.01, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-7-62x39-20-heavy-barreled-mini-action-prod94579.aspx', 'a2ae7230816ff21d0016598361d0f776', 0, NULL, '2018-08-06 12:12:19', '2018-08-06 13:44:48'),
(2493, 4, 'SUREFIRE - AR-15 60RD MAGAZINE 223/5.56', '<h3 class=\"mbm\">More Firepower &amp; Fewer Mag Changes</h3>\n<p></p>\n<p> Ultra-high capacity magazines keep your rifle running longer between mag changes during competition or tactical operations. These magazines meet NATO STANAG 4179 specifications and are compatible with all rifles that accept AR-15/M16/M4 magazines. Less than two standard magazines wide, so they’re easy to hold and handle with one hand. 60-round model fits most dual-mag pouches for 30-round magazines. Weight is centered under the weapon to help you maintain a normal shooting grip and stance. Seats fully loaded on a closed bolt. “Nesting” nylon followers require no lubrication and fully support the round stack to aid in reliable feeding. Cadmium coating on springs reduces friction and resists corrosion.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:062 <br> Big Book Catalog, Issue:71, Page:068</em></strong></div>', NULL, 'https://www.brownells.com/magazines/rifle-magazines/magazines/ar-15-60rd-magazine-223-5-56-prod42026.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/rifle-magazines/magazines/ar-15-60rd-magazine-223-5-56-prod42026.aspx', 'ac68e4c778c1afe6d125f657e4075fbc', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:44:51'),
(2494, 4, 'BROWNELLS - J-B® NON-EMBEDDING BORE CLEANING COMPOUND', '<h3 class=\"mbm\">Cuts Through Toughest Bullet Jacket &amp; Powder Fouling -      Can\'t-Run Paste Formulation -                               Cushioned Abrasive Action Leaves Bores Sparkling -          Won\'t \"Eat\" Stock Finishes</h3>\n<p></p>\n<p> The original, time-proven formula developed by Jim Brobst and produced under exclusive license. J-B has been getting burned-on, caked-in powder residue and copper jacket fouling out of gun barrels since the 1960’s, and hasn’t damaged an inch of rifling yet. Today, J-B once again proves itself a champion by the way it easily cleans the dirtiest, moly-fouled barrels.<br><br> A unique combination of ingredients and a one-of-kind, multi-step mixing process give J-B its special characteristics. They work together to cushion the abrasive action; the soft paste liquifies as you use it, then wipes out of the bore easily. The non-embedding feature means there’s no abrasive residue left behind which might keep \"cutting\" after you’ve finished cleaning.<br><br> J-B has been a favorite on gunsmiths’ benches for years, as a \"magic\" cure for customer guns that \"...just won’t shoot anymore\". These pros know that a good scrubbing with J-B often restores accuracy. Match and varmint shooters put a lot of rounds down range, many of those using moly coated bullets. The large amounts of copper fouling and the burned-in moly can create a cleaning nightmare; J-B makes short work of it. Use J-B with the Lewis Lead Remover to get the last speck of leading out of pistol bores. Shotguns combine lead, powder and plastic fouling to really throw patterns off; J-B cleans it all out quickly and easily.<br><br> Here’s what a couple of the most respected names in the shooting industry have said about J-B. Jim Carmichel, gun writer and dedicated shooter, \"I have used J-B for years and routinely use it even on my very finest benchrest rifles. When no other bore cleaner will get the job done, J-B will.\" The late Warren Page, a benchrest shooting legend, wrote the praises of J-B when it was first introduced to the shooting public. He said, \" J-B is an ultra mild, abrasive oil paste, finer than jewelers’ rouge, which we in the rifle accuracy shenanigan, a few years ago, found was the answer to problems of metal fouling and serious powder fouling that solvents either won’t touch, or will cut only by much labor.\" And, \"... it was quickly discovered that such an extremely fine abrasive, used with discretion, would take out caked powder residue and mild metal streaking without ruining the bore.\"</p>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:04, Page:059 <br> AR-15, Issue:04, Page:073 <br> Big Book Catalog, Issue:71, Page:348 <br> Sinclair, Issue:5B, Page:149</em></strong></div>', NULL, 'https://www.brownells.com/gun-cleaning-chemicals/solvents-degreasers/bore-cleaning-paste/j-b-non-embedding-bore-cleaning-compound-prod1160.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/gun-cleaning-chemicals/solvents-degreasers/bore-cleaning-paste/j-b-non-embedding-bore-cleaning-compound-prod1160.aspx', '663cccc16a329df7e83d28d9c7d683a5', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:44:55'),
(2495, 4, 'TRIJICON - HD XR NIGHT SIGHTS FOR GLOCK', '<h3 class=\"mbm\">Next Level of Advanced Target Identification and Long-Distance Engagement</h3>\n<p></p>\n<p> HD XR Night Sights for Glock handguns from Trijicon offer the next level of advanced target identification and long-distance engagements. While some sights obscure the target, or make confirmation of hits on target hard to see, the thinner front sight post reduces these common issues.<br><br> HD XR Night Sights use a U-notch rear sight design for intuitive use and quick target acquisition.<br>  </p>\n<ul>\n<li>  Sapphire jewel capped tritium lamps</li> <li>  Tritium-phosphor lamp</li> <li>  Silicone rubber cushion</li>\n</ul>\n<p> These XD HR Night Sights are compatible with Glock handguns.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:322</em></strong></div>', NULL, 'https://www.brownells.com/handgun-parts/sights/sight-sets/hd-xr-night-sights-for-glock-prod102459.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/sights/sight-sets/hd-xr-night-sights-for-glock-prod102459.aspx', '68ed3bf90373514681d99406a50fe85f', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:45:00');
INSERT INTO `deals` (`id`, `source_id`, `title`, `description`, `image`, `link`, `ratings`, `reviews_count`, `base_price`, `sale_price`, `save_price`, `from_url`, `unique_md5`, `out_of_stock`, `ext_date`, `created_at`, `updated_at`) VALUES
(2496, 4, 'WHITE OAK ARMAMENT - AR-15/M16 223 WYLDE MATCH BARRELS', '<h3 class=\"mbm\">Wylde Chamber Helps Maximize Performance With .223 Or 5.56 Ammo</h3>\n<p></p>\n<p> Precision-machined stainless steel barrels feature a .223 Wylde chamber that helps maximize the long-range performance of your AR-15 with both .223 Remington and 5.56x45mm NATO ammunition. With 6-groove, 1-7\" button rifling for accuracy and M4-type feed ramps for reliable feeding, these barrels help you reach out to distant targets with issued or magazine-length ammunition. The 18\" barrels offer the Special Purpose Rifle (SPR) profile designed to optimize accuracy out to 600 meters, and are available with Mid-Length or Rifle-Length gas systems. SDM barrel features a heavy, fluted profile under the handguards, for added strength and rigidity.  Threaded muzzle accepts a variety of compensators or flash suppressors.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:020 <br> Big Book Catalog, Issue:71, Page:021 <br> Sinclair, Issue:5B, Page:249</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/barrel-parts/rifle-barrels/ar-15-m16-223-wylde-match-barrels-prod54526.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/barrel-parts/rifle-barrels/ar-15-m16-223-wylde-match-barrels-prod54526.aspx', '6b9733919d5ea86a2d58badec21b438d', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:45:02'),
(2497, 4, 'HOWA - \r\n                1500 308 18.5\" THREADED STANDARD BARRELED ACTION', '<h3 class=\"mbm\">Dead-On Accuracy Out of the Box &amp; Unlimited Customizing Options</h3>\n<p></p>\n<p> The Howa 1500 18.5\" .308 Winchester Barreled Action lets you build your own high-end precision rifle – without getting a second mortgage to pay for it. Built around a short-action (SA) receiver and a high-quality cold hammer-forged barrel, the Howa 1500 .308 Winchester Standard Barreled Action locks up tight with Howa’s one-piece, dual-lug bolt machined for an extremely precise fit to the receiver raceway.</p>\n<p> Also inside, Howa’s Actuator Controlled Trigger (HACT) delivers a crisp, light, consistent pull, adjustable between 2.5 and 3.8 lbs. Rounding out the package is a three-position safety, is often preferred by bolt-action shooters.</p>\n<p> The rest is up to you: customize your rifle exactly the way you want by installing the remaining components yourself. Howa takes care of the most difficult task, mating barrel to action and getting correct headspacing. You install the barreled action into the stock or chassis system of your choice and add accessories. The Scout Model accepts a front sight.</p>\n<ul>\n<li>  18-1/2\" barrel length for a compact, maneuverable field rifle</li> <li>  5/8\"-24 tpi threaded muzzle is ready for a comp/brake/flash suppressor (thread cap included)</li> <li>  Blued finish</li> <li>  M16-type extractor for reliable cartridge extraction</li> <li>  FFL required for purchase</li>\n</ul>\n<p> All that’s needed to complete your Howa 1500 .308 Standard Barreled Action is a stock, scope, bottom metal of choice, and mounting hardware. Then hit the range and see what your new custom rifle can do!</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:160</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-308-18-5-threaded-standard-barreled-action-prod113618.aspx', NULL, NULL, 444.99, 259.99, 185.00, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-308-18-5-threaded-standard-barreled-action-prod113618.aspx', 'd74832ff25caac7532b6880f395842ea', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:45:08'),
(2498, 4, 'FIRE FOR EFFECT - AR-15 GUN BUILDER\'S KIT', '<h3 class=\"mbm\">Only the Parts You Need, Without the Waste</h3>\n<p></p>\n<p> The AR-15 Gun Builder\'s Lower Parts Kit from Fire For Effect contains all the necessary, standard small parts you need to complete a stripped lower receiver or refurbish an old rifle. It leaves out the main parts folks actually want to customize, the pistol grip, trigger, hammer, disconnector, and triggerguard.<br><br> Here’s exactly what the Fire For Effect AR-15 Gun Builder\'s Lower Parts Kit contains:</p>\n<ul>\n<li>  Pivot/takedown pins</li> <li>  2x Takedown pin detent</li> <li>  2x Takedown pin detent spring</li> <li>  Bolt catch</li> <li>  Bolt catch plunger</li> <li>  Bolt catch spring &amp; pin</li> <li>  Buffer retainer &amp; spring</li> <li>  2x Hammer/trigger pins (.153\")</li> <li>  Magazine release button</li> <li>  Magazine catch &amp; spring</li> <li>  Safety selector</li> <li>  Selector detent</li>\n</ul>\n<p> While many \"lower parts kits\" contain the whole shebang - the \"fiddly bits\" AND a mil-spec fire control system and Plain Jane A2 grip - the Fire For Effect AR-15 Gun Builder\'s Lower Parts Kit lets you buy only the parts you’ll actually install in your rifle. And the money you save? We’re sure you can find something to spend it on!<br>  </p>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/parts-kits/rifle-parts-kits/ar-15-gun-builder-s-kit-prod113589.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/receiver-parts/parts-kits/rifle-parts-kits/ar-15-gun-builder-s-kit-prod113589.aspx', '9af288bfa490b6aac36dbd4aec3df5e9', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:45:11'),
(2499, 4, 'SILENCERCO - BERETTA 92FS/M9 THREADED BARREL', '<h3 class=\"mbm\">Sets You Up To Shoot Your Beretta With a Sound Suppressor</h3>\n<p></p>\n<p> The Silencerco Beretta 92F / 92FS / M9 Threaded Pistol Barrel turns your “Plain-Jane” Beretta into a suppressor ready host. The Silencerco Beretta 92F / 92FS / M9 Threaded Pistol Barrel does not require an XL piston. A normal ½\"-28 tpi piston will provide reliable function.</p>\n<ul>\n<li>  Threaded 1/2\"-28 to accept a wide variety of pistol suppressors</li> <li>  1-10\" twist rate</li> <li>  Machined from 416R stainless steel</li> <li>  Nonreflective black nitride finish</li>\n</ul>\n<p> Silencerco\'s Beretta 92F / 92FS / M9 Threaded Pistol Barrel comes ready drop-in into your pistol, and each ships with a thread protector to guard against damage to the threads when you\'re shooting unsuppressed.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:220</em></strong></div>', NULL, 'https://www.brownells.com/handgun-parts/barrel-parts/barrels/beretta-92fs-m9-threaded-barrel-prod104034.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/barrel-parts/barrels/beretta-92fs-m9-threaded-barrel-prod104034.aspx', '39b6a35e6ad60d19d402c366a6450bef', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:45:14'),
(2500, 4, 'TRIJICON - SUPPRESSOR TRITIUM NIGHT SIGHTS for GLOCK®', '<p></p>\n<p>  Trijicon has introduced a line of taller Bright &amp; Tough Night Sights designed specifically for Glock handguns fitted with suppressors and to serve as co-witness iron sights for the growing number of shooters utilizing the Trijicon RMR with machined slides. The new offerings are available in multiple front / rear configurations for a variety of applications. Trijicon self-luminous Night Sights increase night-fire shooting accuracy by as much as five times over conventional sights. Equally impressive, they do so with the same speed as instinctive shooting– and without the need for batteries.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H.  Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H.  The use of Glock on this page is merely to advertise the sale of Glock parts or components.  As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</p>\r\n</div>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:322</em></strong></div>', NULL, 'https://www.brownells.com/handgun-parts/sights/sight-sets/suppressor-tritium-night-sights-for-glock--prod58739.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/sights/sight-sets/suppressor-tritium-night-sights-for-glock--prod58739.aspx', '6be18e9f2c88cf646e2224feb484c965', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:45:17'),
(2501, 4, 'GLOCK - GEN 5MAGAZINE FOR GLOCK®17/34', '<h3 class=\"mbm\">The Latest Gen5 Upgrades - Compatible With Earlier Models</h3>\n<p></p>\n<p> These are genuine factory replacement magazines for Gen5 Glock® 17 / 34 pistols. Built around a tough, crack resistant, molded polymer body, Gen5 mags have a steel lining for extra strength and durability. Inside, an orange follower makes keeping track of load status through the witness holes easier, while the extended, angled baseplate helps with those fast magazine changes.</p>\n<ul>\n<li>  Available with standard 17- or 10-rd capacity</li> <li>  High-visibility orange follower</li> <li>  Witness holes on rear face</li>\n</ul>\n<p> Glock® 17 / 34 Gen5 magazines are contoured at the base to match the flared magwell of Gen5 pistols, yet are still fully compatible with all earlier generation Glock® pistols.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H. Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H. The use of Glock on this page is merely to advertise the sale of Glock parts or components. As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</p>\r\n</div>', NULL, 'https://www.brownells.com/magazines/rifle-magazines/magazines/gen-5magazine-for-glock-17-34-prod115616.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/rifle-magazines/magazines/gen-5magazine-for-glock-17-34-prod115616.aspx', '2604bb95c350a6b349c364e627a5e47d', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:45:20'),
(2502, 4, 'HOWA - \r\n                1500 6.5 GRENDEL 20\" THREADED HEAVY BARRELED MINI ACTION', '<h3 class=\"mbm\">Build Your Dream Rifle Without a Nightmare Price Tag</h3>\n<p></p>\n<p> Howa 1500 Barreled Actions are the perfect platform for a quality precision rifle build, at an affordable cost.  This Howa Barreled Mini Action features a hammer forged barrel, detachable magazine, 5/8\"-24 threaded muzzle, and precise HACT two stage trigger.  The receiver and bolt are forged steel, with the bolt featuring an integral bolt handle.  Bolt faces are square to the barrel chamber and bolt faces have excellent contact with the receiver recesses.  M16 style extractor ensure positive extraction and function.  Factory barrels are hammer forged with headspace set to exacting standards.  The HACT two stage trigger has a crisp, light and consistent pull.  The included 3 position safety allows for the bolt to be locked, as well as put on safe when unloaded.  Scope bases are available from a variety of quality manufacturers.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:160</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-6-5-grendel-20-threaded-heavy-barreled-mini-action-prod113624.aspx', NULL, NULL, 508.99, 359.99, 149.00, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-6-5-grendel-20-threaded-heavy-barreled-mini-action-prod113624.aspx', 'd488f389e1e1be58ae1294115753687d', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:45:24'),
(2503, 4, 'BROWNELLS - M16 458 SOCOM BOLT CARRIER GROUP NITRIDE MP', '<h3 class=\"mbm\">Constructed and Finished for the Big-Bore .458</h3>\n<p></p>\n<p> Get your .458 SOCOM AR-15 running perfectly with the Brownells M16 .458 SOCOM Bolt Carrier Group, which features construction and finishing designed to provide the best possible performance in your rifle.<br><br> The Brownells M16 .458 SOCOM Bolt Carrier Group features a bolt head built using 9310 steel, which undergoes heat treatment and shot peening for a durable finish. The carrier itself is made using 8620 steel that undergoes hardening after machining.</p>\n<ul>\n<li>  Undergoes magnetic particle inspection</li> <li>  Extractor construction includes rubber insert and spring</li> <li>  Increased corrosion resistance offered through black-nitride finish</li> <li>  Features torqued and staked gas key</li>\n</ul>\n<p> The Brownells M16 .458 SOCOM Bolt Carrier Group provides users with a complete assembly, also including a firing pin, cam pin and a firing pin retaining pin.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:009</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-458-socom-bolt-carrier-group-nitride-mp-prod105383.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-458-socom-bolt-carrier-group-nitride-mp-prod105383.aspx', 'a309604dcf4a402fec475f49a47c3680', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:45:28'),
(2504, 4, 'MAGPUL - AR-15 30RD PMAG GEN M2 MOE WINDOW MAGAZINE 223/5.56', '<h3 class=\"mbm\">Dependable &amp; Nearly Indestructible; Store Fully Loaded Without Loss Of Reliability</h3>\n<p></p>\n<p> Exceptionally rugged, combat- and competition-ready magazine functions flawlessly, even when left fully loaded for extended periods. Corrosion-proof, self-lubricating one-piece body of fiber-reinforced, molded polymer has no spot welds or joints to impair the follower, and the constant internal curve ensures smooth, unobstructed movement of the round stack. Anti-tilt follower stabilizes the stack to help prevent nose-diving and bolt-over-head failures. Heat-treated, stainless steel spring is stress-relieved for optimal performance. Withstands the heat from prolonged full-auto fire and is not harmed by most bore cleaners and solvents. Exterior ribbing provides added gripping surface; magazine catch notch, rather than a traditional hole, keeps dirt and debris out. Easy-to-grasp ledge on floorplate aids in extracting magazine from pouches; floorplate removes easily for cleaning. Curved-body 30-Round model in MagLevel configuration with windows on both sides of the magazine and a bright, orange indicator to display ammo level. All models available in Black.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:060 <br> Big Book Catalog, Issue:71, Page:067</em></strong></div>', NULL, 'https://www.brownells.com/magazines/rifle-magazines/magazines/ar-15-30rd-pmag-gen-m2-moe-window-magazine-223-5-56-prod82461.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/rifle-magazines/magazines/ar-15-30rd-pmag-gen-m2-moe-window-magazine-223-5-56-prod82461.aspx', '8da69cdf6e8339897a96aa9a84ebdde0', 0, NULL, '2018-08-06 12:12:20', '2018-08-06 13:45:32'),
(2505, 4, 'HORNADY - 22 CALIBER (0.224\") 55GR FMJBT WITH CANNELURE BULLETS', '<p></p>\n<p> Hornady 22 Caliber (0.224\") 55 grain FMJ bullets are built with a rugged AMP® bullet jacket (Advanced Manufacturing Process) that clearly delivers better performance. The thin-plated full metal jacket offered by other manufacturers is easily distorted and often breaks or separates when the bullet impacts the target.<br><br> The Hornady AMP bullet jacket features virtually zero tolerance for concentricity and near-zero wall thickness variation, punching through targets without deforming or breaking.</p>', NULL, 'https://www.brownells.com/reloading/bullets/rifle-bullets/22-caliber-0-224-55gr-fmjbt-with-cannelure-bullets-prod115430.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/bullets/rifle-bullets/22-caliber-0-224-55gr-fmjbt-with-cannelure-bullets-prod115430.aspx', 'baa8f5613bbf8d9d6ab941c4ddcc5c12', 0, NULL, '2018-08-06 12:12:21', '2018-08-06 13:45:35'),
(2506, 4, 'GLOCK - MODEL 22/35 MAGAZINES', '<h3 class=\"mbm\">Choose Genuine Factory Magazines For Top Performance &amp; Reliability</h3>\n<p></p>\n<p> Be confident your Glock® pistol will perform to factory standards each and every time with genuine Glock® factory magazines. Manufactured to Glock® specifications in Austria by Glock®. All models include round count indicator on rear face of magazine body and standard factory baseplate.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	<em>“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H. Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H. The use of Glock on this page is merely to advertise the sale of Glock parts or components. As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</em></p>\r\n</div>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:227</em></strong></div>', NULL, 'https://www.brownells.com/magazines/handgun-magazines/magazines/model-22-35-magazines-prod71420.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/handgun-magazines/magazines/model-22-35-magazines-prod71420.aspx', '56089a136f7a1d9afe6daf86858ce528', 0, NULL, '2018-08-06 12:12:21', '2018-08-06 13:45:39'),
(2507, 4, 'A-ZOOM - AMMO SNAP CAP DUMMY ROUNDS', '<h3 class=\"mbm\">Practice Loading, Unloading, Dry Firing</h3>\n<p></p>\n<p> Machined, aluminum body with synthetic, cushion primer withstands repeated cycling. Shaped like loaded rounds for correct loading and feeding. Improves shooting skill, gun handling. Handgun shooters can practice reloading, and trigger squeeze. Competitive shooters and hunters can improve rifle handling proficiency.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:368 <br> Sinclair, Issue:5B, Page:221</em></strong></div>', NULL, 'https://www.brownells.com/gunsmith-tools-supplies/general-gunsmith-tools/cartridge-dummies/ammo-snap-cap-dummy-rounds-prod5176.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/gunsmith-tools-supplies/general-gunsmith-tools/cartridge-dummies/ammo-snap-cap-dummy-rounds-prod5176.aspx', '3e1823e8854316d38bfb262d53f309aa', 0, NULL, '2018-08-06 12:12:21', '2018-08-06 13:45:50'),
(2508, 4, 'MGW - RANGE MASTER COMPACT UNIVERSAL SIGHT TOOL', '<h3 class=\"mbm\">A High-End Precision Sight Tool Without the High-End Price</h3>\n<p></p>\n<p> The MGW Rangemaster Universal Sight Tool delivers most of the functionality of MGW’s flagship Sight Pro Tool in a more compact package that better fits the budget of the average pistol owner. The Sight Pro is rightly regarded by many professional pistolsmiths as one of the finest sight installation tools available and worth every penny of its asking price. But it is a substantial investment for the more casual gun-tinkerer or shooter who’s hands-on about repairs and upgrades.<br><br> MGW solves these folks’ financial dilemma with their smaller Rangemaster Universal Sight Tool. The difference? The Rangemaster is limited to a .750\" reach from the backside of the slide underlug to the front sight location. (For reference, the original Sight Pro has a full 1.750\" reach for use on 1911s and long-slide competition pistols.) Otherwise, the function of the Rangemaster is exactly the same as the Sight Pro.</p>\n<ul>\n<li>  Uses the same gun-specific slide shoes (sold separately) as the original Sight Pro. Click <strong><em><u><a href=\"/search/index.htm?k=slide+shoe&amp;ksubmit=y\">Slide Shoe</a></u></em></strong>\n</li> <li>  Comes with standard pusher block for straight-side sights</li> <li>  Also accepts other MGW pusher blocks (must be purchased separately)</li> <li>  Top assembly available separately as MGWSP800-U for quick pusher block changes - simply swap the entire \"top half\"</li> <li>  Sturdy, durable aluminum tool body plus stainless steel hardware ensure proper alignment of tool, slide and sight</li>\n</ul>\n<p> MGW designed the Rangemaster Universal Sight Tool to accept the same gun-specific slide shoe inserts as the Sight Pro. You buy only the inserts you need for the gun(s) you work on. And if you ever upgrade to the Sight Pro, the shoes you already have are 100% compatible.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:478</em></strong></div>', NULL, 'https://www.brownells.com/gunsmith-tools-supplies/sight-scope-installation-tools/sight-movers/range-master-compact-universal-sight-tool-prod107379.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/gunsmith-tools-supplies/sight-scope-installation-tools/sight-movers/range-master-compact-universal-sight-tool-prod107379.aspx', '160cf011f56fb03020220161859c90cc', 0, NULL, '2018-08-06 12:12:21', '2018-08-06 13:45:54'),
(2509, 4, 'CCI - \r\n                BLAZER AMMO 22 LONG RIFLE 40GR LEAD ROUND NOSE', '<h3 class=\"mbm\">Classic .22 Load for Plinking Enjoyment &amp; More!</h3>\n<p></p>\n<p> CCI Blazer .22 LR 40 gr LRN rimfire ammunition is an ideal all-purpose load for a variety of applications. CCI has been a leader in rimfire ammunition for nearly 60 years, and it offers products ideal for the plinker, hunter, and target shooter, including Blazer .22 LR 40 gr LRN.</p>\n<ul>\n<li>  Brass case</li> <li>  Lubricated lead round nose (LRN) bullet</li> <li>  Available in 50-round box OR 500-round brick</li>\n</ul>\n<p> CCI Blazer .22 LR 40 gr LRN rimfire ammunition is gentle enough for older .22 rifles and pistols, yet delivers excellent performance from a gun manufactured yesterday as well. Grab a box or, better yet, a brick today and enjoy some quality time at the range!<br>  </p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:08, Page:096 <br> Big Book Catalog, Issue:66, Page:530</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/rimfire-ammo/blazer-ammo-22-long-rifle-40gr-lead-round-nose-prod85037.aspx', NULL, NULL, 25.99, 2.99, 23.00, 'https://www.brownells.com/ammunition/rimfire-ammo/blazer-ammo-22-long-rifle-40gr-lead-round-nose-prod85037.aspx', 'df3b3a6b7afeda0c779dfd2448dcf9f2', 0, NULL, '2018-08-06 12:12:21', '2018-08-06 13:45:57'),
(2510, 4, 'BROWNELLS - HOWA 1500 BRN-1 PRECISION CHASSIS', '<p></p>\n<p> The Brownells Howa 1500 BRN-1 Chassis system is designed to provide an enhanced rifle setup for owners of a number of popular rifle actions. Manufacturerd by MDT, the chassis is developed exclusively for Brownells and is inspired by the design of MDT\'s LSS rifle chassis. A great option for precision long range shooters looking to upgrade their stock rifle.<br><br> The BRN-1 Chassis system is set up to accept an AR-style buffer tube, allowing access to the incredible aftermarket of AR-15 buttstock accessories. The chassis also allows for the use of AR-style pistol grips, ensuring that owners can customize their rifles in any number of ways. The chassis is constructed from 6061 aluminum and features a V-shaped bedding system that accommodates most heavy barrels. The bedding system ensures that rifle barrels are free-floated for maximum accuracy.</p>\n<ul>\n<li>  Available in black and flat dark earth</li> <li>  Forend features M-LOK attachment points</li> <li>  Can be had in short-action and long-action setups</li> <li>  Maximum recoil-lug compatibility is .350-inch</li>\n</ul>\n<p> Only MDT polymer magazines will work in the short action chassis. The long action rifles will work with the metal 3.715\" magazines without fitting.<br> For .223 models the bolt stop may be too long. This can easily be modified.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:187</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/stock-parts/rifle-stocks/howa-1500-brn-1-precision-chassis-prod116296.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/stock-parts/rifle-stocks/howa-1500-brn-1-precision-chassis-prod116296.aspx', '1e9bc51c86731af307a9dda58b0681dc', 0, NULL, '2018-08-06 12:12:21', '2018-08-06 13:46:00'),
(2511, 4, 'MAGPUL - PMAG 15 GL9 FOR GLOCK® HANDGUNS', '<p></p>\n<p> The PMAG 15 GL9 is a 15-round Glock 9mm handgun magazine featuring a new proprietary all-polymer construction for flawless reliability and durability over thousands of rounds. High visibility anti-tilt follower, stainless steel spring, easily removable floorplate for cleaning, paint pen dot matrix for mag marking, ridged floorplate edges for better grip, and 15rd indicator windows. Drops free loaded or unloaded. All with the same boring reliability you expect from an OEM magazine.</p>\n<p> The PMAG 15 GL9 is compatible with Glock G19 handguns as well as sub-compact variants with some protrusion below the grip.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:227</em></strong></div>', NULL, 'https://www.brownells.com/magazines/handgun-magazines/magazines/pmag-15-gl9-for-glock-handguns-prod81632.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/handgun-magazines/magazines/pmag-15-gl9-for-glock-handguns-prod81632.aspx', '8b93e02388fd74943793a61617d026b2', 0, NULL, '2018-08-06 12:12:21', '2018-08-06 13:46:08'),
(2512, 4, 'HOWA - \r\n                1500 308 WIN 26\" THREADED SEMI HEAVY BARRELED ACTION', '<h3 class=\"mbm\">The Platform for a High-End Rifle   Without The High-End Price</h3>\n<p></p>\n<p> With the Howa 1500 Heavy Barreled .308 Winchester Action you can have that precision, long-range rifle of your dreams for a fraction of the cost (and the typical wait time) of having a custom rifle builder make one for you. All you have to do is outfit it with a stock, scope, a few select accessories, and you’re ready to rock-and-roll!<br><br> This Howa 1500 takes a heavy-contour, hammer-forged barrel and marries it to a forged steel short action (SA) receiver to form the foundation of your .308 Winchester tack-driver. Inside the receiver, a one-piece, dual-lugged bolt with a squared bolt face maintains optimum contact with the receiver recesses. Outside, an easy-to-reach, three-position safety locks the bolt completely or lets you cycle the bolt to clear the rifle while keeping the safety ON.<br><br> The Howa 1500 Heavy Varmint barreled action also gives you the benefit of Howa’s light, two-stage HACT (Howa Actuator Controlled Trigger) trigger. It delivers a smooth, consistent pull and a break that can be set from 2.5 to 3.8 lbs. An M16 style extractor kicks out empty cartridges with alacrity.</p>\n<ul>\n<li>  Fully assembled &amp; headspaced</li> <li>  1/2-28\" threaded muzzle with cap</li> <li>  Blued finish</li> <li>  FFL required for purchase</li>\n</ul>\n<p> The Howa 1500 Heavy Barreled .308 Winchester Action is a great start for building your own custom rifle – especially when the hard part is already done for you!<br>  </p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:160</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-308-win-26-threaded-semi-heavy-barreled-action-prod113621.aspx', NULL, NULL, 450.99, 299.99, 151.00, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-308-win-26-threaded-semi-heavy-barreled-action-prod113621.aspx', '7a4a1447f6fc47801e38a757851c6eea', 0, NULL, '2018-08-06 12:12:21', '2018-08-06 13:46:12'),
(2513, 4, 'TRIJICON - RMR TYPE 2 RM06 3.25 MOA ADJUSTABLE LED REFLEX SIGHT', '<p></p>\n<p> Developed to improve precision and accuracy with any style or caliber of weapon, the Trijicon RMR (Ruggedized Miniature Reflex) Type 2 is designed to be as durable as the legendary ACOG. The RM06 is an LED sight powered by a standard CR2032 battery. Housed in rugged forged aluminum, the RMR is extremely tough yet lightweight. New easy-to-use adjusters with audible clicks allow for quick windage and elevation adjustments.<br>  <br> With eight available brightness settings, the reticle can be manually adjusted by pressing the plus or minus buttons on either side of the unit. To switch to auto adjust mode simply press both buttons simultaneously and release. To save battery life turn the optic off by pressing both buttons simultaneously and holding for 3 seconds.<br>  <br> The Trijicon RMR Type 2 is tougher than any alternative and suitable for military, law enforcement and hunting applications.<br><br> Available in Anodized Black or Cerakote finishes in Sniper Gray, OD Green, and Flat Dark Earth.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:280</em></strong></div>', NULL, 'https://www.brownells.com/optics-mounting/electronic-sights/reflex-sights/rmr-type-2-rm06-3-25-moa-adjustable-led-reflex-sight-prod107911.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/electronic-sights/reflex-sights/rmr-type-2-rm06-3-25-moa-adjustable-led-reflex-sight-prod107911.aspx', 'b11818f9df0231a8d7149bd649c06382', 0, NULL, '2018-08-06 12:12:21', '2018-08-06 13:46:15'),
(2514, 4, 'BERGER BULLETS - BERGER HUNTING BULLETS', '<p></p>\n<p>The Berger Hunting bullet line is proving to be the most lethal big game hunting bullets available. All of the Berger Hunting bullets are made in the VLD design. The VLD design incorporates a sharp nose that allows the bullet to penetrate 2” to 3” before it starts to expand. After the bullet starts to expand it will shed 40% to 85% of its weight as shrapnel into the surrounding tissue (internal organ). The combination between the shrapnel and the hydrostatic shock produces a massive wound cavity within the vital area (internal organs) that will be 13” to 15” long. This massive wound cavity results in the animal dropping fast since most go into shock after such a tremendous blow. Those animals that don’t go down immediately will soon succumb to blood pressure loss and/or organ failure producing a quick ethical kill. Berger bullets don\'t poke through like an arrow (high weight retention, deep penetration bullets) but instead dump their energy where it is most effective, inside the animal. Using the Berger VLD will result in an animal that goes down fast so you can enjoy the results of your hunt without having to track the wounded animal after the shot.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:68, Page:541 <br> Sinclair, Issue:5B, Page:103</em></strong></div>', NULL, 'https://www.brownells.com/reloading/bullets/rifle-bullets/berger-hunting-bullets-prod35294.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/bullets/rifle-bullets/berger-hunting-bullets-prod35294.aspx', '0b8e2fa5b91bf1dcc45d614b56175a6a', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:46:21'),
(2515, 4, 'SILENCERCO - S&W M&P SHIELD THREADED BARREL', '<h3 class=\"mbm\">What s Better Than a Shield? A Suppressor-Ready Shield!</h3>\n<p></p>\n<p> The SilencerCo S&amp;W M&amp;P Shield threaded replacement barrel sets you up to install a sound suppressor on your pistol for quiet practice and home defense use. Machined from stainless steel, these barrels are cut to factory dimensions for a neat, drop-in fit to your M&amp;P.</p>\n<ul>\n<li>  Fits M&amp;P Shield chambered in 9mm</li> <li>  1-10\" RH rifling</li> <li>  ½\"-28 muzzle threads accept most popular silencers and muzzle devices</li> <li>  Machined from blast/wear/corrosion-resistant 416R stainless steel</li>\n</ul>\n<p> The SilencerCo S&amp;W M&amp;P Shield threaded replacement barrel is ready to stand up to thousands of rounds down the bore - and no need for hearing protection (with suppressor installed and subsonic ammunition).</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:220</em></strong></div>', NULL, 'https://www.brownells.com/handgun-parts/barrel-parts/barrels/s-w-m-p-shield-threaded-barrel-prod101184.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/barrel-parts/barrels/s-w-m-p-shield-threaded-barrel-prod101184.aspx', 'c1cf5906b8c29d4c794d417704189f8e', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:46:26'),
(2516, 4, 'NIGHTFORCE - NX8 SCOPE 1-8X24MM FFP FC-MIL RETICLE', '<h3 class=\"mbm\">Offers Owners a Leading Rifle Optic</h3>\n<p></p>\n<p> Built to be more durable than any other optic in its class, the Nightforce Optics NX8 1-8x24mm Scope is designed with all of the features needed for close-to-medium-range target engagement.<br><br> The Nightforce Optics NX8 1-8x24mm Scope was engineered to be the perfect balance between weight, size and durability, giving rifle owners the elements they need on their guns. At its lowest power setting, the optic features true 1X magnification with a red dot that aids in quick targeting.</p>\n<ul>\n<li>  Uses FFP FC-MIL reticle</li> <li>  Weighs 17 ounces</li> <li>  Built on a 30mm tube</li> <li>  Adjustment value: 0.2 MRAD</li>\n</ul>\n<p> Powering the illuminated reticle on the Nightforce Optics NX8 1-8x24mm Scope is a CR2032 battery. The optic also includes the company\'s proven ZeroStop elevation adjustment and Power Throw Lever.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	<em><strong>Promotional Codes are not applicable to Nightforce products</strong>.</em></p>\r\n</div>', NULL, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/nx8-scope-1-8x24mm-ffp-fc-mil-reticle-prod116312.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/nx8-scope-1-8x24mm-ffp-fc-mil-reticle-prod116312.aspx', 'f5beccfa073e6b7e3405ca984d2a81ae', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:46:30'),
(2517, 4, 'SMITH & WESSON - \r\n                SD9VE 4IN 9MM STAINLESS 16+1RD', '<p>The Smith &amp; Wesson SD9VE 9mm Pistol weighs a lightweight 22.7 oz. and features a polymer frame with a stainless-steel slide and barrel. The semiautomatic double-action pistol has a Picatinny rail and comes with two 16-round magazines. White-dot dovetail front and rear sights.</p>', NULL, 'https://www.brownells.com/firearms/handguns/semi-auto/sd9ve-4in-9mm-stainless-16-1rd-prod92573.aspx', NULL, NULL, 0.00, 329.99, 0.00, 'https://www.brownells.com/firearms/handguns/semi-auto/sd9ve-4in-9mm-stainless-16-1rd-prod92573.aspx', 'd30f920741061fa23f69960b26f47c8a', 1, NULL, '2018-08-06 12:12:22', '2018-08-06 13:46:36'),
(2518, 4, 'BROWNELLS - M16 MIL-SPEC MP/HPT BOLT CARRIER GROUP', '<p></p>\n<p> Complete M16 Bolt Carrier Group:</p>\n<ul>\n<li>  Fully assembled Bolt Carrier Group; including the bolt, bolt carrier, gas key, firing pin, cam pin, and firing pin retaining pin</li> <li>  Every Bolt is High Pressure Tested (HPT) with a proof load</li> <li>  Following the High Pressure Test, every Bolt is Magnetic Particle Inspected (MPI)</li> <li>  Not stamped with HPT or MPI</li> <li>  The Bolt is machined from Carpenter 158 steel</li> <li>  Following machining, the Bolt is heat treated and shot peened</li> <li>  Installed extractor includes red o-ring with spring</li> <li>  M16 Bolt Carrier is machined from 8620 steel and hardened</li> <li>  Interior of Bolt Carrier Carrier Key &amp; Bolt Carrier are chrome lined</li> <li>  M16 Bolt Carrier will function in semi-auto or full-auto AR-15/M16</li> <li>  Gas Key Screws are properly torqued and staked</li> <li>  Bolt and Bolt Carrier feature a matte black mil-spec finish</li>\n</ul>\n<p>  </p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:011 <br> Big Book Catalog, Issue:71, Page:011 <br> Sinclair, Issue:5B, Page:248</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-mil-spec-mp-hpt-bolt-carrier-group-prod78714.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-mil-spec-mp-hpt-bolt-carrier-group-prod78714.aspx', '7eb8e5f4f557d414bed07ecc6cea903a', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:46:40'),
(2519, 4, 'BROWNELLS - REMINGTON 700 BRN-1 PRECISION CHASSIS', '<p></p>\n<p> The Brownells Remington 700 (and clone) BRN-1 Chassis system is designed to provide an enhanced rifle setup for owners of a number of popular rifle actions. Manufacturerd by MDT, the chassis is developed exclusively for Brownells and is inspired by the design of MDT\'s LSS rifle chassis. A great option for precision long range shooters looking to upgrade their stock rifle.<br><br> The BRN-1 Chassis system is set up to accept an AR-style buffer tube, allowing access to the incredible aftermarket of AR-15 buttstock accessories. The chassis also allows for the use of AR-style pistol grips, ensuring that owners can customize their rifles in any number of ways. The chassis is constructed from 6061 aluminum and features a V-shaped bedding system that accommodates most heavy barrels. The bedding system ensures that rifle barrels are free-floated for maximum accuracy.</p>\n<ul>\n<li>  Available in black and flat dark earth</li> <li>  Forend features M-LOK attachment points</li> <li>  Can be had in short-action and long-action setups</li> <li>  Maximum recoil-lug compatibility is .350-inch</li> <li>  Compatible with AICS pattern magazines</li>\n</ul>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:187</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/stock-parts/rifle-stocks/remington-700-brn-1-precision-chassis-prod116297.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/stock-parts/rifle-stocks/remington-700-brn-1-precision-chassis-prod116297.aspx', '46a4926d719177049520f1d3349d5127', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:46:43'),
(2520, 4, 'PRECISION GUN SPECIALTIES - SAF-T-TRAINERS DUMMY ROUNDS', '<h3 class=\"mbm\">Brightly Colored \"Dummies\" For Training Exercises</h3>\n<p></p>\n<p> Brightly colored plastic and a different “feel” makes sure you won’t confuse these for live rounds. Popular with many departments and agencies for use in Immediate Action training for just that reason. These do not duplicate weight and balance of loaded rounds or function-testing dummies.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:075 <br> Big Book Catalog, Issue:71, Page:080 <br> Big Book Catalog, Issue:71, Page:369</em></strong></div>', NULL, 'https://www.brownells.com/gunsmith-tools-supplies/general-gunsmith-tools/cartridge-dummies/saf-t-trainers-dummy-rounds-prod9923.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/gunsmith-tools-supplies/general-gunsmith-tools/cartridge-dummies/saf-t-trainers-dummy-rounds-prod9923.aspx', 'b2b495dd807ed8572757df1aa2ea8346', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:46:50'),
(2521, 4, 'TRIJICON - SIGHT INSTALLATION TOOL for GLOCK®', '<h3 class=\"mbm\">Install, Adjust &amp; Remove Glock Sights Without Damage</h3>\n<p></p>\n<p> Specifically designed to install, adjust and remove all models of Trijicon Glock Sights without damage. Includes heavy-duty rear sight mover with oilite bushings that allow for very fine windage adjustments, and a front sight nut driver that fits all models of aftermarket front sights.</p>\n<p> <strong>Will only work on Glock 42 and 43 with the adapter, stock#584-042-043.</strong></p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H.  Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H.  The use of Glock on this page is merely to advertise the sale of Glock parts or components.  As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</p>\r\n</div>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:322 <br> Big Book Catalog, Issue:71, Page:478</em></strong></div>', NULL, 'https://www.brownells.com/gunsmith-tools-supplies/sight-scope-installation-tools/sight-movers/sight-installation-tool-for-glock--prod41512.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/gunsmith-tools-supplies/sight-scope-installation-tools/sight-movers/sight-installation-tool-for-glock--prod41512.aspx', '41d617d6f0b57a6c3d7de21604144248', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:46:58'),
(2522, 4, 'CCI - \r\n                MINI-MAG HP AMMO 22 LONG RIFLE 36GR CPHP', '<p></p>\n<p> CCI\'s varmint lineup offers several loads in a variety of calibers that utilize unique bullet technologies to deliver what we covet most: devastating performance on varmints, time after time. If you can\'t find your ideal rimfire varmint load on these pages, it doesn\'t exist.</p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:08, Page:096 <br> Big Book Catalog, Issue:66, Page:530</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/rimfire-ammo/mini-mag-hp-ammo-22-long-rifle-36gr-cphp-prod85017.aspx', NULL, NULL, 7.49, 6.99, 0.50, 'https://www.brownells.com/ammunition/rimfire-ammo/mini-mag-hp-ammo-22-long-rifle-36gr-cphp-prod85017.aspx', '6a8d445f21e39c1734527ee967920390', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:47:04'),
(2523, 4, 'GLOCK - GEN 5 MAGAZINE FOR GLOCK®19', '<h3 class=\"mbm\">Factory Replacement for Your Gen5 - Fits Earlier \"Gens\" Too!</h3>\n<p></p>\n<p> Factory replacement magazines keep your Gen5 Glock® 19 \"rockin’ and rollin’.” A hardened steel insert encased in slick, wear-resistant high-tech polymer gives each Gen5 magazine impressive strength and durability. Gen5 magazines are contoured at the base to match the flared magwell of Gen5 pistols, but are also compatible with earlier Glock pistols - a quick performance upgrade for your Gen1 to Gen4 guns.</p>\n<ul>\n<li>  Subtle engineering enhancements for even better reliability</li> <li>  Available with full 15-rd or restricted 10-rd capacity</li> <li>  Witness holes on rear face</li>\n</ul>\n<p> The angled baseplate on the Gen5 Glock 19 magazine makes fast mag changes easier, while the bright orange follower helps you keep track of how many rounds are in the mag at a glance.<br>  </p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H. Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H. The use of Glock on this page is merely to advertise the sale of Glock parts or components. As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</p>\r\n</div>', NULL, 'https://www.brownells.com/magazines/rifle-magazines/magazines/gen-5-magazine-for-glock-19-prod115617.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/rifle-magazines/magazines/gen-5-magazine-for-glock-19-prod115617.aspx', '98e9ccb5b90392326f687cb71dcc7266', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:47:07'),
(2524, 4, 'DPMS - 308 AR LOWER PARTS KIT W/ TRIGGER', '<p></p>\n<p> All the internal parts you need to turn a stripped LR-.08 (or equivalent) lower receiver into a fully functional bottom half, ready for assembly to the upper receiver and buttstock. Or, use to rebuild the worn internals of an old rifle and restore it to like-new function and reliability. Eliminates the hassle of scrounging up the parts on by one, plus single-manufacturer source means the kit parts are designed to work together and will require minimal fitting. Kit include the complete fire-control system with trigger, trigger spring, disconnector, .153” diameter hammer/trigger retaining pins, hammer spring, bolt stop, bolt stop screw, selector, selector detent, bolt catch, magazine catch, magazine release button, front pivot pin, rear takedown pin, buffer retainers, and all necessary pins, springs, detents, and screws. Also included is a polymer A2-style pistol grip and an extra-weight hammer for positive ignition of .308 ammo.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:039 <br> Big Book Catalog, Issue:71, Page:043</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/parts-kits/lower-parts-kits/308-ar-lower-parts-kit-w-trigger-prod81678.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/receiver-parts/parts-kits/lower-parts-kits/308-ar-lower-parts-kit-w-trigger-prod81678.aspx', 'eb82201e62471e61f6a9324508bc32ce', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:47:16'),
(2525, 4, 'TRIJICON - HD™ TRITIUM NIGHT SIGHT SETS FOR GLOCK®', '<h3 class=\"mbm\">Dual Self-Illumination System For Better Visibility In Rapidly Changing Light Conditions</h3>\n<p></p>\n<p> The HD Night Sights were specifically created to address the needs of tactical shooters. The three dot green tritium night sight set’s front sight features a taller blade and an aiming point ringed in photoluminescent paint while the rear sight is outlined in black and features a wider U-shaped notch. This unique configuration increases visibility and quickens front sight acquisition—even in transitional lighting. Additionally, the front surface of the rear sight is steeply hooked to assist in emergency one-handed slide operation. The HD Night Sights are designed to shine—even in the most demanding conditions. Green tritium lamps are warranted for 12 years from date of manufacture.</p>\n<p> Glock 42 HD Night Sight Set, Green w/ Yellow Front Outline- Has an aiming point ringed in yellow photoluminescent paint.</p>\n<p> <br> Glock 42 HD Night Sight Set, Green w/ Orange Front Outline- an aiming point ringed in orange photoluminescent paint .</p>\n<br><div class=\"callout color3 help editable mbl\">\n<p>\r\n	“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H.  Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H.  The use of Glock on this page is merely to advertise the sale of Glock parts or components.  As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</p>\r\n</div>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:322</em></strong></div>', NULL, 'https://www.brownells.com/handgun-parts/sights/sight-sets/hd-tritium-night-sight-sets-for-glock--prod42614.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/sights/sight-sets/hd-tritium-night-sight-sets-for-glock--prod42614.aspx', '26025107ff204c3ed6f39b36d3d1c7ab', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:47:26');
INSERT INTO `deals` (`id`, `source_id`, `title`, `description`, `image`, `link`, `ratings`, `reviews_count`, `base_price`, `sale_price`, `save_price`, `from_url`, `unique_md5`, `out_of_stock`, `ext_date`, `created_at`, `updated_at`) VALUES
(2526, 4, 'BROWNELLS - AR-15 BLEMISHED SLICKSIDE UPPER RECEIVER', '<p></p>\n<p> Due to Brownells\' extraordinarily high quality standards, some of the AR-15 upper receivers produced for the company\'s line of BRN-16A1 retro rifles aren\'t up to spec. However, these Brownells Blemished M16 A1 upper receivers are still solid, quality components for AR fans looking for a bargain for their next AR build.<br><br> Each Brownells Blemished M16 A1 upper receiver meets all the requirements in terms of metal quality and specifications. The only difference separating these uppers from those found on the company\'s retro rifles is the finish color, which comes in a variety of finishes not quite up to spec, ranging from shiny green to dull, dark gray. Colors vary greatly between receivers.</p>\n<ul>\n<li>  A1 Receiver uses a Nodak Spud Forging</li> <li>  Machined by Brownells</li> <li>  Made from 7075-T6 aluminum forging</li> <li>  Marked 5.56 NATO</li> <li>  Completely stripped</li>\n</ul>\n<p> Each Brownells Blemished M16 A1 upper receiver feature an original A1-style shape, having no shell deflector, an A1 rear-sight housing and period-correct contours for a carry handle. All standard AR-15 parts are compatible with the lower, and the design is correct for a number of period reproductions.</p>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/upper-receivers/ar-15-blemished-slickside-upper-receiver-prod120486.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/upper-receivers/ar-15-blemished-slickside-upper-receiver-prod120486.aspx', 'c468161d48a12da89114f410a29c5e73', 0, NULL, '2018-08-06 12:12:22', '2018-08-06 13:47:31'),
(2527, 4, 'ED BROWN - 1911 45ACP STAINLESS STEEL MAGAZINES', '<h3 class=\"mbm\">Tactical Quality; Made From Heat-Treated Stainless Steel</h3>\n<p></p>\n<p>Premium-quality magazine is engineered and manufactured to the highest standards to deliver outstanding reliability and smoothness in competition or combat. Virtually seamless body of heat-treated stainless steel and rounded, self-leveling all-steel follower and heavy duty spring further enhance reliability. Witness holes, with extra-large, easy-to-see round count numbers crisply laser etched on both sides. <strong>7-Round </strong>has extended bumper pad that protects magazine if dropped on a hard surface and increases overall length to ensure positive seating. <strong>8-Round -</strong> Full-featured, “8-Pack™” model has extended body designed to provide sufficient room for the extra round and maintain proper spring compression. Hydro-finish process gives body and follower an extra-slick surface that repels dirt, dust, and burned powder to eliminate unnecessary friction against the follower for consistent feeding and easier seating in magwell. Flared bumper pad of tough, impact-absorbing polymer gives a secure grip during mag changes and protects the magazine when dropped. “88” number template—like numbers on a digital clock—on the bottom of the pad lets you create any number from 00 to 99 with a dab of paint to track usage history of individual magazines. Depress the large, easy-to-operate release button to remove the pad for cleaning.</p>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:11, Page:026 <br> Big Book Catalog, Issue:71, Page:120 <br> Sinclair, Issue:1A, Page:004 <br> Sinclair, Issue:1A, Page:024</em></strong></div>', NULL, 'https://www.brownells.com/magazines/handgun-magazines/magazines/1911-45acp-stainless-steel-magazines-prod1354.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/handgun-magazines/magazines/1911-45acp-stainless-steel-magazines-prod1354.aspx', '5490c9481d2c8b5528d221ca0be0b2c6', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:47:37'),
(2528, 4, 'BROWNELLS - AR-15 RIFLE BUFFER TUBE KIT', '<h3 class=\"mbm\">Mil-Spec Hardware for Your AR Build</h3>\n<p></p>\n<p> The Brownells AR-15 Rifle Length Buffer Tube Kit is made from Mil-Spec 7075 aluminum and features a matte black hardcoat anodized finish.<br><br> This kit includes a buffer and spring designed to fit standard AR-15 and M16 lower receivers and rifle length buttstocks.  </p>\n<ul>\n<li>  Machined from 7075 aluminum</li> <li>  Matte black hardcoat anodized</li> <li>  9 5/8” length</li> <li>  1.110” diameter</li>\n</ul>\n<p> The Brownells Rifle Length Buffer Tube Kit provides Mil-Spec hardware for your AR.</p>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/buffer-tube-parts/buffer-tubes/ar-15-rifle-buffer-tube-kit-prod105047.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/receiver-parts/buffer-tube-parts/buffer-tubes/ar-15-rifle-buffer-tube-kit-prod105047.aspx', '559596eb229e963ff8c275e4a4412d79', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:47:40'),
(2529, 4, 'SINCLAIR INTERNATIONAL - F-CLASS BIPOD SLING SWIVEL MOUNT W/QUICK-ADJUST ELEVATION KNOB', '<p></p>\n<p> This new third generation Sinclair F-Class Bipod is offered with the optional quick-adjust elevation knob rather than the fixed configuration, for faster target acquisition making follow-up shots easier.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:362 <br> Sinclair, Issue:5B, Page:170</em></strong></div>', NULL, 'https://www.brownells.com/shooting-accessories/bipods-monopods-amp-accessories/bipods/f-class-bipod-sling-swivel-mount-w-quick-adjust-elevation-knob-prod44699.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/shooting-accessories/bipods-monopods-amp-accessories/bipods/f-class-bipod-sling-swivel-mount-w-quick-adjust-elevation-knob-prod44699.aspx', 'b5237e7063e95422f32a82ac3e877e57', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:47:45'),
(2530, 4, 'HOWA - \r\n                1500 308 WIN 20\" FLUTED HEAVY BARRELED ACTION', '<p></p>\n<p> Howa 1500 Barreled Actions are the perfect platform for a quality precision rifle build, at an affordable cost.  Every Howa Barreled Action features a hammer forged barrel, bottom metal and precise HACT two stage trigger.  The receiver and bolt are forged steel, with the bolt featuring an integral bolt handle.  Bolt faces are square to the barrel chamber and bolt faces have excellent contact with the receiver recesses.  M16 style extractor ensure positive extraction and function.  Factory barrels are hammer forged with headspace set to exacting standards.  The HACT two stage trigger has a crisp, light and consistent pull.  The included 3 position safety allows for the bolt to be locked, as well as put on safe when unloaded.  Scope bases are available from a variety of quality manufacturers.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:160</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-308-win-20-fluted-heavy-barreled-action-prod94614.aspx', NULL, NULL, 492.00, 284.99, 207.01, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-308-win-20-fluted-heavy-barreled-action-prod94614.aspx', '137412f073bbb9779bfe78355117fbb5', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:47:50'),
(2531, 4, 'HOPPES - HOPPE\'S No. 9', '<h3 class=\"mbm\">Famous The World Over</h3>\n<p></p>\n<p> Hoppe\'s No. 9 Gun Bore Cleaner, the most universally used solvent for removing primer, powder, lead and metal fouling - for preventing rust. Quick, super-efficient, safe and easy to use. Flows freely and penetrates rapidly. Five sizes meet every cleaning requirement.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	Cannot ship outside Continental U. S. Shipped UPS or FedEx Ground only within U.S. *Requires Additional Hazardous Materials Surcharge.</p>\r\n</div>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:04, Page:060 <br> AR-15, Issue:04, Page:073 <br> Big Book Catalog, Issue:71, Page:347 <br> Sinclair, Issue:5B, Page:143</em></strong></div>', NULL, 'https://www.brownells.com/gun-cleaning-chemicals/solvents-degreasers/bore-solvents/hoppe-s-no-9-prod9806.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/gun-cleaning-chemicals/solvents-degreasers/bore-solvents/hoppe-s-no-9-prod9806.aspx', '1380f02281348088716c992321a7d62a', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:47:56'),
(2532, 4, 'TRIJICON - ACOG 4x32MM BAC RIFLE SCOPES', '<h3 class=\"mbm\">Advanced Combat Optical Gunsight</h3>\n<p></p>\n<p> Compact, 4x magnification scope clamps to a MIL-STD 1913 Picatinny receiver rail and features a bright, red Chevron reticle that is lit by both fiber optics and Tritium. Gives a vivid sight picture at distances up to 800 meters. Uses the Bindon Aiming concept (BAC) for excellent, both-eyes-open, target acquisition. Sight tunnel retains use of iron sights. <strong>TA31G</strong> - Green Donut .223 Ballistic Reticle, does not include Picatinny stype base required for mounting to rail. <strong>TA31F-</strong> Red chevron reticle with TA51Picatinny mount. <strong>TA31-CH-</strong> Red crosshair reticle with TA51Picatinny mount. <strong>TA31F-G</strong>- Green chevron reticle with TA51Picatinny mount. <strong>TA31H- </strong>Red horseshoe and dot reticle with TA51Picatinny mount. <strong>TA31H-G -</strong> Green horseshoe and dot reticle with TA51Picatinny mount. <strong>TA31-68- </strong>Red horseshoe and dot reticle with TA51Picatinny mount calibrated for 6.8SPC rifles.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:102 <br> Big Book Catalog, Issue:69, Page:269</em></strong></div>', NULL, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/acog-4x32mm-bac-rifle-scopes-prod24992.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/acog-4x32mm-bac-rifle-scopes-prod24992.aspx', 'd366dc6d40bcb43748d7aa00460b2b18', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:04'),
(2533, 4, 'HORNADY - \r\n                MATCH AMMO 6.5MM CREEDMOOR 147GR ELD MATCH', '<p></p>\n<p> Hornady crafts each 6.5mm Creedmoor 147 gr ELD Match cartridge under rigorous quality control routines to ensure proper bullet seating, as well as consistent charges and pressures to deliver optimal velocity and repeatable accuracy.<br><br> Hornady 6.5mm Creedmoor 147 gr ELD Match is loaded with Hornady’s latest Extremely Low Drag Match bullet with a Heat Shield® polymer tip and additional design features for an unusually high ballistic coefficient and superb accuracy.</p>\n<ul>\n<li>  Boxer-primed brass case</li> <li>  Secant ogive, boattail bullet with highest-in-class B.C.</li> <li>  Superb round-to-round consistency</li> <li>  Available in 20-round box or 200-round case</li>\n</ul>\n<p> When you line up the crosshairs on the target, you can be sure that the Hornady 6.5mm Creedmoor 147 gr ELD-Match round in your rifle’s chamber is one variable you have under total control. As for the wind...</p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>', NULL, 'https://www.brownells.com/ammunition/rifle-ammo/match-ammo-6-5mm-creedmoor-147gr-eld-match-prod98979.aspx', NULL, NULL, 278.99, 25.99, 253.00, 'https://www.brownells.com/ammunition/rifle-ammo/match-ammo-6-5mm-creedmoor-147gr-eld-match-prod98979.aspx', 'cc5b7f3ceda4658c9cc5ba5206f816fd', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:07'),
(2534, 4, 'BROWNELLS - \r\n                BRN-22 BARRELED RECEIVER FOR RUGER™ 10/22™', '<h3 class=\"mbm\">Barrel Included - The Customizing Is Up To You</h3>\n<p></p>\n<p> With our BRN-22™ Barreled Receivers, Brownells includes the other major component, the barrel. You get our target-rifle quality BRN-22™ receiver with the barrel included, so adding the remaining components - your choice of trigger, stock, sights/optic, and muzzle device - is up to you.<br><br> Barrels are available in Sporter and Heavy profile, both in 16\"length, while the Heavy barrel is also available in a short, 10\" length for pistol or SBR builds. All barrels come with ½\"-28 tpi muzzle threads for the installation of a compensator, flash suppressor, or silencer.<br><br> The BRN-22™ receiver itself is precision-machined from billet 6061 aluminum and is fully compatible with components that fit the Ruger® 10/22® platform. Receivers are available with the Standard factory 10/22® top profile, right down to the drilled-and-tapped scope mounting holes, or a Railed model with an integral Picatinny top rail to maximize your scope-mounting. (For a full description of the BRN-22 receiver’s features, see the separate listing for the stripped receivers.)</p>\n<ul>\n<li>  Receiver machined from 6061 T6 aluminum billet</li> <li>  Barrel is NOT installed</li> <li>  Durable matte black hardcoat anodized receiver finish</li> <li>  1/2\"-28 tpi muzzle threads accept popular muzzle devices</li> <li>  Matte black oxide finish on barrels</li> <li>  Compatible with all components that fit a factory Ruger® 10/22®</li> <li>  Also available as a bare stripped receiver - Click here to see separate listing</li> <li>  FFL or delivery to an FFL holder required for purchase</li>\n</ul>\n<p> A pre-cut hole at the rear of each receiver allows easy insertion of a cleaning rod to clean the bore from the chamber, the RIGHT way, to prevent accuracy-compromising cleaning rod damage to the muzzle.</p>\n<p> <br> The BRN-22™ barreled receiver is ready to serve as the foundation of a precision rimfire rifle Dream Gun™. Get your imagination fired up and see what you can build!<br><br><strong>Due to varying dimensions in aftermarket and some older factory aluminum trigger housings, fitting may be required.</strong></p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:158</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/brn-22-barreled-receiver-for-ruger-10-22--prod116209.aspx', NULL, NULL, 159.99, 139.99, 20.00, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/brn-22-barreled-receiver-for-ruger-10-22--prod116209.aspx', 'fd3ce253eabd6df07d8780c56db96a94', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:11'),
(2535, 4, 'BROWNELLS - 100 PAKS 100% COTTON FLANNEL CLEANING PATCHES', '<h3 class=\"mbm\">Convenient 100 Paks For Take-A-Long Or Easier Bench Storage</h3>\n<p></p>\n<p> Now you can choose your favorite size and shape of Brownells cleaning patch without buying more than you need. High-quality, 100% Cotton Flannel Patches in convenient, resealable bags of 100. Saves weight and space, perfect for hunting or shooting excursions.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:04, Page:072 <br> Big Book Catalog, Issue:71, Page:339</em></strong></div>', NULL, 'https://www.brownells.com/gun-cleaning-chemicals/patches-mops/bore-patches/100-paks-100-cotton-flannel-cleaning-patches-prod1291.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/gun-cleaning-chemicals/patches-mops/bore-patches/100-paks-100-cotton-flannel-cleaning-patches-prod1291.aspx', 'b07244c2b82f5dbd46c0a8b5f220a013', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:17'),
(2536, 4, 'SMITH & WESSON - \r\n                686 3-5-7 MAGNUM SERIES HANDGUN', '<p></p>\n<p> A “Collector must have” , the “3-5-7” Magnum Series features the Model 686 Plus Deluxe with custom black/silver “357” wood grips, unfluted cylinders and is available in three barrel lengths, 3” – 5” – 7”. Chambered with 7 rounds of .357 Magnum, the all stainless steel Model 686 Plus Deluxe offers compact powerful protection, sport shooting and collecting all in one.</p>', NULL, 'https://www.brownells.com/firearms/handguns/revolver/686-3-5-7-magnum-series-handgun-prod92325.aspx', NULL, NULL, 732.99, 719.99, 13.00, 'https://www.brownells.com/firearms/handguns/revolver/686-3-5-7-magnum-series-handgun-prod92325.aspx', '3c79fe9852524456eebf1e9d8f2a9e5a', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:20'),
(2537, 4, 'HORNADY - HOT TUB SONIC CLEANER', '<p></p>\n<p> The Hornady® Hot Tub™ takes sonic cleaning to a whole new level.  Featuring a 9 liter capacity, the Hot Tub™ is long enough to accommodate and clean a 16 inch AR-15 upper.  In addition to having 4 transducers, there is also a heating element that enhances cleaning action, which is especially useful when cleaning gun parts. Combined with One Shot® Sonic Clean™ solution, the microjet action of the Hornady® Hot Tub™ removes carbon residue and other debris from cartridge cases, gun parts and other metal equipment. Unlike traditional tumblers, sonic cleaners can clean internal and external surfaces of cartridge cases and primer pockets. One 1.7 quart inner tank comes with the unit and can be used in the main tank for cleaning multiple smaller batches or to use separate solutions at the same time.  Additional inner tanks can be purchased separately. Hanging cords have been integrated into the design to allow large objects to take full advantage of the ultrasonic energy.  Additionally, the Hot Tub® features integrated drain pans in the lids, a small parts basket, a degas function and 5 temperature settings from 100-140°F.  Hot Tub® main tank dimensions: (9 Liters / 2.3 Gallons) 25.5\" x 7.0\" x 4\" / Internal Divider Tank dimensions (sold separately): 6.7\" x 4.7\" x 3.2\" (1.6 Liters / 1.7 Quarts)</p>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:11, Page:069 <br> Big Book Catalog, Issue:68, Page:540 <br> Sinclair, Issue:5B, Page:076</em></strong></div>', NULL, 'https://www.brownells.com/gun-cleaning-chemicals/professional-cleaning-systems/ultrasonic-cleaning-kits/hot-tub-sonic-cleaner-prod55609.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/gun-cleaning-chemicals/professional-cleaning-systems/ultrasonic-cleaning-kits/hot-tub-sonic-cleaner-prod55609.aspx', '9172cd45c67819babb2deed5da2770bd', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:23'),
(2538, 4, 'BROWNELLS - RUGER AMERICAN BRN-1 PRECISION CHASSIS', '<p></p>\n<p> The Brownells Ruger American BRN-1 Chassis system is designed to provide an enhanced rifle setup for owners of a number of popular rifle actions. Manufacturerd by MDT, the chassis is developed exclusively for Brownells and is inspired by the design of MDT\'s LSS rifle chassis. A great option for precision long range shooters looking to upgrade their stock rifle.<br><br> The BRN-1 Chassis system is set up to accept an AR-style buffer tube, allowing access to the incredible aftermarket of AR-15 buttstock accessories. The chassis also allows for the use of AR-style pistol grips, ensuring that owners can customize their rifles in any number of ways. The chassis is constructed from 6061 aluminum and features a V-shaped bedding system that accommodates most heavy barrels. The bedding system ensures that rifle barrels are free-floated for maximum accuracy.</p>\n<ul>\n<li>  Available in black and flat dark earth</li> <li>  Forend features M-LOK attachment points</li> <li>  Can be had in short-action and long-action setups</li> <li>  Maximum recoil-lug compatibility is .350-inch</li> <li>  Compatible with AICS pattern magazines</li>\n</ul>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:187</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/stock-parts/rifle-stocks/ruger-american-brn-1-precision-chassis-prod116299.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/stock-parts/rifle-stocks/ruger-american-brn-1-precision-chassis-prod116299.aspx', 'a670d28d0fe8cc73c34cba8ca1e0118e', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:27'),
(2539, 4, 'HORNADY - \r\n                MATCH AMMO 6MM CREEDMOOR 108GR ELD MATCH', '<p></p>\n<p> Hornady\'s Match 6mm Creedmoor 108gr ELD ammunition has carefully selected components to ensure uniformity. It is then loaded to exacting specifications to provide pinpoint accuracy. Loaded with Hornady ELD Match bullets, stringent quality control ensures proper bullet seating, consistent powder charges and pressures, optimal velocity and repeatable accuracy.</p>\n<ul>\n<li>  Cases are hand selected based on strict criteria.</li> <li>  Advanced Manufacturing Process Bullet Jackets feature near-zero wall thickness variations, resulting in unpreciedented concentricity and uniformity</li> <li>  Powder is matched carefully to each load for optimal pressure and velocities</li>\n</ul>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>', NULL, 'https://www.brownells.com/ammunition/rifle-ammo/match-ammo-6mm-creedmoor-108gr-eld-match-prod98976.aspx', NULL, NULL, 278.99, 25.99, 253.00, 'https://www.brownells.com/ammunition/rifle-ammo/match-ammo-6mm-creedmoor-108gr-eld-match-prod98976.aspx', 'cffe2c4bcbbb883ca4a2db43ed12897d', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:31'),
(2540, 4, 'BROWNELLS PREMIUM BARRELS - AR-15/M16 6.5 GRENDEL BARRELS', '<p></p>\n<p> Brownells AR-15/M16 barrels, made for Brownells by Satern Barrels, feature 5R button rifling and are machined from 416R gun barrel steel for a superior shooting barrel. These 6.5 Grendel barrels feature a stainless steel finish. Barrels have 1-8 twist for excellent performance with a wide range of bullets. Available in 18” &amp; 24” lengths. The 18” barrel features a mid-length gas system, while the 24” has a rifle length system. Muzzle is threaded 5/8\"-24 and the gas shoulder accepts 0.750\" gas block. Chamber is 6.5 Grendel II. Opposite side of gas port features a dimple for a gas block set screw. A 6.5 Grendel bolt is included with each barrel. Bolt is machined from 9310 steel with a bolt face depth of .136\". Barrel extension is M4 feed ramp style.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:018 <br> Big Book Catalog, Issue:71, Page:018 <br> Sinclair, Issue:5B, Page:248</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/barrel-parts/rifle-barrels/ar-15-m16-6-5-grendel-barrels-prod69785.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/barrel-parts/rifle-barrels/ar-15-m16-6-5-grendel-barrels-prod69785.aspx', '9e3523526d444efc92859c4a7e738d03', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:34'),
(2541, 4, 'ATN - X-SIGHT II 5-20X SMART RIFLE SCOPE', '<p></p>\n<p> The first digital scope to break the true HD barrier! Gone are the grainy black and white images — the X-Sight II takes digital imaging to a whole new level. Crystal clear images and millions of colors will have you forgetting that you are looking through a digital scope. Immerse yourself in an advanced cockpit like experience. Take advantage of the suite of sensors and advanced processing power for an entirely new shooting<br><br> Share the fun with your friends and family with HD video and photos that you can take day or night. No more forgetting to record those “perfect shots” with ATN’s RAV (Recoil Activated Video) feature that automatically records videos before and after you pull the trigger experience like never before.<br><br> X-Sight II — the most powerful shooting solution on the market that will not break the bank.</p>\n<ul>\n<li>  RECORD HD VIDEO</li> <li>  5-20x MAGNIFICATION WITH SMOOTH ZOOM</li> <li>  FULL COLOR DAY MODE</li> <li>  NIGHT VISION</li> <li>  RECOIL ACTIVATED VIDEO (RAV)</li> <li>  Wi-Fi</li> <li>  BLUETOOTH</li> <li>  E-COMPASS</li> <li>  RANGE FINDER</li> <li>  SHOOTING SOLUTIONS</li> <li>  GEOTAGGING</li> <li>  OBSIDIAN USER INTERFACE</li> <li>  3D GYROSCOPE</li> <li>  FIRMWARE UPGRADEABLE</li>\n</ul>', NULL, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/x-sight-ii-5-20x-smart-rifle-scope-prod85705.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/x-sight-ii-5-20x-smart-rifle-scope-prod85705.aspx', '786eb502984a5c858520bc2722c4f043', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:37'),
(2542, 4, 'HOWA - \r\n                1500 308 WIN 24\" HEAVY BARRELED ACTION', '<p></p>\n<p> Howa 1500 Barreled Actions are the perfect platform for a quality precision rifle build, at an affordable cost.  Every Howa Barreled Action features a hammer forged barrel, bottom metal and precise HACT two stage trigger.  The receiver and bolt are forged steel, with the bolt featuring an integral bolt handle.  Bolt faces are square to the barrel chamber and bolt faces have excellent contact with the receiver recesses.  M16 style extractor ensure positive extraction and function.  Factory barrels are hammer forged with headspace set to exacting standards.  The HACT two stage trigger has a crisp, light and consistent pull.  The included 3 position safety allows for the bolt to be locked, as well as put on safe when unloaded.  Scope bases are available from a variety of quality manufacturers.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:160</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-308-win-24-heavy-barreled-action-prod94612.aspx', NULL, NULL, 449.99, 249.99, 200.00, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-308-win-24-heavy-barreled-action-prod94612.aspx', '7b214b97d37156294603d10e113dae02', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:42'),
(2543, 4, 'RUGER - \r\n                PRECISION RIFLE 308 WIN 20\" 10+1 BRAKE', '<p></p>\n<p> Ruger\'s Precision Rifle features a medium-contour barrel which has an Ruger Precision Rifle Hybrid Muzzle Brake to effectively reduce recoil while minimizing noise and blast to the sides of the shooter. Its MSR stock with QD sling attachment points features a bottom Picatinny rail and soft rubber buttpad. The Marksman Adjustable trigger is externally adjustable with a pull weight range of 2.25 to 5.0 lbs.. Included is a wrench which is stored in the bolt shroud and two, 10-round Magpul PMAG magazines. This rifle is also equipped with a Ruger Precision Rifle Short-Action Handguard for improved scope clearance for long-range scopes.</p>\n<p> <strong>Optic Not Included</strong></p>', NULL, 'https://www.brownells.com/firearms/rifles/bolt-action/precision-rifle-308-win-20-10-1-brake-prod105790.aspx', NULL, NULL, 1.00, 1.00, 0.00, 'https://www.brownells.com/firearms/rifles/bolt-action/precision-rifle-308-win-20-10-1-brake-prod105790.aspx', '79990730059b6487211494667f0850f7', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:45'),
(2544, 4, 'LYMAN - GEN6 COMPACT TOUCH SCREEN POWDER SYSTEM', '<p></p>\n<p> The compact Gen6 design takes a minimum of bench space and offers unrestricted pan and touch screen access for both right and left hand users. Accurate to one tenth grain, the Gen6 dispenses all types of smokeless powder at two grains per second. In addition, it features an auto repeat function that drops a precise charge each time the pan is reset.</p>\n<p> Based on totally digital technology that overcomes problems commonly experienced by older designs, the system is packed with additional state of the art improvements like fast, 3 minute warmup, anti-static and anti-drift technology and has sophisticated electronic shielding to resist interference from other electronic devices like cell phones, etc.</p>\n<ul>\n<li>  Touch-Screen Controls</li> <li>  Compact Size - Uses 50% Less Bench Space</li> <li>  Auto Repeat Function Drops Charges Each Time the Pan is Reset</li> <li>  Quick-Drain to Change Powders</li> <li>  Electronic Interference Shield Resists Interference from Cell Phones, etc</li> <li>  Anti-Static/Anti-Drift Technology</li> <li>  Fast Operation - Dispenses 2 Grains per Second</li> <li>  Accurate to 1/10 grain</li> <li>  Handles all types of Smokeless Powders</li>\n</ul>\n<p> <strong>Not for use with black powder</strong>.</p>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:11, Page:068 <br> Big Book Catalog, Issue:68, Page:538 <br> Sinclair, Issue:5B, Page:088</em></strong></div>', NULL, 'https://www.brownells.com/reloading/powder-handling/powder-measures-dispensers/gen6-compact-touch-screen-powder-system-prod59679.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/powder-handling/powder-measures-dispensers/gen6-compact-touch-screen-powder-system-prod59679.aspx', 'bf9c8a8454aa87db9491b59c16786538', 0, NULL, '2018-08-06 12:12:23', '2018-08-06 13:48:48'),
(2545, 4, 'BROWNELLS - HOWA MINI ACTION BRN-1 PRECISION CHASSIS', '<p></p>\n<p> The Brownells Howa Mini Action BRN-1 Precision Chassis system is designed to provide an enhanced rifle setup for owners of a number of popular rifle actions. Manufacturerd by MDT, the chassis is developed exclusively for Brownells and is inspired by the design of MDT\'s LSS rifle chassis. A great option for precision long range shooters looking to upgrade their stock rifle.<br><br> The BRN-1 Chassis system is set up to accept an AR-style buffer tube, allowing access to the incredible aftermarket of AR-15 buttstock accessories. The chassis also allows for the use of AR-style pistol grips, ensuring that owners can customize their rifles in any number of ways. The chassis is constructed from 6061 aluminum and features a V-shaped bedding system that accommodates most heavy barrels. The bedding system ensures that rifle barrels are free-floated for maximum accuracy.</p>\n<ul>\n<li>  Available in black and flat dark earth</li> <li>  Forend features M-LOK attachment points</li> <li>  Can be had in short-action and long-action setups</li> <li>  Maximum recoil-lug compatibility is .350-inch</li> <li>  Compatible with Howa Mini Action Magazines</li>\n</ul>\n<p>  </p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:187</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/stock-parts/rifle-stocks/howa-mini-action-brn-1-precision-chassis-prod112529.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/stock-parts/rifle-stocks/howa-mini-action-brn-1-precision-chassis-prod112529.aspx', '3237b18c71f045a3da0acb2b1a5905a3', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:48:51'),
(2546, 4, 'HORNADY - XTP PISTOL BULLETS', '<p></p>\n<p>Hornady XTP Pistol Bullets are designed for hunting, law enforcement, and self-sefense. These hollow-point bullets expand with control for deep terminal penetration.</p>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:11, Page:070 <br> Sinclair, Issue:5B, Page:110</em></strong></div>', NULL, 'https://www.brownells.com/reloading/bullets/pistol-bullets/xtp-pistol-bullets-prod33922.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/bullets/pistol-bullets/xtp-pistol-bullets-prod33922.aspx', '351dc82b39305e420cdda273add1dc48', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:48:57'),
(2547, 4, 'TULAMMO USA - \r\n                STEEL CASE AMMO 9MM LUGER 115GR FMJ', '<p></p>\n<p> In the fields, at the range or on the hund, ou can trust TulaAmmo to deliver a superior level of internal, external, and terminal ballistics, more consistent velocities and impressive retained energies downrange from your favorite rifle, with an unmatched valut-to-performance ratio. All TulaAmmo rifle cartridges are steel cased, zinc jacketed, non-corrosive Berdan primed, with a phosphate polymer coating and a lead core.</p>\n<ul>\n<li>  Shooting Accuracy- more uniform and consistent jacket delivers up to 15% better shooting accuracy than standard bimetal bullets.</li> <li>  Corrosion Resistance- Zinc jacket doesn\'t change in apperance over time and is proven to inhibit electrochemical corrosion of the steel case.</li> <li>  Environmental Impact- Zinc jacket is more ecologically sound.</li>\n</ul>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>', NULL, 'https://www.brownells.com/ammunition/handgun-ammo/steel-case-ammo-9mm-luger-115gr-fmj-prod95197.aspx', NULL, NULL, 173.99, 8.99, 165.00, 'https://www.brownells.com/ammunition/handgun-ammo/steel-case-ammo-9mm-luger-115gr-fmj-prod95197.aspx', '35a7ec969f4b59fa9a299f646c2de17f', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:01'),
(2548, 4, 'CMMG - AR-15 LOWER PARTS KIT', '<p></p>\n<p> Complete kit contains every internal part needed to complete or rebuild an AR lower receiver. High-quality components are designed to work in coordination with each other to ensure smooth operation, and they come packaged in color-coded bags that organize related parts for easy assembly. Includes molded-polymer A2 pistol grip,  Mil-Spec trigger that offers a conventional, single-stage 6 to 6½ lb. service rifle pull.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:038 <br> Big Book Catalog, Issue:71, Page:042</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/parts-kits/lower-parts-kits/ar-15-lower-parts-kit-prod73612.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/receiver-parts/parts-kits/lower-parts-kits/ar-15-lower-parts-kit-prod73612.aspx', '05483ee4eda171e43039ecef62e2e30a', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:06'),
(2549, 4, 'MAGTECH AMMUNITION - \r\n                9MM 115GR FMJ AMMO', '<h3 class=\"mbm\">Dependable, Economical 9mm Luger FMJ Ammo Keeps You Shooting</h3>\n<p></p>\n<p> From targets, to training and practice, competition to plinking at the range, Magtech Sport Shooting 9mm Luger 115gr FMJ ammo has you covered. Magtech’s Sport Shooting 9mm Luger 115 gr FMJ ammo offers a great combination of performance and value, with the classic round-nose FMJ bullet profile that almost any 9mm semi-auto pistol will feed reliably.</p>\n<ul>\n<li>  Applications: target / match, practice, plinking</li> <li>  Boxer-primed, brass cases - collect your brass for reloading</li> <li>  FMJ bullet greatly reduces bore leading</li> <li>  Case quantity available</li>\n</ul>\n<p> Magtech Sport Shooting 9mm Luger 115 gr FMJ ammo is economically-priced so you can afford more trigger time to hone your marksmanship skills.<br>  </p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:10, Page:072 <br> Big Book Catalog, Issue:66, Page:522</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/handgun-ammo/9mm-115gr-fmj-ammo-prod95196.aspx', NULL, NULL, 252.99, 10.99, 242.00, 'https://www.brownells.com/ammunition/handgun-ammo/9mm-115gr-fmj-ammo-prod95196.aspx', '6e70c89753f5d31aab99e40e77a160e5', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:09'),
(2550, 4, 'SMITH & WESSON - SW22 VICTORY MAGAZINE', '<h3 class=\"mbm\">Snag Some Spare Mags</h3>\n<p></p>\n<p> Owners of the revolutionary new SW22 Victory pistol can increase their magazine capacity by grabbing an extra SSW22 Victory Magazine.<br><br> The SW22 Victory Magazine is an easy replacement or addition to your Victory pistol kit, allowing you to shoot with ease.</p>\n<ul>\n<li>  .22LR caliber only</li> <li>  10-round capacity</li> <li>  Constructed from steel</li>\n</ul>\n<p> The SW22 Victory Magazine is a direct factory replacement.</p>', NULL, 'https://www.brownells.com/magazines/handgun-magazines/magazines/sw22-victory-magazine-prod104157.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/handgun-magazines/magazines/sw22-victory-magazine-prod104157.aspx', '48fe14ac2c46bd63cbcdcb3be940fb56', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:12'),
(2551, 4, 'WINCHESTER - \r\n                USA WHITE BOX AMMO 45 ACP 230GR FMJ', '<h3 class=\"mbm\">Budget-Friendly, Classic .45 ACP Ball Ammo for Practice &amp; Other Applications</h3>\n<p></p>\n<p> Winchester USA brand \"white box\" .45 ACP 230gr FMJ ammo gives the high-volume pistol shooter great performance at an affordable price. Winchester’s USA white box .45 ACP 230gr FMJ ammo is loaded with a traditional \"ball\" full metal jacket round-nose bullet that delivers reliable function and good accuracy without terminal bullet expansion or barrel leading.</p>\n<ul>\n<li>  Applications: practice, target, competition, recreation</li> <li>  Reloadable brass cases</li> <li>  Copper jacketed bullet helps combat lead fouling of bore</li> <li>  Single box and case quantities available</li>\n</ul>\n<p> When you’re looking for practice ammo with the performance and reliability of a premium load, reach for a box - or a case! - of Winchester USA White Box .45 ACP 230gr FMJ.</p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:11, Page:072 <br> Big Book Catalog, Issue:66, Page:523</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/handgun-ammo/usa-white-box-ammo-45-acp-230gr-fmj-prod43224.aspx', NULL, NULL, 74.99, 19.99, 55.00, 'https://www.brownells.com/ammunition/handgun-ammo/usa-white-box-ammo-45-acp-230gr-fmj-prod43224.aspx', 'fc160fb542ac62f75e5de82a9bdb4abf', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:16'),
(2552, 4, 'FEDERAL - \r\n                GAME-SHOK AMMO 22 MAGNUM (WMR) 50GR JACKETED HOLLOW POINT', '<h3 class=\"mbm\">Targets Or Game, This Ammo Makes Its Mark</h3>\n<p></p>\n<ul>\n<li>50 cartridges per box</li>\n<li>22 Winchester Magnum caliber</li>\n<li>50-grain bullet</li>\n<li>Jacketed hollow point bullet</li>\n<li>1530 feet per second</li>\n</ul>\n<br><p>Small game hunting just got easer with the <strong>Federal Game-Shok</strong> ammunition line. The 22 Winchester Magnum has a 50-grain, jacketed hollow point bullet that travels at 1530 feet per second. When this bullet hits game all the energy is transferred immediately and in the rare possibility that the bullet misses the target, the bullet will shatter on any hard surface making your hunt safer. </p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:66, Page:530</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/rimfire-ammo/game-shok-ammo-22-magnum-wmr-50gr-jacketed-hollow-point-prod43061.aspx', NULL, NULL, 11.99, 9.99, 2.00, 'https://www.brownells.com/ammunition/rimfire-ammo/game-shok-ammo-22-magnum-wmr-50gr-jacketed-hollow-point-prod43061.aspx', '2b8317bf78d5122749d90e97ebfe1699', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:21'),
(2553, 4, 'BROWNING - \r\n                BPR 22 WINCHESTER MAGNUM 40GR JHP', '<h3 class=\"mbm\">High-Velocity Bullet to Extend Your Range</h3>\n<p></p>\n<p> The BPR Performance Rimfire .22 Winchester Magnum Jacketed Hollow Point is a rimfire ammunition designed for smooth feeding, reliable extraction and consistent performance.</p>\n<ul>\n<li>  Bullet Weight: 40</li> <li>  Cartridge: .22 Winchester Magnum</li> <li>  Muzzle Energy: 342</li> <li>  Muzzle Velocity: 1,910</li> <li>  Rounds: 50 or 500</li>\n</ul>\n<p> With a muzzle velocity of 1,910 fps, the BPR Winchester Magnum offers high velocity and downrange energy extending the effective range. Available in 50 or 500 round boxes.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	If the item is out of stock, Brownells will allow customers to backorder the item. However, the factory Browning does NOT allow us to backorder items. As soon as Browning has the part available and we are allowed to order the part, we will do so.</p>\r\n</div>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>', NULL, 'https://www.brownells.com/ammunition/rimfire-ammo/bpr-22-winchester-magnum-40gr-jhp-prod116196.aspx', NULL, NULL, 134.99, 11.99, 123.00, 'https://www.brownells.com/ammunition/rimfire-ammo/bpr-22-winchester-magnum-40gr-jhp-prod116196.aspx', '9a5e2d28a3166dbcf9bf379f759d0019', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:26');
