(2554, 4, 'BROWNELLS - M16 6.8MM SPC BOLT CARRIER GROUP NITRIDE MP', '<h3 class=\"mbm\">An Ideal Bolt Carrier for a Special Cartridge</h3>\n<p></p>\n<p> The Brownells M16 6.8 SPC Bolt Carrier Group offers premium performance for AR-15-style rifle chambered in the unique 6.8 SPC cartridge, ensuring reliable and durable service.<br><br> The Brownells M16 6.8 SPC Bolt Carrier Group features construction using both 8620 and 9310 steel. The bolt face is constructed using the harder 9310 steel, which then undergoes heat treatment and shot peening. The carrier itself is machined from hardened 8620 steel.</p>\n<ul>\n<li>  Quality assured with magnetic particle inspection</li> <li>  Rubber insert and spring included in extractor construction</li> <li>  Matte-black nitride finish provides reduced friction and increased rust-resistance</li> <li>  Properly torqued and staked gas-key screws</li>\n</ul>\n<p> The Brownells M16 6.8 SPC Bolt Carrier Group also comes complete with a firing pin, cam pin and firing-pin retaining pin.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:009</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-6-8mm-spc-bolt-carrier-group-nitride-mp-prod105384.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-6-8mm-spc-bolt-carrier-group-nitride-mp-prod105384.aspx', '4c31bd4c3edad960ba5b321a04b9c748', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:29'),
(2555, 4, 'SILENCERCO - S&W M&P THREADED BARRELS', '<h3 class=\"mbm\">Swap-In Ready for Silencer - No Sacrifice of Factory Barrel Performance</h3>\n<p></p>\n<p> SilencerCo’s replacement barrel for the Smith &amp;Wesson M&amp;P comes with a threaded muzzle ready for your favorite suppressor. Available in both 9mm and .45 ACP for full-size 5\" barreled S&amp;W M&amp;P pistols, these barrels are machined from high-grade stainless steel to factory dimensions for an easy, drop-in fit to your M&amp;P. Muzzle threads are compatible with the most popular silencers for each caliber.</p>\n<ul>\n<li>  9x19mm model: 1-10\" RH rifling, ½\"-28 threads</li> <li>  .45 ACP model: 1-16\" RH rifling, .578\"-28 threads</li> <li>  416R stainless steel</li>\n</ul>\n<p> The SilencerCo S&amp;W M&amp;P threaded replacement barrel easily turns your factory M&amp;P into a suppressor-ready pistol.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:220</em></strong></div>', NULL, 'https://www.brownells.com/handgun-parts/barrel-parts/barrels/s-w-m-p-threaded-barrels-prod101183.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/barrel-parts/barrels/s-w-m-p-threaded-barrels-prod101183.aspx', 'b2a4be619a60d912cecdf72ceceede6e', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:32'),
(2556, 4, 'SINCLAIR INTERNATIONAL - CARBIDE EXPANDER MANDRELS', '<h3 class=\"mbm\">Yields Closer Tolerances and More Lubricity</h3>\n<p></p>\n<p> Sinclair Carbide Neck Expander Mandrels are ground from solid carbide stock, which yields closer tolerances and more lubricity. Carbide is also better at resisting galling which can leave behind material and scratch the inside of your necks.</p>\n<p> The shape, finish, and size are the result of years of use and experimentation by many hand loaders. Sinclair expander mandrels are made .001\" smaller than bullet diameter. Using an expander mandrel prior to neck turning sizes the case to fit the neck turning mandrels perfectly, or use prior to bullet seating to get more concentric necks and perfect neck tension.</p>\n<p> All Sinclair Mandrels are designed for use with the Sinclair Expander Die and all Sinclair Neck Turning Tools.</p>', NULL, 'https://www.brownells.com/reloading/case-preparation/neck-turning/turning-amp-expander-mandrels/carbide-expander-mandrels-prod119668.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/case-preparation/neck-turning/turning-amp-expander-mandrels/carbide-expander-mandrels-prod119668.aspx', 'f02f056b4c441366418242c48ff4b2b3', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:38'),
(2557, 4, 'BERGER BULLETS - BERGER HYBRID BULLETS', '<p></p>\n<p>Bergers Hybrid design blends the best of both worlds by incorporating two different shapes within the nose. As the bearing surface ends, a tangent ogive begins. This tangent section of the ogive results in the bullet being much less sensitive to seating depth. As you move forward along the tangent portion, the shape changes into a secant ogive (the shape used on the VLD bullets). This shape is very efficient in the wind and is why the VLD became so popular. The key to all this is not just the combining of these two shapes but also the partnership between the ballistician and the bullet maker. Berger’s Chief Ballistician, Bryan Litz uses his expertise to combine the appropriate shapes for optimum performance.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:68, Page:541 <br> Sinclair, Issue:5B, Page:102</em></strong></div>', NULL, 'https://www.brownells.com/reloading/bullets/rifle-bullets/berger-hybrid-bullets-prod54522.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/bullets/rifle-bullets/berger-hybrid-bullets-prod54522.aspx', 'e5e8c5feac34d3f3736b4dbd59becfd1', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:42'),
(2558, 4, 'WINCHESTER - \r\n                USA WHITE BOX AMMO 9MM LUGER 115GR FMJ', '<p></p>\n<h3 class=\"mbm\"> Economical Ammo For A Variety Of Shooting Applications</h3>\n<p> Winchester \"USA White Box\" has always stood for consistent performance and outstanding value, offering high-quality ammunition to suit a wide range of hunter\'s and shooters need\'s.</p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:09, Page:065 <br> Big Book Catalog, Issue:66, Page:523</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/handgun-ammo/usa-white-box-ammo-9mm-luger-115gr-fmj-prod95254.aspx', NULL, NULL, 279.99, 12.99, 267.00, 'https://www.brownells.com/ammunition/handgun-ammo/usa-white-box-ammo-9mm-luger-115gr-fmj-prod95254.aspx', '79e50697f279941151d0e62fc0671a8a', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:48'),
(2559, 4, 'BSF BARRELS - AR-15 BARREL CARBON FIBER 223 WYLDE 1-8 TWIST', '<h3 class=\"mbm\">A Target Barrel Light Enough for All Day Carry!</h3>\n<p></p>\n<p> The BSF .223 Wylde Carbon Fiber AR-15 Barrels are built around a 416R stainless steel inner core wrapped in an advanced carbon fiber jacket for enhanced strength and rapid cooling. The result is the rigidity and stability of a heavy target barrel without the enormous weight penalty - your rifle is just as accurate but much easier to lug around!</p>\n<p> Since the carbon jacket on BSF .223 Wylde Carbon Fiber AR-15 Barrels contact only 5% of the inner barrel, there is an air pocket between the two that allows air to flow freely and keep the inner barrel cool. Vent holes in the carbon fiber jacket let the heat out, promoting a convection cooling process that results in a barrel that can be handled with bare hands, even after dumping two full-size 30-round mags right after each other.</p>\n<ul>\n<li>  .223 Wylde chamber is optimized to give excellent performance with both civilian .223 Rem and military 5.56 NATO ammo</li> <li>  1\"-8 rifling stabilizes a wide range of bullet weights</li> <li>  .936 O.D. bull/target barrel contour</li> <li>  Match-grade 416R stainless steel barrel is double stress relieved to further resist heat warping</li>\n</ul>\n<p> Three times stronger than steel, the carbon fiber wrap on BSF .223 Wylde Carbon Fiber AR-15 Barrels maintains outstanding rigidity and strength while keeping the barrel remarkably light.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:018</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/barrel-parts/rifle-barrels/ar-15-barrel-carbon-fiber-223-wylde-1-8-twist-prod109096.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/barrel-parts/rifle-barrels/ar-15-barrel-carbon-fiber-223-wylde-1-8-twist-prod109096.aspx', '9c11fdc3544744fe798a77ea5a827a08', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:51'),
(2560, 4, 'HORNADY - BULK RIFLE BULLETS', '<p></p>\n<p> Hornady bulk rifle bullets are great for target practice as well as varmint shooting and plinking. These bullets feature a copper jacket with a lead core. Available in popular calibers for high volume shooters. Shoot more with these inexpensive bulk bullets!</p>', NULL, 'https://www.brownells.com/reloading/bullets/rifle-bullets/bulk-rifle-bullets-prod55232.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/bullets/rifle-bullets/bulk-rifle-bullets-prod55232.aspx', '013dea5cd3cb1955796cc62fb6a4fe9a', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:55'),
(2561, 4, 'AMERICAN EAGLE - \r\n                RANGE & FIELD AMMO 22 LONG RIFLE 38GR COPPER PLATED HOLLOW POINT', '<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>', NULL, 'https://www.brownells.com/ammunition/rimfire-ammo/range-field-ammo-22-long-rifle-38gr-copper-plated-hollow-point-prod106124.aspx', NULL, NULL, 0.00, 14.99, 0.00, 'https://www.brownells.com/ammunition/rimfire-ammo/range-field-ammo-22-long-rifle-38gr-copper-plated-hollow-point-prod106124.aspx', 'd3fb97af13cdbabba9e4134f575d9c5d', 1, NULL, '2018-08-06 12:12:24', '2018-08-06 13:49:58'),
(2562, 4, 'FEDERAL - \r\n                CHAMPION AMMO 22 LONG RIFLE 40GR LEAD ROUND NOSE', '<h3 class=\"mbm\">Down Range Consistancy From Shot To Shot</h3>\n<p></p>\n<ul>\n<li>50 per box</li>    <li>40-grain, .22 Long Rifle Solid</li>    <li>Champion Target line</li>    <li>High Velocity Lightening</li>\n</ul>\n<p>The <strong>Federal Ammo .22 Long Rifle Solid</strong> is a great combination of performance and price for a wide range of target shooting applications for your rimfire guns. Its effective velocity, accuracy and quality design is ideal for the casual range shooter.</p>\n<p> </p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:08, Page:096 <br> Big Book Catalog, Issue:66, Page:530</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/rimfire-ammo/champion-ammo-22-long-rifle-40gr-lead-round-nose-prod43054.aspx', NULL, NULL, 2.69, 2.29, 0.40, 'https://www.brownells.com/ammunition/rimfire-ammo/champion-ammo-22-long-rifle-40gr-lead-round-nose-prod43054.aspx', 'a2d0419077932f4ad3e043e2b1b98702', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:50:02'),
(2563, 4, 'DPMS - AR-15 LOWER PARTS KIT LESS TRIGGER GROUP & GRIP', '<h3 class=\"mbm\">Sub-Assembly, Mil-Spec Parts Packaged In Money-Saving Kits</h3>\n<p></p>\n<p> The easiest way to stock and sell genuine, mil-spec AR-15 parts, or use to assemble rifles on your receivers. Much lower in total cost than buying the parts one at a time. Kit contains only new, current-production, genuine, mil-spec parts; never pull-offs or direct-exchange surplus. Just add a hammer, trigger, and pistol grip of your choice.<strong> Kit includes </strong>trigger spring, trigger pin, hammer spring, hammer pin, disconnector and spring, bolt catch, bolt catch plunger, bolt catch spring, bolt catch roll pin, selector, selector detent, selector detent spring, (2) takedown detents and springs, pivot pin, rear takedown pin, buffer retainer and spring, magazine catch, button and spring, screw and washer, triggerguard assembly and pin.</p>\n<div class=\"callout\"><strong><em> <br> AR-15, Issue:11, Page:039 <br> Big Book Catalog, Issue:71, Page:043</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/parts-kits/lower-parts-kits/ar-15-lower-parts-kit-less-trigger-group-grip-prod73621.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/receiver-parts/parts-kits/lower-parts-kits/ar-15-lower-parts-kit-less-trigger-group-grip-prod73621.aspx', '11f6f9221bd7bb7ed268a44c1d3f15bb', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:50:06'),
(2564, 4, 'GEMPRO - 250 PRECISION SCALE', '<p></p>\n<p> Looking for the Ultimate Gem Scale? Look no further! Introducing the GemPro-250 scale!The GemPro is bound to surpass the expectations of even the most demanding reloader. With dual-division capability, static-electricity resistance, 3 calibration settings, 6 weighing modes, programmable auto-off, an optional backlight, a full tare feature, and an included adapter, this scale is in a league of its own. Also included is a calibration weight, a stainless-steel weighing-tray, an expansion scoop/bowl, and a protective hard-case.</p>\n<p> The GemPro-250 has a 50 gram/772gr capacity with an accuracy of 0.001g/0.02gr.Runs on 4 AAA Batteries (not included) or supplied AC Adapter.</p>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:11, Page:068 <br> Big Book Catalog, Issue:68, Page:538 <br> Sinclair, Issue:5B, Page:087</em></strong></div>', NULL, 'https://www.brownells.com/reloading/powder-handling/powder-scales/250-precision-scale-prod59271.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/powder-handling/powder-scales/250-precision-scale-prod59271.aspx', 'f3029311a5279724fdb13b8a7489ba17', 0, NULL, '2018-08-06 12:12:24', '2018-08-06 13:50:09'),
(2565, 4, 'LYMAN - CASE PREP XPRESS', '<h3 class=\"mbm\">One-Stop Machine Helps You Quickly Perform Brass Prep</h3>\n<p></p>\n<p> All-in-one power tool includes the most popular case preparation accessories in one unit driven by a single high-torque, low-RPM motor ideally suited to case prep work. Nothing else to buy to get started! Quick, easy cleanup, too - just brush all the brass chips into the removable collection pan. Includes attachments to perform these case prep operations: deburr case neck inside (VLD) and outside; clean/lubricate case neck; clean/uniform primer pocket and ream out primer crimp on military brass (includes attachments for both large and small pockets). Comes with case neck brushes in .25, .30, .38 and .45 calibers, plus Mica case neck lube and a handy clean-up brush.</p>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:11, Page:065 <br> Big Book Catalog, Issue:68, Page:529 <br> Sinclair, Issue:5B, Page:008</em></strong></div>', NULL, 'https://www.brownells.com/reloading/case-preparation/case-prep-units/case-prep-xpress-prod42938.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/case-preparation/case-prep-units/case-prep-xpress-prod42938.aspx', 'cf48916d54cba2749ae346249dd9cb6a', 0, NULL, '2018-08-06 12:12:25', '2018-08-06 13:50:14'),
(2566, 4, 'REMINGTON - \r\n                UMC AMMO 45 ACP 230GR FMJ', '<p></p>\n<h3 class=\"mbm\"> Reliable, Economical, Popular Handgun Calibers &amp; Loads</h3>\n<p> Made with Remington components right here in the USA, UMC ammo provides shooters with an excellent blend of value and performance. It’s available in today’s most popular pistol and revolver calibers with both metal case (MC) or jacketed hollow point (JHP) bullets. For target shooting, tactical training, action-pistol competition, or any other high-volume shooting activity, UMC handgun ammunition offers outstanding performance without any compromise in quality or reliability. You’ll be hard-pressed to find a better value anywhere. Many of the most sought-after calibers are available in convenient bulk packs. <strong>MC = FMJ.</strong></p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:09, Page:065 <br> Big Book Catalog, Issue:68, Page:547</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/handgun-ammo/umc-ammo-45-acp-230gr-fmj-prod95234.aspx', NULL, NULL, 184.99, 16.59, 168.40, 'https://www.brownells.com/ammunition/handgun-ammo/umc-ammo-45-acp-230gr-fmj-prod95234.aspx', '78fd9011d83dac4227b91e287dba448a', 0, NULL, '2018-08-06 12:12:25', '2018-08-06 13:50:19'),
(2567, 4, 'TRIJICON - RMR DUAL-ILLUMINATION SIGHTS', '<h3 class=\"mbm\">Compact, Ruggedized Red Dot Sight System For Fast, Accurate Targeting</h3>\n<p></p>\n<p> As tough as Trijicon’s legendary ACOG® scopes, the low-profile RMR™ (Ruggedized Miniature Reflex) sight enables fast, both-eyes-open, target acquisition—even in poor lighting conditions. Unlimited eye relief allows natural presentation from almost any shooting position, plus clear, unobstructed panoramic views for maximum situational awareness. Mount an RMR on your rifle to supplement your ACOG, and you’re ready to address targets at any range.</p>\n<p> Performs in the harshest operating conditions thanks to a computer-optimized geometric housing of high-strength, forged, military-grade, aluminum that absorbs shock and diverts stress away from the lens. Simple to operate, no switches to toggle, or forget to activate under stress, because the sight is always on. The True-Color 28-layer coated, non-magnifying lens delivers a crisp, clear shooting picture. Fully adjustable for windage and elevation, 1 MOA per audible click. Each RMR is pre-adjusted at the factory to be parallax-free at 50 meters.</p>\n<p> Battery-free Dual-Illuminated models use a combination of powerful, light-gathering fiber optics and self-illuminating Tritium to project a bright amber dot on the sight in any light conditions from pitch darkness to broad daylight. Automatically adjusts brightness and contrast of reticle to ambient light. All RMR models come shipped in a water-resistant, dustproof, and crushproof Pelican™ case.</p>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:11, Page:048 <br> AR-15, Issue:11, Page:100 <br> Big Book Catalog, Issue:71, Page:142 <br> Big Book Catalog, Issue:71, Page:280</em></strong></div>', NULL, 'https://www.brownells.com/optics-mounting/electronic-sights/reflex-sights/rmr-dual-illumination-sights-prod55663.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/electronic-sights/reflex-sights/rmr-dual-illumination-sights-prod55663.aspx', '24f51b6a791f7af7faa1b62cc9d025cb', 0, NULL, '2018-08-06 12:12:25', '2018-08-06 13:50:23'),
(2568, 4, 'TRIJICON - RMR TYPE 2 RM07 6.5 MOA ADJUSTABLE LED REFLEX SIGHT', '<p></p>\n<p> Developed to improve precision and accuracy with any style or caliber of weapon, the Trijicon RMR (Ruggedized Miniature Reflex) Type 2 is designed to be as durable as the legendary ACOG. The RM06 is an LED sight powered by a standard CR2032 battery. Housed in rugged forged aluminum, the RMR Type 2 is extremely tough yet lightweight. New easy-to-use adjusters with audible clicks allow for quick windage and elevation adjustments.<br><br> With eight available brightness settings, the reticle can be manually adjusted by pressing the plus or minus buttons on either side of the unit. To switch to auto adjust mode simply press both buttons simultaneously and release. To save battery life turn the optic off by pressing both buttons simultaneously and holding for 3 seconds.  <br><br> The Trijicon RMR Type 2 is tougher than any alternative and suitable for military, law enforcement and hunting applications.<br><br> Available in Anodized Black or Cerakote finishes in Sniper Gray, OD Green, and Flat Dark Earth.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:280</em></strong></div>', NULL, 'https://www.brownells.com/optics-mounting/electronic-sights/reflex-sights/rmr-type-2-rm07-6-5-moa-adjustable-led-reflex-sight-prod107919.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/electronic-sights/reflex-sights/rmr-type-2-rm07-6-5-moa-adjustable-led-reflex-sight-prod107919.aspx', '75045a79f1288214f91473fe4d14f570', 0, NULL, '2018-08-06 12:12:25', '2018-08-06 13:50:26'),
(2569, 4, 'MAGPUL - AK/AKM 30RD PMAG GEN M3 MAGAZINE 7.62X39', '<h3 class=\"mbm\">GEN 3 Ergonomics &amp; Reliability For Your AK Plus Internal Reinforcing For Maximum Durability</h3>\n<p></p>\n<p> The Magpul PMAG AK/AKM GEN M3 brings Kalashnikov PMAG technology up to the same state-of-the-art as GEN M3 mags for AR-pattern rifles. This rugged yet lightweight, high-reliability mag is designed specifically for AK-pattern rifles, including the AKM, AKS, SIG556R, and similar variants.<br><br> The mag body has a steel-reinforced spine and front/rear lugs for superb durability under hard use, plus Magpul\'s constant-curve internal geometry for smooth movement of the round stack. Handy paint pen dot matrix panels on the lower portion of the body make it easy to ID each of your mags.<br><br> The flared floorplate is easy to grab, yet is slim enough for use with standard AK mag pouches, and of course it\'s easy to remove for cleaning. The low-friction, anti-tilt polymer follower delivers reliable performance and the durability you expect from any magazine with the \"PMAG\" name. Counts as 3 U.S.-sourced parts for compliance with 18 U.S.C. Sec. 922(r).</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:179</em></strong></div>', NULL, 'https://www.brownells.com/magazines/rifle-magazines/magazines/ak-akm-30rd-pmag-gen-m3-magazine-7-62x39-prod75049.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/rifle-magazines/magazines/ak-akm-30rd-pmag-gen-m3-magazine-7-62x39-prod75049.aspx', '967a3768308e17e658dc74d497cd4bc7', 0, NULL, '2018-08-06 12:12:25', '2018-08-06 13:50:30'),
(2570, 4, 'GLOCK - 22/35 .40 S&W MAGAZINE 10 PACK', '<p></p>\n<p> Be confident your Glock pistol will perform to factory standards each and every time with genuine Glock factory magazines. Manufactured to Glock specifications in Austria by Glock. All models include round count indicator on rear face of magazine body and standard factory baseplate.</p>', NULL, 'https://www.brownells.com/magazines/handgun-magazines/magazines/22-35-40-s-w-magazine-10-pack-prod80252.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/handgun-magazines/magazines/22-35-40-s-w-magazine-10-pack-prod80252.aspx', 'e69425842e2c73b4e7cb61d48851f2bb', 0, NULL, '2018-08-06 12:12:25', '2018-08-06 13:50:34'),
(2571, 4, 'TRIJICON - TRITIUM NIGHT SIGHT SETS FOR GLOCK®', '<p></p>\n<p> Nighttime and low light shooting tests prove sights equipped with these glowing dots are easier to see and more accurate than instinctive shooting with standard black sights. Rugged, heavy duty, Traser®, luminous, 3-Dot tritium lamps provide their own long-lasting energy source. Lamps are mounted in silicone-sealed, metal cylinders to give maximum protection from breakage or leakage. Polished sapphire, crystal windows give a bright, crisp and perfectly round aiming dot in low light. Inlaid white rings around each sapphire make the sights appear as standard white dots in daylight. Very narrow blades do not have the white ring and will look more like a plain black blade in daylight. Most can be installed in factory dovetail or sight base.</p>\n<p> Trijicon Bright &amp; Tough™ Night Sights are three-dot iron sights that increase night-fire shooting accuracy by as much as five times over conventional sights. Equally impressive, they do so with the same speed as instinctive shooting - and without the need for batteries. Housed in a metal body and cushioned within silicone rubber, Bright &amp; Tough Night Sights feature a unique shock-resistant design. Each lamp is capped with a sapphire jewel to help evenly distribute the light while protecting the lamp from solvents and puncture. Contained within aluminum cylinders for additional protection, the lamps are mounted on silicone rubber cushions to withstand shock and heavy recoil. Green lamps are warranted for 12 years from the date of manufacture.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H.  Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H.  The use of Glock on this page is merely to advertise the sale of Glock parts or components.  As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</p>\r\n</div>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:322</em></strong></div>', NULL, 'https://www.brownells.com/handgun-parts/sights/sight-sets/tritium-night-sight-sets-for-glock--prod70744.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/sights/sight-sets/tritium-night-sight-sets-for-glock--prod70744.aspx', '1fe114354cef5b90241724306f49bb74', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:50:39'),
(2572, 4, 'BARNES BULLETS - BARNES TIPPED TRIPLE-SHOCK X BULLETS', '<p></p>\n<p> These Tipped TSX bullets feature the same copper body, multiple ring construction as the TSX with the addition of a streamlined polymer tip to improve long-range ballistics. The tip and re-engineered nose cavity provide even faster expansion than the TSX with nearly 100% weight retention, deadly accuracy and excellent terminal performance.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:68, Page:540 <br> Sinclair, Issue:5B, Page:115</em></strong></div>', NULL, 'https://www.brownells.com/reloading/bullets/rifle-bullets/barnes-tipped-triple-shock-x-bullets-prod39592.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/bullets/rifle-bullets/barnes-tipped-triple-shock-x-bullets-prod39592.aspx', '2078807eae338b20976e2b56e8547055', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:50:44'),
(2573, 4, 'NIGHTFORCE - NX8 SCOPE 1-8x24MM FFP FC-MOA RETICLE', '<h3 class=\"mbm\">Made for the AR Platform</h3>\n<p></p>\n<p> Choosing an optic to top your AR-15 can be a challenge, especially with all of the options available today. However, professionals know that the Nightforce Optics NX8 1-8x24mm Scope is battle-proven and loaded with all the features needed for success.<br><br> The Nightforce Optics NX8 1-8x24mm Scope features a balanced design that meets all the right requirements for size, weight and durability. The optic features a visible red dot on its 1X setting, allowing for quick targeting at close range, while the 8X setting enables AR users to stretch the range of their chosen caliber.</p>\n<ul>\n<li>  Uses FFP FC-MOA reticle</li> <li>  Weight: 17 ounces</li> <li>  Tube size: 30mm</li> <li>  Click value: 1/2 MOA</li>\n</ul>\n<p> Other added features on the Nightforce Optics NX8 1-8x24mm Scope include a ZeroStop elevation turret and the company\'s easy-to-use Power Throw Lever. The illuminated reticle is powered by a single CR2032 battery.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	<em><strong>Promotional Codes are not applicable to Nightforce products</strong>.</em></p>\r\n</div>', NULL, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/nx8-scope-1-8x24mm-ffp-fc-moa-reticle-prod116313.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/nx8-scope-1-8x24mm-ffp-fc-moa-reticle-prod116313.aspx', 'bc23b03b03f437e64d57d14c260a4eac', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:50:49'),
(2574, 4, 'BROWNELLS - M16 7.62X39 BOLT CARRIER GROUP NITRIDE MP', '<h3 class=\"mbm\">Allows Your 7.62x39 AR to Run the Right Way</h3>\n<p></p>\n<p> The Brownells M16 7.62x39 Bolt Carrier Group offers AR-15 builders building a unique rifle chambered in the 7.62x39 cartridge with the final necessary component needed to get their gun running right.<br><br> The Brownells M16 7.62x39 Bolt Carrier Group features a bolt head that is fully machined from solid 9310 steel, which is then completed with a heat treatment and shot peening. The carrier is built using 8620 hardened steel.</p>\n<ul>\n<li>  Features torqued and staked gas keys</li> <li>  Extractor assembled with rubber insert and spring</li> <li>  Checked thoroughly with magnetic-particle inspection</li> <li>  Increased corrosion resistance with black-nitride finish</li>\n</ul>\n<p> The Brownells M16 7.62x39 Bolt Carrier Group comes complete with a firing pin, cam pin and firing pin retaining pin, along with the bolt carrier, bolt and gas key.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:009</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-7-62x39-bolt-carrier-group-nitride-mp-prod105381.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-7-62x39-bolt-carrier-group-nitride-mp-prod105381.aspx', 'a23ddb3808f52ebc21f56529818598f4', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:50:55'),
(2575, 4, 'RADIAN WEAPONS - AR-15 AMBIDEXTROUS RAPTOR CHARGING HANDLE W/ TALON SAFETY', '<h3 class=\"mbm\">Enhances the Controls on Your AR-15</h3>\n<p></p>\n<p> The Radian Weapons AR-15 Ambidextrous Raptor Charging Handle with Talon Safety is a product pairing you\'ll only see from Brownells, and the setup ensures that AR owners have two enhanced elements that are vital parts of any improved AR-15 rifle.</p>\n<ul>\n<li>  Black finish</li> <li>  Made from 7075 aluminum</li> <li>  Safety selector provides 90-degree or 45-degree throw</li> <li>  Selector can be used in most AR-15 and AR-10 rifles</li>\n</ul>\n<p> The Radian Weapons AR-15 Ambidextrous Raptor Charging Handle with Talon Safety is completely made in the USA to ensure high-quality design and construction.</p>', NULL, 'https://www.brownells.com/rifle-parts/bolt-parts/charging-handle-parts/charging-handles/ar-15-ambidextrous-raptor-charging-handle-w-talon-safety-prod109511.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/bolt-parts/charging-handle-parts/charging-handles/ar-15-ambidextrous-raptor-charging-handle-w-talon-safety-prod109511.aspx', '8e8d3e178daaba45abfbeb036d1e6033', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:50:58'),
(2576, 4, 'SK - \r\n                STANDARD PLUS AMMO 22 LONG RIFLE 40GR LEAD ROUND NOSE', '<p></p>\n<p> Universal training cartridge with highest quality and precision for short and long ranges. Ideal for use for all rifle and pistol disciplines.</p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>', NULL, 'https://www.brownells.com/ammunition/rimfire-ammo/standard-plus-ammo-22-long-rifle-40gr-lead-round-nose-prod59258.aspx', NULL, NULL, 6.49, 5.59, 0.90, 'https://www.brownells.com/ammunition/rimfire-ammo/standard-plus-ammo-22-long-rifle-40gr-lead-round-nose-prod59258.aspx', '6a0acf71976b9f80fd51ff16fe9dccf9', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:51:03'),
(2577, 4, 'AMERIGLO - SUPPRESSOR SIGHT SET for GLOCK®', '<p></p>\n<ul>\n<li style=\"list-style-type: disc; box-sizing: border-box; padding: 0px; margin: 0px;\">  Suppressor Sights for Glock®? available with or without Tritium</li> <li style=\"list-style-type: disc; box-sizing: border-box; padding: 0px; margin: 0px;\">  Suppressor height sights allow for a proper sight picture when firing a suppressed Glock or when using an RMR equipped slide such as the Tactical Glock Slide from One Source Tactical</li> <li style=\"list-style-type: disc; box-sizing: border-box; padding: 0px; margin: 0px;\">  Night Sight model includes Trijicon Tritium inserts</li> <li style=\"list-style-type: disc; box-sizing: border-box; padding: 0px; margin: 0px;\">  Nights Sight has a 3-Dot sight picture, with the Tritium illuminating green on both the front and rear sight</li> <li style=\"list-style-type: disc; box-sizing: border-box; padding: 0px; margin: 0px;\">  The standard Suppressor Sight set does not feature dots or Tritium, allowing for a clean sight picture</li> <li style=\"list-style-type: disc; box-sizing: border-box; padding: 0px; margin: 0px;\">  The standard front sight features a serrated face, for an anti-glare sight picture</li> <li style=\"list-style-type: disc; box-sizing: border-box; padding: 0px; margin: 0px;\">  The standard set is an excellent option when using iron sights as backups on an RMR equipped slide</li> <li style=\"list-style-type: disc; box-sizing: border-box; padding: 0px; margin: 0px;\">  Machined steel construction</li> <li style=\"list-style-type: disc; box-sizing: border-box; padding: 0px; margin: 0px;\">  Matte black finish</li>\n</ul>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H.  Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H.  The use of Glock on this page is merely to advertise the sale of Glock parts or components.  As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</p>\r\n</div>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:317</em></strong></div>', NULL, 'https://www.brownells.com/handgun-parts/sights/sight-sets/suppressor-sight-set-for-glock--prod70515.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/sights/sight-sets/suppressor-sight-set-for-glock--prod70515.aspx', 'f38671d1c7f44b42d089ec5e22fb0a79', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:51:06'),
(2578, 4, 'HORNADY - \r\n                ELD MATCH 224 VALKYRIE AMMO', '<h3 class=\"mbm\">.224 Valkyrie Loaded with Hornady s Superior ELD Match Bullet</h3>\n<p></p>\n<p> The new 224 Valkyrie cartridge is now being chambered by Hornady in their radically superior ELD Match bullets. Hornady carefully selects components to ensure uniformity, then loads to exacting specifications to provide pinpoint accuracy.</p>\n<ul>\n<li>  Hornady Match Bullets</li> <li>  Carefully selected brass cases and matched powders for optimal pressure, velocity and consistent accuracy.</li> <li>  Available in 20 or 200 round boxes.</li>\n</ul>\n<p> The Hornady .224 Valkyrie ELD series ensures proper bullet seating, consistent powder charges, pressures, optimal velocity, consistent overall length and repeatable accuracy.</p>\n<ul><li>   </li></ul>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>', NULL, 'https://www.brownells.com/ammunition/rifle-ammo/eld-match-224-valkyrie-ammo-prod119760.aspx', NULL, NULL, 204.99, 18.99, 186.00, 'https://www.brownells.com/ammunition/rifle-ammo/eld-match-224-valkyrie-ammo-prod119760.aspx', '78f8093c37a0ee324362f34486ea7e4b', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:51:10'),
(2579, 4, 'HORNADY - BULK PISTOL BULLETS', '<p></p>\n<p> Hornady bulk pistol bullets are great for target practice and plinking. These bullets feature a copper jacket with a lead core. Available in popular calibers for high volume shooters. You know the old adage \"Practice makes perfect\", well you\'ll be a pro in no time with these inexpensive bulk bullets.</p>', NULL, 'https://www.brownells.com/reloading/bullets/pistol-bullets/bulk-pistol-bullets-prod55233.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/bullets/pistol-bullets/bulk-pistol-bullets-prod55233.aspx', 'aa41997e2b42c1bb99b1e794ac64c69b', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:51:14'),
(2580, 4, 'TRIJICON - MRO WITH BATTLE ARMS LIGHTWEIGHT MOUNT', '<h3 class=\"mbm\">Ready-to-Use Package for Rifle Mounting</h3>\n<p></p>\n<p> The Trijicon MRO with Battle Arms Development Lightweight Mount package provides gun owners with a high-quality red-dot optic paired up with a battle-ready mount that is ready to put onto your go-to rifle in seconds.<br><br> The Trijicon MRO with B.A.D Lightweight Mount package deal includes the battle-ready MRO red-dot, which is constructed on a forged 7075-T6 aluminum housing that\'s waterproof and ruggedly built for use in any environment. The optic features a 2-MOA red dot with six brightness settings and is fully night-vision compatible.</p>\n<ul>\n<li>  Weight: 4.98 ounces</li> <li>  Powered by CR2032 battery</li> <li>  Battery life: 5 years</li> <li>  1/2 MOA adjustment value</li>\n</ul>\n<p> The Trijicon MRO with Battle Arms Development Lightweight Mount package deal also features a high-quality optics mount machined from 7075-T6 aluminum and weighs in at just 0.88 ounce. The mount can be had in either a co-witness setup or a lower-third co-witness mount.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:280</em></strong></div>', NULL, 'https://www.brownells.com/optics-mounting/electronic-sights/red-dot-sights/mro-with-battle-arms-lightweight-mount-prod113317.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/electronic-sights/red-dot-sights/mro-with-battle-arms-lightweight-mount-prod113317.aspx', 'f5829f80d9c2d63e21137c06fc275ff8', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:51:18'),
(2581, 4, 'BADGER ORDNANCE - REMINGTON 700 SHORT ACTION SCOPE RAILS', '<h3 class=\"mbm\">Forward Cant Helps You Zero Your Scope for Extended Ranges</h3>\n<p></p>\n<p> Badger Ordnance’s Remington Short Action Scope Rail is a heavy-duty steel base with built-in forward angle bias so you can take those ultra-long-range shots without exceeding the elevation adjustment of your scope.</p>\n<p> The Badger Ordnance Remington Short Action Scope Rail has a MIL-STD 1913 Picatinny slot pattern for maximum compatibility with the many Picatinny tactical scope rings currently available.</p>\n<ul><li>  Bore height dimension is .31\"</li></ul>\n<p> The Badger Ordnance Remington Short Action Scope Rail has an integral recoil lug that ensures this base won’t move, even when shooting the hardest-kicking cartridges.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:257</em></strong></div>', NULL, 'https://www.brownells.com/optics-mounting/rings-mounts-amp-bases/rifle-bases/remington-700-short-action-scope-rails-prod109718.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/rings-mounts-amp-bases/rifle-bases/remington-700-short-action-scope-rails-prod109718.aspx', 'eef22d4b582a1a8d805f1ab898395bfb', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:51:22'),
(2582, 4, 'HORNADY - LOCK-N-LOAD AUTO PROGRESSIVE PRESS', '<p></p>\n<p>This automatic, five station press lets you switch your reloading dies and accessories without changing the entire tool head. With a quick twist, the Lock-N-Load inserts allow you to engage or disengage your accessories in each station. The solid top-plate construction means you’ll never have to purchase additional tool plates. You may also use 7⁄8-14\" dies and powder measures from your other favorite manufacturers by installing Lock-N-Load bushing inserts (listed below). The Hornady automatic case feeder is available by special order at this time. It has one of the highest torque motors of any progressive press and will feed hundreds of rounds per hour. Adapts to your press and feeds each cartridge to your shell plate – ask any of our customer service representatives for assistance.</p>\n<p><strong>Features Include:</strong> Lock-N-Load Powder Measure: The AP uses Hornady’s full size powder measure which can change powder charges with the press of the button. Hornady utilizes a quickchange measure insert that can be stored with your reloading dies preset to the charge you desire. You’ll never have to adjust your measure back to that favorite load again – just purchase additional inexpensive measure inserts for each of your cartridges. This is the most flexible powder system of any progressive press on the market.</p>\n<p><strong>Priming System: </strong>The primer is dropped in place at the top of the stroke and inserts into the case at the end of each stroke. Slide tray is easily changed from large to small primers and includes primer pick-up tubes to fill the main primer tube.</p>\n<p><strong>Case Activated Powder Drop: </strong>The Case Activated Powder Drop provides the powder charge only when a cartridge is in place. Prevents powder charging errors, or can be set to manual operation to check charges. No powder mess to clean up, automatic case indexing prevents double charges.</p>\n<p><strong>Case Retainer: </strong>The Case Retainer allows you to quickly and easily remove or replace a case from the shell plate at any point in the cycle without extra retaining buttons. Retainer fits all calibers.</p>\n<p><strong>Automatic Indexing and Case Ejector:</strong> The Lock-N-Load automatically advances the cases to the next station with the smoothest indexing of any press we’ve operated. It rotates every half stroke (shorter movements) to lessen the chance of powder spillage. At the completion of each round, the case is automatically ejected into the large capacity case catcher (included). All you need in addition to your Hornady AP press is a shell plate and dies to get you started. Ask any of our customer service representatives for help in determining your shell plate size.</p>\n<p>These other Hornady AP accessories, such as additional Powder Measure Metering Insert, Quick Change Powder Die, and the Powder Cop, enable you to have the fastest cartridge conversion on the market. Ask any of our customer service representatives to explain these upgrade options.</p>\n<p style=\"text-align: center\"><strong><a target=\"_blank\" href=\"http://www.hornady.com/assets/files/shell-plate-chart.pdf\">Click here for Hornady Shell Plates &amp; Shell Holders chart.</a></strong></p>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:11, Page:067 <br> Big Book Catalog, Issue:68, Page:535 <br> Sinclair, Issue:5B, Page:062</em></strong></div>', NULL, 'https://www.brownells.com/reloading/reloading-presses/progressive-presses/lock-n-load-auto-progressive-press-prod38390.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/reloading-presses/progressive-presses/lock-n-load-auto-progressive-press-prod38390.aspx', 'baa7278fa2e6110ac427b634961b5cfe', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:51:26');
INSERT INTO `deals` (`id`, `source_id`, `title`, `description`, `image`, `link`, `ratings`, `reviews_count`, `base_price`, `sale_price`, `save_price`, `from_url`, `unique_md5`, `out_of_stock`, `ext_date`, `created_at`, `updated_at`) VALUES
(2583, 4, 'BROWNELLS - AR-15 BROWNELLS 9MM BOLT CARRIER GROUP', '<h3 class=\"mbm\">A Purpose-Made Bolt for Your Pistol-Caliber Carbine</h3>\n<p></p>\n<p> The Brownells 9mm AR-15 Bolt Carrier Group is specifically designed for use in pistol-caliber carbines, which are a growing trend in the AR-15 world. This bolt-carrier group allows AR builders to custom-make their own 9mm AR.<br><br> The Brownells 9mm AR-15 Bolt Carrier Group is constructed entirely from a single piece of steel billet and features a pinned weight that can be taken out for compatibility with different buffer systems.</p>\n<ul>\n<li>  Compatible with both Glock and Colt magazines</li> <li>  Features complete nitride treatment for reduced friction</li>\n</ul>\n<p> The Brownells 9mm AR-15 Bolt Carrier Group also features a captured firing pin in order to prevent the possibility of slam fires.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:009</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/ar-15-brownells-9mm-bolt-carrier-group-prod110189.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/ar-15-brownells-9mm-bolt-carrier-group-prod110189.aspx', '51672adca34a92a535146ea01ccc6f21', 0, NULL, '2018-08-06 12:12:28', '2018-08-06 13:51:29'),
(2584, 4, 'VORTEX OPTICS - VIPER PST GEN II 1-6X24MM VRM-2 MOA RETICLE', '<p></p>\n<p> The Vortex Optics 1-6x24mm Viper PST Gen II is an incredibly versatile, variable power scope that gets you on target in demanding situations. Equipped with an illuminated, second focal plane reticle, the Vortex Optics 1-6x24mm Viper PST Gen II has highly functional, intuitive and detailed hold points, yet lens remains uncluttered optimum viewing.<br><br> Built on a single piece, aluminum main body, the Vortex Optics 1-6x24mm Viper PST Gen II riflescope has exposed turrets with laser etched elevation and windage adjustment marks. The patented RZR Zero stop ensures accurate returns to sight in zero after dialing elevation correction.</p>\n<ul>\n<li>  VRM-2 MOA Reticle</li> <li>  Second focal plane</li> <li>  10 illumination levels</li> <li>  Fast focus eyepiece</li> <li>  Parallax-free at 100 yards</li>\n</ul>\n<p> Outfitted with fully multi-coated, extra-low dispersion (XD) lenses, the Vortex Optics 1-6x24mm Viper PST Gen II riflescope delivers high resolution images with sharp color fidelity. The argon filled, O-rings sealed, 30mm tube ensures fog and waterproof performance.</p>', NULL, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/viper-pst-gen-ii-1-6x24mm-vrm-2-moa-reticle-prod98291.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/scopes/rifle-scopes/viper-pst-gen-ii-1-6x24mm-vrm-2-moa-reticle-prod98291.aspx', 'ace32bd0e2211c8a5a3e140e2c50ce3b', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:51:34'),
(2585, 4, 'RUGER - 10/22 SR-22 RIFLE CONVERSION KIT BLACK', '<h3 class=\"mbm\">Go Tactical on Your 10/22 With AR-15 Ergonomics &amp; Accessory Options</h3>\n<p></p>\n<p> Available ONLY from Brownells, the Ruger® SR-22® rifle conversion kit transforms your stock 10/22® into a “tacti-cool” rimfire with the look and feel of an AR-15. The SR-22 kit comes from the factory that built your rifle, so you can be assured these bolt-on parts will fit. It includes heavy-duty aluminum upper and lower receiver covers that bolt around your 10/22’s receiver to provide attachment points for the Hogue® Monogrip® pistol grip, mil-spec diameter (1.14\") AR-15 receiver extension (\"buffer tube\") and 6-position, adjustable, M4-style buttstock.<br><br> Up front, the SR-22 conversion kit’s receiver cover has an attachment point like an AR-15 barrel nut for accepting the kit\'s round, machined aluminum, mid-length handguard (of course, the barrel remains attached to the core 10/22 receiver). A set of Ruger’s Rapid Deploy Sights® mount to the flattop \"receiver’s\" Picatinny rail and a rail section at the top front of the handguard.</p>\n<ul>\n<li>  AR-15 flattop-style receiver cover with Picatinny top rail</li> <li>  Uses standard 10/22 10-round rotary magazines (Not Included)</li> <li>  Mid-length (approx. 9\") aluminum handguard</li> <li>  Handguard drilled for additional bolt-on accessory rails (Not included)</li> <li>  Adjustable front and rear sights</li> <li>  All necessary mounting hardware &amp; sight adjustment tool included</li> <li>  <strong>Kit does NOT include rifle or barrel</strong>\n</li>\n</ul>\n<p> The Ruger® SR-22® rifle conversion kit gives a plain, workaday 10/22® the ergonomics and accessory mounting versatility of an AR-15 carbine - and gives it a new, more aggressive stance.<br>  </p>', NULL, 'https://www.brownells.com/rifle-parts/stock-parts/rifle-stocks/10-22-sr-22-rifle-conversion-kit-black-prod114120.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/stock-parts/rifle-stocks/10-22-sr-22-rifle-conversion-kit-black-prod114120.aspx', '05b57d8c93dc057114b0e6875bb41341', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:51:37'),
(2586, 4, 'SILENCERCO - HK VP9 THREADED BARREL 9MM 1/2X28', '<h3 class=\"mbm\">Suppressor-Ready Replacement Barrel for Your VP9</h3>\n<p></p>\n<p> SilencerCo’s threaded replacement barrel is everything you need to convert your 9mm HK VP9 to accept a silencer or other muzzle device. Precision machined to factory dimensions, the SilencerCo HK VP9 replacement barrel has ½\"-28 muzzle threads compatible with most 9mm pistol suppressors.</p>\n<ul>\n<li>  Fits 9mm chambered HK VP9 with 4-1/2\" barrel</li> <li>  1-10\" RH rifling</li> <li>  416R stainless steel</li>\n</ul>\n<p> With the SilencerCo HK VP9 threaded replacement barrel, you can easily upgrade your pistol for use with a wide variety of popular sound suppressors (muzzle brakes and comps, too).</p>\n<p>  </p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:220</em></strong></div>', NULL, 'https://www.brownells.com/handgun-parts/barrel-parts/barrels/hk-vp9-threaded-barrel-9mm-1-2x28-prod101182.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/barrel-parts/barrels/hk-vp9-threaded-barrel-9mm-1-2x28-prod101182.aspx', '5aa9ecae08c346eb329bf0f8e0f7d740', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:51:41'),
(2587, 4, 'HOWA - \r\n                1500 6.5 CREEDMOOR 22\" SPORTER BARRELED ACTION', '<p></p>\n<p> Howa 1500 Barreled Actions are the perfect platform for a quality precision rifle build, at an affordable cost.  Every Howa Barreled Action features a hammer forged barrel, bottom metal and precise HACT two stage trigger.  The receiver and bolt are forged steel, with the bolt featuring an integral bolt handle.  Bolt faces are square to the barrel chamber and bolt faces have excellent contact with the receiver recesses.  M16 style extractor ensure positive extraction and function.  Factory barrels are hammer forged with headspace set to exacting standards.  The HACT two stage trigger has a crisp, light and consistent pull.  The included 3 position safety allows for the bolt to be locked, as well as put on safe when unloaded.  Scope bases are available from a variety of quality manufacturers.</p>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:160</em></strong></div>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-6-5-creedmoor-22-sporter-barreled-action-prod94596.aspx', NULL, NULL, 422.99, 339.99, 83.00, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/barreled-receivers/1500-6-5-creedmoor-22-sporter-barreled-action-prod94596.aspx', '555b22e76a89e336e3036f480172ce9a', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:51:45'),
(2588, 4, 'SINCLAIR/L.E. WILSON - MICRO-ADJUST BULLET SEATERS', '<p></p>\n<p> We gathered our customers ideas and reloading experience with hand dies, and partnered with the experts who make them, to introduce the new Sinclair/L.E. Wilson Micro-Adjust Bullet Seater. It features easy-adjust seating depth capabilities with a simple turn of the die body. Sinclair/L.E. Wilson Micro-Adjust Bullet Seaters are detent-bearing driven with positive “click”  increments of .0005” for fast, accurate bullet seating depth adjustments. Here are the details of construction:</p>\n<ol>\n<li>  Each seater stem is custom fitted to the seater body ensuring close tolerance fit</li> <li>  Precision-cut threads allow bullet seating depth adjustment in .0005” increments</li> <li>  Graduated scale for repeated use with different bullets and seating depths</li> <li>  Micro-Adjust “clicks” via stainless springs and stainless ball bearings</li> <li>  Constructed of 416 Stainless Steel with precise, laser-etched adjustment scale</li> <li>  Made in the USA by L.E. Wilson with 85 years of inline die experience</li>\n</ol>\n<p> We feel these dies are the finest available in terms of quality, construction, and performance.</p>\n<div class=\"callout\"><strong><em> <br> Sinclair, Issue:5B, Page:051</em></strong></div>', NULL, 'https://www.brownells.com/reloading/reloading-dies/rifle-dies/micro-adjust-bullet-seaters-prod65610.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/reloading-dies/rifle-dies/micro-adjust-bullet-seaters-prod65610.aspx', '95dd0222f9f02e93e949c4263469164f', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:51:49'),
(2589, 4, 'BROWNELLS - GLOCK® 9MM GEN3 WINDOWED SLIDE W/RMR RM06 RED DOT', '<p></p>\n<p> Brownells Front Cut RMR Slides for Glock® pistols feature a distinctive, wraparound serration pattern that aids in manipulating the slide, especially when checking the chamber. They also come with a pre-cut slot for easy, secure, low-profile mounting of a Trijicon RMR sight. In addition, you can get your Front Cut RMR Slide with a \"window\" cutout on top between the front serrations that reduces weight and enhances airflow to keep the barrel cooler.</p>\n<ul>\n<li>  Fits Gen3 Glock 17 and 19 pistols &amp; components</li> <li>  Machined from corrosion-resistant 17-4 stainless steel billet</li> <li>  Heat treated to add surface hardness &amp; given a wear-resistant matte black Nitride finish</li>\n</ul>\n<p> Comes as a kit with a Trijicon RMR RM06 which features adjustable brightness and a 3.25 MOA Dot. The RMR has a long battery life off a single CR2032 Battery and is housed in a rugged forged aluminum housing.<br><br> Channel liner required for these slides.  Channel liners are a press fit and require a tool to install.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	<em>“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H.  Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H.  The use of Glock on this page is merely to advertise the sale of Glock parts or components.  As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</em></p>\r\n</div>', NULL, 'https://www.brownells.com/handgun-parts/slide-parts/slides/glock-9mm-gen3-windowed-slide-w-rmr-rm06-red-dot-prod113009.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/handgun-parts/slide-parts/slides/glock-9mm-gen3-windowed-slide-w-rmr-rm06-red-dot-prod113009.aspx', '60ce371c89dfa7815dd392329824761f', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:51:53'),
(2590, 4, 'REMINGTON - \r\n                UMC AMMO 9MM LUGER 115GR FMJ', '<h3 class=\"mbm\">High-Quality \"Go-To\" Ammo for Your 9mm Pistol - Economical, Too</h3>\n<p></p>\n<p> Made with Remington components right here in the USA, UMC 9mm Luger 115gr MC / FMJ ammo provides pistol shooters with an excellent blend of value and performance. For target shooting, tactical training, action-pistol competition, or any other high-volume shooting activity, Remington UMC 9mm Luger 115gr MC / FMJ ammunition offers outstanding performance without any compromise in quality or reliability.</p>\n<ul>\n<li>  Standard FMJ bullet any standard 9mm pistol is designed to feed reliably</li> <li>  MC = \"Metal Case,\" Remington’s term for Full Metal Jacket</li> <li>  Reloadable brass case</li>\n</ul>\n<p> You’ll be hard-pressed to find a better value than Remington UMC 9mm Luger 115gr MC / FMJ ammo anywhere. Available by the box - but seriously, who fires only one box of 9mm? - or in case quantities.</p>\n<div class=\"callout\">\n<strong>Ammo</strong><br><strong><font color=\"red\">WARNING</font></strong>\r\n<br>\r\nYou must be 18 or older to purchase shotgun or rifle ammunition and 21 or older to purchase handgun ammunition. All ammunition must be shipped Domestic Ground. <strong>Shipping not available for International residents. Residents in CA, DC, DE, IL, MA, NY and OH may have additional restrictions.</strong> Always make sure you use the correct ammunition for your firearms. Check your state and local laws for any other applicable firearms and ammunition regulations. Due to Department of Transportation regulations, we cannot accept returns on ammo.  Please check local laws before ordering. <strong><a href=\"http://www.brownells.com/helpcenter/ammorestrictions/index.htm?id=36\">View full restrictions here</a>.<br><br>Ammunition pricing is per box. \r\n</strong>\r\n<strong>ATTENTION – California Customers</strong><br>\r\nBrownells is still shipping ammunition orders to California but the process has changed to comply with California Proposition 63. We must now ship ammunition purchased online to an FFL or California-approved ammunition dealer. After placing your order, a Brownells representative will contact you to ensure your ammunition arrives quickly and in compliance with the law.<br><br>\n</div>\n<div class=\"callout\"><strong><em> <br> 1911, Issue:11, Page:072 <br> AR-15, Issue:08, Page:095 <br> Big Book Catalog, Issue:68, Page:547</em></strong></div>', NULL, 'https://www.brownells.com/ammunition/handgun-ammo/umc-ammo-9mm-luger-115gr-fmj-prod95239.aspx', NULL, NULL, 58.99, 12.99, 46.00, 'https://www.brownells.com/ammunition/handgun-ammo/umc-ammo-9mm-luger-115gr-fmj-prod95239.aspx', 'cd3cf472d23835593375d6d9731803a8', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:51:55'),
(2591, 4, 'GLOCK - MODEL 23 40S&W MAGAZINES', '<h3 class=\"mbm\">Choose Genuine Factory Magazines For Top Performance &amp; Reliability</h3>\n<p></p>\n<p> Be confident your Glock® pistol will perform to factory standards each and every time with genuine Glock® factory magazines. Manufactured to Glock® specifications in Austria by Glock®. All models include round count indicator on rear face of magazine body and standard factory baseplate.</p>\n<div class=\"callout color3 help editable mbl\">\n<p>\r\n	<em>“GLOCK” is a federally registered trademark of Glock, Inc. and is one of many trademarks owned by Glock, Inc. or Glock Ges.m.b.H. Brownells is an independent dealer of parts and accessories for Glock® pistols, and is not affiliated with or endorsed by Glock, Inc. or Glock Ges.m.b.H. The use of Glock on this page is merely to advertise the sale of Glock parts or components. As indicated in the product descriptions, not all parts and accessories on this site are official Glock products.</em></p>\r\n</div>\n<div class=\"callout\"><strong><em> <br> Big Book Catalog, Issue:71, Page:227</em></strong></div>', NULL, 'https://www.brownells.com/magazines/handgun-magazines/magazines/model-23-40s-w-magazines-prod71421.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/magazines/handgun-magazines/magazines/model-23-40s-w-magazines-prod71421.aspx', '71a988038c9977cb868ed049c786a9cf', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:52:02'),
(2592, 4, 'BROWNELLS - M16 5.56 TITANIUM BOLT CARRIER GROUP DLC', '<h3 class=\"mbm\">Enhances Durability and Lightness of Any AR Rifle</h3>\n<p></p>\n<p> When it comes to building a lightweight, durable AR-15, only premium components will do, and the Brownells M16 Titanium Bolt Carrier Group is designed to provide rifle owners with a durable, high-quality component that provides multiple benefits.<br><br> The Brownells M16 Titanium Bolt Carrier Group uses a carrier machined from 6A1-4V titanium and includes a bolt made using 9310 tool steel. The bolt itself is magnetic-particle inspected for quality assurance, and the entire unit features a Diamond Like Carbon (DLC) coating for added ruggedness.</p>\n<ul>\n<li>  Weight: 7.9 ounces</li> <li>  Functions in 5.56 NATO, .223 Rem., 300 Blackout and .204 Ruger rifles</li> <li>  Includes M16 carrier notch for function in full-auto M16 rifles</li>\n</ul>\n<p> The Brownells M16 Titanium Bolt Carrier Group is a great addition to any lightweight rifle build and also helps to reduce recoil. All bolt-carrier groups ship fully assembled with extractor O-rings and securely torqued and staked gas keys.</p>', NULL, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-5-56-titanium-bolt-carrier-group-dlc-prod116268.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/bolt-parts/bolt-carrier-groups/m16-5-56-titanium-bolt-carrier-group-dlc-prod116268.aspx', '77b5d21728661d988fdb713db4038b6c', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:52:06'),
(2593, 4, 'BROWNELLS - AR-15 COMPLETE UPPER M-LOK 5.56 W/ 5-PK 30-RD PMAG', '<p></p>\n<p> This Brownells’ exclusive Complete AR Upper Receiver is Made in the USA.  Chambered in 5.56x45mm NATO and featuring a 16” barrel with a 1:8 twist.  The standard A3 13-slot aluminum flat top receiver comes with a 10” handguard utilizing the M-LOK rail system.  A low profile gas block, bolt carrier group,  charging handle, forward assist, ejection port cover and phosphate finish help to complete this outstanding package.  This complete A3 upper receiver will attach to almost any standard AR-15 lower receiver.<br><br> The receiver is being paired with 5 Magpul PMAGs for even better savings! Exceptionally rugged, combat- and competition-ready magazine functions flawlessly, even when left fully loaded for extended periods. Corrosion-proof, self-lubricating one-piece body of fiber-reinforced, molded polymer has no spot welds or joints to impair the follower, and the constant internal curve ensures smooth, unobstructed movement of the round stack. Anti-tilt follower stabilizes the stack to help prevent nose-diving and bolt-over-head failures. Heat-treated, stainless steel spring is stress-relieved for optimal performance. Withstands the heat from prolonged full-auto fire and is not harmed by most bore cleaners and solvents. Exterior ribbing provides added gripping surface; magazine catch notch, rather than a traditional hole, keeps dirt and debris out. Easy-to-grasp ledge on floorplate aids in extracting magazine from pouches; floorplate removes easily for cleaning. All models available in Black. DO NOT COME WITH DUST COVERS.<br><br> The BCG is the M16-style BCG. It will not work with older Colt lowers that have the sear block.<br>  </p>', NULL, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/upper-receivers/ar-15-complete-upper-m-lok-5-56-w-5-pk-30-rd-pmag-prod97309.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/rifle-parts/receiver-parts/receivers/upper-receivers/ar-15-complete-upper-m-lok-5-56-w-5-pk-30-rd-pmag-prod97309.aspx', 'bdea8551d2b114da731fa93f9caaaf54', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:52:11'),
(2594, 4, 'BERGER BULLETS - HYBRID TARGET 6MM (.243\") 105GR HYBRID BOAT TAIL BULLETS', '<h3 class=\"mbm\">Combines the Best of Two Worlds</h3>\n<p></p>\n<p> The Berger 6mm Hybrid Target Bullet is unique in the world of rifle projectiles, thanks to a unique combination of two bullet designs seen on the market. This new hybrid bullet ensures that shooters get the most out of their long-range shot, enhancing the capability of any precision-rifle platform.<br><br> The Berger 6mm Hybrid Target Bullet was designed by Berger Chief Ballistician Bryan Litz, and his unique combination provides a tangent ogive that begins as soon as the bearing surface on the projectile ends. This transitions into a secant ogive. The end result of this combination means that these rounds are much more forgiving of bullet-seating depth.</p>\n<ul>\n<li>  True diameter: 0.243 inch</li> <li>  Weight: 105 grains</li> <li>  Boattail design</li>\n</ul>\n<p> The Berger 6mm Hybrid Target Bullet also provides an efficient shape against the wind, making for an accurate, precise projectile.</p>\n<div class=\"callout\"><strong><em> <br> Sinclair, Issue:5B, Page:102</em></strong></div>', NULL, 'https://www.brownells.com/reloading/bullets/rifle-bullets/hybrid-target-6mm-243-105gr-hybrid-boat-tail-bullets-prod110805.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/reloading/bullets/rifle-bullets/hybrid-target-6mm-243-105gr-hybrid-boat-tail-bullets-prod110805.aspx', '628fc085880d26eae72a085121451893', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:52:16'),
(2595, 4, 'GUNWERKS LLC - G7 BR2500 BALLISTIC RANGEFINDER', '<h3 class=\"mbm\">Military-Grade Rangefinder Delivering Incredible Results</h3>\n<p></p>\n<p> The Gunwerks G7 BR2500 Ballistic Rangefinder is built with incredible ranging capabilities, ensuring that hunters and precision shooters have access to exact ranging technology that was only previously available to military units.<br><br> The Gunwerks G7 BR2500 Ballistic Rangefinder incorporates a number of new algorithms in order to enhance the ability of the laser beam to ascertain true distance. The hardware on the rangefinder has also been updated to limit beam divergence, ensuring that you\'re ranging the exact target you need.</p>\n<ul>\n<li>  Powered by CR123 battery</li> <li>  Color: matte black</li> <li>  Weight: 14.4 ounces</li> <li>  Maximum range: 2,500 yards</li>\n</ul>\n<p> The Gunwerks G7 BR2500 Ballistic Rangefinder also allows for the integration of custom cartridge data and provides compensation information for wind, angle, temperature and altitude. The unit is sealed in a rugged weatherproof housing with Gore-Tex membrane.</p>', NULL, 'https://www.brownells.com/optics-mounting/rangefinders/g7-br2500-ballistic-rangefinder-prod110266.aspx', NULL, NULL, 0.00, 0.00, 0.00, 'https://www.brownells.com/optics-mounting/rangefinders/g7-br2500-ballistic-rangefinder-prod110266.aspx', '4df06481ece654468e84a863fa6809b8', 0, NULL, '2018-08-06 12:12:29', '2018-08-06 13:52:19'),
